INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, 'Ku uciesze kibiców i fanów ulicznej mody ten piłkarski model z lat 60. ma jeszcze co nieco do powiedzenia. To wierna reedycja ulepszonych butów Gazelle z 1991 roku z wykorzystaniem autentycznych materiałów, faktur i proporcji. Cholewkę wykonano ze świńskiego nubuku ze stonowanym kolorystycznie wykończeniem i srebrzystym napisem.', '', 'buty-gazelle', '', '', '', 'Buty Gazelle', '', '', '', ''),
(2, 1, 1, 'Zmierz się z plenerem, niezależnie od tego, czy odkrywasz miasto, czy spacerujesz po okolicy. Buty adidas stworzone na cześć designu butów stworzonych z myślą o trudnym terenie łączą innowacyjność i komfort. Pikowana cholewka jest wykończona zygzakowatymi sznurowadłami, a gumowa podeszwa zewnętrzna nadaje całości mocny look. Podeszwa środkowa BOOST zwraca energię, a miękka wyściółka jest miła w dotyku przy każdym założeniu. Śmiały, ale uniwersalny, futurystyczny look pasuje niemal do wszystkiego — zwłaszcza do zwężanych spodni lub podwiniętych mankietów, które pozwolą Ci się pokazać. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-nmds1', '', '', '', 'Buty NMD_S1', '', '', '', ''),
(3, 1, 1, 'Ponadczasowy charakter. Wyluzowany klimat. Uniwersalność na co dzień. Od ponad 50 lat buty adidas Stan Smith pozostają ikoną stylu. Ta wersja zyskała nową konstrukcję, która jest wynikiem zobowiązania adidas, aby w procesie produkcyjnym wykorzystywać wyłącznie poliester pochodzący z recyklingu do 2024 roku. Mając wegańską cholewkę i podeszwę zewnętrzną z gumy pochodzącej z recyklingu, wciąż są kultowe, a ponadto powstały z myślą o planecie.\n\nButy są wykonane z wegańskich zamienników komponentów lub materiałów pochodzenia zwierzęcego. Ten produkt jest też wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka w 50% wykonana z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'stan-smith-shoes', '', '', '', 'Stan Smith Shoes', '', '', '', ''),
(4, 1, 1, 'Buty Samba, które narodziły się na boisku, stały się ponadczasową ikoną stylu miejskiego. Ta sylwetka pozostaje wierna tradycji za sprawą gustownej, niskoprofilowej cholewki z miękkiej skóry, zamszowych nakładek i gumowej podeszwy, dzięki czemu jest podstawowym elementem garderoby każdego — na boisku i poza nim.', '', 'buty-samba-og', '', '', '', 'Buty Samba OG', '', '', '', ''),
(5, 1, 1, 'Wybierz buty łączące elementy retro z futurystycznymi liniami designu, aby wprowadzić styl z przełomu XX i XXI wieku na nowe terytoria. Wykonane są z siateczki, zamszu i gładkiego TPU. Strategicznie rozmieszczone wsparcie w przedniej części stopy i w pięcie sprawia, że bieg staje się niezwykle komfortowy.', '', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(6, 1, 1, 'Buty Forum 84 Low ADV, inspirowane klasycznym modelem tenisowym, dostosowują oryginalny design do wymogów skateboardingu, wykorzystując nowoczesne technologie i opływowy styl. Zmodyfikowane panele modelu Forum 84 Low ADV zapewniają lepsze dopasowanie i wyczucie oraz zwiększoną trwałość, a specjalna konstrukcja jednoczęściowej podeszwy powstała z myślą o wyczuciu deski, komforcie i wsparciu śródstopia.', '', 'forum-84-low-adv-shoes', '', '', '', 'Forum 84 Low ADV Shoes', '', '', '', ''),
(7, 1, 1, 'Buty, które zadebiutowały w 1979 roku jako model dla topowych piłkarzy ręcznych, cieszą się teraz popularnością ze względu na swój klasyczny design. Ta wersja została wyposażona w delikatną w dotyku cholewkę z nubuku. Miękka podeszwa zewnętrzna z gumy pozostaje wierna swoim archiwalnym korzeniom.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(8, 1, 1, 'Buty, które zadebiutowały w 1979 roku jako model dla topowych piłkarzy ręcznych, cieszą się teraz popularnością ze względu na swój klasyczny design. Ta wersja została wyposażona w delikatną w dotyku cholewkę z nubuku. Miękka podeszwa zewnętrzna z gumy pozostaje wierna swoim archiwalnym korzeniom.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(9, 1, 1, 'Na dobry start. Buty do piłki ręcznej adidas Handball Spezial zostały pierwotnie zaprojektowane w latach 70. do startów i zatrzymań w grze. Obecnie teksturowana, zamszowa cholewka i sprężysta gumowa podeszwa bez dwóch zdań nadają się na ulice.', '', 'handball-spezial-shoes', '', '', '', 'Handball Spezial Shoes', '', '', '', ''),
(10, 1, 1, 'Buty Samba, które narodziły się na boisku, stały się ponadczasową ikoną stylu miejskiego. Ta sylwetka pozostaje wierna tradycji za sprawą gustownej, niskoprofilowej cholewki z miękkiej skóry, zamszowych nakładek i gumowej podeszwy, dzięki czemu jest podstawowym elementem garderoby każdego — na boisku i poza nim.', '', 'buty-samba-og', '', '', '', 'Buty Samba OG', '', '', '', ''),
(11, 1, 1, 'Startuj. Ląduj. I jeszcze raz. Biegi długodystansowe to stawianie jednej stopy przed drugą — tak przez dłuższy czas. Buty adidas Adistar 2.0 powstały to, by udało Ci się pobiec jeszcze dalej.\n\nPodeszwa środkowa łączy dwa rodzaje pianki EVA: REPETITOR to lekka pianka, która zwiększa sprężystość butów, a REPETITOR+ to twardsza mieszanka, która otula piętę. Cholewka z siateczki blokuje stopę i zapewnia wsparcie, dzięki czemu możesz biegać krok po kroku, kilometr po kilometrze, a podeszwa zewnętrzna z gumy Continental™ gwarantuje nadzwyczajną trakcję na mokrych i suchych nawierzchniach.', '', 'buty-adistar-20', '', '', '', 'Buty Adistar 2.0', '', '', '', ''),
(12, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(13, 1, 1, 'Buty Prime X 2 Strung, stworzone z wykorzystaniem innowacyjnej technologii i zaprojektowane bez konieczności przestrzegania globalnych ograniczeń wynikających z przepisów dotyczących konkurencji biegowych, oferują jeszcze lepsze parametry techniczne designu wyścigowego. Tekstylna, innowacyjna cholewka STRUNG bazuje na danych pozyskanych od sportowców i przekształconych w dynamiczny materiał dostosowany do ich potrzeb. Prime X 2 Strung ma również 3 warstwy LIGHTSTRIKE PRO o łącznej grubości 50 mm. Zupełnie nowy rdzeń dodający energii między dwiema warstwami pianki pomaga zmniejszyć wagę i zapewnia sprężystość w przedniej i środkowej części stopy, dzięki czemu możesz ścigać się z własną życiówką. Podeszwa zewnętrzna z mieszanki Continental zapewnia doskonałą przyczepność na różnych nawierzchniach.', '', 'buty-adizero-prime-x-20-strung', '', '', '', 'Buty Adizero Prime X 2.0 STRUNG', '', '', '', ''),
(14, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(15, 1, 1, 'Gdziekolwiek się udajesz, zabierz ze sobą swój sportowy styl dzięki tym butom adidas. Krój inspirowany bieganiem oznacza, że Twoje stopy będą czuć się komfortowo, gdy jesteś na mieście lub odpoczywasz na podwórku. Tekstylna cholewka zapewnia komfort i nadaje unikalny look vintage. Gumowa podeszwa zewnętrzna zapewnia przyczepność na mokrych i suchych nawierzchniach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'run-60s-30-lifestyle-running-shoes', '', '', '', 'Run 60s 3.0 Lifestyle Running Shoes', '', '', '', ''),
(16, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(17, 1, 1, 'Klimat wakacji przez cały czas. Wsuń bose stopy w klapki Adilette Lite. (Ale możesz je nosić także do skarpetek, nie będziemy się czepiać). Ten model charakteryzuje się wyjątkowo miękką i komfortowo wygodną wewnętrzną częścią podeszwy. Buty mają logo adidas Trefoil na górnym pasku, więc zachowujesz sportowy wygląd nawet podczas relaksu.', '', 'adilette-lite-slides', '', '', '', 'Adilette Lite Slides', '', '', '', ''),
(18, 1, 1, 'Klimat wakacji przez cały czas. Wsuń bose stopy w klapki Adilette Lite. (Ale możesz je nosić także do skarpetek, nie będziemy się czepiać). Ten model charakteryzuje się wyjątkowo miękką i komfortowo wygodną wewnętrzną częścią podeszwy. Buty mają logo adidas Trefoil na górnym pasku, więc zachowujesz sportowy wygląd nawet podczas relaksu.', '', 'adilette-lite-slides', '', '', '', 'Adilette Lite Slides', '', '', '', ''),
(19, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(20, 1, 1, 'Buty hikingowe adidas Terrex Skychaser stworzone z myślą o szybkich ruchach na szlaku i poza nim są przepustką do szybkich wędrówek i trudnych wspinaczek na szczyt. Buty inspirowane biegami przełajowymi mają ultralekką amortyzację Lightstrike, która zapewnia sprężystość i zwinną pracę nóg. Membrana GORE-TEX nie przepuszcza wilgoci, pozwalając jednocześnie stopom oddychać i regulując temperaturę. Wzmocniona płytka w podeszwie środkowej zwiększa stabilizację podczas wspinaczki po kamienistych nawierzchniach, dzięki czemu pewnie robisz każdy krok, a odporna na przetarcia siateczka gwarantuje trwałość butów. Strefa z gumy Stealth Hf zapewnia przyczepność na skałach, która sprawdzi się podczas wspinaczki po skałach i górach.', '', 'terrex-skychaser-xt-gore-tex-hiking-shoes', '', '', '', 'Terrex Skychaser XT GORE-Tex Hiking Shoes', '', '', '', ''),
(21, 1, 1, 'Buty Prime X 2 Strung, stworzone z wykorzystaniem innowacyjnej technologii i zaprojektowane bez konieczności przestrzegania globalnych ograniczeń wynikających z przepisów dotyczących konkurencji biegowych, oferują jeszcze lepsze parametry techniczne designu wyścigowego. Tekstylna, innowacyjna cholewka STRUNG bazuje na danych pozyskanych od sportowców i przekształconych w dynamiczny materiał dostosowany do ich potrzeb. Prime X 2 Strung ma również 3 warstwy LIGHTSTRIKE PRO o łącznej grubości 50 mm. Zupełnie nowy rdzeń dodający energii między dwiema warstwami pianki pomaga zmniejszyć wagę i zapewnia sprężystość w przedniej i środkowej części stopy, dzięki czemu możesz ścigać się z własną życiówką. Podeszwa zewnętrzna z mieszanki Continental zapewnia doskonałą przyczepność na różnych nawierzchniach.', '', 'buty-adizero-prime-x-20-strung', '', '', '', 'Buty Adizero Prime X 2.0 STRUNG', '', '', '', ''),
(22, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Oddychająca membrana GORE-TEX zapewnia suchy komfort stopom, gdy pluskasz się w kałużach. Podeszwa środkowa BOOST jest najlżejsza jak do tej pory — lekka pianka BOOST — zwraca więcej energii niż kiedykolwiek, zapewniając Ci siłę podczas mżawki i ulewy. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(23, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy-fg', '', '', '', 'Buty PREDATOR ACCURACY+ FG', '', '', '', ''),
(24, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(25, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(26, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie, które sprawiają wrażenie lżejszych niż powietrze, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a giętka wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-sg', '', '', '', 'Buty X Crazyfast+ SG', '', '', '', ''),
(27, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(28, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II FG', '', '', '', ''),
(29, 1, 1, 'Nie da się uderzyć tego, czego nie widać. Dzięki butom bokserskim adidas Box Hog będziesz tańczyć na ringu za sprawą lekkiej cholewki z siateczki, supercienkiej podeszwy środkowej z pianki EVA i przyczepnej gumowej podeszwy zewnętrznej. Średniowysoki profil i wewnętrzne wzmocnienia zapewniają stabilizację, gdy osiągasz najwyższy poziom pracy nóg.', '', 'box-hog-20-boots', '', '', '', 'Box Hog 2.0 Boots', '', '', '', ''),
(30, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(31, 1, 1, 'Zmień zasady gry w butach piłkarskich X Crazyfast+ FG do gry na naturalnych nawierzchniach. Buty stworzone, aby zapewniać poczucie wyjątkowej lekkości, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-fg', '', '', '', 'Buty X CRAZYFAST+ FG', '', '', '', ''),
(32, 1, 1, 'Uniwersalne niczym multi-tool buty hikingowe adidas Terrex zapewniają trwałość i funkcjonalność w każdym terenie. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody, pozwala stopom oddychać i gwarantuje im wygodę w każdych warunkach. Lekki, a jednocześnie wytrzymały model pozwoli Ci szybko stawić czoła wielu przygodom. Podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną przyczepność w każdych warunkach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-swift-r2-gore-tex-hiking', '', '', '', 'Buty Terrex Swift R2 GORE-TEX Hiking', '', '', '', ''),
(33, 1, 1, 'Zmień zasady gry w butach piłkarskich X Crazyfast+ FG do gry na naturalnych nawierzchniach. Buty stworzone, aby zapewniać poczucie wyjątkowej lekkości, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-fg', '', '', '', 'Buty X CRAZYFAST+ FG', '', '', '', ''),
(34, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niesznurowane buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-sg', '', '', '', 'Buty Predator Accuracy+ SG', '', '', '', ''),
(35, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(36, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(37, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Membrana GORE-TEX sprawdzi się, gdy pokonujesz kałuże. Od spodu najlżejsza podeszwa środkowa BOOST — lekka pianka BOOST — dodaje Ci energii na każdym kroku. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(38, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te niesznurowane buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-laceless-sg', '', '', '', 'Buty X Crazyfast.1 Laceless SG', '', '', '', ''),
(39, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(40, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy-fg', '', '', '', 'Buty PREDATOR ACCURACY+ FG', '', '', '', ''),
(41, 1, 1, 'Znajdź swój rytm w dobrym stylu dzięki butom Earthlight z kolekcji adidas by Stella McCartney, które są równie efektowne jak efektywne. \n\nButy będące doskonałym wyborem na miejskie biegi na dystansie do 10 km mają przyczepną, gumową podeszwę zewnętrzną o unikalnym designie. Została zaprojektowana tak, aby zapewniać optymalne wsparcie przy wybiciu do przodu i płynne przetaczanie stopy podczas pokonywania kolejnych kilometrów. \n\nCholewka z przewiewnej siateczki gwarantuje chłód podczas biegu, a podeszwa środkowa z pianki EVA wspiera każdy Twój krok. \n\nAby zyskać jak najlepszy efekt, zestaw buty z innymi modelami z kolekcji adidas by Stella McCartney.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% składu przędy stanowi poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-earthlight-mesh-shoes', '', '', '', 'adidas by Stella McCartney Earthlight Mesh Shoes', '', '', '', ''),
(42, 1, 1, 'Najnowsza, jedenasta odsłona butów adidas Boston widziana oczami Y-3 prezentuje charakterystyczną, potrójnie czarną kolorystykę. Perspektywa Y-3 jest wyraźnie widoczna na butach sportowych za sprawą przeszyć i detali z nici, które ozdabiają zewnętrzną stronę buta — niepowtarzalny znak Yohjiego Yamamoto. Podpis Yamamoto widnieje na drugiej stronie. Y-3 maluje klasyczne 3 paski, burząc oczekiwaną estetykę. Funkcjonalne i techniczne, lekkie i trwałe buty do biegania mają zaawansowaną amortyzację Lightstrike i ENERGYRODS, które pomagają ograniczyć utratę energii.', '', 'y-3-boston-11-shoes', '', '', '', 'Y-3 Boston 11 Shoes', '', '', '', ''),
(43, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niesznurowane buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-sg', '', '', '', 'Buty Predator Accuracy+ SG', '', '', '', ''),
(44, 1, 1, 'W tym sezonie stylowa kolekcja adidas by Stella McCartney przypomina nam o radości, jaką daje ruch na łonie natury. Techniczne detale łączą się z modnymi, inspirowanymi Ziemią motywami ― od psychodelicznych drzew i kamuflażowych wzorów po wzory słojów w przekroju drzewa. Kolekcja oddaje hołd niezrównanemu pięknu przyrody, inspirując Cię do przeniesienia treningu na świeże powietrze. \n\nWysokowydajne buty w modnym stylu. Przedstawiamy buty ULTRABOOST 23 — Twój nowy ulubiony towarzysz codziennych biegów. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Buty ze wspierającą cholewką z siateczki w modnych kolorach pomogą Ci się subtelnie wyróżnić, gdy pokonujesz kolejne kilometry.', '', 'adidas-by-stella-mccartney-ultraboost-speed', '', '', '', 'adidas by Stella McCartney ULTRABOOST SPEED', '', '', '', ''),
(45, 1, 1, 'Kiedy wychodzimy na zimną pogodę, ważne jest, by zachować ciepło i suchy komfort stóp. Nie musisz się martwić o chłód, wybierz TERREX FREE HIKER 2 COLD. RDY. Podeszwa zewnętrzna z gumy Continental™ zapewnia niezawodną przyczepność na każdym kroku. Dzięki membranie GORE-TEX, która gwarantuje Twoim stopom suchy komfort, oraz piance BOOST amortyzującej każdy krok, chłód już nie stanowi problemu.', '', 'terrex-free-hiker-2-coldrdy', '', '', '', 'TERREX FREE HIKER 2 COLD.RDY', '', '', '', ''),
(46, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(47, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(48, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie bez sznurowadeł do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-ag', '', '', '', 'Buty Predator Accuracy+ AG', '', '', '', ''),
(49, 1, 1, 'Od błotnistych górskich szlaków po wilgotne, leśne runo ― eksploruj każde miejsce dzięki wodoodpornej ochronie za sprawą tych butów hikingowych adidas. GORE-TEX odprowadza wodę, pozwalając jednocześnie Twoim stopom oddychać. Lekka amortyzacja z pianki EVA w połączeniu z wyjątkowo przyczepną gumą dodadzą Ci pewności na każdym szlaku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-eastrail-gore-tex-hiking', '', '', '', 'Buty Terrex Eastrail GORE-TEX Hiking', '', '', '', ''),
(50, 1, 1, 'Niezależnie od tego, co dźwigasz, te buty adidas do podnoszenia ciężarów zapewniają Ci komfort. Lekka, lecz mocna płócienna cholewka ma wstawki z siateczki o dużych oczkach, które zwiększają przewiewność. Połączenie paska i sznurowadeł zabezpiecza śródstopie, a podwyższona podeszwa środkowa gwarantuje solidną stabilizację przy dużym obciążeniu. Od spodu gumowa podeszwa zewnętrzna trzyma się maty, dając Ci dobry punkt zaczepienia.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-powerlift-5-weightlifting', '', '', '', 'Buty Powerlift 5 Weightlifting', '', '', '', ''),
(51, 1, 1, 'Poczuj płynność biegu w butach do biegania Ultra 4DFWD. Łączą cholewkę naszych kultowych butów Ultraboost z podeszwą środkową adidas 4DFWD z nadrukiem 3D, która została udoskonalona tak, aby kompresja do przodu zmniejszała siłę hamowania i przekształcała energię uderzenia w ruch naprzód. Gwarantuje to płynne przetoczenie stopy i wyjątkowe wrażenia niczym podczas szybowania. Cholewka adidas PRIMEKNIT otula stopę, zapewniając jej dynamiczne wsparcie w strategicznych obszarach, a podeszwa zewnętrzna z gumy Continental™ zwiększa przyczepność w każdych warunkach pogodowych.', '', 'ultra-4dfwd-shoes', '', '', '', 'Ultra 4DFWD Shoes', '', '', '', ''),
(52, 1, 1, 'Inspiracja, która doprowadziła do powstania tych butów hikingowych z kolekcji adidas by Stella McCartney, jest oczywista — to sprzęt górski. Sznurowadła ze sznurka do wspinaczki bezpiecznie i wygodnie blokują stopy. Dodaj do tego mocną podeszwę zewnętrzną, a zyskasz pewność siebie na każdym kroku. A skoro już mowa o nieprzewidywalności na łonie natury, to wodoodporna cholewka z siateczki sprawia, że możesz ruszać na podbój przygody, nawet gdy zmienia się pogoda. W tych butach niemal nic Cię nie powstrzyma.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'adidas-by-stella-mccartney-seeulater-shoes', '', '', '', 'adidas by Stella McCartney Seeulater Shoes', '', '', '', ''),
(53, 1, 1, 'Buty, które zadebiutowały w 1979 roku jako model dla topowych piłkarzy ręcznych, cieszą się teraz popularnością ze względu na swój klasyczny design. Ta wersja została wyposażona w delikatną w dotyku cholewkę z nubuku. Miękka podeszwa zewnętrzna z gumy pozostaje wierna swoim archiwalnym korzeniom.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(54, 1, 1, 'Stride through the city on a 3D-printed midsole that provides impact absorption and stability on your daily run. adidas 4DFWD X STRUNG running shoes glide across pavement, powered by the industry\'s most innovative technology. Coded for the perfect fit, the upper provides seamless, cocoon-like containment for your foot, while the grippy, durable Continental™ Rubber outsole sticks to the street and keeps you grounded along your route. \n\nThis product features at least 20% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.', '', '4dfwd-x-strung-4d-running-shoes', '', '', '', '4DFWD x STRUNG 4D Running Shoes', '', '', '', ''),
(55, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na sztucznej trawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-pilkarskie-x-crazyfast1-ag', '', '', '', 'Buty piłkarskie X Crazyfast.1 AG', '', '', '', ''),
(56, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na sztucznej trawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-pilkarskie-x-crazyfast1-ag', '', '', '', 'Buty piłkarskie X Crazyfast.1 AG', '', '', '', ''),
(57, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
