(59, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(60, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy1-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 FG', '', '', '', ''),
(61, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-sg', '', '', '', 'Buty Predator Accuracy.1 SG', '', '', '', ''),
(62, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(63, 1, 1, 'Eksploruj świat w tych lekkich butach hikingowych adidas na cały dzień. Błotniste szlaki czy kamieniste wspinaczki nie powstrzymają Cię w tych wygodnych butach na wędrówki. Podeszwa zewnętrzna Traxion została stworzona z myślą o trudnym terenie, a mocna, odporna na przetarcia siateczka ochroni Twoje stopy na szlaku lub na spacerze po lesie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'eastrail-20-hiking-shoes', '', '', '', 'Eastrail 2.0 Hiking Shoes', '', '', '', ''),
(64, 1, 1, 'Powstały z myślą o koszykówce, ale bardzo szybko zadomowiły się w świecie hip-hopu i skateboardingu. Klasyczne, skórzane Superstary odmieniły modę miejską, gdy po raz pierwszy opuściły koszykarski parkiet. Ząbkowane 3 paski, kultowa osłona palców w kształcie muszli i charakterystyczne logo sprawiają, że jest to jedna z gwiazd Originals.', '', 'buty-superstar', '', '', '', 'Buty Superstar', '', '', '', ''),
(65, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie, które sprawiają wrażenie lżejszych niż powietrze, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a giętka wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-sg', '', '', '', 'Buty X Crazyfast+ SG', '', '', '', ''),
(66, 1, 1, 'W butach adidas Superstar chodzi o indywidualność. Buty adidas AdiFOM SST nie boją się przełamywać schematów, czerpią inspirację z przeszłości i dostosowują ją do współczesnego stylu miejskiego. Krój butów i konstrukcja z ekologicznej pianki wybiegają w przyszłość, a kultowa osłona palców w kształcie muszli oddaje hołd ich historii. Załóż skarpetki, aby zyskać idealny komfort, a miękka pianka zajmie się resztą.\n\nTen produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', '', 'buty-adifom-sst-boot', '', '', '', 'Buty AdiFOM SST Boot', '', '', '', ''),
(67, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(68, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl', '', '', '', 'ADIZERO SL', '', '', '', ''),
(69, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX mokre, śliskie nawierzchnie nie stanowią problemu. Wodoodporny, oddychający GORE-TEX pomaga Ci pokonywać kolejne kilometry w wilgotne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia odpowiednią przyczepność na każdym kroku. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(70, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(71, 1, 1, 'Ciesz się komfortem i pewnością siebie podczas pierwszego maratonu lub swobodnego biegu po okolicy. Te buty do biegania adidas zostały zaprojektowane zarówno dla początkujących, jak i dla zapalonych biegaczy. Podeszwa środkowa Dreamstrike+ została stworzona z myślą o komforcie, a pręty wspierające prowadzą stopę, gwarantując płynne przetoczenie stopy na wyższy poziom. Wycięcia w podeszwie zewnętrznej zmniejszają wagę, dzięki czemu możesz skoncentrować się na treningu. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-supernova-rise', '', '', '', 'Buty Supernova Rise', '', '', '', ''),
(72, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(73, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-sg', '', '', '', 'Buty Predator Accuracy.1 SG', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(74, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nNie pozwól, by spadająca temperatura powstrzymała Cię przed długim biegiem. Buty Adistar COLD.RDY dbają o ciepły komfort stóp kilometr po kilometrze dzięki izolacji COLD.RDY. Dwa rodzaje pianki tworzą podeszwę środkową o podwójnej gęstości, która amortyzuje i wspiera każdy krok, aby pomóc Ci dotrzeć dalej niż sądzisz, że to możliwe. Wodoodporna cholewka i wyjątkowo mocna podeszwa zewnętrzna z gumy Continental™ dodadzą Ci pewności siebie w każdych warunkach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-adistar-coldrdy', '', '', '', 'Buty Adistar COLD.RDY', '', '', '', ''),
(75, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niskie buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-low-ag', '', '', '', 'Buty Predator Accuracy.1 Low AG', '', '', '', ''),
(76, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niskie buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-low-ag', '', '', '', 'Buty Predator Accuracy.1 Low AG', '', '', '', ''),
(77, 1, 1, 'W tym sezonie stylowa kolekcja adidas by Stella McCartney przypomina nam o radości, jaką daje ruch na łonie natury. Techniczne detale łączą się z modnymi, inspirowanymi Ziemią motywami ― od psychodelicznych drzew i kamuflażowych wzorów po wzory słojów w przekroju drzewa. Kolekcja oddaje hołd niezrównanemu pięknu przyrody, inspirując Cię do przeniesienia treningu na świeże powietrze. \n\nWysokowydajne buty w modnym stylu. Przedstawiamy buty ULTRABOOST 23 — Twój nowy ulubiony towarzysz codziennych biegów. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Buty ze wspierającą cholewką z siateczki w modnych kolorach pomogą Ci się subtelnie wyróżnić, gdy pokonujesz kolejne kilometry.', '', 'adidas-by-stella-mccartney-ultraboost-speed', '', '', '', 'adidas by Stella McCartney ULTRABOOST SPEED', '', '', '', ''),
(78, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-ag', '', '', '', 'Buty Predator Accuracy.1 AG', '', '', '', ''),
(79, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te niesznurowane buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-laceless-sg', '', '', '', 'Buty X Crazyfast.1 Laceless SG', '', '', '', ''),
(80, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast3-ll-fg', '', '', '', 'Buty X CRAZYFAST.3 LL FG', '', '', '', ''),
(81, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia.', '', 'buty-predator-accuracy1-l-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 L FG', '', '', '', ''),
(82, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia.', '', 'buty-predator-accuracy1-l-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 L FG', '', '', '', ''),
(83, 1, 1, 'Buty hikingowe adidas Terrex Skychaser stworzone z myślą o szybkich ruchach na szlaku i poza nim są przepustką do szybkich wędrówek i trudnych wspinaczek na szczyt. Buty inspirowane biegami przełajowymi mają ultralekką amortyzację Lightstrike, która zapewnia sprężystość i zwinną pracę nóg. Membrana GORE-TEX nie przepuszcza wilgoci, pozwalając jednocześnie stopom oddychać i regulując temperaturę. Wzmocniona płytka w podeszwie środkowej zwiększa stabilizację podczas wspinaczki po kamienistych nawierzchniach, dzięki czemu pewnie robisz każdy krok, a odporna na przetarcia siateczka gwarantuje trwałość butów. Strefa z gumy Stealth Hf zapewnia przyczepność na skałach, która sprawdzi się podczas wspinaczki po skałach i górach.', '', 'terrex-skychaser-xt-gore-tex-hiking-shoes', '', '', '', 'Terrex Skychaser XT GORE-Tex Hiking Shoes', '', '', '', ''),
(84, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(85, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(86, 1, 1, 'Kontrola, precyzja, osiągi. W czasie treningu lub meczu te buty tenisowe adidas zapewniają amortyzację i stabilizację, których potrzebujesz. Podeszwa środkowa Bounce łączy komfort z elastycznością, a Torsion System oznacza wsparcie, gdy przemierzasz kort. Daj z siebie wszystko podczas wymiany piłek, wiedząc że Adituff chroni palce i przednią część stopy. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'courtjam-control-clay-tennis-shoes', '', '', '', 'CourtJam Control Clay Tennis Shoes', '', '', '', ''),
(87, 1, 1, 'Świętujemy trwały ślad, jaki Lionel Messi na odcisnął w świecie piłki nożnej. Te buty mają półprzezroczystą cholewkę Aeropacity Speedskin z akcentami w kolorze charakterystycznego dla Argentyny błękitu i srebra inspirowanego pucharami oraz wzmocnienia tam, gdzie są one najbardziej potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci prędkości godnej G.O.A.T. na naturalnej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-x-crazyfast-messi1-fg', '', '', '', 'Buty X Crazyfast Messi.1 FG', '', '', '', ''),
(88, 1, 1, 'Co mają ze sobą wspólnego dżinsy rurki i zwiewne spódniczki? Jedno i drugie wspaniale wygląda z modnymi butami adidas Nizza na platformie. Zrób krok naprzód, wyjdź na ulicę i nadaj każdemu strojowi styl wysokich lotów. Nawet jeśli tylko spacerujesz bez celu po mieście.', '', 'nizza-platform-shoes', '', '', '', 'Nizza Platform Shoes', '', '', '', ''),
(89, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-ag', '', '', '', 'Buty Predator Accuracy.1 AG', '', '', '', ''),
(90, 1, 1, 'Łatwiej osiągnąć swoje cele treningowe, gdy masz parę sprawdzonych, wygodnych butów na co dzień. \n\nPoznaj buty Solarboost 5. Model, który zapewnia równowagę między wsparciem, amortyzacją i zwrotem energii, łączy sprężystą piankę Light BOOST z przewiewną cholewką z siateczki. System Linear Energy Push dodaje Ci energii na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-solarboost-5', '', '', '', 'Buty Solarboost 5', '', '', '', ''),
(91, 1, 1, 'Buty adidas Retropy F2, nawiązując do przeszłości, odkrywają nostalgię za sprawą futurystycznego spojrzenia. Zainspirowaliśmy się klasycznym stylem biegowym z lat 80., a następnie wzbogaciliśmy design o nowe proporcje i akcenty, które naprawdę robią wrażenie. Poza tym nie bez powodu te buty staną się Twoim ulubionym strojem na co dzień — mocna, tekstylna cholewka i amortyzowana podeszwa środkowa z pianki EVA wspierają Twoje ruchy w pełnym komforcie.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'retropy-f2-shoes', '', '', '', 'Retropy F2 Shoes', '', '', '', ''),
(92, 1, 1, 'Przy każdej pogodzie. Na każdej nawierzchni. Buty do kolarstwa górskiego adidas Five Ten stworzone z myślą o wyprawach przełajowych i nieuczęszczanych drogach mają lekką, amortyzowaną konstrukcję typową dla butów do biegów przełajowych. Wodoodporna, oddychająca membrana GORE-TEX zapewnia stopom suchy komfort na mokrych nawierzchniach. Guma Stealth® Phantom zapewnia przyczepność do pedałów na każdym szlaku. Neoprenowe osłony nie przepuszczają brudu i żwiru. Wybieraj mało uczęszczane trasy.', '', 'five-ten-trailcross-gore-tex-mountain-bike-shoes', '', '', '', 'Five Ten Trailcross GORE-TEX Mountain Bike Shoes', '', '', '', ''),
(93, 1, 1, 'Buty adidas Five Ten Trailcross XT do kolarstwa górskiego powstały z myślą o poszukiwaczach przygód i łączą wsparcie techniczne typowe dla butów do biegów przełajowych z detalami dostosowanymi do jazdy na rowerze, co przekłada się na doskonałe połączenie stabilizacji podczas pieszych wycieczek z kontrolą w czasie jazdy na rowerze. Te buty to Twoja przepustka do odkrywania świata: od porzuconych, nieutwardzanych dróg po single-tracki i wspinaczkę poza szlakiem. Guma Stealth Phantom pewnie trzyma się pedałów, ułatwiając Ci jazdę po każdym szlaku. Oddychająca cholewka zapewnia stopom komfort przez cały czas, dzięki czemu możesz jeździć, wędrować, odkrywać i podążać mniej uczęszczaną ścieżką.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'five-ten-trailcross-xt-shoes', '', '', '', 'Five Ten Trailcross XT Shoes', '', '', '', ''),
(94, 1, 1, '1994 rok. Po raz pierwszy na boisku dostrzeżono nowe buty piłkarskie adidas. Natychmiast powstaje klasyka. Buty piłkarskie Predator Elite FT FG z limitowanej edycji to ukłon w stronę pamiętnych dni. W ramach prawdziwego potwierdzenia ich wyjątkowości dostępnych jest tylko 1994 par, z których każda ma niepowtarzalny numer.\n\nSą tu wszystkie unikalne cechy, które sprawiły, że buty adidas Predator stały się legendą, w tym charakterystyczne, przyczepne gumowe elementy zapewniające lepszą kontrolę nad piłką i odświeżona podeszwa zewnętrzna Hybridtouch2.0 do gry na naturalnej nawierzchni, gwarantująca jeszcze większą stabilizację. Kontroluj tempo gry i dominuj na boisku w ekskluzywnych butach piłkarskich adidas Predator.\n\nTen produkt został wykonany częściowo z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które mają na celu zmniejszenie ilości odpadów i śladu węglowego wytwarzanych przez nas produktów.', '', 'buty-predator-elite-ft-fg', '', '', '', 'Buty Predator Elite FT FG', '', '', '', ''),
(95, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(96, 1, 1, 'Te buty Y-3 stanowią nową odsłonę nowoczesnego kodu modowego i bazują na jednym z najbardziej wpływowych modeli sneakerów koszykarskich lat 80. — adidas Rivalry. Pozostają bliskie oryginałowi i stanowią wyrafinowany akcent koszykarski za sprawą cholewki z luksusowego nubuku wykończonej gładką skórą i neoprenowymi detalami.', '', 'buty-y-3-rivalry', '', '', '', 'Buty Y-3 Rivalry', '', '', '', ''),
(97, 1, 1, 'Od drzwi Twojego domu po szlak i z powrotem buty TERREX SOULSTRIDE FLOW są Twoim partnerem podczas długich przygód w outdoorze. Buty do biegów przełajowych z miękką amortyzacją z lekkiej pianki EVA powstały, aby zapewnić Ci swobodę ruchu. Podeszwa zewnętrzna z gumy Continental™ doskonale trzyma się korzeni, kamieni i ziemi, a cholewka z siateczki o specjalnej konstrukcji gwarantuje optymalny podział na strefy, przewiewność, elastyczność i idealne dopasowanie.', '', 'terrex-soulstride-flow-trail-running-shoes', '', '', '', 'TERREX Soulstride Flow Trail Running Shoes', '', '', '', ''),
(98, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(99, 1, 1, 'Wyrusz w podróż z butami 11Pro i świętuj ich 10. rocznicę, wybierając tę ekskluzywną, limitowaną edycję.\n\nButy 11Pro FG są częścią kolekcji, która oddaje hołd niezniszczalnej więzi między piłkarzem a jego butami. Wykonana z wyjątkową dbałością o szczegóły, nowoczesna podeszwa zewnętrzna Copa Pure do gry na naturalnej nawierzchni stabilizuje ruchy, a cholewka ze skóry Taurus zapewnia miękki kontakt z piłką i optymalny komfort. Design z zapięciem na sznurowadła zapewnia bezpieczne dopasowanie i odtwarza design butów, w których niemiecki piłkarz Toni Kroos zakochał się przed laty.', '', 'buty-11pro-fg', '', '', '', 'Buty 11Pro FG', '', '', '', ''),
(100, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(101, 1, 1, 'Spójność to klucz do sukcesu. Nie rezygnuj z biegania w butach do biegania adidas stworzonych z myślą o komforcie i wsparciu, które robią różnicę. Podeszwa środkowa Dreamstrike+ amortyzuje każde lądowanie. Mocna podeszwa zewnętrzna Adiwear zapewnia niezawodną przyczepność. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-supernova-rise', '', '', '', 'Buty Supernova Rise', '', '', '', ''),
(102, 1, 1, 'Trawers po górskim szczycie. Wspinaczka po głazach. Wielodniowa wędrówka. W butach hikingowych adidas Terrex do kostki świat stoi przed Tobą otworem. Wodoodporna, oddychająca konstrukcja GORE-TEX i lekki, a jednocześnie mocny design ułatwiają eksplorację i poruszanie się w górach ze zwinnością inspirowaną butami do biegania. BOOST zapewnia stabilizację i energię na każdym kroku, a otulająca stopę cholewka wspiera precyzyjną pracę nóg w technicznym terenie. Zintegrowana płytka chroniąca przed kamieniami stanowi zabezpieczenie na skalistych szlakach. Guma Continental™ pozwala Ci pewnie przemierzać strumienie i bezpiecznie zejść ze szlaku. Zasznuruj te buty i ruszaj na podbój odległych szczytów.', '', 'terrex-skychaser-mid-gore-tex-hiking-shoes-20', '', '', '', 'Terrex Skychaser Mid GORE-TEX Hiking Shoes 2.0', '', '', '', ''),
(103, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci grać z klasą na mokrej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-sg', '', '', '', 'Buty Copa Pure II SG', '', '', '', ''),
(104, 1, 1, 'Buty Adistar CS 2.0 zostały zaprojektowane, aby przenieść Twój codzienny bieg na wyższy poziom. Buty do biegania, które zrodziły się z idei perpetuum mobile, wspierają rytmiczny bieg, który pomoże Ci osiągnąć wyznaczone cele. Mają podeszwę środkową REPETITOR+ o zwiększonej gęstości, która stabilizuje każdy krok i wspiera płynne przetoczenie stopy pomiędzy krokami. Asymetryczny system sznurowania łączy się ze stabilną ramą Repetitor Plus i wzmocnioną warstwą siateczki, aby zapewnić Ci stabilizację na każdym kroku. Dodaj do tego specjalną geometrię buta i ruszaj przed siebie, aby pobić życiówkę.', '', 'buty-adistar-cs-20', '', '', '', 'Buty Adistar CS 2.0', '', '', '', ''),
(105, 1, 1, 'Od niezobowiązujących spacerów po weekendowe wycieczki – buty hikingowe TERREX WMN RAIN.RDY zostały zaprojektowane przez kobiety dla kobiet. Wygodny, elastyczny kołnierz zapewnia komfort i wsparcie przy każdym ruchu. Podeszwa zewnętrzna z gumy Continental zapewnia doskonałą przyczepność na każdym terenie. Zachowaj suchy komfort dzięki wodoodpornej technologii RAIN.RDY. Te buty zawierają co najmniej 50% materiałów pochodzących z recyklingu i są naszą pomocą w walkę z zanieczyszczeniem plastikiem.', '', 'terrex-wmn-mid-rainrdy-hiking-shoes', '', '', '', 'TERREX WMN MID RAIN.RDY Hiking Shoes', '', '', '', ''),
(106, 1, 1, 'Przygody w outdoorze już na Ciebie czekają, a wodoodporne buty hikingowe adidas Terrex pomogą Ci odkrywać świat: ten bliski i ten daleki. Ich uniwersalny, sportowy design jest wystarczająco lekki, aby sprostać codziennym wędrówkom, i wystarczająco techniczny, aby wytrzymać trudy górskiej wspinaczki czy przejścia via ferrata. Ten model wspiera Twoje stopy lekkim, a jednocześnie mocnym i stabilnym designem, który ułatwia koncentrację na szlaku. Wodoodporny, oddychający GORE-TEX nie przepuszcza wody i błota, pozwalając jednocześnie stopom oddychać. Język z klinem i mankiet do kostki otulają stopę i nie przepuszczają kurzu ani brudu, gwarantując komfort inspirowany butami do biegania. Przyczepność gumy Continental™ w każdych warunkach oznacza, że możesz pewnie poruszać się po kamienistych zboczach, mokrych korzeniach i piaszczystych trasach. A więc załóż te buty i ruszaj w drogę.', '', 'terrex-ax4-mid-gore-tex-hiking-shoes', '', '', '', 'Terrex AX4 Mid GORE-TEX Hiking Shoes', '', '', '', ''),
(107, 1, 1, 'Nawiązując do adidas Rivalry, jednego z najbardziej wyrazistych designów koszykarskich z lat 80., ten model Y-3 na nowo interpretuje reguły modowe. Model pozostaje bliski oryginałowi, stanowiąc wyrafinowaną wersję koszykarskiego designu za sprawą gładkiej, skórzanej cholewki i skórzanych 3 pasków na bokach.', '', 'y-3-rivalry', '', '', '', 'Y-3 Rivalry', '', '', '', ''),
(108, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-sg', '', '', '', 'Buty X Crazyfast.1 SG', '', '', '', ''),
(109, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Innowacyjna podeszwa środkowa adidas 4D z nadrukiem 3D i nową konstrukcją przypominającą kratownicę przekształca siły uderzenia w ruch do przodu wspierana przez nadzwyczajną przyczepność podeszwy zewnętrznej z gumy Continental™. Cholewka z lekkiej, oddychającej monosiateczki z kołnierzem PRIMEKNIT wokół kostki gwarantuje stopom komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(110, 1, 1, 'Wynieś swój bieg na wyższy poziom dzięki tym butom do biegania adidas. Buty nazwane na cześć rewolucyjnej podeszwy środkowej drukowanej w technologii 3D pochłaniają siłę uderzenia i dodają Ci przyspieszenia na każdym kroku. Cholewka adidas Primeknit otula Twoją stopę, zapewniając przewiewny komfort i wspierając naturalne ruchy na ulicach miasta. Podeszwa zewnętrzna z gumy Continental™ gwarantuje przyczepność, dzięki czemu możesz biegać w deszczu lub słońcu. Niezależnie od tego, czy trenujesz na dystansie 5 kilometrów, czy po prostu biegniesz, ile sił w nogach, buty 4DFWD uprzyjemnią Ci każdy bieg.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(111, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(112, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(113, 1, 1, 'Stworzone, by uzupełniać Twoje umiejętności na hali. Niezależnie od tego, jak grasz, buty adidas Court Team Bounce 2.0 zapewnią Ci komfort dzięki podeszwie środkowej Bounce na całej długości. Wzmocniona, dwuwarstwowa cholewka z siateczki owija się wokół stopy, blokując ją, gwarantując dodatkową stabilizację podczas ruchu na boki. Od spodu przyczepna, gumowa podeszwa zewnętrzna sprawi, że wyróżnisz się podczas gry, ale nie pozostawisz po sobie śladu na parkiecie.', '', 'court-team-bounce-20-shoes', '', '', '', 'Court Team Bounce 2.0 Shoes', '', '', '', ''),
(114, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(115, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Buty w kultowym stylu zapewniają pewny kontakt dzięki pikowanej przedniej części stopy ze skóry Fusionskin z subtelną mikroteksturą. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II. FG', '', '', '', ''),
(116, 1, 1, 'Buty Copa powstały z myślą o grze. Są wykonane z elastycznych materiałów, które zapewniają amortyzację przy kontakcie z piłką i pełną kontrolę w każdej sytuacji.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II. FG', '', '', '', ''),
(117, 1, 1, 'Wybierz się na spacer podziwiać widoki. Wędrówka do wodospadu. Przechadzka po mieście. Poczuj swobodę, wędrując komfortowo w tych butach hikingowych adidas. Odporne na przetarcia nakładki na oddychającej cholewce z siateczki sprawdzą się podczas przygód, a lekka amortyzacja zapewnia komfort stopom. Nawet w trudnym terenie podeszwa zewnętrzna Traxion ułatwia pewny krok.', '', 'eastrail-20-hiking-shoes', '', '', '', 'Eastrail 2.0 Hiking Shoes', '', '', '', ''),
(118, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-sg', '', '', '', 'Buty X Crazyfast.1 SG', '', '', '', ''),
(119, 1, 1, 'Niezależnie od tego, czy wybierasz się na górski szlak, czy na wypad do ulubionej kawiarni, te buty do biegania adidas zapewnią Ci amortyzację. Podeszwa środkowa Cloudfoam oferuje natychmiastowy komfort, który nigdy się nie kończy, a tekstylna cholewka gwarantuje wsparcie i przewiewność. Gumowa podeszwa zewnętrzna trzyma się nawierzchni w zmiennym terenie, ułatwiając pewny krok.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-tr-shoes', '', '', '', 'Runfalcon 3 TR Shoes', '', '', '', ''),
(120, 1, 1, 'Zdumiewająco lekkie. Bezkompromisowo szybkie. adidas Adizero Adios Pro Evo 1 to nowa klasa butów do biegania, zaprojektowana, aby pomóc ambitnym maratończykom dać z siebie wszystko. Model jest o 40% lżejszy od wszystkich stworzonych przez nas butów do biegania, to zaledwie 138 g czystej innowacji. Pianka Lightstrike Pro łączy się z przełomową technologią podeszwy zewnętrznej, lekką jak piórko siateczką i pierwszym w swoim rodzaju elementem kołyszącym w przedniej części stopy, który został przetestowany laboratoryjnie, aby poprawić ekonomię biegania. Adizero Adios Pro Evo 1 to doskonałe narzędzie do biegania, które pomoże Ci przetrwać cały bieg i dotrzeć do linii mety. Ten model jest gotowy do wyścigu.', '', 'adizero-adios-pro-evo-1', '', '', '', 'Adizero Adios Pro Evo 1', '', '', '', ''),
(121, 1, 1, 'Dla niektórych chłód oznacza odwrót. Ale te buty z kolekcji adidas by Stella McCartney zachęcają do czegoś wręcz przeciwnego: do wyjścia na dwór, cieszenia się niższymi temperaturami i często także spokojem, który się z nimi wiąże. Technologia COLD.RDY niweluje poczucie chłodu, zapewniając Ci suchy komfort, ciepło i pewność siebie. Ruszaj więc na szlak, eksploruj miasto, rób wszystko, na co tylko masz ochotę, bo po to stworzono te śmiałe, ultranowoczesne buty. \n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-coldrdy-winter-boots', '', '', '', 'adidas by Stella McCartney COLD.RDY Winter Boots', '', '', '', ''),
(122, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(123, 1, 1, 'Jedź rowerem. Odkrywaj. Powtarzaj. Buty adidas Five Ten Trailcross Pro Clip-In do jazdy na rowerze górskim, stworzone z myślą o przygodach, zarówno na wąskich dróżkach, jak i na żwirowych drogach, są kompatybilne z technologią clip-in i oferują wyważoną elastyczność, która sprawdzi się podczas jazdy i nie tylko. Model nieco sztywniejszy od standardowego modelu Trailcross wyposażono w BOA® Fit System, który pozwala na precyzyjne i szybkie dopasowanie oraz zapewnia otulające stopę wsparcie. Oddychająca cholewka daje stopom przewiewny i suchy komfort, a neopren w mankietach chroni przed kurzem i brudem. Guma Stealth Marathon zapewnia przyczepność na każdym kroku podczas jazdy na rowerze i pieszych wypraw. Lekka amortyzacja oferuje komfort niczym w butach do biegania przełajowego.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'five-ten-trailcross-pro-clip-in-mountain-biking-shoes', '', '', '', 'Five Ten Trailcross Pro Clip-In Mountain Biking Shoes', '', '', '', ''),
(124, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(125, 1, 1, 'Zamknij za sobą drzwi i ruszaj na podbój przygody. Te buty podejściowe adidas pozwolą Ci poruszać się szybko po szlakach, uprawiać bouldering i wspinaczkę skałkową dzięki wyjątkowo przyczepnej podeszwie zewnętrznej Traxion i stabilizującej podeszwie środkowej, która zapewnia pewny krok. Lekka cholewka z tkaniny ripstop jest odporna na przetarcia, a amortyzacja z pianki EVA nie obciąża stóp.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-swift-solo-20-hiking', '', '', '', 'Buty Terrex Swift Solo 2.0 Hiking', '', '', '', ''),
(126, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-30-shoes', '', '', '', 'Adizero Adios Pro 3.0 Shoes', '', '', '', ''),
(127, 1, 1, 'Buty na wędrówki stworzone z myślą o zimnych, deszczowych dniach zapewnią ciepły i suchy komfort Twoim stopom na szlaku. Mankiet do kostki i wodoodporna konstrukcja nie przepuszczają wilgoci do środka, a izolacja na całej powierzchni zatrzymuje ciepło przy ciele. Przyczepna, gumowa podeszwa zewnętrzna gwarantuje pewny krok na śliskich lub pokrytych lodem nawierzchniach.', '', 'terrex-frozetrack-mid-winter-hiking-shoes', '', '', '', 'Terrex Frozetrack Mid Winter Hiking Shoes', '', '', '', ''),
(128, 1, 1, 'Buty adidas Ligra 7 stworzone z myślą o grze na każdym rodzaju nawierzchni pomogą Ci poprawić wyniki na hali. Gdy zmienia się przebieg gry, ich przewiewna cholewka z siateczki gwarantuje komfort i pewność siebie. Połączenie przyczepnej w różnych kierunkach podeszwy zewnętrznej ze wspierającymi nakładkami zapewnia stabilizację, gdy dajesz z siebie wszystko. Syntetyczna skóra na palcach gwarantuje trwałość.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka wykonana jest w 50% z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'ligra-7-indoor-shoes', '', '', '', 'Ligra 7 Indoor Shoes', '', '', '', ''),
(129, 1, 1, 'Buty Marathon Trail to nowa odsłona klasycznego modelu adidas Marathon widzianego z perspektywy Y-3. Buty będące ukłonem w stronę japońskiej techniki szycia Sashiko mają wyraźne choć stonowane kolorystycznie przeszycia wokół zakładki z oczkami na sznurowadła, naszywki na pięcie, podeszwy środkowej i charakterystycznych 3 pasków. Wszystkie nici w przeszyciach swobodnie zwisają.', '', 'y-3-marathon-trail', '', '', '', 'Y-3 Marathon Trail', '', '', '', ''),
(130, 1, 1, 'Klasyka adidas widziana przez pryzmat Y-3. Słynne buty Gazelle w nowej odsłonie mają wyraźne choć stonowane kolorystycznie przeszycia wokół zakładki z oczkami na sznurowadła, naszywki na pięcie, podeszwy środkowej i charakterystycznych 3 pasków. Wszystkie nici w przeszyciach swobodnie zwisają, nawiązując do japońskiej techniki szycia Sashiko. Mają design z zamszu i otok wokół całej podeszwy zewnętrznej, który lekko zachodzi na zewnętrzny bok, nadając modelowi subtelny, a jednocześnie wyróżniający się look.', '', 'y-3-gazelle', '', '', '', 'Y-3 Gazelle', '', '', '', ''),
(131, 1, 1, 'Stworzone z myślą o błyskawicznej mobilności na pierwszej linii. Najlżejsze, profesjonalne buty do rugby od adidas wyróżniają się przyciągającą wzrok cholewką z tkaniny ripstop. Wewnętrzny system wsparcia zwiększa ich stabilność, co pozwala na skuteczną grę podczas młyna i w polu punktowym. Dzielona podeszwa zewnętrzna z ośmioma kołkami zapewnia elastyczność, której potrzebujesz, aby stawiać czoła wyzwaniom.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'kakari-z1-sg-boots', '', '', '', 'Kakari Z.1 SG Boots', '', '', '', ''),
(132, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(133, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(134, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II FG', '', '', '', ''),
(135, 1, 1, 'Najlepszy widok jest z góry, a buty trekkingowe Terrex Skychaser 2.0 GORE-TEX zostały stworzone, aby pomóc Ci tam dotrzeć. Inspirowane bieganiem buty hikingowe dla tych, którzy chcą poruszać się szybko w technicznym terenie. Zapewniają równowagę między trwałością i doskonałą stabilizacją za sprawą zwracającej energię adidas BOOST, która pomoże Ci iść jeszcze dalej i dotrzeć jeszcze wyżej. Wodoodporny GORE-TEX nie przepuszcza wody, a płytka chroniąca przed kamieniami stanowi zabezpieczenie w skalistym terenie. Zasznuruj otulającą stopę cholewkę i zacznij odkrywać świat.', '', 'terrex-skychaser-20-gore-tex-hiking-shoes', '', '', '', 'Terrex Skychaser 2.0 GORE-TEX Hiking Shoes', '', '', '', ''),
(136, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(137, 1, 1, 'Przygotuj się na każdą wędrówkę. Buty hikingowe adidas Terrex Swift R3 GORE-TEX łączą lekki design i amortyzację butów do biegów przełajowych z uniwersalnością i stabilnością butów hikingowych. \n\nMembrana GORE-TEX zapewnia wodoodporne, oddychające okrycie i ochronę przed zachlapaniem i wilgotnymi szlakami, a formowana wkładka gwarantuje wygodne dopasowanie na każdym kroku. Podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną przyczepność — na leśnym szlaku, podczas górskich wędrówek lub epickiej przygody poza szlakiem.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-terrex-swift-r3-gore-tex-hiking', '', '', '', 'Buty Terrex Swift R3 GORE-TEX Hiking', '', '', '', ''),
(138, 1, 1, 'Stare płyty. Klasyczne filmy. Ta kusa dżinsowa kurtka, która tak fajnie wygląda. Wszyscy pytają zawsze: „Co nowego”? Ale może warto zainteresować się bardziej tym, co wypróbowane. adidas stworzył buty Handball Spezial w 1979 roku, tak, owszem ― dla piłkarzy ręcznych. Dziś mogą służyć za wzorzec butów w stylu retro, jakie możesz spotkać w reklamach vintage. Pomyśl o nich jak o winylowych płytach.', '', 'handball-spezial-shoes', '', '', '', 'Handball Spezial Shoes', '', '', '', ''),
(139, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(140, 1, 1, 'Buty X Crazyfast Injection.1 FG są znane z tego, że pomagają zawodnikom osiągać maksymalną szybkość i zwinność na boisku, i powstały z myślą o momentach, które decydują o grze.\n\nButy piłkarskie z grafiką w jodełkę mają konstrukcję, która zapewnia niesamowitą szybkość. AEROPACITY SPEEDSKIN zapewnia maksymalną szybkość i optymalne wyczucie piłki, a superlekka cholewka dopasowuje się do stopy, wspierając ją. PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE została zaprojektowana z myślą o dynamicznych ruchach i przyspieszeniu. Konstrukcja kołków optymalizuje przyczepność podczas szybkiego przyspieszania. Cienki, swobodnie ulokowany język i sznurowadła zapewniają regulowane dopasowanie i bezpieczną blokadę stopy podczas gry.\n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-x-crazyfast-injection1-fg', '', '', '', 'Buty X Crazyfast Injection.1 FG', '', '', '', ''),
(141, 1, 1, 'Od ponad dwóch dekad współpraca adidas i Yohjiego Yamamoto jest pionierem w branży, prezentując unikalne podejście do awangardowej odzieży sportowej.\n\nŚwiętując tę współpracę, adidas i Yohji Yamamoto ponownie łączą siły, tworząc nową odsłonę kultowego modelu adidas: Stan Smith.\n\nModel tenisowy w nowej odsłonie, stworzonej z myślą o buntowniczych projektach Yohjiego Yamamoto, po raz pierwszy zaprezentowany na wybiegu w sezonie Jesień/Zima 2023-24 w Paryżu, został wykonany z wysokiej jakości, gładkiej skóry z kontrastowymi detalami.', '', 'yohji-stan', '', '', '', 'Yohji Stan', '', '', '', ''),
(142, 1, 1, 'Męskie buty outdoorowe, które bazują na dziesięcioleciach doświadczeń w projektowaniu profesjonalnego obuwia taktycznego. Mają odpowiednie wsparcie kostki, bardzo odporną na otarcia cholewkę oraz oddychającą i wodoodporną ochronę Climaproof. Podeszwa środkowa z pianki EVA i podeszwa zewnętrzna TRAXION zapewniają amortyzację i mocną przyczepność w każdym terenie.', '', 'gsg-92-boots', '', '', '', 'GSG 9.2 Boots', '', '', '', ''),
(143, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(144, 1, 1, 'Niech Twoje pragnienie przygody prowadzi Cię cały dzień. Od miasta po szlak, te przełajowe buty hikingowe adidas na pierwszym miejscu stawiają komfort. Krój znany z modeli biegowych daje możliwość dłuższych wędrówek. Wodoodporna, oddychająca cholewka pozwala skoncentrować się na odkrywaniu. Załóż je i zobacz, dokąd zaprowadzi Cię dzień.', '', 'terrex-trailmaker-gore-tex-hiking-shoes', '', '', '', 'Terrex Trailmaker GORE-TEX Hiking Shoes', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(145, 1, 1, 'Graj ostro, odpoczywaj na całego. Te dopasowane spodnie dresowe adidas spełniają wszystkie Twoje wymagania. Kieszenie na suwak pomieszczą niezbędne drobiazgi na kanapie lub w drodze. Zaprojektowany z myślą o Twoim komforcie model z pewnością będzie Twoim ulubionym elementem garderoby.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'trefoil-essentials-pants', '', '', '', 'Trefoil Essentials Pants', '', '', '', ''),
(146, 1, 1, 'Koszulka polo adidas, która powstała pięćdziesiąt lat po powstaniu Women\'s Tennis Association i Wojny Płci, oddaje hołd pozytywnym skutkom, jakie niesie zmiana status quo. Dopasowana koszulka z nadrukiem przedstawiającym przygodę na rękawach z siateczki powstała, aby błyszczeć w świetle reflektorów. Design FreeLift zapewnia komfort podczas gry z ramionami w górze, a HEAT.RDY gwarantuje przewiewność, gdy nadchodzi czas, aby wprowadzić zmiany.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'koszulka-tennis-heatrdy-freelift-pro-polo', '', '', '', 'Koszulka Tennis HEAT.RDY FreeLift Pro Polo', '', '', '', ''),
(147, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Ta bluza z kapturem adidas zapewnia wygodę za sprawą konstrukcji z miękkiego polaru. Kiedy zwalnia tempo sesji treningowej, załóż kaptur i ogrzej dłonie w kieszeni kangurce.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'entrada-22-sweat-hoodie', '', '', '', 'Entrada 22 Sweat Hoodie', '', '', '', ''),
(148, 1, 1, 'Tradycja zyskuje złoty akcent na designie koszulki podstawowej Realu Madryt na sezon 2023/24. Zachowujący czystej, białe tło, uderzający zestaw kontynuuje idee robiącego wrażenie projektowania, zmieniając się w stylową koszulkę zakorzenioną w legendarnej historii piłki nożnej.\n\nZłote detale nawiązują do starszych zestawów, a podkreśla je elegancka granatowa oprawa. Nadruk na całej powierzchni stanowi subtelną odsłonę klasycznego, białego stroju dostosowaną do potrzeb kibiców, która zapewnia dopasowanie i stylowy look na co dzień. Odprowadzający pot AEROREADY zapewnia komfort na boisku lub w tłumie, a wyszywane godło i napis „Hala Madrid!” na karku przywołują przebojową postawę klubu.', '', 'koszulka-real-madrid-23-24-home', '', '', '', 'Koszulka Real Madrid 23/24 Home', '', '', '', ''),
(149, 1, 1, 'Niezależnie od tego, czy jest chłodny dzień, czy po prostu potrzebujesz dodatkowego komfortu, wybierzesz te spodnie adidas. Model z miękkiego polaru o dużej zawartości bawełny sprawdzi się przez cały dzień bez żadnych wątpliwości. Średniowysoki krój jest wykończony elastyczną talią, a zwężane nogawki i mankiety ze ściągaczem pozwolą Ci zaprezentować buty. Kieszenie z przodu pomieszczą wszystko, czego potrzebujesz, a kieszeń na telefon pomieści niezbędne drobiazgi. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'spodnie-essentials-fleece-3-stripes-tapered-cuff', '', '', '', 'Spodnie Essentials Fleece 3-Stripes Tapered Cuff', '', '', '', ''),
(150, 1, 1, 'Minimalistyczna konstrukcja spodni Y-3 Organic Cotton Terry z mankietami stanowi funkcjonalną podstawę stroju na co dzień. Model z materiału frotté o dużej zawartości bawełny organicznej ma luźny, swobodny krój.\n\nTen produkt został wykonany z naturalnych i pozyskanych z odnawialnych źródeł materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'y-3-organic-cotton-terry-cuffed-pants', '', '', '', 'Y-3 Organic Cotton Terry Cuffed Pants', '', '', '', ''),
(151, 1, 1, 'Nowe wynalazki wykorzystują osiągnięcia przeszłości do współczesnych potrzeb. Spodnie dresowe adidas inspirowane archiwalnym stylem oddają hołd przeszłości przy pomocy dopasowanego kroju, mankietów ze ściągaczem i wyszywanego logo Trefoil na jednej nogawce. Miękki materiał zapewnia komfort właśnie dziś, a elastyczna talia regulowana sznurkiem gwarantuje idealne dopasowanie przy każdym założeniu. Noś je, gdy masz ochotę spędzić dzień na relaksie. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'adicolor-classics-sst-track-pants', '', '', '', 'Adicolor Classics SST Track Pants', '', '', '', ''),
(152, 1, 1, 'Niezależnie od tego, czy pedałujesz, zasuwasz po asfalcie, czy leżysz kołami do góry, te spodnie dresowe adidas są tak miękkie, że z łatwością zapomnisz, że masz je na sobie. Spodnie z bawełnianego materiału frotté, który jest miły w dotyku i nie zwiększa ciężaru stroju, idealnie nadają się do regularnego noszenia. Boczne kieszenie i kieszeń na nogawce ułatwiają organizację niezbędnych drobiazgów.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-french-terry-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials French Terry Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(153, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Klasyczna koszulka adidas ma dopasowany krój i kontrastowy dół w wyszukanym stylu vintage. Zestaw ją z ulubionymi ciemnymi dżinsami, aby uzyskać swobodny, klasyczny look. Konstrukcja z miękkiej bawełny gwarantuje komfort.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(154, 1, 1, 'Wybierz luźną bluzę z kapturem adidas Rekive w swobodnym stylu. Konstrukcja z miękkiego, wygodnego polaru ma dobrze znane logo Trefoil na piersi i linie kroju, które współgrają z kultowymi 3 paskami. Zgrzewane kieszenie i ściągaczowe detale dopełniają design stroju do noszenia na co dzień.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-adidas-rekive', '', '', '', 'Bluza z kapturem adidas Rekive', '', '', '', ''),
(155, 1, 1, 'Jakie miasto, taki klub. Pokaż z dumą barwy swojej drużyny w koszulce podstawowej Manchester United 23/24. \n\nKoszulka stanowi nawiązanie do ciągłych wpływów Manchesteru na całym świecie. Czerpiąc elementy designu z pobliskiego mostu z ery rewolucji przemysłowej, prezentuje powtarzający się, geometryczny wzór inspirowany różą Lancashire na przodzie. Odprowadzający pot HEAT.RDY i lekkie detale drużyny sprawiają, że idealnie nadaje się na boisko — niezależnie od tego, czy przygotowujesz się do międzynarodowego meczu, czy do lokalnych rozgrywek na małym boisku.', '', 'manchester-united-23-24-home-jersey', '', '', '', 'Manchester United 23/24 Home Jersey', '', '', '', ''),
(156, 1, 1, 'Niezależnie od tego, czy przemierzasz miejskie chodniki czy nieprzetarte szlaki, przyszłość należy do Ciebie. Wybierz bluzę z kapturem o technicznym wyglądzie i ciesz się minimalistycznym lookiem, który pasuje do Twojego stylu życia. Subtelne akcenty graficzne sprawiają, że model świetnie nadaje się zarówno na co dzień, jak i na wyjątkowe okazje.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'city-escape-hoodie', '', '', '', 'City Escape Hoodie', '', '', '', ''),
(157, 1, 1, 'Na chłody i niepogodę. Załóż ciepłą, polarową bluzę z kapturem, która zapewni Ci komfort, gdy słońce chowa się za chmurami. Włóż ręce do kieszeni kangurki, aby szybko ogrzać dłonie. \n\nKupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego. Ten produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-fleece-hoodie', '', '', '', 'Essentials Fleece Hoodie', '', '', '', ''),
(158, 1, 1, 'Kluczowy element Twojej garderoby. Wybierz klasyczną i dyskretną koszulkę adidas. Model z komfortowej dzianiny bawełnianej jest tak wygodny, na jaki wygląda. \n \nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-single-jersey-embroidered-small-logo-tee', '', '', '', 'Essentials Single Jersey Embroidered Small Logo Tee', '', '', '', ''),
(159, 1, 1, 'Szorty adidas stworzone z myślą o zabieganych dniach mają wewnętrzną bieliznę z przewiewnej siateczki, która zapewnia dodatkowe okrycie i większą wygodę. Pochłaniający wilgoć AEROREADY dba o suchy komfort w ruchu. Charakterystyczne 3 paski wzdłuż boków pokazują wszystkim, że należysz do drużyny adidas.', '', 'aeroready-essentials-chelsea-3-stripes-shorts', '', '', '', 'AEROREADY Essentials Chelsea 3-Stripes Shorts', '', '', '', ''),
(160, 1, 1, 'Sportowcy są zgodni: jeśli dobrze opanujesz podstawy, wszystko inne przyjdzie z czasem. Te spodnie dresowe adidas to obiecujący początek. Są uszyte z polaru i mają miękki, wygodny krój, od elastycznej, średnio zabudowanej talii po mankiety przy nogawkach. Dzięki bocznym kieszeniom i tylnej kieszeni pomieszczą więcej niż tylko Twój telefon. Dzięki temu masz wolne ręce i możesz wziąć kawę. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'essentials-fleece-regular-tapered-pants', '', '', '', 'Essentials Fleece Regular Tapered Pants', '', '', '', ''),
(161, 1, 1, 'Nic nie gwarantuje takiej wygody jak ten dres adidas. Ten podstawowy element garderoby idealnie podkreśla Twój styl, gdy spotykasz się z przyjaciółmi lub wybierasz się na popołudniowy spacer. Sznurek do regulacji w talii pozwala na indywidualne dopasowanie odpowiednio do Twoich potrzeb w zakresie stylu i wygody. Przy pomocy 3 pasków komfortowo zaprezentujesz dumny styl adidas.', '', 'basic-3-stripes-tricot-track-suit', '', '', '', 'Basic 3-Stripes Tricot Track Suit', '', '', '', ''),
(162, 1, 1, 'Koszulka adidas, która sprawdzi się jako warstwa podstawowa, pomoże Ci dać z siebie wszystko podczas ćwiczeń cardio i treningu ramion. Bij rekordy życiowe, ciesząc się komfortem dzięki siateczce w górnej części pleców i pochłaniającemu wilgoć AEROREADY. Konstrukcja tej koszulki zapewnia swobodę ruchu za sprawą dynamicznych linii kroju i niezwykle elastycznego materiału.', '', 'techfit-training-long-sleeve-tee', '', '', '', 'Techfit Training Long Sleeve Tee', '', '', '', ''),
(163, 1, 1, 'Wybierz spodnie cargo od adidas, które są idealnym połączeniem stylu outdoorowego i kanapowego. Mają średniowysoką, elastyczną talię i zwężane nogawki, które nadają im opływowy look i zapewniają swobodę. Model z miękkiego polaru idealnie sprawdzi się podczas zimowych spacerów. Wsuń nogawki do butów i włóż rękawiczki do dodatkowych kieszeni. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'essentials-fleece-regular-tapered-cargo-pants', '', '', '', 'Essentials Fleece Regular Tapered Cargo Pants', '', '', '', ''),
(164, 1, 1, 'Jeśli lubisz styl retro, nie przegap tej bluzy adidas. Jej design pochodzi wprost z archiwów, a kultowa grafika stanowi hołd dla naszej sportowej tradycji. Ale nie daj się zwieść sportowemu stylowi. Jej swobodny komfort został stworzony, aby się wyluzować.\n\nTen produkt zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 40% materiałów pochodzących z recyklingu.', '', 'adicolor-classics-cut-line-crew-sweatshirt', '', '', '', 'Adicolor Classics Cut Line Crew Sweatshirt', '', '', '', ''),
(165, 1, 1, 'Spodnie z mankietami Y-3 Refined Wool jest ucieleśnieniem elegancji dzięki materiałowi, z którego zostały uszyte, i detalom. Wyszukana konstrukcja ma swobodny krój, który luźno układa się na ciele za sprawą elastycznej talii regulowanej sznurkiem. Kultowe 3 paski zostały wkomponowane w materiał premium i biegną wzdłuż lewego boku.', '', 'y-3-3-stripes-refined-wool-cuffed-pants', '', '', '', 'Y-3 3-Stripes Refined Wool Cuffed Pants', '', '', '', ''),
(166, 1, 1, 'Pomachaj hantlami. Zarzuć sztangę. Poboksuj worek treningowy. Stworzone z myślą o ruchu szorty adidas są niezawodnym partnerem na każdy rodzaj treningu. AEROREADY pochłania wilgoć, zapewniając suchy komfort Tobie i... podłodze na siłowni. Schowaj klucze i telefon w bocznych kieszeniach na suwak. \n\nTen produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'aeroready-designed-for-movement-shorts', '', '', '', 'AEROREADY Designed for Movement Shorts', '', '', '', ''),
(167, 1, 1, 'Archiwalne linie kroju podkreślone lamówką nadają tej bluzie z kapturem adidas swobodny, modny styl retro. Od relaksu w domu po spotkania z przyjaciółmi, miękki polar zapewni Ci komfort przez cały dzień. Logo Trefoil nadaje modelowi status must-have, który trudno nazwać zwyczajnym.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'adicolor-seasonal-archive-hoodie', '', '', '', 'Adicolor Seasonal Archive Hoodie', '', '', '', ''),
(168, 1, 1, 'Staw czoła zimowej aurze w puchowej kurtce adidas z gęsiego puchu. Kurtka stworzona, aby chronić Cię przed chłodem, ma gruby design z izolacją z gęsiego puchu, który zatrzymuje ciepło, zapewniając Ci ciepło. Niezależnie od tego, czy spacerujesz po lesie, czy spędzasz popołudnie w mieście, elastyczne mankiety i regulowany dół zatrzymują ciepło i nie przepuszczają zimnego powietrza do środka. Aby zapewnić sobie ciepło i wygodę, po prostu zasuń wysoki kołnierz i załóż kaptur.', '', 'kurtka-goose-down', '', '', '', 'Kurtka Goose Down', '', '', '', ''),
(169, 1, 1, 'Spodnie cargo Y-3 Utility czerpią z klasycznego i funkcjonalnego podejścia, by następnie zaproponować zaskakujący efekt. Model ze spranego, marszczonego diagonalu ma luźny krój wykończony metalowymi akcentami, taśmą, sprzączką FIDLOCK® i kieszeniami na całej powierzchni.', '', 'spodnie-y-3-utility-cargo', '', '', '', 'Spodnie Y-3 Utility Cargo', '', '', '', ''),
(170, 1, 1, 'Zrób sobie przerwę i wyjdź na łono natury. Ta bluza z kapturem adidas ma luźny krój, dzięki czemu łatwo jest ją założyć na wszystkie rodzaje ubrań ― te outdoorowe i wszystkie inne. Kieszenie na suwaki bezpiecznie przechowają Twój telefon i klucze, gdy dotleniasz się na świeżym powietrzu. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-z-kapturem-city-escape-full-zip', '', '', '', 'Bluza z kapturem City Escape Full-Zip', '', '', '', ''),
(171, 1, 1, 'Powtarzające się symbole nieskończoności na przodzie koszulki wyjazdowej Realu Madryt na sezon 23/24 świadczą o pełnym oddaniu kibiców Realu Madryt swojemu klubowi. To również przypomnienie, że w dniu meczu chodzi zarówno o podróż, jak i o piękną grę. \n\nKoszulka została zaprojektowana z myślą o optymalnym komforcie podczas meczów wyjazdowych dzięki lekkim detalom i wstawkom z siateczki. Wykorzystując zaawansowane materiały, adidas AEROREADY maksymalizuje przepływ powietrza, jednocześnie zapewniając zawodnikom przewiewny komfort w czasie treningu. Trójkolorowe 3 paski na ramionach i wyszywane godło drużyny na piersi podkreślają jej dumny styl. Przędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów.', '', 'koszulka-real-madrid-23-24-away', '', '', '', 'Koszulka Real Madrid 23/24 Away', '', '', '', ''),
(172, 1, 1, 'Krok naprzód. Dociągnięcie narty. Oddech. I jeszcze raz. Gdy koncentrujesz się na trasie, ta kurtka adidas do narciarstwa biegowego z miękką warstwą wierzchnią wspiera Cię, gwarantując komfort i swobodę ruchu. Wiatroszczelny materiał chroni przed mroźnymi podmuchami powietrza, a elastyczna wstawka z tyłu rozciąga się i porusza razem z Tobą. Ruszaj naprzód i daj z siebie wszystko. AEROREADY pochłania wilgoć, zapewniając Ci suchy komfort podczas długich wędrówek.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-terrex-xperior-cross-country-ski-soft-shell', '', '', '', 'Kurtka Terrex Xperior Cross-Country Ski Soft Shell', '', '', '', ''),
(173, 1, 1, 'Piłkarska elegancja. Trudno ją opisać, ale równie trudno jej nie dostrzec. Będąca ukłonem w stronę zachwycających meczów wyjazdowych Realu Madryt trzecia koszulka Real Madrid 23/24 zachowuje klasyczny styl dzięki czarnemu tłu i wyszywanemu napisowi „RMCF” po lewej stronie kołnierza Henley. Odprowadzający pot AEROREADY dba o suchy komfort, a detale z siateczki zwiększają wygodę, co przekłada się na doskonałe wyniki na boisku. \n\nTen produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'koszulka-real-madrid-23-24-third', '', '', '', 'Koszulka Real Madrid 23/24 Third', '', '', '', ''),
(174, 1, 1, 'Koszulka polo adidas, która powstała pięćdziesiąt lat po powstaniu Women\'s Tennis Association i Wojny Płci, oddaje hołd pozytywnym skutkom, jakie niesie zmiana status quo. Dopasowana koszulka z nadrukiem przedstawiającym przygodę na rękawach z siateczki powstała, aby błyszczeć w świetle reflektorów. Design FreeLift zapewnia komfort podczas gry z ramionami w górze, a HEAT.RDY gwarantuje przewiewność, gdy nadchodzi czas, aby wprowadzić zmiany.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'koszulka-tennis-heatrdy-freelift-pro-polo', '', '', '', 'Koszulka Tennis HEAT.RDY FreeLift Pro Polo', '', '', '', ''),
(175, 1, 1, 'Życie jest po to, by się nim cieszyć. Więc wybierz gruby materiał tej bluzy z kapturem adidas i maksymalnie wykorzystaj każdą chwilę. Minimalistyczny styl i konstrukcja z miękkiej bawełny organicznej sprawiają, że wyglądasz świetnie i czujesz się dobrze.\n\nTen produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'adicolor-contempo-french-terry-hoodie', '', '', '', 'Adicolor Contempo French Terry Hoodie', '', '', '', ''),
(176, 1, 1, 'Przy ilości zadań, którą musisz zrealizować na co dzień, potrzebujesz czegoś, co sprawdzi się w każdej sytuacji. I tu na scenę wkracza ta bluza z kapturem i suwakiem na całej długości od adidas. To kultowy design sportowy z charakterystycznym brandingiem adidas, który wyróżnia się na solidnej konstrukcji. Subtelny, nieoczekiwany akcent pojawia się, gdy zakładasz kaptur — przedłużone 3 paski, które rozciągają się od mankietu do mankietu, a następnie biegną aż po górę. Miękki materiał frotté umożliwia pełen relaks pod koniec dnia.', '', 'essentials-french-terry-3-stripes-full-zip-hoodie', '', '', '', 'Essentials French Terry 3-Stripes Full-Zip Hoodie', '', '', '', ''),
(177, 1, 1, 'Kluczowy element Twojej garderoby. Wybierz klasyczną i dyskretną koszulkę adidas. Model z komfortowej dzianiny bawełnianej jest tak wygodny, na jaki wygląda. \n \nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-single-jersey-embroidered-small-logo-tee', '', '', '', 'Essentials Single Jersey Embroidered Small Logo Tee', '', '', '', ''),
(178, 1, 1, 'Ta bluza z kapturem adidas to gwarancja ciepła i przyciągające wzrok logo. Model z polaru z dużą zawartością bawełny stanowi idealną warstwę zewnętrzną, gdy potrzebujesz najwygodniejszej bluzy. Wygodna kieszonka pomieści Twój telefon w zasięgu ręki.  \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-z-kapturem-essentials-fleece-big-logo', '', '', '', 'Bluza z kapturem Essentials Fleece Big Logo', '', '', '', ''),
(179, 1, 1, 'Podkręć swój look ponadczasowym klasykiem. Spodnie dresowe adidas Adicolor Beckenbauer pochodzą prosto z archiwalnych katalogów z 3 paskami i stanowią hołd dla legendarnego piłkarza. Dopasowany krój otula ciało, a wyszywane logo Trefoil i 3 paski prezentują kultowy, archiwalny look. Konstrukcja z miękkiej mieszanki bawełnianej sprawia, że będziesz po nie ciągle sięgać.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'spodnie-dresowe-adicolor-classics-beckenbauer', '', '', '', 'Spodnie dresowe Adicolor Classics Beckenbauer', '', '', '', ''),
(180, 1, 1, 'Przygotuj się na mecz, nawet w chłodne dni. Staw czoła kaprysom pogody i pokaż, komu kibicujesz, nosząc piłkarski płaszcz adidas w barwach wyjazdowych Realu Madryt. Długi fason zapewni Ci okrycie, którego potrzebujesz, gdy masz na sobie zestaw meczowy. Klapka przeciwsztormowa i wypełnienie z kaczego puchu i pierza zapewnią Ci ciepły komfort, gdy czekasz na moment, by przyłączyć się do akcji.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'plaszcz-real-madrid-dna-down', '', '', '', 'Płaszcz Real Madrid DNA Down', '', '', '', ''),
(181, 1, 1, 'Spodnie Wool Flannel Cuffed od Y-3 wyraźnie znajdują się na styku dwóch światów adidas i Yohjiego Yamamoto. Elegancka konstrukcja z wełny ma swobodny krój wykończony kieszeniami z boku i z tyłu.', '', 'spodnie-y-3-wool-flannel-cuffed', '', '', '', 'Spodnie Y-3 Wool Flannel Cuffed', '', '', '', ''),
(182, 1, 1, 'Ponadczasowa klasyka w postaci tej bluzy z kapturem adidas jest niezbędnym elementem garderoby na dni wolne od pracy. Miękki polar i wygodny krój zapewniają przyjemny komfort. Wyszywane logo Trefoil nadaje autentyczny charakter temu minimalistycznemu modelowi, który z łatwością zestawisz z innymi ulubionymi ubraniami. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-trefoil-essentials-full-zip', '', '', '', 'Bluza z kapturem Trefoil Essentials Full-Zip', '', '', '', ''),
(183, 1, 1, 'Od wyciskania po pompki możesz poruszać się swobodnie w tej koszulce treningowej adidas. Ma krój, który nie krępuje ruchów ramion nad głową. Oddychający materiał i pochłaniający wilgoć AEROREADY zapewniają Ci suchy komfort, gdy skacze Ci tętno.', '', 'train-essentials-feelready-training-tee', '', '', '', 'Train Essentials Feelready Training Tee', '', '', '', ''),
(184, 1, 1, 'Jeden z wyróżników stylu adidas — 3 paski — został podkreślony na koszulce z długim rękawem Y-3 Stripes. Koszulka ma luźny krój z miękkiej bawełny wykończony raglanowymi szwami, wkomponowanymi 3 paskami i rozcięciami po bokach.', '', 'y-3-stripes-long-sleeve-tee', '', '', '', 'Y-3 Stripes Long Sleeve Tee', '', '', '', ''),
(185, 1, 1, 'Spodnie Y-3 z grafiką uszyte z materiału frotté zapewniają harmonijną równowagę między modą a sportem. Luźny krój swobodnie układa się na ciele, zapewniając miękki komfort. Całość uzupełnia naszywka z grafiką Y-3.\n\nTen produkt został wykonany z naturalnych i pozyskanych z odnawialnych źródeł materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'spodnie-y-3-graphic-french-terry', '', '', '', 'Spodnie Y-3 Graphic French Terry', '', '', '', ''),
(186, 1, 1, 'Nie da się mieć zbyt wielu bluz, zwłaszcza jeśli w grę wchodzi ta wyjątkowo miękka bluza adidas w klasycznym stylu z 3 paskami. Zabierz ją na zajęcia, aby założył po treningu, gdy robi się chłodno, lub załatwiaj w niej swoje sprawy. Detale takie jak mankiety i dół ze ściągaczami oraz bawełniany materiał frotté sprawią, że ta bluza stanie się Twoim nowym ulubionym strojem.', '', 'essentials-french-terry-3-stripes-sweatshirt', '', '', '', 'Essentials French Terry 3-Stripes Sweatshirt', '', '', '', ''),
(187, 1, 1, 'Niezależnie od tego, czy pedałujesz, zasuwasz po asfalcie, czy leżysz kołami do góry, te spodnie dresowe adidas są tak miękkie, że z łatwością zapomnisz, że masz je na sobie. Spodnie z bawełnianego materiału frotté, który jest miły w dotyku i nie zwiększa ciężaru stroju, idealnie nadają się do regularnego noszenia. Boczne kieszenie i kieszeń na nogawce ułatwiają organizację niezbędnych drobiazgów.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-french-terry-tapered-cuff-3-stripes-pants', '', '', '', 'Essentials French Terry Tapered Cuff 3-Stripes Pants', '', '', '', ''),
(188, 1, 1, 'Pokaż, że kibicujesz swojemu klubowi, zachowując jednocześnie ciepły komfort. Ta bluza piłkarska adidas prezentuje godło Realu Madryt na tle barw zestawu wyjazdowego. Mocna tkanina o splocie płóciennym okrywająca lekkie wypełnienie z kaczego puchu i pierza ochroni Cię przed kaprysami pogody. Luźny krój zapewnia swobodne wsparcie.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-real-madrid-dna-down', '', '', '', 'Kurtka Real Madrid DNA Down', '', '', '', ''),
(189, 1, 1, 'Nowe wynalazki wykorzystują osiągnięcia przeszłości do współczesnych potrzeb. Spodnie dresowe adidas inspirowane archiwalnym stylem oddają hołd przeszłości przy pomocy dopasowanego kroju, mankietów ze ściągaczem i wyszywanego logo Trefoil na jednej nogawce. Miękki materiał zapewnia komfort właśnie dziś, a elastyczna talia regulowana sznurkiem gwarantuje idealne dopasowanie przy każdym założeniu. Noś je, gdy masz ochotę spędzić dzień na relaksie. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'adicolor-classics-sst-track-pants', '', '', '', 'Adicolor Classics SST Track Pants', '', '', '', ''),
(190, 1, 1, 'Pogoda może być nieprzewidywalna, ale Twoja cotygodniowa pora gry w golfa nie jest. Przygotuj się na zmienne warunki dzięki wkładanej przez głowę bluzie adidas do gry w golfa. Model uszyto z miękkiego polaru, który zapewni Ci ciepły komfort na polu golfowym. Stawiany kołnierz jest miły w dotyku, a mocna, wodoodporna powłoka odprowadza lekki deszcz, dzięki czemu możesz grać przez cały mecz. Ściągaczowe wstawki po bokach dodadzą stylu Twojej grze w chłodne dni.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'bluza-dwr-quarter-zip', '', '', '', 'Bluza DWR Quarter-Zip', '', '', '', ''),
(191, 1, 1, 'Legginsy Run It od adidas zostały uszyte z miękkiego, elastycznego materiału z pochłaniającą wilgoć technologią AEROREADY, dzięki czemu zachowasz suchy komfort i koncentrację. Płaskie szwy zapobiegają otarciom skóry, które mogą stanowić niepotrzebny czynnik rozpraszający, a wstawki z siateczki zapewniają przewiewność tam, gdzie zazwyczaj się nagrzewasz. Odblaskowe detale i boczne kieszenie zwiększają funkcjonalność wygodnego, sportowego designu.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'legginsy-run-it', '', '', '', 'Legginsy Run It', '', '', '', ''),
(192, 1, 1, 'Dwustronna kurtka adidas zapewni Ci wiele okrycia, a gdziekolwiek się udasz, będziesz reprezentować swoją ulubioną drużynę piłkarską dzięki godłu Juventusu na piersi. Kurtka ma przytulną izolację z puchu i pierza, a kaptur jest podszyty miękką podszewką. Elastyczne mankiety i dół zatrzymują ciepło, zapewniając Ci ciepło, gdy jesteś na stadionie lub wychodzisz po zachodzie słońca. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-juventus-dna-down', '', '', '', 'Kurtka Juventus DNA Down', '', '', '', ''),
(193, 1, 1, 'Urozmaicaj swój trening i ruszaj na basen, aby pokonać kolejne długości basenu. Te bokserki do pływania adidas zostały uszyte z mocnego, miękkiego i gładkiego materiału, który jest odporny na działanie chloru. A więc po prostu załóż gogle i ruszaj.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'bokserki-do-plywania-solid', '', '', '', 'Bokserki do pływania Solid', '', '', '', ''),
(194, 1, 1, 'Klasyczny look w wersji Adicolor. Ten podstawowy element garderoby prezentuje kultowy styl Firebird, który znasz i kochasz, ale ma nowoczesny krój i świeżą paletę kolorów. Wyszywane logo Trefoil na piersi i 3 paski wzdłuż ramion to kwintesencja stylu adidas, a stawiany kołnierz podkreśla nastwienie, którego potrzebujesz, aby przejąć kontrolę nad swoim dniem. Przechowuj niezbędne drobiazgi w kieszeniach na suwak i ciesz się przytulnym komfortem dzięki mankietom ze ściągaczem. Jaki jest Twój ulubiony kolor?\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-dresowa-adicolor-classics-firebird', '', '', '', 'Bluza dresowa Adicolor Classics Firebird', '', '', '', ''),
(195, 1, 1, 'adidas Terrex nawiązuje wieloletnią współpracę z japońską awangardową marką outdoorową and wander z myślą o eksplorowaniu relacji łączących ludzkość z naturą. Obie marki łączy zamiłowanie do outdooru, dlatego szukają kreatywnych sposobów na przeniesienie estetyki do współczesnego życia w mieście i przygód na świeżym powietrzu. Marka and wander została założona w 2011 roku w Tokio przez Keitę Ikeuchiego i Mihoko Mori, którzy poznali się, pracując jako projektanci dla Issey Miyake. Ich wiedza o modzie połączona z zamiłowaniem do outdooru podkręca charakter adidas Terrex, dając w rezultacie unikalną kolekcję, w której splata się nowoczesność i funkcjonalność gotowa na górskie szlaki.\n\nWybierz kurtkę adidas, aby móc docenić piękno świata także w chłodne dni. Jej design łączy DNA naszej kurtki XPLORIC z kreatywną wizją japońskiej marki outdoorowej and wander. Liczne kieszenie oznaczają, że masz dużo miejsca na niezbędne drobiazgi, a konstrukcja 3-w-1 oferuje uniwersalne okrycie odpowiednie na chłodne dni. Załóż wewnętrzną kurtkę, aby chronić się przed chłodem i zewnętrzną kurtkę z RAIN.RDY dla osłony przed deszczem. Oba modele noszone rzeczy razem gwarantują maksymalną ochronę przed kaprysami pogody. Jest Twoja i tylko Twoja.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-adidas-terrex-and-wander-xploric', '', '', '', 'Kurtka adidas Terrex + and wander XPLORIC', '', '', '', ''),
(196, 1, 1, 'Poranek. Niepewne prognozy pogody. Puchowa kurtka adidas COLD.RDY chroni przed wilgocią i zatrzymuje ciepło, dzięki czemu możesz skoncentrować się tym, co przed Tobą. Model zapewnia ochronę przed deszczem w strategicznych miejscach, takich jak górna część tułowia, kaptur i rękawy. Wodoodporna, puchowa izolacja nie przepuszcza wody, zapewniając Ci ciepły komfort w wilgotne dni. Zachodzące na siebie pikowane zakładki ograniczają utratę ciepła. Ruszaj pewnie przed siebie.', '', 'traveer-coldrdy-jacket', '', '', '', 'Traveer COLD.RDY Jacket', '', '', '', ''),
(197, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Konstrukcja z miękkiego polaru sprawia, że te spodnie dresowe adidas to wygodny strój w drodze na trening. Zwężane nogawki i mankiety ze ściągaczem nadają modelowi opływowy kształt, dzięki czemu możesz zaprezentować swoją wyszukaną pracę nóg, gdy już dotrzesz na miejsce.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'entrada-22-sweat-pants', '', '', '', 'Entrada 22 Sweat Pants', '', '', '', ''),
(198, 1, 1, 'Staw czoła nierównej opaleniźnie w szortach do pływania adidas o bardzo krótkim kroju. Wbudowana bielizna z siateczki zapewnia lekkość i przewiewność. Te szorty do pływania ze średnio zabudowaną talią zostały uszyte z szybkoschnącego materiału z wodoodpornym wykończeniem niezawierającym perfluorowęglowodorów (PFC).\n\nTen produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', '3-stripes-clx-swim-shorts', '', '', '', '3-Stripes CLX Swim Shorts', '', '', '', ''),
(199, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW tych spodniach z dzianiny Own The Run Astro poczujesz się jeszcze lepiej. Zwężane nogawki nadają im klasyczny look biegowy, a suwaki w kostkach ułatwiają zakładanie i zdejmowanie spodni, zanim wyjdziesz na trasę. Sznurek do regulacji utrzymuje je na swoim miejscu, a odprowadzająca pot technologia AEROREADY zapewnia Ci suchy komfort. Boczne i wewnętrzne kieszenie na monety pomieszczą niezbędne drobiazgi, a odblaskowe detale błyszczą jasno w słabym świetle.', '', 'spodnie-own-the-run-astro-knit', '', '', '', 'Spodnie Own the Run Astro Knit', '', '', '', ''),
(200, 1, 1, 'Model zainspirowany piękną grą. Piłkarska bluza z kapturem adidas będąca częścią kolekcji Tiro 23 League zapewni Ci ciepły komfort poza boiskiem dzięki konstrukcji z miękkiego polaru. Załóż obszerny kaptur na głowę i wsuń ręce do kieszeni kangurki, aby zapomnieć, ile kosztowała Cię sesja treningowa.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'tiro-23-league-sweat-hoodie', '', '', '', 'Tiro 23 League Sweat Hoodie', '', '', '', ''),
(201, 1, 1, 'Nadruk z monogramem z logo Trefoil nadaje tej bluzie dresowej adidas dopracowany look. Ściągacze w mankietach i talii sprawiają, że sylwetka jest zawsze dopasowana do ciała, a suwak z przodu i stawiany kołnierz dają Ci różne opcje stylizacji i świeży look przy każdym założeniu. \n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'bluza-dresowa-blue-version-sst', '', '', '', 'Bluza dresowa Blue Version SST', '', '', '', ''),
(202, 1, 1, 'Nie musisz już wybierać między wygodą a stylem. Kurtka puchowa adidas Midweight oferuje jedno i drugie. Podkręć swój look, zakładając tę kurtkę. Kurtka z wysokiej jakości nylonowej tafty i poliestrowej tkaniny ripstop ma krój inspirowany stylem retro, który pozwoli Ci wyróżnić się z tłumu. Od kaczego puchu po ukrytą kieszeń na niezbędne drobiazgi ten model spełnia wszystkie Twoje wymagania.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'kurtka-midweight-down-puffer', '', '', '', 'Kurtka Midweight Down Puffer', '', '', '', ''),
(203, 1, 1, 'Woda jest dla każdego. Chłodzi, odświeża, relaksuje. Jak tu jej nie kochać? Ciesz się pokonywaniem kolejnych długości basenu, pływaniem w rzece lub dynamicznym wiosłowaniem w tych bokserkach do pływania adidas. Miękki, odporny na działanie chloru materiał zapewnia swobodę ruchu w wodzie. Aplikacja z 3 paskami pozostaje wierna naszym sportowym korzeniom.', '', 'classic-3-stripes-swim-boxers', '', '', '', 'Classic 3-Stripes Swim Boxers', '', '', '', ''),
(204, 1, 1, 'Nie musisz już wybierać między wygodą a stylem. Kurtka puchowa adidas Midweight oferuje jedno i drugie. Podkręć swój look, zakładając tę kurtkę. Kurtka z wysokiej jakości nylonowej tafty i poliestrowej tkaniny ripstop ma krój inspirowany stylem retro, który pozwoli Ci wyróżnić się z tłumu. Od kaczego puchu po ukrytą kieszeń na niezbędne drobiazgi ten model spełnia wszystkie Twoje wymagania.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'kurtka-midweight-down-puffer', '', '', '', 'Kurtka Midweight Down Puffer', '', '', '', ''),
(205, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Ta bluza z kapturem adidas zapewnia wygodę za sprawą konstrukcji z miękkiego polaru. Kiedy zwalnia tempo sesji treningowej, załóż kaptur i ogrzej dłonie w kieszeni kangurce.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'entrada-22-sweat-hoodie', '', '', '', 'Entrada 22 Sweat Hoodie', '', '', '', ''),
(206, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nBluza dresowa Statement Nylon została uszyta z gładkiej, nylonowej tkaniny o splocie płóciennym i łączy sportową funkcjonalność z luksusowymi detalami. Ma elegancki look z asymetrycznymi zatrzaskami z przodu i półgolfem ze ściągaczem.', '', 'bluza-dresowa-wales-bonner-statement-nylon', '', '', '', 'Bluza dresowa Wales Bonner Statement Nylon', '', '', '', ''),
(207, 1, 1, 'Pętelkowy materiał frotté z organicznej bawełny sprawia, że sweter Y-3 Graphic Crew jest wyjątkowo miękki w dotyku. Luźny krój umożliwia warstwowe stylizacje, a ściągacz na dole i w mankietach dopasowuje się do sylwetki. Logo Y-3 prezentuje się w formie offsetu po jednej stronie z przodu.', '', 'sweter-y-3-graphic-crew', '', '', '', 'Sweter Y-3 Graphic Crew', '', '', '', ''),
(208, 1, 1, 'Kurtka stworzona z myślą o życiu w ruchu powstała z myślą o tych, którzy nie dają się zamknąć w czterech ścianach. Izolacja PrimaLoft Gold i mankiety ze ściągaczem zatrzymują ciepło. Kieszenie na suwaki pomieszczą niezbędne drobiazgi w zasięgu ręki. Będąca ukłonem w stronę bogatej historii sportowej adidas metka Spezial oznacza ten styl jako inspirowany tradycjami kultury stadionowej. Duże, modne logo Trefoil wyróżnia się na plecach. Mocna konstrukcja z tkaniny ripstop jest podkreślona dwukierunkowym suwakiem i stawianym kołnierzem, który nadaje jej wyrazisty charakter.', '', 'kurtka-topfield-liner', '', '', '', 'Kurtka Topfield Liner', '', '', '', ''),
(209, 1, 1, 'Kiedy wyjdzie słońce, zkrzyknij kumpli i ruszaj na basen. Te szorty do pływania adidas zostały stworzone z myślą o pływaniu, nurkowaniu i odpoczynku z przyjaciółmi. Sportowy krój i miękki, odporny na działanie chloru materiał zapewniają Ci komfort przez cały dzień.', '', 'branded-swim-boxers', '', '', '', 'Branded Swim Boxers', '', '', '', ''),
(210, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nSpodnie dresowe zostały uszyte z nylonowej tkaniny o splocie płóciennym i mają kieszenie w szwach bocznych. Regulowane mankiety zwężają sylwetkę lub pozwalają jej swobodnie się poruszać.', '', 'spodnie-wales-bonner-track-suit', '', '', '', 'Spodnie Wales Bonner Track Suit', '', '', '', ''),
(211, 1, 1, 'Każdy zasługuje na odrobinę niezobowiązującego komfortu w życiu, a w tej podstawowej koszulce adidas relaks to nic trudnego. Charakterystyczne 3 paski na obu rękawach podkreślają Twój dumny styl adidas, gdy spotykasz się z przyjaciółmi lub spacerujesz po mieście. Prosty, a jednocześnie klasyczny styl koszulki sprawia, że łatwo ją zestawić z dowolnym elementem Twojej garderoby.', '', 'essentials-single-jersey-3-stripes-tee', '', '', '', 'Essentials Single Jersey 3-Stripes Tee', '', '', '', ''),
(212, 1, 1, 'Ponadczasowa klasyka w postaci tej bluzy z kapturem adidas jest niezbędnym elementem garderoby na dni wolne od pracy. Miękki polar i wygodny krój zapewniają przyjemny komfort. Wyszywane logo Trefoil nadaje autentyczny charakter temu minimalistycznemu modelowi, który z łatwością zestawisz z innymi ulubionymi ubraniami. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-trefoil-essentials-full-zip', '', '', '', 'Bluza z kapturem Trefoil Essentials Full-Zip', '', '', '', ''),
(213, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nPrzedłużone mankiety nadają wyszukany akcent wyróżniającym się spodniom z dzianiny. Są uszyte z luksusowej mieszanki wełny merynosowej, która jest miękka w dotyku i nadaje wyszukany look codziennemu stylowi.', '', 'spodnie-wales-bonner-statement-knit', '', '', '', 'Spodnie Wales Bonner Statement Knit', '', '', '', ''),
(214, 1, 1, 'Zrelaksuj się na maksa w spodniach adidas z 3 paskami. Idealnie pasują do Twoich ulubionych ubrań i sprawdzą się w leniwe dni lub podczas wypadu na zakupy. Dopasowany krój nadaje modelowi nowoczesny, dopracowany look. Gdziekolwiek się udasz, miękki polar zapewni Ci komfort przez cały dzień.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-3-stripes-pants', '', '', '', 'Adicolor Classics 3-Stripes Pants', '', '', '', ''),
(215, 1, 1, 'Odkryj lepszą wersję siebie. Trenuj, jak chcesz, w koszulce adidas stworzonej z myślą o ruchu. AEROREADY reguluje wilgoć, gdy robi się gorąco, zapewniając Ci komfort. Design gwarantuje pełną swobodę ruchu, więc zdecyduj się na dodatkową serię ćwiczeń z uniesionymi ramionami.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'train-essentials-3-stripes-training-tee', '', '', '', 'Train Essentials 3-Stripes Training Tee', '', '', '', ''),
(216, 1, 1, 'Gdy wygoda i praktyczność są na szczycie Twojej listy, bluza z kapturem adidas Trefoil Essentials to prosty wybór. Ta klasyczna bluza z kapturem została uszyta z miękkiego polaru o dużej zawartości bawełny i wykończona wyszywanym logo Trefoil. Klasyczny krój zapewnia komfort na co dzień. Wybierz swobodny look, a jednocześnie ponadczasowy design.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-trefoil-essentials', '', '', '', 'Bluza z kapturem Trefoil Essentials', '', '', '', ''),
(217, 1, 1, 'Kluczowy element Twojej garderoby. Wybierz klasyczną i dyskretną koszulkę adidas. Model z komfortowej dzianiny bawełnianej jest tak wygodny, na jaki wygląda. \n \nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-single-jersey-embroidered-small-logo-tee', '', '', '', 'Essentials Single Jersey Embroidered Small Logo Tee', '', '', '', ''),
(218, 1, 1, 'Wybierz spodnie adidas do gry w golfa, które zapewnią Ci optymalny komfort na polu golfowym w każdy dzień. Mocna tkanina o ukośnym splocie stworzona do całorocznej gry jest przewiewna i rozciąga się w czterech kierunkach, gwarantując pełną swobodę ruchu. Wbudowana ochrona przed promieniowaniem UV zapewnia odpowiednią osłonę w słoneczne dni. Zwężany krój dopełnia całości. \n\nTen produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'ultimate365-tapered-pants', '', '', '', 'Ultimate365 Tapered Pants', '', '', '', ''),
(219, 1, 1, 'Załóż puchowy bezrękawnik adidas i podkręć swój codzienny look. Inspirowany klasycznym krojem bezrękawnik prezentuje nowoczesne detale, które gwarantują ciepły komfort w modnym stylu. Pikowany design z logo Trefoil stanowi ukłon w stronę autentycznego stylu adidas, a puch oznacza wygodę. Wykończenie stonowanymi kolorystycznie 3 paskami po obu stronach na podstawowym elemencie garderoby na chłodne dni gwarantuje stylowy wygląd i dobre samopoczucie.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bezrekawnik-down', '', '', '', 'Bezrękawnik Down', '', '', '', ''),
(220, 1, 1, 'Minimalistyczna konstrukcja bluzy z kapturem Y-3 Organic Cotton Terry to idealne połączenie wygody i funkcjonalności na co dzień. Model z materiału frotté o dużej zawartości bawełny organicznej ma luźny, swobodny krój.\n\nTen produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'y-3-organic-cotton-terry-hoodie', '', '', '', 'Y-3 Organic Cotton Terry Hoodie', '', '', '', ''),
(221, 1, 1, 'Model stworzony z myślą o pięknej grze. Spodnie treningowe adidas, będące częścią kolekcji Tiro 23 League, mają dopasowany i opływowy krój, który pozwoli Ci w pełni wykorzystać swoją szybkość. AEROREADY usuwa wilgoć z powierzchni skóry, zapewniając Ci suchy komfort, gdy trening nabiera tempa. A po wyczerpującym treningu łatwo je zdjąć. Suwaki w kostkach pozwolą Ci założyć spodnie nawet na najbardziej masywne buty piłkarskie lub treningowe.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-23-league-training-pants', '', '', '', 'Tiro 23 League Training Pants', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(222, 1, 1, 'Długa puchowa kurtka adidas jest jedyną w swoim rodzaju deklaracją stylu. Chociaż całość ma minimalistyczny look, to właśnie misterne detale wyróżniają tę kurtkę. Puchowe wypełnienie i kieszenie z brandingiem zapewniają funkcjonalność, a stonowane kolorystycznie 3 paski z tkaniny ripstop i boczne suwaki wentylacyjne gwarantują dbałość o detale. Nie możesz zapomniećo tej kurtce, gdy pogoda wymaga przytulnej warstwy zewnętrznej.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'long-down-puffer-jacket', '', '', '', 'Long Down Puffer Jacket', '', '', '', ''),
(223, 1, 1, 'Od poprawy nastroju dzieli Cię tylko jeden trening. Załóż koszulkę treningową adidas i ruszaj. Wzór New Lift oznacza osłonę podczas ćwiczeń z uniesionymi ramionami, takich jak wyciskanie i podciąganie na drążku. AEROREADY pozwala Ci zachować suchy komfort i gotowość na każde wyzwanie.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'train-essentials-feelready-logo-training-tee', '', '', '', 'Train Essentials Feelready Logo Training Tee', '', '', '', ''),
(224, 1, 1, 'Podkreśl styl piłkarski w swoim codziennym looku. Te spodnie adidas Tiro mają zwężane nogawki z suwakami w kostkach, które nadają im gładki fason i poruszają się razem z Tobą, gdy załatwiasz swoje sprawy lub spotykasz się z przyjaciółmi. Kieszenie na suwak bezpiecznie pomieszczą niezbędne przedmioty.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'spodnie-tiro', '', '', '', 'Spodnie Tiro', '', '', '', ''),
(225, 1, 1, 'Od wyciskania po pompki możesz poruszać się swobodnie w tej koszulce treningowej adidas. Ma krój, który nie krępuje ruchów ramion nad głową. Oddychający materiał i pochłaniający wilgoć AEROREADY zapewniają Ci suchy komfort, gdy skacze Ci tętno.', '', 'train-essentials-feelready-training-tee', '', '', '', 'Train Essentials Feelready Training Tee', '', '', '', ''),
(226, 1, 1, 'Gdy następnym razem pójdziesz na siłownię w szortach Designed for Training, będziesz rozkoszować się każdą chwilą tego czasu tylko dla Ciebie. Wyposażono je we wszystko, czego potrzebujesz, aby osiągnąć i utrzymać odpowiedni poziom koncentracji i jak najlepiej wykorzystać sesję treningową.\n\nTe szorty zostały stworzone, aby pasować do Twoich ruchów. Od przemyślanego rozmieszczenia szwów, które zapewnia dodatkowy komfort, po wentylację tam, gdzie najbardziej jej potrzebujesz — ten model zawsze Cię wspiera. Elastyczne, a jednocześnie mocne szorty zostały uszyte z mocnej i rozciągliwej tkaniny, która sprawdzi się podczas najgłębszych przysiadów. A gdy robi się gorąco, do gry wkracza adidas AEROREADY. Produkty adidas AEROREADY zostały wykonane z odprowadzających pot lub pochłaniających wilgoć materiałów i zapewniają suchy komfort.\n\nKultowe logo Badge of Sport w nowym miejscu stanowi dopełniający akcent, podkreślając Twoje zaangażowanie. Nawet nie poczujesz, kiedy pobijesz swój życiowy rekord w martwym ciągu.', '', 'designed-for-training-shorts', '', '', '', 'Designed for Training Shorts', '', '', '', ''),
(227, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nPunkt styku pomiędzy sportem i modą był zawsze podstawą stylu Y-3. Eksplorując oba światy, spodnie cargo Wool Flannel mają luźny, elegancki flanel z udoskonalonej mieszanki wełnianej. Pasek zwisa ze sprzączki FIDLOCK®, a kieszenie dopełniają funkcjonalny look.', '', 'spodnie-y-3-wool-flannel-cargo', '', '', '', 'Spodnie Y-3 Wool Flannel Cargo', '', '', '', ''),
(228, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nBluza dresowa Statement Knit, która czerpie inspirację z minionych dekad, łączy archiwalne detale z ultranowoczesnym nastrojem. Połączenie tych cech powstało dzięki miękkiemu, przypominającemu sweter materiałowi z kontrastowymi detalami na dole i mankietach oraz wyróżniającym się, stawianym kołnierzem.', '', 'bluza-dresowa-statement-knit', '', '', '', 'Bluza dresowa Statement Knit', '', '', '', ''),
(229, 1, 1, 'Gdy sam styl nie gwarantuje wyników, ale solidna ochrona stanowi doskonałe wsparcie. Koszulka adidas, którą bramkarze Realu Madryt noszą na stadionie Bernabéu, została zaprojektowana z myślą o przewadze nad rywalami. Aerodynamiczny, dopasowany krój rozciąga się dokładnie tam, gdzie tego potrzebujesz, aby pomóc Ci osiągnąć każdy cel. AEROREADY usuwa wilgoć, gwarantując Ci pewność siebie w momentach, które zmieniają obraz gry.\n\nTen produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'real-madrid-condivo-22-home-goalkeeper-jersey', '', '', '', 'Real Madrid Condivo 22 Home Goalkeeper Jersey', '', '', '', ''),
(230, 1, 1, 'Styl i wydajność na korcie tenisowym. Koszulka z zaokrąglonym dekoltem z kolekcji adidas Club ma dodatkowy materiał pod ramionami, który uwalnia ramiona i zwiększa siłę uderzenia. Bez względu na to, jak intensywna jest Twoja gra na korcie, AEROREADY usuwa wilgoć z powierzchni Twojej skóry, zapewniając Ci suchy komfort i gotowość do kolejnej akcji.\n\nTen produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'club-tennis-tee', '', '', '', 'Club Tennis Tee', '', '', '', ''),
(231, 1, 1, 'Pętelkowy materiał frotté z organicznej bawełny sprawia, że bluza z kapturem Y-3 Graphic jest wyjątkowo miękka w dotyku. Kaptur i kieszeń kangurka zapewniają komfort na co dzień, a ściągacz na dole i w mankietach dopasowuje się do sylwetki. Logo Y-3 prezentuje się w formie offsetu po jednej stronie z przodu.', '', 'bluza-z-kapturem-y-3-graphic', '', '', '', 'Bluza z kapturem Y-3 Graphic', '', '', '', ''),
(232, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nWyróżniająca się, nylonowa bluza dresowa ma elegancki look z gładkiej tkaniny o splocie płóciennym. Kołnierz i dół regulują sylwetkę, a rozcięcie wentylacyjne z tyłu zwiększa przewiewność i zapewnia wygodę noszenia. Odblaskowe detale zwiększają Twoją widoczność w słabym oświetleniu.', '', 'bluza-dresowa-wales-bonner-statement-nylon', '', '', '', 'Bluza dresowa Wales Bonner Statement Nylon', '', '', '', ''),
(233, 1, 1, 'Ten długi, ocieplany płaszcz od adidas zapewni Ci ciepło, gdy temperatura spada. Model jest wypełniony puchem i pierzami, co zapewnia przytulny komfort. Zatrzaski wzdłuż klapki przeciwsztormowej i rozcięcia po bokach zatrzymują ciepło i nie dopuszczają chłodu do środka. Kieszenie na suwak bezpiecznie przechowają Twój telefon i klucze. Gdziekolwiek podróżujesz, godło Arsenalu pokazuje, że kibicujesz swojej ulubionej drużynie piłkarskiej. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'plaszcz-arsenal-dna-down', '', '', '', 'Płaszcz Arsenal DNA Down', '', '', '', ''),
(234, 1, 1, 'W chłodne dni komfort jest najważniejszy, gdy jesteś na trybunach lub wychodzisz na boisko. Ten długi, ocieplany płaszcz adidas pokazuje, że kibicujesz Bayernowi Monachium, prezentując wyróżniające się godło klubu piłkarskiego na piersi. Wyściełanie z puchu i pierza zapewnia wygodę. Zatrzaski wzdłuż klapki przeciwsztormowej i rozcięcia po bokach zatrzymują ciepło i nie dopuszczają chłodu do środka. W kieszeniach na suwak bezpiecznie przechowasz cenne drobiazgi, gdy mecz całkowicie Cię pochłonie. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'plaszcz-fc-bayern-dna-down', '', '', '', 'Płaszcz FC Bayern DNA Down', '', '', '', ''),
(235, 1, 1, 'Kibicuj Juventusowi aż do ostatniego gwizdka. Długi, ocieplany płaszcz od adidas zapewni Ci ciepło na trybunach i po wyjściu z domu. Wyściełanie z puchu i pierza zapewnia wygodę. Zatrzaski wzdłuż klapki przeciwsztormowej i rozcięcia po bokach zatrzymują ciepło i nie dopuszczają chłodu do środka. Potężne godło Juventusu pokazuje wszystkim, że kibicujesz swojemu ulubionemu klubowi piłkarskiemu. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'plaszcz-juventus-dna-down', '', '', '', 'Płaszcz Juventus DNA Down', '', '', '', ''),
(236, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nIndywidualny styl i kreatywność w wyrażaniu siebie nadają spodniom dresowym unikalny rytm. Model z wygodnymi detalami i suwakami w kostkach został uszyty z miłego w dotyku, przypominającego sweter materiału i ma elastyczną talię ze ściągaczem.', '', 'spodnie-wales-bonner-track-suit', '', '', '', 'Spodnie Wales Bonner Track Suit', '', '', '', ''),
(237, 1, 1, 'Ciesz się przytulnym komfortem pod osłoną. Ten długi, ocieplany płaszcz adidas sprawdzi się w chłodne dni, gdy jesteś na stadionie lub na spacerze. Wyściełanie z puchu i pierza zapewnia wygodę. Zatrzaski wzdłuż klapki przeciwsztormowej i rozcięcia po bokach zatrzymują ciepło i nie dopuszczają chłodu do środka. Regulowany kaptur i mankiety ściągają sznurki, aby ochronić się przed wiatrem. Godło Manchesteru United na piersi stanowi ukłon w stronę Twojej ulubionej drużyny piłkarskiej. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'plaszcz-manchester-united-dna-down', '', '', '', 'Płaszcz Manchester United DNA Down', '', '', '', ''),
(238, 1, 1, 'Wspieraj jedną z największych angielskich legend w przedmeczowej koszulce Arsenal Ian Wright. Kolekcja oddaje hołd kultowemu dziedzictwu Iana Wrighta, supergwiazdy Arsenalu, przywołując wspomnienia z przeszłości. \n\nRuszaj na boisko w dobrym stylu z koszulką, która oddaje hołd pięknej, złotej epoce gry. Standardowy krój zapewnia komfort bez czynników rozpraszających podczas rozgrzewki, a AEROREADY zapewnia Ci komfort dłużej. Godło Arsenalu blisko Twojego serca sprawia, że nigdy nie zabraknie Ci inspiracji do gry. \n\nTen produkt został częściowo wykonany z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'koszulka-arsenal-ian-wright-pre-match', '', '', '', 'Koszulka Arsenal Ian Wright Pre-Match', '', '', '', ''),
(239, 1, 1, 'Ponadczasowy styl i niezrównana wygoda, jaką daje puch. Puchowa kurtka adidas na zimę zapewnia ciepło, które poczujesz, gdy tylko ją zapniesz. Elastyczne mankiety i regulowany dół zatrzymują ciepłe powietrze, gwarantując Ci komfort przez całą zimę. Naciągnij kaptur, aby uzyskać optymalne okrycie. W kieszeniach na suwak ogrzejesz ręce, a klucze i telefon będziesz mieć pod ręką.', '', 'helionic-hooded-down-jacket', '', '', '', 'Helionic Hooded Down Jacket', '', '', '', ''),
(240, 1, 1, 'Chłodna pogoda oznacza, że musisz \nstarannie chronić się przed zimnem. Załóż parkę adidas z kapturem i ruszaj w miasto. Ma izolację z puchu, która zapewnia niezrównane ciepło, i wodoodporne wykończenie, które chroni przed deszczem. Charakterystyczne 3 paski uzupełniają całość.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'essentials-3-stripes-light-down-hooded-parka', '', '', '', 'Essentials 3-Stripes Light Down Hooded Parka', '', '', '', ''),
(241, 1, 1, 'Osiąganie celów treningowych nie wymaga nadludzkich wysiłków. Chodzi o codzienną pracę nad tym, aby stać się silniejszą, sprawniejszą i szybszą wersją siebie. Te krótkie legginsy adidas wspierają Cię na każdym kroku. Techfit ma gładki, kompresyjny design, który zapewnia komfort bez czynników rozpraszających. Pochłaniający wilgoć AEROREADY oznacza suchy komfort podczas wspinaczki, przysiadów i skoków na skrzynię.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'techfit-training-short-tights', '', '', '', 'Techfit Training Short Tights', '', '', '', ''),
(242, 1, 1, 'Staw czoła zimowej aurze w puchowej kurtce adidas z gęsiego puchu. Kurtka stworzona, aby chronić Cię przed chłodem, ma gruby design z izolacją z gęsiego puchu, który zatrzymuje ciepło, zapewniając Ci ciepło. Niezależnie od tego, czy spacerujesz po lesie, czy spędzasz popołudnie w mieście, elastyczne mankiety i regulowany dół zatrzymują ciepło i nie przepuszczają zimnego powietrza do środka. Aby zapewnić sobie ciepło i wygodę, po prostu zasuń wysoki kołnierz i załóż kaptur.', '', 'kurtka-goose-down', '', '', '', 'Kurtka Goose Down', '', '', '', ''),
(243, 1, 1, 'Gdy wygoda i praktyczność są na szczycie Twojej listy, bluza z kapturem adidas Trefoil Essentials to prosty wybór. Ta klasyczna bluza z kapturem została uszyta z miękkiego polaru o dużej zawartości bawełny i wykończona wyszywanym logo Trefoil. Klasyczny krój zapewnia komfort na co dzień. Wybierz swobodny look, a jednocześnie ponadczasowy design.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-trefoil-essentials', '', '', '', 'Bluza z kapturem Trefoil Essentials', '', '', '', ''),
(244, 1, 1, 'Co naprawdę musisz mieć w tym sezonie? Bluzę z suwakiem do połowy długości uszytą z miłego w dotyku polaru. Kołnierz inspirowany modelem Beckenbauer nadaje jej sprawdzony od dawna styl, a wyszywane logo Trefoil na piersi i 3 paski wzdłuż rękawów nawiązują do kultowego DNA adidas. I choć ten model wywodzi się od archiwalnych designów, jest jednak na wskroś nowoczesny i wygodny. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-adicolor-classics-3-stripes-half-zip', '', '', '', 'Bluza Adicolor Classics 3-Stripes Half-Zip', '', '', '', ''),
(245, 1, 1, 'Minimalistyczna konstrukcja spodni Y-3 z bawełny organicznej stanowi funkcjonalną podstawę stroju co dzień. Mają elastyczną talię, swobodny krój, który luźno układa się na ciele, oraz sznurek do regulacji, który możesz przeciągnąć przez wyszywany otwór na guziki i ukryć w środku.\n\nTen produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', '', 'y-3-organic-cotton-terry-straight-pants', '', '', '', 'Y-3 Organic Cotton Terry Straight Pants', '', '', '', ''),
(246, 1, 1, 'Ogrzej swoje ciało w ponadczasowym stylu przy pomocy niezrównanej izolacji i puchu. W chłodne, zimowe dni ten puchowy bezrękawnik adidas stanowi ciepłą warstwę, którą możesz założyć na sweter lub lekką kurtkę. Bezrękawnik zapewnia dodatkową swobodę ruchu ramion dzięki dodatkowemu, przytulnemu wypełnieniu z puchu o współczynniku sprężystości 600 cuin. Naciągnij kaptur, aby zyskać dodatkowe okrycie. W kieszeniach na suwak ogrzejesz ręce, a klucze i telefon będziesz mieć pod ręką.', '', 'helionic-hooded-down-vest', '', '', '', 'Helionic Hooded Down Vest', '', '', '', ''),
(247, 1, 1, 'Przy ilości zadań, którą musisz zrealizować na co dzień, potrzebujesz czegoś, co sprawdzi się w każdej sytuacji. I tu na scenę wkracza ta bluza z kapturem i suwakiem na całej długości od adidas. To kultowy design sportowy z charakterystycznym brandingiem adidas, który wyróżnia się na solidnej konstrukcji. Subtelny, nieoczekiwany akcent pojawia się, gdy zakładasz kaptur — przedłużone 3 paski, które rozciągają się od mankietu do mankietu, a następnie biegną aż po górę. Miękki materiał frotté umożliwia pełen relaks pod koniec dnia.', '', 'essentials-french-terry-3-stripes-full-zip-hoodie', '', '', '', 'Essentials French Terry 3-Stripes Full-Zip Hoodie', '', '', '', ''),
(248, 1, 1, 'Puchowa kurtka adidas Terrex Techrock sprawdzi się podczas wspinaczki alpejskiej wśród wyeksponowanych szczytów i półek skalnych, oraz wypraw w góry o każdej porze roku. Uniwersalny design jest wystarczająco ciepły, aby nosić go samodzielnie w szerokim zakresie temperatur i ma dyskretny design, który sprawdzi się jako warstwa środkowa w chłodne dni. Łączy grubą, puchową izolację z mocną i lekką warstwą wierzchnią Pertex® Diamond Fuse, zatrzymując ciepło, jednocześnie zapewniając lekkość i łatwość w spakowaniu. COLD.RDY z zachodzącymi na siebie przegrodami maksymalizuje ciepło, a detale, takie jak zatrzymujące ciepło stuptuty przy mankietach i dekolcie, nie przepuszczają zimnego powietrza do środka. Od gładkiego kaptura, który wygodnie układa się pod kaskiem, po niskoprofilowe mankiety, ta kurtka została zaprojektowana z myślą o aktywności. Dwukierunkowy suwak zapewnia dostęp do uprzęży lub wentylacji. W zestawie łatka, która umożliwia naprawę i zapewnia dłuższe korzystanie z modelu.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-terrex-techrock-down-hooded', '', '', '', 'Kurtka Terrex Techrock Down Hooded', '', '', '', ''),
(249, 1, 1, 'Klasyczna bluza z kapturem adidas nie tylko wygląda dobrze, ale też zapewnia komfort, który nigdy nie wyjdzie z mody. Model z miękkiego polaru o dużej zawartości bawełny bez wątpienia sprawdzi się w noszeniu przez cały dzień. Ma detale, bez których nie obejdzie się żadna dobra bluza z kapturem, takie jak kieszeń kangurka i kaptur regulowany sznurkiem. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'essentials-fleece-3-stripes-hoodie', '', '', '', 'Essentials Fleece 3-Stripes Hoodie', '', '', '', ''),
(250, 1, 1, 'Zanim zaczniesz cokolwiek robić, upewnij się, że masz solidną podstawę. Ta bluza z kapturem adidas to dobry początek. Zapewnia Ci dobre samopoczucie dzięki miękkiemu, bawełnianemu materiałowi i ściągaczowym detalom. Gdy ją zakładasz, masz nieograniczone możliwości. Relaksuj się na maksa. Dawaj z siebie wszystko. A może coś pomiędzy? Będziesz czuć się komfortowo niezależnie od rodzaju aktywności.', '', 'bluza-z-kapturem-future-icons-3-stripes-full-zip', '', '', '', 'Bluza z kapturem Future Icons 3-Stripes Full-Zip', '', '', '', ''),
(251, 1, 1, 'Oddaj hołd tradycji adidas przy pomocy tej wyróżniającej się bluzy dresowej. Nadruk na całej powierzchni pokazuje wszystkim, że jesteś prawdziwym kibicem. Model z miękkiego polaru ma luźny krój, który zapewni Ci swobodę ruchu. Obszerne kieszenie i kaptur z podszewką stanowią dopełniający, miły w dotyku akcent.  \n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'bluza-dresowa-embossed-adidas-polar-fleece-full-zip', '', '', '', 'Bluza dresowa Embossed adidas Polar Fleece Full-Zip', '', '', '', ''),
(252, 1, 1, 'Życie jest po to, by się nim cieszyć. Więc wybierz gruby materiał tej bluzy z kapturem adidas i maksymalnie wykorzystaj każdą chwilę. Minimalistyczny styl i konstrukcja z miękkiej bawełny organicznej sprawiają, że wyglądasz świetnie i czujesz się dobrze.\n\nTen produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'adicolor-contempo-french-terry-hoodie', '', '', '', 'Adicolor Contempo French Terry Hoodie', '', '', '', ''),
(253, 1, 1, 'Są zwyczajne bluzy z kapturem. I jest też ONA. Nigdy nie wybierzesz wygody zamiast stylu dzięki temu modelowi adidas, który zdecydowanie zasługuje na miejsce w Twojej garderobie. Stonowany kolorystycznie, teksturowany materiał został wykonany z czystej bawełny i ma paski z barwionej przędzy. Całość została podkreślona ściągaczowymi mankietami i guzikami przy dekolcie. Kaptur ze sznurkiem do regulacji sprawia, że ta klasyczna bluza z kapturem jest zawsze na czasie.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-nice-knitted', '', '', '', 'Bluza z kapturem Nice Knitted', '', '', '', ''),
(254, 1, 1, 'Model zainspirowany piękną grą. Piłkarska bluza z kapturem adidas będąca częścią kolekcji Tiro 23 League zapewni Ci ciepły komfort poza boiskiem dzięki konstrukcji z miękkiego polaru. Załóż obszerny kaptur na głowę i wsuń ręce do kieszeni kangurki, aby zapomnieć, ile kosztowała Cię sesja treningowa.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'tiro-23-league-sweat-hoodie', '', '', '', 'Tiro 23 League Sweat Hoodie', '', '', '', ''),
(255, 1, 1, 'Bluza sportowa, którą nosisz w dobrym stylu. Ten design adidas stanowi ukłon w stronę stylu życia kibiców piłkarskich. Reedycja kultowego modelu została uszyta z tkaniny o splocie płóciennym i ma kieszenie cargo w funkcjonalnym stylu. Regulowane mankiety pozwalają bawić się stylem. Zapnij ją z przodu, aby uzyskać opływowy look, lub noś ją rozpiętą, aby odblokować jej warstwowy potencjał.', '', 'bluza-haslingden', '', '', '', 'Bluza Haslingden', '', '', '', ''),
(256, 1, 1, 'Bluza wyjściowa będąca podstawowym elementem stroju na dzień meczu to idealny sposób, aby drużyny mogły pokazać swoją jedność przed pierwszym gwizdkiem. Załóż bluzę adidas Arsenal z suwakiem na całej długości i naniesionym pod wpływem temperatury godłem, aby pokazać swoje piłkarskie oddanie. Model ma kieszeń na suwak z jednej strony i wsuwaną kieszeń z drugiej oraz mnóstwo miejsca na klucze i telefon.', '', 'bluza-arsenal-anthem', '', '', '', 'Bluza Arsenal Anthem', '', '', '', ''),
(257, 1, 1, 'Gdy wygoda i praktyczność są na szczycie Twojej listy, bluza z kapturem adidas Trefoil Essentials to prosty wybór. Ta klasyczna bluza z kapturem została uszyta z miękkiego polaru o dużej zawartości bawełny i wykończona wyszywanym logo Trefoil. Klasyczny krój zapewnia komfort na co dzień. Wybierz swobodny look, a jednocześnie ponadczasowy design.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-trefoil-essentials', '', '', '', 'Bluza z kapturem Trefoil Essentials', '', '', '', ''),
(258, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Dzięki konstrukcji z miękkiego polaru ta bluza adidas zapewni Ci komfort w drodze na trening. Długie rękawy zapewniają lepsze okrycie, gdy przygotowujesz się na wieczorne sesje w chłodne dni.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'entrada-22-sweatshirt', '', '', '', 'Entrada 22 Sweatshirt', '', '', '', ''),
(259, 1, 1, 'Koszulka adidas będzie Twoim partnerem podczas pełnego koncentracji treningu. Dynamiczne linie kroju i wyjątkowo elastyczna konstrukcja pozwolą Ci zmaksymalizować ruchy podczas intensywnych treningów. AEROREADY odprowadza pot, zapewniając Ci suchy komfort, a Techfit odpowiada za gładką kompresję i komfort bez czynników rozpraszających.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów pochodzących z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'techfit-allover-print-training-tee', '', '', '', 'Techfit Allover Print Training Tee', '', '', '', ''),
(260, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Ta bluza z kapturem adidas zapewnia wygodę za sprawą konstrukcji z miękkiego polaru. Kiedy zwalnia tempo sesji treningowej, załóż kaptur i ogrzej dłonie w kieszeni kangurce.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'entrada-22-sweat-hoodie', '', '', '', 'Entrada 22 Sweat Hoodie', '', '', '', ''),
(261, 1, 1, 'Zanim zaczniesz cokolwiek robić, upewnij się, że masz solidną podstawę. Ta bluza z kapturem adidas to dobry początek. Zapewnia Ci dobre samopoczucie dzięki miękkiemu, bawełnianemu materiałowi i ściągaczowym detalom. Gdy ją zakładasz, masz nieograniczone możliwości. Relaksuj się na maksa. Dawaj z siebie wszystko. A może coś pomiędzy? Będziesz czuć się komfortowo niezależnie od rodzaju aktywności.', '', 'bluza-z-kapturem-future-icons-3-stripes-full-zip', '', '', '', 'Bluza z kapturem Future Icons 3-Stripes Full-Zip', '', '', '', ''),
(262, 1, 1, 'Ten dres adidas ma wszystko, czego potrzebujesz. Jeśli nie chcesz myśleć o przygotowaniu do wyjścia z domu, to jest najlepsza opcja. Możesz połączyć spodnie i bluzę z innymi elementami garderoby lub nosić je solo. Miękki materiał frotté zapewnia Ci komfort od stóp do głów.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'basic-3-stripes-french-terry-track-suit', '', '', '', 'Basic 3-Stripes French Terry Track Suit', '', '', '', ''),
(263, 1, 1, 'Wyciągnij lekką kurtkę adidas Terrex z kapturem z plecaka, gdy dotrzesz na szczyt, aby uniknąć szczękania zębami podczas podziwiania widoków. Niezależnie od tego, czy jesteś w ruchu, czy się relaksujesz, lekka konstrukcja gwarantuje ciepły komfort dzięki hybrydowemu połączeniu puchu i syntetycznej izolacji. Schowaj dłonie — lub przekąski na szlak — do bocznych kieszeni na suwaki.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-terrex-multi-light-down-hooded', '', '', '', 'Kurtka Terrex Multi Light Down Hooded', '', '', '', ''),
(264, 1, 1, 'Kick off the day feeling, and looking, your best. A sleek answer to cool weather, this adidas hoodie wraps you up in plush organic cotton with plenty of room to move. Pull it on and go make things happen. \n\nThis sweatshirt is made with natural and renewable materials as part of our journey to design out finite resources and help end plastic waste.', '', 'adicolor-contempo-crew-french-terry-sweatshirt', '', '', '', 'Adicolor Contempo Crew French Terry Sweatshirt', '', '', '', ''),
(265, 1, 1, 'Show up in this iconic adidas hoodie in your pursuit of an unapologetically stylish life. The Badge of Sport puff-print graphic adds standout street cred to your look, whether you\'re meeting friends for coffee or exploring a new city. Crafted from a soft cotton blend, it keeps you cosy wherever the day takes you. Ribbed cuffs seal in warmth while the loose cut allows for free movement. Slip into this adidas essential and make a sporty statement.\n\nBy choosing recycled, we are able to reuse materials that have already been created, which helps to reduce waste. Renewable materials choices will help us to remove our reliance on finite resources. Our products made with a blend of recycled and renewable materials feature at least 70% total of these materials.', '', 'future-icons-badge-of-sport-hoodie', '', '', '', 'Future Icons Badge of Sport Hoodie', '', '', '', ''),
(266, 1, 1, 'Woda jest dla każdego. Chłodzi, odświeża, relaksuje. Jak tu jej nie kochać? Ciesz się pokonywaniem kolejnych długości basenu, pływaniem w rzece lub dynamicznym wiosłowaniem w tych bokserkach do pływania adidas. Miękki, odporny na działanie chloru materiał zapewnia swobodę ruchu w wodzie. Aplikacja z 3 paskami pozostaje wierna naszym sportowym korzeniom.', '', 'classic-3-stripes-swim-boxers', '', '', '', 'Classic 3-Stripes Swim Boxers', '', '', '', ''),
(267, 1, 1, 'W koszykówce chodzi zarówno o wydajność, jak i styl. Ta bluza z zaokrąglonym dekoltem od adidas Koszykówka została uszyta z bawełniano-poliestrowej dzianiny o podwójnym splocie, która zapewnia ciepło i komfort, a do tego jest miękka w dotyku. Ściągacze w mankietach i u dołu gwarantują pewne dopasowanie, a naszywki z przodu, z tyłu i na rękawach stanowią charakterystyczne wykończenie.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'adidas-basketball-hoodie', '', '', '', 'adidas Basketball Hoodie', '', '', '', ''),
(268, 1, 1, 'Bez względu na to, czy decydujesz się na kolejne powtórzenie na siłowni, czy planujesz szybką sesję treningową w domu, koszulka Designed for Training pomoże Ci to osiągnąć.  \n\nĆwicz z hantlami, wyciskaj sztangę i przekraczaj własne granice, ciesząc się pełnym wsparciem dynamicznych linii kroju i elastanu, który zapewnia swobodę ruchu podczas treningu siłowego górnych partii ciała. Produkty adidas AEROREADY z pochłaniających pot materiałów zapewniają Ci suchy komfort, kiedy się poruszasz. Nieważne, jak bardzo wymagający będzie trening. \n\nDbałość o detale oznacza wyjątkowy komfort, a specjalne rozmieszczenie szwów na ramionach, ramionach i bokach zapobiega powstawaniu otarć. Unikalny panel wspomaga Twoje wysiłki podczas ćwiczeń z obciążeniem, a solidny materiał pozwoli stawić czoła wszelkim wyzwaniom. Kultowe logo adidas w nieoczekiwanym miejscu stanowi dopełniający akcent.', '', 'designed-for-training-tee', '', '', '', 'Designed for Training Tee', '', '', '', ''),
(269, 1, 1, '„Chcieliśmy stworzyć równowagę między tradycją a nowoczesnością – oto nowoczesne, inspirowane stylem miejskim modele i detale, które odzwierciedlają kultową historię adidas. W tym sezonie wykorzystujemy szeroką paletę fioletów i opalizujące akcenty, aby podkreślić moc kolorów inspirowanych zaawansowanymi technologiami”. — Mishaal Mansoor, projektant Adicolor\n \nBluza z kapturem Adicolor Neuclassics o swobodnym kroju i zabawnych proporcjach to stylowy akcent we współczesnym stylu retro. Miękki, miły w dotyku materiał owija się wokół solidnych mankietów w nadgarstku i talii, tworząc nową, kokonową sylwetkę. Nie brakuje też poziomych pasków z archiwalnych katalogów. Ząbkowane brzegi, zwykle widoczne tylko na butach, nadają nowy wymiar kultowemu znakowi z 3 paskami.', '', 'bluza-z-kapturem-adicolor-neuclassics', '', '', '', 'Bluza z kapturem Adicolor Neuclassics', '', '', '', ''),
(270, 1, 1, 'Jeśli szukasz szortów, które sprawdzą się w każdej sytuacji, wybierz ten design adidas. Model w swobodnym stylu został uszyty z miękkiej mieszanki bawełnianej, która zapewnia komfort. Sznurek do regulacji w elastycznej talii zapewnia Ci tyle miejsca, ile potrzebujesz, a boczne kieszenie na suwaki pomieszczą rzeczy, takie jak telefon, portfel i klucze. \n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'trefoil-essentials-shorts', '', '', '', 'Trefoil Essentials Shorts', '', '', '', ''),
(271, 1, 1, 'Ruszaj na trening pływacki w tych szortach do pływania adidas. Uszyto je z miękkiego, odpornego na działanie chloru materiału, który zapewnia Ci swobodę ruchu w wodzie. Podszewka oferuje pełne okrycie, a sznurek do regulacji w talii gwarantuje pewne dopasowanie. Całość uzupełniają kultowe 3 paski w sportowym stylu.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'classic-3-stripes-swim-trunks', '', '', '', 'Classic 3-Stripes Swim Trunks', '', '', '', ''),
(272, 1, 1, 'Inspirowana przyciągającym wzrok trzecim zestawem klubowym koszulka Real Madrid od adidas zmienia zaawansowany technologicznie design piłkarski w wyjątkowo funkcjonalne okrycie. Luksusowe detale i żakard poliestrowy podkręcają look i teksturę tej wysokiej jakości koszulki, gwarantując komfort i klasyczny styl na co dzień. Model ze stonowanymi kolorystycznie naszywkami tworzy prosty, wyrazisty look, który z pewnością zostanie doceniony nie tylko przez kibiców klubu.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'koszulka-real-madrid-23-24-lfstlr', '', '', '', 'KOSZULKA REAL MADRID 23/24 LFSTLR', '', '', '', ''),
(273, 1, 1, 'Niezależnie od tego, czy szykujesz się na poranny trening, czy relaksujesz po długim dniu, ta bluza adidas zapewni Ci okrycie. Wyjątkowo miły w dotyku materiał frotté oraz mankiety i dół ze ściągaczami gwarantują wygodę i komfort termiczny niezależnie od tego, co robisz. A więc załóż ją i przygotuj się na wszystko.', '', 'essentials-french-terry-big-logo-sweatshirt', '', '', '', 'Essentials French Terry Big Logo Sweatshirt', '', '', '', ''),
(274, 1, 1, 'Niech nic Cię nie spowolni. Poruszaj się swobodnie podczas intensywnych sesji, nosząc te legginsy jako warstwę podstawową. Wykonuj wyroki i kopnięcia na treningu cardio, ciesząc się pełnym komfortem dzięki formowanej wypukłej wstawce. Detale z siateczki i pochłaniający wilgoć AEROREADY zapewniają Ci suchy komfort, dzięki czemu możesz trenować bez przeszkód.', '', 'legginsy-techfit-3-stripes-training-long', '', '', '', 'Legginsy Techfit 3-Stripes Training Long', '', '', '', ''),
(275, 1, 1, 'Gdziekolwiek zaprowadzi Cię dzień, zawsze jesteś gotowy w tych szortach piłkarskich adidas Entrada 22. Mają minimalistyczny, klasyczny design i AEROREADY, które zapewnią Ci suchy i świeży komfort. Elastyczna, regulowana sznurkiem talia sprawia, że model pozostaje na swoim miejscu.\n\nTen produkt został wykonany wyłącznie materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'entrada-22-shorts', '', '', '', 'Entrada 22 Shorts', '', '', '', ''),
(276, 1, 1, 'Przemierzaj szlaki lub wyjdź na dwór, wiedząc, że deszczowa pogoda Ci niestraszna. Kurtka adidas Essentials RAIN.RDY to niezbędny sprzęt na bliższe i dalsze outdoorowe wyprawy. Model z całkowicie zgrzewanymi szwami i suwakami z klapką przeciwsztormową chroni przed wiatrem i deszczem, zapewniając Ci suchy komfort.', '', 'essentials-rainrdy-jacket', '', '', '', 'Essentials RAIN.RDY Jacket', '', '', '', ''),
(277, 1, 1, 'Przejdź swobodnie i stylowo z siłowni na ulicę. Te szorty adidas mają konstrukcję AEROREADY, która pochłania wilgoć i zapewnia Ci suchy komfort. Klasyczne 3 paski biegną od biodra do dołu, nadając sportową estetykę tym wygodnym szortom.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', '', 'aeroready-essentials-chelsea-3-stripes-shorts', '', '', '', 'AEROREADY Essentials Chelsea 3-Stripes Shorts', '', '', '', ''),
(278, 1, 1, 'Zrelaksuj się, łącząc dumny styl Madridisty z DNA adidas. Wyszywane logo Trefoil przy godle Realu Madryt na tej sportowej bluzie z kapturem nadaje całości klasyczny, piłkarski styl. Uszyta z wygodnego polaru z dużą zawartością bawełny bluza z kapturem została wykończona ściągaczowym dołem i mankietami. Idealny do noszenia na co dzień model doskonale nadaje się do założenia na koszulkę meczową, zanim wyjdziesz na mecz.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-z-kapturem-real-madrid-essentials-trefoil', '', '', '', 'Bluza z kapturem Real Madrid Essentials Trefoil', '', '', '', ''),
(279, 1, 1, 'Czasami mniej znaczy więcej. Bluza z zaokrąglonym dekoltem adidas Trefoil Essentials do perfekcji opanowała swobodny, ponadczasowy styl. Wyszywane logo Trefoil zdobi prostą sylwetkę. Design z zaokrąglonym dekoltem stworzony z myślą o codziennym, swobodnym stylu ma prosty, a jednocześnie śmiały look.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'trefoil-essentials-crewneck', '', '', '', 'Trefoil Essentials Crewneck', '', '', '', ''),
(280, 1, 1, 'Zrelaksuj się na maksa w spodniach adidas z 3 paskami. Idealnie pasują do Twoich ulubionych ubrań i sprawdzą się w leniwe dni lub podczas wypadu na zakupy. Dopasowany krój nadaje modelowi nowoczesny, dopracowany look. Gdziekolwiek się udasz, miękki polar zapewni Ci komfort przez cały dzień.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-3-stripes-pants', '', '', '', 'Adicolor Classics 3-Stripes Pants', '', '', '', ''),
(281, 1, 1, 'Podaruj swojej garderobie coś nowego, na co zasługuje. Ta bluza dresowa adidas Adicolor jest uniwersalnym elementem garderoby, który szybko stanie się nieodłączną częścia Twojego stroju. Nowa odsłona kultowego designu z wygodnej dzianiny o podwójnym splocie nadaje drugie życie archiwalnym materiałom. Klasyczne 3 paski i branding Trefoil uzupełniają całość jako charakterystyczne, sportowe akcenty.\n\nTen produkt został wykonany wyłącznie z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'bluza-dresowa-adicolor-re-pro-sst-material-mix', '', '', '', 'Bluza dresowa Adicolor Re-Pro SST Material Mix', '', '', '', ''),
(282, 1, 1, '<p>Klasyczny look w wersji Adicolor. Ten podstawowy element garderoby prezentuje kultowy styl Firebird, który znasz i kochasz, ale ma nowoczesny krój i świeżą paletę kolorów. Wyszywane logo Trefoil na jednym boku i 3 paski wzdłuż nogawek to kwintesencja stylu adidas, a elastyczna talia regulowana sznurkiem gwarantuje odpowiednie dopasowanie. Schowaj niezbędne drobiazgi do kieszeni na suwaki i ruszaj na podbój dnia. Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.</p>', '<p><br /></p>', 'spodnie-dresowe-adicolor-classics-firebird', '', '', '', 'Spodnie dresowe Adicolor Classics Firebird', '', '', '', ''),
(283, 1, 1, 'Niezależnie od tego, czy zakładasz ją po siłowni, czy przygotowujesz się do wyjścia w niej z domu, ta podstawowa koszulka adidas wzywa Cię do działania. Logo adidas Badge of Sport stworzone z myślą o komforcie i wygodzie w dobrym stylu błyszczy z przodu, podkreślając Twój dumny look adidas. Możesz połączyć ten model z każdym innym elementem Twojej garderoby, ponieważ klasyczny, sportowy styl pasuje do każdej stylizacji.', '', 'essentials-single-jersey-big-logo-tee', '', '', '', 'Essentials Single Jersey Big Logo Tee', '', '', '', ''),
(284, 1, 1, 'Pierwsza rzecz, jaką trzeba zrobić w dniu treningu ramion? Założyć koszulkę treningową bez rękawów od adidas. Techfit to gładki, kompresyjny design, który zapewnia komfort bez czynników rozpraszających i optymalne wsparcie przez cały dzień. AEROREADY kontroluje wilgoć, dając Ci suchy komfort i koncentrację podczas ćwiczeń. Siateczka na plecach gwarantuje wentylację. Teraz możesz ruszać na siłownię.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'techfit-training-sleeveless-tee', '', '', '', 'Techfit Training Sleeveless Tee', '', '', '', ''),
(285, 1, 1, 'Swobodna bluza łączy się z ciepłem parki w tej hybrydowej kurtce adidas. Idealna na krótką wędrówkę, wieczorne wyjście lub szybką wyprawę do pobliskiego sklepu jest uniwersalną warstwą na chłodne dni. Połączenie lekkiej wyściółki i syntetycznej izolacji sprawia, że dobrze się ją nosi. 3 paski nadają jej styl tradycyjnej odzieży sportowej.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'essentials-insulated-hooded-hybrid-jacket', '', '', '', 'Essentials Insulated Hooded Hybrid Jacket', '', '', '', ''),
(286, 1, 1, 'Dla swojej drużyny. Dla naszej planety. Stworzona z myślą o „futbolu dla wszystkich” kolekcja Entrada 22 zapewnia Ci wszystko, czego potrzebujesz, aby Twoja gra była piękniejsza i bardziej widowiskowa. Konstrukcja z miękkiego polaru sprawia, że te spodnie dresowe adidas to wygodny strój w drodze na trening. Zwężane nogawki i mankiety ze ściągaczem nadają modelowi opływowy kształt, dzięki czemu możesz zaprezentować swoją wyszukaną pracę nóg, gdy już dotrzesz na miejsce.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'entrada-22-sweat-pants', '', '', '', 'Entrada 22 Sweat Pants', '', '', '', ''),
(287, 1, 1, 'Oto Twoja nowa ulubiona koszulka. Klasyczna koszulka adidas ma dopasowany krój i kontrastowy dół w wyszukanym stylu vintage. Zestaw ją z ulubionymi ciemnymi dżinsami, aby uzyskać swobodny, klasyczny look. Konstrukcja z miękkiej bawełny gwarantuje komfort.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-3-stripes-tee', '', '', '', 'Adicolor Classics 3-Stripes Tee', '', '', '', ''),
(288, 1, 1, 'Łącząc styl z detalami, które eliminują czynniki rozpraszające, najnowsza kolekcja biegowa adidas zapewni Ci świetny wygląd i wygodę podczas biegu. Zaawansowane technologicznie ubrania zostały zaprojektowane z myślą o Twoim następnym biegu, więc możesz skupić się na tym, co najważniejsze: na dobrej zabawie. \n\nWybierz szorty do biegania Designed 4, które staną się Twoim ulubionym strojem na codzienne biegi. Szorty są lekkie i przewiewne, a wbudowana bielizna z siateczki zapewnia wsparcie i pewne okrycie. Szorty o standardowym kroju z elastyczną talią regulowaną sznurkiem mają odprowadzającą pot technologię AEROREADY, która dba o suchy komfort na każdym kroku.', '', 'szorty-designed-4-running', '', '', '', 'Szorty Designed 4 Running', '', '', '', ''),
(289, 1, 1, 'Torba na kije adidas VS.6 zaprojektowana specjalnie dla zawodników hokeja na trawie ma kieszeń na cały sprzęt hokejowy, w tym ochraniacze na golenie, ubrania, buty i kij. Ergonomicznie zaprojektowany system pasków oznacza, że model jest wygodny w noszeniu, więc możesz spakować się na mecz i trening tylko w tę jedną torbę.', '', 'vs6-black-gold-hockey-stick-bag', '', '', '', 'VS.6 Black/Gold Hockey Stick Bag', '', '', '', ''),
(290, 1, 1, 'Zadbaj o porządek podczas kolejnej przygody dzięki plecakowi adidas Adventure. Model stworzony z myślą o maksymalnej wygodzie ma zapięcie na suwak na górze i przednią kieszeń na suwak, w której przechowasz niezbędne drobiazgi, a także dwie otwarte kieszenie boczne ułatwiające dostęp do rzeczy. Regulowane szelki zapewniają bezpieczne dopasowanie, a poliestrowa podszewka i konstrukcja z tkaniny o splocie płóciennym gwarantują trwałość podczas podróży. Gdziekolwiek się udasz, zabierz ze sobą uniwersalny, funkcjonalny look.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'plecak-adidas-adventure', '', '', '', 'Plecak adidas Adventure', '', '', '', ''),
(291, 1, 1, 'Plecak powraca. Klasyczny model adidas to stylowy sposób na przechowywanie wszystkich rzeczy. Od termicznego kubka na kawę, poprzez laptopa, aż po sprzęt do biegania. Ma również boczną kieszeń na bidon. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'classic-badge-of-sport-backpack', '', '', '', 'Classic Badge of Sport Backpack', '', '', '', ''),
(292, 1, 1, 'Kiedy stylowy akcent pomoże Ci uporządkować swoje rzeczy, wiesz, że masz w rękach coś dobrego. Pokryty zabawną i świeżą grafiką plecak adidas sprawdzi się na długich dystansach dzięki licznym kieszeniom, w których przechowasz niezbędne drobiazgi. Regulowane szelki zapewniają idealne dopasowanie, a specjalna powłoka na dole sprawia, że model jest odporny na zużycie. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'classic-backpack', '', '', '', 'Classic Backpack', '', '', '', ''),
(293, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(294, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(295, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(296, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(297, 1, 1, 'Czapka beanie z wywijanym brzegiem zyskała w tym sezonie świeżą kolorystykę. Naszywka z logo Trefoil nadaje jej subtelny akcent adidas. Szew na górze zapewnia jej odpowiedni kształt.', '', 'adicolor-cuff-beanie', '', '', '', 'Adicolor Cuff Beanie', '', '', '', ''),
(298, 1, 1, 'Od stoków po miejskie wyprawy, ta czapka beanie adidas pomoże Ci pokonać chłód za sprawą klasycznego looku. Wywijany brzeg i ściągaczowy materiał zapewniają wygodę. Logo Badge of Sport uzupełnia ponadczasowy look.', '', 'czapka-logo', '', '', '', 'Czapka Logo', '', '', '', ''),
(299, 1, 1, 'Plecak powraca. Klasyczny model adidas to stylowy sposób na przechowywanie wszystkich rzeczy. Od termicznego kubka na kawę, poprzez laptopa, aż po sprzęt do biegania. Ma również boczną kieszeń na bidon. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'classic-badge-of-sport-backpack', '', '', '', 'Classic Badge of Sport Backpack', '', '', '', ''),
(300, 1, 1, 'Podróżuj komfortowo i w dobrym stylu z plecakiem adidas. Ten model z mocnej tkaniny CORDURA® to dobry wybór, gdy jedziesz rowerem do biura lub podróżujesz w terenie. Kieszeń na wodę pozwoli Ci się napić bez zwalniania tempa, a przegroda na laptopa pomieści Twój sprzęt. Tylny panel z przewiewnej siateczki i regulowane szelki zapewnią Ci przewiewny komfort i wsparcie na długich dystansach. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-4cmte', '', '', '', 'Plecak 4CMTE', '', '', '', ''),
(301, 1, 1, 'Plecak adidas Rekive, który łączy przeszłość z teraźniejszością, tworząc unikalny klimat, jest idealnym rozwiązaniem na zabiegane dni. Dzięki licznym przednim kieszeniom na suwaki i bocznym, wsuwanym kieszeniom masz wiele opcji przechowywania dodatkowych rzeczy. Innowacyjny materiał dystansowy, który zapewnia dodatkowe wsparcie i przepływ powietrza, dając poczucie lekkości, nie zwiększa wagi modelu. Spakuj się i ruszaj w drogę.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'adidas-rekive-backpack', '', '', '', 'adidas Rekive Backpack', '', '', '', ''),
(302, 1, 1, 'Plecak powraca. Klasyczny model adidas to stylowy sposób na przechowywanie wszystkich rzeczy. Od termicznego kubka na kawę, poprzez laptopa, aż po sprzęt do biegania. Ma również boczną kieszeń na bidon. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'classic-badge-of-sport-backpack', '', '', '', 'Classic Badge of Sport Backpack', '', '', '', ''),
(303, 1, 1, 'Rękawice treningowe adidas dbają o detale, dzięki czemu możesz skupić się na ciężarze, z którym się mierzysz. Model z mocnego materiału sprawdzi się podczas intensywnych sesji treningowych: od rozgrzewki do ostatniej serii. Zapięcie na rzepy w nadgarstkach gwarantuje idealne dopasowanie, a antypoślizgowa część dłoni doskonale trzyma się hantli, sztangi i uchwytów maszyny. Materiał do wycierania nosa na kciukach to detal, który od tej pory będzie Twoim must-have, a wstawki z siateczki na plecach zwiększają przewiewność.', '', 'rekawice-training', '', '', '', 'Rękawice Training', '', '', '', ''),
(304, 1, 1, 'Pokaż wszystkim, że jesteś w drużynie z 3 paskami, nosząc te śmiałe rękawiczki adidas. Bez względu na to, czy założysz je w chłodny poranek czy na górską wędrówkę, zapewnią Twoim dłoniom ciepło i wygodę aż po czubki palców z przewodzącymi końcówkami.', '', '3-stripes-conductive-gloves', '', '', '', '3-Stripes Conductive Gloves', '', '', '', ''),
(305, 1, 1, 'Based on classic shapes, these adidas sport sunglasses mix performance and versatile style. Easy to wear, comfortable and durable, these sunglasses are ideal and practical during and after any type of athletic activity.', '', 'sport-sunglasses-sp0047', '', '', '', 'Sport Sunglasses SP0047', '', '', '', ''),
(306, 1, 1, 'Masz dość mrużenia oczu w słońcu? Nie ma sprawy. Te przełomowe okulary przeciwsłoneczne mają ponadczasowy design z nylonowymi soczewkami, które chronią Twoje oczy przed blaskiem. Regulowane noski i lekkie, elastyczne zauszniki zapewniają idealne dopasowanie. Gumowa wstawka z logo adidas dopełnia całości.', '', 'or0084-original-sunglasses', '', '', '', 'OR0084 Original Sunglasses', '', '', '', ''),
(307, 1, 1, 'Nie możesz zdecydować, jaki kolor okularów przeciwsłonecznych wybrać? Nie ma sprawy. Ta błyszcząca para od adidas jest dostępna w wielu opcjach, dzięki czemu idealnie pasuje do każdego stroju. Poliwęglanowe soczewki chronią oczy przed ostrymi promieniami słonecznymi, a elastyczne końcówki zauszników zapewniają wygodę w noszeniu. Metalowa plakietka z wycinanym laserowo logo marki dopełnia całości.', '', 'or0080-original-sunglasses', '', '', '', 'OR0080 Original Sunglasses', '', '', '', ''),
(308, 1, 1, 'Nie możesz zdecydować, jaki kolor okularów przeciwsłonecznych wybrać? Mamy coś dla Ciebie. Ta błyszcząca para od adidas ma kwadratową oprawkę i jest dostępna w wielu opcjach, dzięki czemu idealnie pasuje do każdego stroju. Poliwęglanowe soczewki chronią oczy przed ostrymi promieniami słonecznymi, a elastyczne końcówki zauszników zapewniają wygodę w noszeniu. Metalowa plakietka z wycinanym laserowo logo marki dopełnia całości.', '', 'or0079-original-sunglasses', '', '', '', 'OR0079 Original Sunglasses', '', '', '', ''),
(309, 1, 1, 'Im dalej biegasz, tym więcej rzeczy potrzebujesz na trasie. Noś wszystko w torbie-nerce adidas z paskiem. Jest w niej miejsce na smartfona, klucze i żele, a całość wygodnie układa się na ciele, pozwalając Ci skupić się wyłącznie na treningu. Odblaskowe detale sprawdzą się, gdy zachodzi słońce.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'running-belt-waist-bag', '', '', '', 'Running Belt Waist Bag', '', '', '', ''),
(310, 1, 1, 'Zyskaj swobodę rąk dzięki tej stylowej torbie-nerce adidas. Mocny i idealny do noszenia na co dzień model ma monochromatyczny look, który pasuje praktycznie do każdego stroju. Noś ją wszędzie, w dzień lub w nocy. Odblaskowe detale dodają blasku.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'torba-nerka', '', '', '', 'Torba-nerka', '', '', '', ''),
(311, 1, 1, 'Klucze. Smartfon. Żele energetyczne. Wszystko, czego potrzebujesz podczas długich biegów, możesz zmieścić w tej torbie-nerce adidas do biegania i nie musisz rezygnować z komfortu, aby mieć je przy sobie. Model ma kompaktową konstrukcję dzięki elastycznemu materiałowi i kompresyjną taśmę, która zapobiega wstrząsom. Wyreguluj pasek i ruszaj w drogę.', '', 'running-waist-bag', '', '', '', 'Running Waist Bag', '', '', '', ''),
(312, 1, 1, 'Podróżuj z lekkością dzięki regulowanemu paskowi i kompaktowemu designowi, który Cię nie obciąży. Ta przewieszana przez tułów torba adidas ma wiele kieszeni, w tym przednią kieszeń na suwak i wewnętrzną kieszeń z siateczki, które pomagają utrzymać porządek. Torba z mocnej, a jednocześnie lekkiej tkaniny bawełnianej pozwoli Ci poruszać się swobodnie przez cały dzień.\n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 50%.', '', 'torba-lounge-crossbody', '', '', '', 'Torba Lounge Crossbody', '', '', '', ''),
(313, 1, 1, 'Czapki robią dwie rzeczy: zapewniają ciepło Twojej głowie i uzupełniają Twój strój. Wnieś tę łagodną energię do swojego stylu dzięki czapce beanie adidas. Lekka, jednowarstwowa konstrukcja sprawia, że model idealnie sprawdzi się w każdych warunkach pogodowych. Śmiała grafika adidas nawiązuje do Twojego ducha oryginalności.', '', 'czapka-daily-light', '', '', '', 'Czapka Daily Light', '', '', '', ''),
(314, 1, 1, 'Czapka Y-3 Knitted ma klasyczny fason wykonany w całości z dzianej przędzy. Wkomponowane 3 paski biegną z przodu do tyłu, a całość uzupełnia naszywka Y-3 na wywijanym brzegu.', '', 'czapka-y-3-knitted', '', '', '', 'Czapka Y-3 Knitted', '', '', '', ''),
(315, 1, 1, 'Czapka-kapelusik, która jest synonimem miejskiej mody, łączy szyk ze swobodą. Kapelusz Y-3 pozostaje wierny swoim miejskim korzeniom, jednocześnie podkreślając dbałość o detale. Monochromatyczne logo Y-3 uzupełnia całość.', '', 'kapelusz-y-3-staple-bucket', '', '', '', 'Kapelusz Y-3 Staple Bucket', '', '', '', ''),
(316, 1, 1, 'Niezależnie od tego, czy wychodzisz na miasto załatwiać swoje sprawy, czy ruszasz w poszukiwaniu przygód, ta czapka adidas zapewni Ci okrycie. Wyreguluj pasek z tyłu, aby uzyskać indywidualne dopasowanie i cieszyć się komfortem przez cały dzień. Niezbędny element codziennej garderoby, który doda stylu każdemu Twojemu strojowi. \n\nBawełna wykorzystana w tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'czapka', '', '', '', 'Czapka', '', '', '', ''),
(317, 1, 1, 'Torba adidas Festival to połączenie stylu i funkcjonalności. Torba idealna na codzienne dojazdy lub jednodniową wycieczkę pomoże Ci uporządkować rzeczy i świetnie wyglądać. W przedniej kieszeni na suwak bezpiecznie przechowasz niezbędne drobiazgi, a wszystko inne zmieścisz w komorze głównej na suwak. Regulowany, przewieszany przez tułów pasek sprawia, że model idealnie się układa, a tkanina o splocie płóciennym z nadrukiem Trefoil jest trwała i stylowa.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'monogram-festival-bag', '', '', '', 'Monogram Festival Bag', '', '', '', ''),
(318, 1, 1, 'Noś swój sprzęt piłkarski w dobrym stylu dzięki torbie-workowi adidas Tiro League. Mały rozmiar idealnie nadaje się na krótkie wyjazdy lub wyjście na siłownię, a wyściełany pasek na ramię zadba o Twój komfort w każdej podróży. Zapięcie w kształcie litery U gwarantuje łatwy dostęp do rzeczy, a wentylowana przegroda na buty dba o ich świeżość.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-small', '', '', '', 'Tiro League Duffel Bag Small', '', '', '', ''),
(319, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(320, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(321, 1, 1, 'Niech Twoje buty adidas wyglądają najlepiej jak się da. Gotowe do użycia chusteczki do sneakerów są spakowane do pojemnika, który można wziąć ze sobą w podróż. Jedna strona chusteczki ma gładką powierzchnię do zwykłego czyszczenia, a druga – teksturowana – jest przeznaczona do bardziej upartych zabrudzeń.', '', 'wipes', '', '', '', 'Wipes', '', '', '', ''),
(322, 1, 1, 'Utrzymaj świeży look. Dzięki ściereczce z mikrofibry utrzymasz swoje buty adidas w czystości. Jest miękka, wyjątkowo chłonna i szybko usuwa wilgoć oraz brud.', '', 'microfibre-cloth', '', '', '', 'Microfibre Cloth', '', '', '', ''),
(323, 1, 1, 'Niech Twoje nowe buty adidas zawsze wyglądają jak świeżo po zakupie. Ta pianka do czyszczenia butów i sneakerów nadaje się do wszystkich materiałów, w tym do skóry, zamszu, nubuku, płótna, winylu i nylonu. Formuła na bazie wody działa szybko. Wystarczy wstrząsnąć, rozpylić i przetrzeć szczotką.', '', 'foam-cleaner', '', '', '', 'Foam Cleaner', '', '', '', ''),
(324, 1, 1, 'Zabezpiecz swoje ulubione buty adidas przed wodą i plamami. Ten impregnat na bazie wody przenika przez materiał, tworząc niewidzialną barierę, która pomaga odprowadzać wodę z Twoich sneakerów i chronić je przed plamami.', '', 'protector', '', '', '', 'Protector', '', '', '', ''),
(325, 1, 1, 'Torba na kije adidas VS.6 zaprojektowana specjalnie dla zawodników hokeja na trawie ma kieszeń na cały sprzęt hokejowy, w tym ochraniacze na golenie, ubrania, buty i kij. Ergonomicznie zaprojektowany system pasków oznacza, że model jest wygodny w noszeniu, więc możesz spakować się na mecz i trening tylko w tę jedną torbę.', '', 'vs6-red-grey-hockey-stick-bag', '', '', '', 'VS.6 Red/Grey Hockey Stick Bag', '', '', '', ''),
(326, 1, 1, 'Każdy dzień to przygoda, a dzięki temu plecakowi adidas będziesz na nią przygotowany. Model inspirowany sprzętem outdoorowym ma górną kieszeń na suwak, dzięki czemu możesz szybko dostać się do kluczy, portfela lub telefonu. W łatwo dostępnej wewnętrznej przegrodzie bezpiecznie schowasz laptopa. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', '4athlts-camper-backpack', '', '', '', '4ATHLTS Camper Backpack', '', '', '', ''),
(327, 1, 1, 'Jesteś w ruchu — potrzebujesz plecaka, który dotrzyma Ci kroku w realizacji Twoich planów. I to w dobrym stylu. Wybierz ten plecak adidas. Nieregularny krój pasuje do wszystkich strojów, a duża kieszeń na suwak pomieści cały Twój sprzęt. Wyściełana przegroda na laptopa zabezpiecza Twoje urządzenie przez cały dzień. Uchwyty do noszenia ułatwiają życie, gdy jesteś w ruchu.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'plecak-prime', '', '', '', 'Plecak Prime', '', '', '', ''),
(328, 1, 1, 'Jeśli jesteś w ciągłym ruchu, ten plecak adidas pomoże Ci swobodnie przejść z pracy na trening. Wyściełane szelki i odprowadzający wilgoć panel z tyłu zapewniają maksymalny komfort w ruchu. Uporządkuj swoje rzeczy dzięki licznym kieszeniom z siateczki i oddzielnej przegrodzie na laptopa. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-hybrid', '', '', '', 'Plecak Hybrid', '', '', '', ''),
(329, 1, 1, 'Skarpety adidas do łydki uszyte z miękkiej w dotyku bawełny i poliestru. Wspierające podbicie, amortyzacja w pięcie i palcach komfortowo otulają Twoją stopę, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-crew-socks-6-pairs', '', '', '', 'Cushioned Sportswear Crew Socks 6 Pairs', '', '', '', ''),
(330, 1, 1, 'Skarpety adidas do łydki uszyte z miękkiej w dotyku bawełny i poliestru. Wspierające podbicie, amortyzacja w pięcie i palcach komfortowo otulają Twoją stopę, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-crew-socks-6-pairs', '', '', '', 'Cushioned Sportswear Crew Socks 6 Pairs', '', '', '', ''),
(331, 1, 1, 'Znajdź swoje ulubione miejsce między piętą a łydką. Skarpety adidas do pół łydki nie są ani za krótkie, ani za długie. Zapewnią Ci świetny look podczas treningu lub odpoczynku. Bawełniana konstrukcja gwarantuje idealny komfort i dopasowanie.', '', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid-Cut Crew Socks 3 Pairs', '', '', '', ''),
(332, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(333, 1, 1, 'Gdy atakujesz w strefie przeciwnika, utrata ochraniaczy na golenie nie wchodzi w grę. Te paski na kostki sprawią, że zawsze będziesz w gotowości do akcji. Łatwy do założenia i wygodny model przytrzyma w miejscu ochraniacze na golenie, gdy Ty dominujesz na boisku.', '', 'ankle-straps', '', '', '', 'Ankle Straps', '', '', '', ''),
(334, 1, 1, 'Model stworzony z myślą o pewności siebie podczas gry w piłkę nożną. Ochraniacze na golenie adidas Tiro League powstały dla zawodników, którzy nie zwalniają tempa. Włóż elastyczne płytki do kompresyjnych rękawów, aby zapewnić sobie wygodne dopasowanie, które utrzymuje się na swoim miejscu. Formowana pianka EVA z tyłu pochłania siłę uderzenia, gdy dajesz z siebie wszystko.\n\nModel zawiera co najmniej 20% materiałów z odzysku, co pozwala uniknąć dużego wpływu na środowisko, jaki ma produkcja nowo powstałych materiałów.', '', 'ochraniacze-na-golenie-tiro-league', '', '', '', 'Ochraniacze na golenie Tiro League', '', '', '', ''),
(335, 1, 1, 'Model stworzony z myślą o pewności siebie podczas gry w piłkę nożną. Ochraniacze na golenie adidas Tiro League powstały dla zawodników, którzy nie zwalniają tempa. Włóż elastyczne płytki do kompresyjnych rękawów, aby zapewnić sobie wygodne dopasowanie, które utrzymuje się na swoim miejscu. Formowana pianka EVA z tyłu pochłania siłę uderzenia, gdy dajesz z siebie wszystko.\n\nModel zawiera co najmniej 20% materiałów z odzysku, co pozwala uniknąć dużego wpływu na środowisko, jaki ma produkcja nowo powstałych materiałów.', '', 'ochraniacze-na-golenie-tiro-league', '', '', '', 'Ochraniacze na golenie Tiro League', '', '', '', ''),
(336, 1, 1, 'Gdy atakujesz w strefie przeciwnika, utrata ochraniaczy na golenie nie wchodzi w grę. Te paski na kostki sprawią, że zawsze będziesz w gotowości do akcji. Łatwy do założenia i wygodny model przytrzyma w miejscu ochraniacze na golenie, gdy Ty dominujesz na boisku.', '', 'ankle-straps', '', '', '', 'Ankle Straps', '', '', '', ''),
(337, 1, 1, 'Klasyczny plecak ma w sobie coś satysfakcjonującego. To Twój codzienny towarzysz w drodze na siłownię i podczas weekendowych przygód. Ten model od adidas sprawdzi się w każdej sytuacji, oferując mnóstwo miejsca na uporządkowanie wszystkiego, czego potrzebujesz. Ma pojemną komorę główną oraz kieszenie z przodu i po bokach. Wewnętrzna, wsuwana kieszeń zapewnia łatwy dostęp do niezbędnych drobiazgów, które chcesz zabezpieczyć w środku. Wyściełane szelki można regulować, aby zyskać wygodne dopasowanie, a tkanina jest trwała i wytrzymała. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'plecak-adicolor', '', '', '', 'Plecak Adicolor', '', '', '', ''),
(338, 1, 1, 'Przyjrzyjmy się temu plecakowi adidas. Ma konstrukcję z wytrzymałej poliestrowej tkaniny o splocie płóciennym, dzięki czemu wygląda jak nowy nawet przy intensywnym użytkowaniu. W zapinanej przegrodzie na suwak zabezpieczysz swoje rzeczy w zabiegany dzień pracy lub w drodze na siłownię. Kieszeń na suwak z przodu pomieści Twój telefon i etui na karty, a bidon możesz schować do jednej z bocznych kieszeni. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'classic-badge-of-sport-3-stripes-backpack', '', '', '', 'Classic Badge of Sport 3-Stripes Backpack', '', '', '', ''),
(339, 1, 1, 'Każdy dzień to przygoda, a dzięki temu plecakowi adidas będziesz na nią przygotowany. Model inspirowany sprzętem outdoorowym ma górną kieszeń na suwak, dzięki czemu możesz szybko dostać się do kluczy, portfela lub telefonu. W łatwo dostępnej wewnętrznej przegrodzie bezpiecznie schowasz laptopa. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', '4athlts-camper-backpack', '', '', '', '4ATHLTS Camper Backpack', '', '', '', ''),
(340, 1, 1, 'Potrzebujesz plecaka, który sprawdzi się zarówno na co dzień, jak i podczas outdoorowej przygody? Ten bardzo funkcjonalny design od adidas jest Twoim rozwiązaniem. Liczne kieszenie dają wiele możliwości przechowywania, w tym wyściełaną przegrodę na laptopa lub inne urządzenia. Boczne kieszenie z zapięciem na sprzączkę sprawiają, że niezbędne drobiazgi pozostaną na swoim miejscu, a pojemna kieszeń z przodu została uszyta z siateczki, dzięki czemu możesz zobaczyć, co jest w środku. Pasek na piersi zapewnia idealne dopasowanie, gdy wędrujesz lub po prostu masz wolny dzień. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów pochodzących z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'plecak-xplr', '', '', '', 'Plecak X_PLR', '', '', '', ''),
(341, 1, 1, 'Monochromatyczna czapka adidas w minimalistycznym stylu. Subtelna naszywka z brandingiem nadaje jej przyciągający wzrok design, który odbija światło. Wyreguluj pasek z tyłu, aby znaleźć perfekcyjne dopasowanie.  \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-metal-badge-lightweight-baseball', '', '', '', 'Czapka Metal Badge Lightweight Baseball', '', '', '', ''),
(342, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nProstota czapki Y-3 z tkaniny ripstop odpowiada za jej uniwersalność. Jednobarwna konstrukcja jest przewiewna dzięki oczkom wentylacyjnym na główce. Duże, stonowane kolorystycznie logo Y-3 zdobi przód.', '', 'y-3-logo-cap', '', '', '', 'Y-3 Logo Cap', '', '', '', ''),
(343, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nProstota czapki Y-3 z tkaniny ripstop odpowiada za jej uniwersalność. Jednobarwna konstrukcja jest przewiewna dzięki oczkom wentylacyjnym na główce. Duże, stonowane kolorystycznie logo Y-3 zdobi przód.', '', 'y-3-logo-cap', '', '', '', 'Y-3 Logo Cap', '', '', '', ''),
(344, 1, 1, 'Czapka adidas w swobodnym stylu ma łatwy do spakowania, minimalistyczny design. Wysokiej jakości bawełna i odprowadzająca wilgoć opaska przeciwpotna zapewnią Ci komfort.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'premium-essentials-dad-cap', '', '', '', 'Premium Essentials Dad Cap', '', '', '', ''),
(345, 1, 1, 'Torba-worek adidas Tiro League idealna na Twój sprzęt piłkarski ma mocną przegrodę na dole i boczną kieszeń z siateczki, w której przechowasz przekąski i bidon. Wyściełany, regulowany pasek na ramię sprawia, że można ją nosić wygodnie na wiele sposobów. Uchwyty ułatwiają przenoszenie, gdy spieszysz się na trening.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-small', '', '', '', 'Tiro League Duffel Bag Small', '', '', '', ''),
(346, 1, 1, 'Model idealny na siłownię i weekendowe wypady. Ta torba adidas ma solidny spód, który ochroni Twoje rzeczy. Komora główna z dwukierunkowym suwakiem daje łatwy dostęp do wyposażenia z obu stron. Model ma mnóstwo kieszeni i wbudowaną przegrodę na buty, w której oddzielisz sneakery od reszty.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-linear-duffel-bag-medium', '', '', '', 'Essentials Linear Duffel Bag Medium', '', '', '', ''),
(347, 1, 1, 'Model idealny na siłownię i weekendowe wypady. Ta torba adidas ma solidny spód, który ochroni Twoje rzeczy. Komora główna z dwukierunkowym suwakiem daje łatwy dostęp do wyposażenia z obu stron. Model ma mnóstwo kieszeni i wbudowaną przegrodę na buty, w której oddzielisz sneakery od reszty.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-linear-duffel-bag-medium', '', '', '', 'Essentials Linear Duffel Bag Medium', '', '', '', ''),
(348, 1, 1, 'Masz sporo sprzętu do noszenia. Ta torba-worek adidas go pomieści. Trwała torba ma idealną pojemność na zawody i treningi szkoleniowe poza miastem. W zamykanej na suwak przegrodzie możesz schować mokre ubrania z dala od butów. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', '4athlts-duffel-bag-medium', '', '', '', '4ATHLTS Duffel Bag Medium', '', '', '', ''),
(349, 1, 1, 'Sprytne pakowanie to klucz do podróżowania z lekkim bagażem. Ta bardzo mała torba-worek adidas jest wystarczająco pojemna, aby szybko ją zabrać na siłownię. W siateczkowej kieszeni na suwak możesz schować mokre ubrania z dala od butów. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', '4athlts-duffel-bag-small', '', '', '', '4ATHLTS Duffel Bag Small', '', '', '', ''),
(350, 1, 1, 'Wybierz sposób noszenia zestawu piłkarskiego. Torba adidas Tiro Competition ma pojemną komorę główną z łatwym dostępem, dzięki czemu ochraniacze na golenie nie będą Ci przeszkadzać w szatni. Ma nawet specjalną przegrodę z dodatkową wentylacją na wilgotne buty. Nie martw się też, że w drodze do domu zmęczysz się — uchwyt może posłużyć również jako paski do noszenia na ramionach.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-competition-duffel-bag-medium', '', '', '', 'Tiro Competition Duffel Bag Medium', '', '', '', ''),
(351, 1, 1, 'Model stworzony z myślą o pięknej grze. Uniwersalna torba piłkarska adidas, będąca częścią kolekcji Tiro League, idealnie nadaje się zarówno na dzień meczu, jak i na weekendowy wyjazd. Model z mocnej, plecionej tkaniny osadzony na trwałej, powlekanej podstawie poradzi sobie z chaosem panującym w szatni. Kiedy nadejdzie czas powrotu do domu, schowaj wilgotny sprzęt do specjalnej, wentylowanej przegrody, aby go przewietrzyć.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-medium', '', '', '', 'Tiro League Duffel Bag Medium', '', '', '', ''),
(352, 1, 1, 'Model stworzony z myślą o pięknej grze. Uniwersalna torba piłkarska adidas, będąca częścią kolekcji Tiro League, idealnie nadaje się zarówno na dzień meczu, jak i na weekendowy wyjazd. Model z mocnej, plecionej tkaniny osadzony na trwałej, powlekanej podstawie poradzi sobie z chaosem panującym w szatni. Kiedy nadejdzie czas powrotu do domu, schowaj wilgotny sprzęt do specjalnej, wentylowanej przegrody, aby go przewietrzyć.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-medium', '', '', '', 'Tiro League Duffel Bag Medium', '', '', '', ''),
(353, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(354, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(355, 1, 1, 'Niewidoczne w butach skarpetki adidas idealnie nadają się do noszenia ze sneakerami. Wsparcie łuku stopy i lekka konstrukcja zapewniają wygodne dopasowanie, gdy odpoczywasz na kanapie lub wychodzisz pobiegać. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-no-show-socks-3-pairs', '', '', '', 'Thin and Light No-Show Socks 3 Pairs', '', '', '', ''),
(356, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(357, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(358, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(359, 1, 1, 'Noś te skarpetki adidas do kostki z niskimi sneakerami, aby pokazać subtelne, a jednocześnie wyróżniające się logo. Skarpety z mieszanki bawełny i poliestru powstały z myślą o komforcie przez cały dzień. Amortyzacja w pięcie i palcach wspiera każdy krok, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-3-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 3 Pairs', '', '', '', ''),
(360, 1, 1, 'Skarpety adidas do gry w golfa uzupełniają Twój strój na ciepłe dni. Niewidoczny w butach design pasuje do szortów i zwężanych spodni. Wentylacja z siateczki na górze zapewnia stopom przewiewny komfort podczas długich popołudniowych rozgrywek, a kompresyjne podbicie zwiększa wsparcie. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'no-show-socks-3-pairs', '', '', '', 'No-Show Socks 3 Pairs', '', '', '', ''),
(361, 1, 1, 'Niewidoczne w butach skarpetki adidas idealnie nadają się do noszenia ze sneakerami. Wsparcie łuku stopy i lekka konstrukcja zapewniają wygodne dopasowanie, gdy odpoczywasz na kanapie lub wychodzisz pobiegać. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-no-show-socks-3-pairs', '', '', '', 'Thin and Light No-Show Socks 3 Pairs', '', '', '', ''),
(362, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(363, 1, 1, 'Logo Trefoil stało się czymś więcej niż tylko rozpoznawalną ikoną. Nosili je nasi ulubieni sportowcy, muzycy i artyści. Oznacza styl i komfort nawet w skarpetkach. Skarpety adidas Trefoil Cushion Crew są dostępne w opakowaniu po 3 par, aby zapewnić Ci świeży komfort.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'trefoil-cushion-crew-socks-3-pairs', '', '', '', 'Trefoil Cushion Crew Socks 3 Pairs', '', '', '', ''),
(364, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(365, 1, 1, 'Dodaj sportowy akcent za sprawą tych skarpet adidas do kostki. Konstrukcja z mieszanki bawełny i poliestru jest miękka i przewiewna, a zintegrowane szwy w palcach zapobiegają otarciom. Amortyzacja w pięcie i palcach oraz wspierające dopasowanie w łuku stopy zapewniają komfort przez cały dzień. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-6-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(366, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(367, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', '', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(368, 1, 1, 'Niskie skarpetki adidas miękko przylegają do Twoich stóp. Konstrukcja z mieszanki lekkiej bawełny i poliestru idealnie dopasowuje się do łuku stopy, a zintegrowane szwy w palcach zapobiegają otarciom. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-sportswear-low-cut-socks-3-pairs', '', '', '', 'Thin and Light Sportswear Low-Cut Socks 3 Pairs', '', '', '', ''),
(369, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(370, 1, 1, 'Noś te skarpetki adidas do kostki z niskimi sneakerami, aby pokazać subtelne, a jednocześnie wyróżniające się logo. Skarpety z mieszanki bawełny i poliestru powstały z myślą o komforcie przez cały dzień. Amortyzacja w pięcie i palcach wspiera każdy krok, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-3-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 3 Pairs', '', '', '', ''),
(371, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(372, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(373, 1, 1, 'Lekkie skarpety do kostki ze wsparciem łuku stopy, bezszwową konstrukcją w palcach i odrobiną streczu idealnie nadają się do noszenia na co dzień. Kontrastowe logo adidas Badge of Sport wyróżnia się w kostce. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-ankle-socks-3-pairs', '', '', '', 'Thin and Light Ankle Socks 3 Pairs', '', '', '', ''),
(374, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(375, 1, 1, 'Skarpetki Trefoil Liner dodają trochę oryginalności temu najbardziej powszechnemu elementowi garderoby. Mają niski krój, niewidoczny w połączeniu ze sneakerami, wykonany z lekko elastycznej bawełny i ozdobiony logo Trefoil na wierzchu stopy.', '', 'trefoil-liner-socks-3-pairs', '', '', '', 'Trefoil Liner Socks 3 Pairs', '', '', '', ''),
(376, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(377, 1, 1, 'Znajdź swoje ulubione miejsce między piętą a łydką. Skarpety adidas do pół łydki nie są ani za krótkie, ani za długie. Zapewnią Ci świetny look podczas treningu lub odpoczynku. Bawełniana konstrukcja gwarantuje idealny komfort i dopasowanie.', '', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid-Cut Crew Socks 3 Pairs', '', '', '', ''),
(378, 1, 1, 'Skarpetki adidas o długości do kostki mają subtelnie ściągaczowe brzegi, które utrzymują je na swoim miejscu. Model wykonany z mieszanki lekkiego, miękkiego materiału jest dostępny w opakowaniach po trzy pary i stanowi sportowe uzupełnienie Twojej szuflady na skarpetki.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'think-linear-ankle-socks-3-pairs', '', '', '', 'Think Linear Ankle Socks 3 Pairs', '', '', '', ''),
(379, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', '', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
