(401, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(402, 1, 1, 'Szalik Y-3 Mixed Yarn łączy dwie różne konstrukcje — jednobarwną, ściągaczową strukturę skontrastowaną z puszystą przędzą na końcach. Wyszywane logotypy Y-3 uzupełniają całość.', '', 'szalik-y-3-mixed-yarn', '', '', '', 'Szalik Y-3 Mixed Yarn', '', '', '', ''),
(403, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(404, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(405, 1, 1, 'Nie pozwól, by gniecenie, opadanie lub podsuwanie się do góry skarpetek spowolniło Twoje tempo. Te krótkie skarpetki adidas pozostają na miejscu pod Twoimi sneakerami bez względu na wszystko. Czujesz tylko komfort.', '', 'no-show-socks-3-pairs', '', '', '', 'No-Show Socks 3 Pairs', '', '', '', ''),
(406, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(407, 1, 1, 'Skarpetki adidas o długości do kostki mają subtelnie ściągaczowe brzegi, które utrzymują je na swoim miejscu. Model wykonany z mieszanki lekkiego, miękkiego materiału jest dostępny w opakowaniach po trzy pary i stanowi sportowe uzupełnienie Twojej szuflady na skarpetki.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'think-linear-ankle-socks-3-pairs', '', '', '', 'Think Linear Ankle Socks 3 Pairs', '', '', '', ''),
(408, 1, 1, 'Dodaj sportowy akcent za sprawą tych skarpet adidas do kostki. Konstrukcja z mieszanki bawełny i poliestru jest miękka i przewiewna, a zintegrowane szwy w palcach zapobiegają otarciom. Amortyzacja w pięcie i palcach oraz wspierające dopasowanie w łuku stopy zapewniają komfort przez cały dzień. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-6-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(409, 1, 1, 'Niskie skarpetki adidas miękko przylegają do Twoich stóp. Konstrukcja z mieszanki lekkiej bawełny i poliestru idealnie dopasowuje się do łuku stopy, a zintegrowane szwy w palcach zapobiegają otarciom. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-sportswear-low-cut-socks-3-pairs', '', '', '', 'Thin and Light Sportswear Low-Cut Socks 3 Pairs', '', '', '', ''),
(410, 1, 1, 'Lekkie skarpety do kostki ze wsparciem łuku stopy, bezszwową konstrukcją w palcach i odrobiną streczu idealnie nadają się do noszenia na co dzień. Kontrastowe logo adidas Badge of Sport wyróżnia się w kostce. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-ankle-socks-3-pairs', '', '', '', 'Thin and Light Ankle Socks 3 Pairs', '', '', '', ''),
(411, 1, 1, 'W tym modelu znajdziesz wiele detali, które zapewnią Ci komfort przez cały trening. Załóż te skarpetki do kostki i ruszaj na podbój świata. Elementy z siateczki usprawniają przepływ powietrza. Ciesz się suchym komfortem dzięki adidas AEROREADY. Elastyczne strefy tam, gdzie ich potrzebujesz i wsparcie w podbiciu sprawiają, że możesz się ruszać, jak tylko zechcesz. Każde opakowanie zawiera trzy pary skarpet.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-cushioned-mid-cut-socks-3-pairs', '', '', '', 'Performance Cushioned Mid-Cut Socks 3 Pairs', '', '', '', ''),
(412, 1, 1, 'Najbardziej utytułowana drużyna Ligi Mistrzów, Real Madryt, lepiej niż większość rozumie znaczenie słów hymnu turnieju. Minipiłka inspirowana oficjalną piłką meczową Ligi Mistrzów UEFA adidas idealnie nadaje się do zaprezentowania Twoich umiejętności w drodze dzięki niewielkiej sylwetce i piankowemu wnętrzem. Napis \"The Champions\" i subtelne nuty muzyczne sprawiają, że te 12 gwiazdek błyszczy dzięki mocnej, poliuretanowej powłoce.', '', 'pilka-ucl-real-madrid-mini-23-24-group-stage', '', '', '', 'Piłka UCL Real Madrid Mini 23/24 Group Stage', '', '', '', ''),
(413, 1, 1, 'Logo Trefoil stało się czymś więcej niż tylko rozpoznawalną ikoną. Nosili je nasi ulubieni sportowcy, muzycy i artyści. Oznacza styl i komfort nawet w skarpetkach. Skarpety adidas Trefoil Cushion Crew są dostępne w opakowaniu po 6 par, aby zapewnić Ci świeżość przez cały tydzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'trefoil-cushion-crew-socks-6-pairs', '', '', '', 'Trefoil Cushion Crew Socks 6 Pairs', '', '', '', ''),
(414, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
(415, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
(416, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(417, 1, 1, 'Skarpetki Trefoil Liner dodają trochę oryginalności temu najbardziej powszechnemu elementowi garderoby. Mają niski krój, niewidoczny w połączeniu ze sneakerami, wykonany z lekko elastycznej bawełny i ozdobiony logo Trefoil na wierzchu stopy.', '', 'trefoil-liner-socks-3-pairs', '', '', '', 'Trefoil Liner Socks 3 Pairs', '', '', '', ''),
(418, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
(419, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(420, 1, 1, 'Skarpetki adidas do kostki, które idealnie pasują do sneakerów.c Uszyto je z mieszanki bawełny i poliestru, dzięki czemu są miękkie i niemal niewyczuwalne w dotyku. Zintegrowane szwy w palcach zapobiegają otarciom, a idealnie dopasowany krój wokół łuku stopy zapewnia wsparcie.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-sportswear-ankle-socks-6-pairs', '', '', '', 'Thin and Light Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(421, 1, 1, 'Położenie kresu plastikowym odpadom to nie tylko marzenie. Dla adidas jest to cel. Ten stalowy bidon Parley for the Oceans pokaże, kogo wspierasz. Bo razem możemy to zrobić.', '', 'parley-for-the-oceans-steel-water-bottle', '', '', '', 'Parley for the Oceans Steel Water Bottle', '', '', '', ''),
(422, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(423, 1, 1, 'Zapewnij swoim stopom wygodną podstawę. Te niskie skarpety treningowe adidas oferują wsparcie w podbiciu, a także miękką amortyzację w pięcie i palcach. AEROREADY reguluje wilgoć, gdy biegasz, spacerujesz lub trenujesz. W opakowaniu znajdują się trzy pary.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-cushioned-low-socks-3-pairs', '', '', '', 'Performance Cushioned Low Socks 3 Pairs', '', '', '', ''),
(424, 1, 1, 'Chociaż przed Tobą może nie być długiego dnia spędzonego na morzu, ta rybacka czapka w stylu Adicolor to idealny towarzysz na wietrzne dni. Wywijany brzeg i stonowana kolorystycznie naszywka z logo Trefoil nadają całości wyrazisty look, a konstrukcja z dzianiny o gładkim splocie zapewnia komfort przez cały dzień. Wrzuć tę czapkę od adidas do torby, a następnym razem, gdy zrobi się chłodno, nic nie powstrzyma Cię przed wyjściem. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-adicolor-short', '', '', '', 'Czapka Adicolor Short', '', '', '', ''),
(425, 1, 1, 'Powitaj jesień w dobrym stylu. Gotowa na chłodniejsze dni czapka beanie adidas zapewni Ci komfort, ciepło i zachęci do wyjścia na dwór. Design z mankietami prezentuje 3 paski z tyłu i ponadczasowe logo Trefoil z przodu. Model z mieszanki bawełny i akrylu jest miękki i elastyczny, dzięki czemu zapewnia idealne dopasowanie. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć pod adresem: bettercotton.org/learnmore', '', 'czapka-adicolor-cuff-knit', '', '', '', 'Czapka Adicolor Cuff Knit', '', '', '', ''),
(426, 1, 1, 'Nie zwalniaj tempa, gdy dajesz z siebie wszystko. Krótkie skarpety treningowe adidas mają AEROREADY, który zarządza wilgocią, zapewniając Ci suchy komfort na siłowni, korcie lub szlaku. Miękki, elastyczny i cienki model w naturalny sposób dopasowuje się do ciała. W opakowaniu znajdują się trzy pary.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-light-low-socks-3-pairs', '', '', '', 'Performance Light Low Socks 3 Pairs', '', '', '', ''),
(427, 1, 1, 'Ciesz się ciepłem i wyglądaj świeżo. Ta czapka adidas typu beanie zapewnia ciepły komfort i śmiały look, który wyjątkowo do Ciebie pasuje. Pompon wnosi tę zabawną energię. Duża grafika adidas podkreśla oryginalność.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-pompom', '', '', '', 'Czapka Pompom', '', '', '', ''),
(428, 1, 1, 'Step onto the course ready to play in these adidas golf socks. The ankle-length design features a compression instep for support. Mesh at the top keeps feet cool. \n\nOur cotton products support more sustainable cotton farming.', '', 'basic-golf-ankle-socks', '', '', '', 'Basic Golf Ankle Socks', '', '', '', ''),
(429, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(430, 1, 1, 'Wyjdź na zieloną trawkę w tych skarpetach adidas do gry w golfa. Design do kostki ma kompresyjne podbicie, które wspiera stopę. Siateczka na górze gwarantuje przewiewny komfort aż do ostatniego dołka. \n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'ankle-socks-3-pairs', '', '', '', 'Ankle Socks 3 Pairs', '', '', '', ''),
(431, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(432, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(433, 1, 1, 'Ku uciesze kibiców i fanów ulicznej mody ten piłkarski model z lat 60. ma jeszcze co nieco do powiedzenia. To wierna reedycja ulepszonych butów Gazelle z 1991 roku z wykorzystaniem autentycznych materiałów, faktur i proporcji. Cholewkę wykonano ze świńskiego nubuku ze stonowanym kolorystycznie wykończeniem i srebrzystym napisem.', '', 'buty-gazelle', '', '', '', 'Buty Gazelle', '', '', '', ''),
(434, 1, 1, 'Buty Samba, które narodziły się na boisku, stały się ponadczasową ikoną stylu miejskiego. Ta sylwetka pozostaje wierna tradycji za sprawą gustownej, niskoprofilowej cholewki z miękkiej skóry, zamszowych nakładek i gumowej podeszwy, dzięki czemu jest podstawowym elementem garderoby każdego — na boisku i poza nim.', '', 'buty-samba-og', '', '', '', 'Buty Samba OG', '', '', '', ''),
(435, 1, 1, 'Buty, które zadebiutowały w 1979 roku jako model dla topowych piłkarzy ręcznych, cieszą się teraz popularnością ze względu na swój klasyczny design. Ta wersja została wyposażona w delikatną w dotyku cholewkę z nubuku. Miękka podeszwa zewnętrzna z gumy pozostaje wierna swoim archiwalnym korzeniom.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(436, 1, 1, 'Wybierz buty łączące elementy retro z futurystycznymi liniami designu, aby wprowadzić styl z przełomu XX i XXI wieku na nowe terytoria. Wykonane są z siateczki, zamszu i gładkiego TPU. Strategicznie rozmieszczone wsparcie w przedniej części stopy i w pięcie sprawia, że bieg staje się niezwykle komfortowy.', '', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(437, 1, 1, 'Te buty adidas zostały stworzone, aby przyciągać spojrzenia. Przyciągające wzrok, metaliczne akcenty i powiększona platforma przyciągną wzrok, gdziekolwiek się udasz, niezależnie od tego, czy jesteś w parku, czy w pracy. Buty mają wyszukany, luksusowy look, który zwraca uwagę zarówno miłośników sneakerów, jak i prawdziwych miłośników mody.', '', 'buty-forum-bold', '', '', '', 'Buty Forum Bold', '', '', '', ''),
(438, 1, 1, 'Buty, które zadebiutowały w 1979 roku jako model dla topowych piłkarzy ręcznych, cieszą się teraz popularnością ze względu na swój klasyczny design. Ta wersja została wyposażona w delikatną w dotyku cholewkę z nubuku. Miękka podeszwa zewnętrzna z gumy pozostaje wierna swoim archiwalnym korzeniom.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(439, 1, 1, 'Zmierz się z plenerem, niezależnie od tego, czy odkrywasz miasto, czy spacerujesz po okolicy. Buty adidas stworzone na cześć designu butów stworzonych z myślą o trudnym terenie łączą innowacyjność i komfort. Pikowana cholewka jest wykończona zygzakowatymi sznurowadłami, a gumowa podeszwa zewnętrzna nadaje całości mocny look. Podeszwa środkowa BOOST zwraca energię, a miękka wyściółka jest miła w dotyku przy każdym założeniu. Śmiały, ale uniwersalny, futurystyczny look pasuje niemal do wszystkiego — zwłaszcza do zwężanych spodni lub podwiniętych mankietów, które pozwolą Ci się pokazać. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-nmds1', '', '', '', 'Buty NMD_S1', '', '', '', ''),
(440, 1, 1, 'Na dobry start. Buty do piłki ręcznej adidas Handball Spezial zostały pierwotnie zaprojektowane w latach 70. do startów i zatrzymań w grze. Obecnie teksturowana, zamszowa cholewka i sprężysta gumowa podeszwa bez dwóch zdań nadają się na ulice.', '', 'handball-spezial-shoes', '', '', '', 'Handball Spezial Shoes', '', '', '', ''),
(441, 1, 1, 'Buty Samba, które narodziły się na boisku, stały się ponadczasową ikoną stylu miejskiego. Ta sylwetka pozostaje wierna tradycji za sprawą gustownej, niskoprofilowej cholewki z miękkiej skóry, zamszowych nakładek i gumowej podeszwy, dzięki czemu jest podstawowym elementem garderoby każdego — na boisku i poza nim.', '', 'buty-samba-og', '', '', '', 'Buty Samba OG', '', '', '', ''),
(442, 1, 1, 'Idź tam, gdzie tylko zapragniesz w tych sneakerach adidas. Niskoprofilowe buty Handball Spezial, które zadebiutowały w 1979 roku na profesjonalnych boiskach halowych, a od tamtej pory stały się ikoną stylu miejskiego, w odsłonie w ponadczasowym stylu retro. Design stworzony na nowo z myślą o wolnych duchach, które wyznaczają swój własny kierunek. Cholewkę z wysokiej jakości zamszu zdobią 3 paski z zamszu i inne charakterystyczne detale inspirowane archiwalnymi modelami adidas Originals. Klasyczna sylwetka została osadzona na gumowej podeszwie zewnętrznej, która zapewnia trwałość i przyczepność.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(443, 1, 1, 'Inspirowany bieganiem styl do codziennych przygód. Ta przełomowa wersja butów adidas NMD_R1 jest nawiązuje do oryginalnego modelu inspirowanego latami 80., a barwne wstawki i kolorowe końcówki sznurowadeł stanowią świeże akcenty. Elastyczna, pleciona cholewka otula stopę, zapewniając komfort w ruchu. Długie dojazdy i śliskie chodniki to żaden problem, gdy masz pod stopami przyczepną gumową podeszwę zewnętrzną i podeszwę środkową Boost.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'nmdr1-shoes', '', '', '', 'NMD_R1 Shoes', '', '', '', ''),
(444, 1, 1, 'W butach adidas Superstar chodzi o indywidualność. Buty adidas AdiFOM SST nie boją się przełamywać schematów, czerpią inspirację z przeszłości i dostosowują ją do współczesnego stylu miejskiego. Krój butów i konstrukcja z ekologicznej pianki wybiegają w przyszłość, a kultowa osłona palców w kształcie muszli oddaje hołd ich historii. Załóż skarpetki, aby zyskać idealny komfort, a miękka pianka zajmie się resztą.\n\nTen produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', '', 'buty-adifom-sst-boot', '', '', '', 'Buty AdiFOM SST Boot', '', '', '', ''),
(445, 1, 1, 'Proporcje się zmieniają, ale unikalny styl zawsze pozostaje na topie. Buty adidas, które prezentują nowe spojrzenie na model Campus 80s, podkreślają śmiałą prostotę w najlepszym wydaniu za sprawą prostej, zamszowej cholewki i klasycznych, kontrastowych 3 pasków. Unowocześnione proporcje inspirowane designem skejtowym z początku XXI wieku nadają autentyczny charakter Twojemu codziennemu stylowi.', '', 'campus-00s-shoes', '', '', '', 'Campus 00s Shoes', '', '', '', ''),
(446, 1, 1, 'Startuj. Ląduj. I jeszcze raz. Biegi długodystansowe to stawianie jednej stopy przed drugą — tak przez dłuższy czas. Buty adidas Adistar 2.0 powstały to, by udało Ci się pobiec jeszcze dalej.\n\nPodeszwa środkowa łączy dwa rodzaje pianki EVA: REPETITOR to lekka pianka, która zwiększa sprężystość butów, a REPETITOR+ to twardsza mieszanka, która otula piętę. Cholewka z siateczki blokuje stopę i zapewnia wsparcie, dzięki czemu możesz biegać krok po kroku, kilometr po kilometrze, a podeszwa zewnętrzna z gumy Continental™ gwarantuje nadzwyczajną trakcję na mokrych i suchych nawierzchniach.', '', 'buty-adistar-20', '', '', '', 'Buty Adistar 2.0', '', '', '', ''),
(447, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(448, 1, 1, 'Buty Prime X 2 Strung, stworzone z wykorzystaniem innowacyjnej technologii i zaprojektowane bez konieczności przestrzegania globalnych ograniczeń wynikających z przepisów dotyczących konkurencji biegowych, oferują jeszcze lepsze parametry techniczne designu wyścigowego. Tekstylna, innowacyjna cholewka STRUNG bazuje na danych pozyskanych od sportowców i przekształconych w dynamiczny materiał dostosowany do ich potrzeb. Prime X 2 Strung ma również 3 warstwy LIGHTSTRIKE PRO o łącznej grubości 50 mm. Zupełnie nowy rdzeń dodający energii między dwiema warstwami pianki pomaga zmniejszyć wagę i zapewnia sprężystość w przedniej i środkowej części stopy, dzięki czemu możesz ścigać się z własną życiówką. Podeszwa zewnętrzna z mieszanki Continental zapewnia doskonałą przyczepność na różnych nawierzchniach.', '', 'buty-adizero-prime-x-20-strung', '', '', '', 'Buty Adizero Prime X 2.0 STRUNG', '', '', '', ''),
(449, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(450, 1, 1, 'Gdziekolwiek się udajesz, zabierz ze sobą swój sportowy styl dzięki tym butom adidas. Krój inspirowany bieganiem oznacza, że Twoje stopy będą czuć się komfortowo, gdy jesteś na mieście lub odpoczywasz na podwórku. Tekstylna cholewka zapewnia komfort i nadaje unikalny look vintage. Gumowa podeszwa zewnętrzna zapewnia przyczepność na mokrych i suchych nawierzchniach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'run-60s-30-lifestyle-running-shoes', '', '', '', 'Run 60s 3.0 Lifestyle Running Shoes', '', '', '', ''),
(451, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(452, 1, 1, 'Klimat wakacji przez cały czas. Wsuń bose stopy w klapki Adilette Lite. (Ale możesz je nosić także do skarpetek, nie będziemy się czepiać). Ten model charakteryzuje się wyjątkowo miękką i komfortowo wygodną wewnętrzną częścią podeszwy. Buty mają logo adidas Trefoil na górnym pasku, więc zachowujesz sportowy wygląd nawet podczas relaksu.', '', 'adilette-lite-slides', '', '', '', 'Adilette Lite Slides', '', '', '', ''),
(453, 1, 1, 'Klimat wakacji przez cały czas. Wsuń bose stopy w klapki Adilette Lite. (Ale możesz je nosić także do skarpetek, nie będziemy się czepiać). Ten model charakteryzuje się wyjątkowo miękką i komfortowo wygodną wewnętrzną częścią podeszwy. Buty mają logo adidas Trefoil na górnym pasku, więc zachowujesz sportowy wygląd nawet podczas relaksu.', '', 'adilette-lite-slides', '', '', '', 'Adilette Lite Slides', '', '', '', ''),
(454, 1, 1, 'There\'s bold, and then there are these adidas OZWEEGO Knit Shoes. Understandable since they take their inspiration from the \'90s and early 2000s — the eras of not just doing things, but doing things differently. The statement trainers are crafted in a mash-up of materials, all riding on the undeniable comfort of Adiprene cushioning doubled-up with an EVA midsole.', '', 'ozweego-knit-shoes', '', '', '', 'OZWEEGO Knit Shoes', '', '', '', ''),
(455, 1, 1, 'Nie zawsze możesz uciec z miasta, ale zawsze możesz czerpać inspirację z natury. Łącząc płynne linie występujące w świecie przyrody z komfortem zapożyczonym od sławnych butów do biegania z lat 90., te buty adidas sprawiają, że każdy krok jest bardziej harmonijny. Zostaw codzienny chaos za sobą. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'retropy-adisuper-shoes', '', '', '', 'Retropy Adisuper Shoes', '', '', '', ''),
(456, 1, 1, 'Wybierz styl i wygodę, które dają te buty adidas. Czerpiąc inspirację z kultowych sneakerów Response z początku XXI wieku, ten nowoczesny model łączy sportowy design z pluszowymi detalami. Liczne nakładki i akcenty w kontrastowych kolorach nadają całości luksusowy look o silnym rodowodzie adidas. Obszerna cholewka z siateczki zapewnia właściwy przepływ powietrza przy stopie, bez względu na to, gdzie zaprowadzi Cię dzień. Podeszwa środkowa z pianki EVA i gumowa podeszwa zewnętrzna dbają o lekką amortyzację i przyczepność. Wybierz ten model, aby zapewnić sobie wygodę i styl retro. \n\nTen produkt został wykonany co najmniej w 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-response-cl', '', '', '', 'Buty Response CL', '', '', '', ''),
(457, 1, 1, 'Wybierz buty adidas, które są dowodem na to, że inspirowane bieganiem modele mogą również stanowić deklarację stylu. Model o eklektycznym designie z warstwowymi, zwierzęcymi wzorami jest autentyczną reedycją wersji z lat 80. od pięty po palce. Lata 80, zwierzęcy wzór, adidas Originals i sportowy styl. Dwie najbardziej kultowe kombinacje.', '', 'zx-5020-shoes', '', '', '', 'ZX 5020 Shoes', '', '', '', ''),
(458, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(459, 1, 1, 'Buty hikingowe adidas Terrex Skychaser stworzone z myślą o szybkich ruchach na szlaku i poza nim są przepustką do szybkich wędrówek i trudnych wspinaczek na szczyt. Buty inspirowane biegami przełajowymi mają ultralekką amortyzację Lightstrike, która zapewnia sprężystość i zwinną pracę nóg. Membrana GORE-TEX nie przepuszcza wilgoci, pozwalając jednocześnie stopom oddychać i regulując temperaturę. Wzmocniona płytka w podeszwie środkowej zwiększa stabilizację podczas wspinaczki po kamienistych nawierzchniach, dzięki czemu pewnie robisz każdy krok, a odporna na przetarcia siateczka gwarantuje trwałość butów. Strefa z gumy Stealth Hf zapewnia przyczepność na skałach, która sprawdzi się podczas wspinaczki po skałach i górach.', '', 'terrex-skychaser-xt-gore-tex-hiking-shoes', '', '', '', 'Terrex Skychaser XT GORE-Tex Hiking Shoes', '', '', '', ''),
(460, 1, 1, 'Buty Prime X 2 Strung, stworzone z wykorzystaniem innowacyjnej technologii i zaprojektowane bez konieczności przestrzegania globalnych ograniczeń wynikających z przepisów dotyczących konkurencji biegowych, oferują jeszcze lepsze parametry techniczne designu wyścigowego. Tekstylna, innowacyjna cholewka STRUNG bazuje na danych pozyskanych od sportowców i przekształconych w dynamiczny materiał dostosowany do ich potrzeb. Prime X 2 Strung ma również 3 warstwy LIGHTSTRIKE PRO o łącznej grubości 50 mm. Zupełnie nowy rdzeń dodający energii między dwiema warstwami pianki pomaga zmniejszyć wagę i zapewnia sprężystość w przedniej i środkowej części stopy, dzięki czemu możesz ścigać się z własną życiówką. Podeszwa zewnętrzna z mieszanki Continental zapewnia doskonałą przyczepność na różnych nawierzchniach.', '', 'buty-adizero-prime-x-20-strung', '', '', '', 'Buty Adizero Prime X 2.0 STRUNG', '', '', '', ''),
(461, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Oddychająca membrana GORE-TEX zapewnia suchy komfort stopom, gdy pluskasz się w kałużach. Podeszwa środkowa BOOST jest najlżejsza jak do tej pory — lekka pianka BOOST — zwraca więcej energii niż kiedykolwiek, zapewniając Ci siłę podczas mżawki i ulewy. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(462, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy-fg', '', '', '', 'Buty PREDATOR ACCURACY+ FG', '', '', '', ''),
(463, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(464, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(465, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie, które sprawiają wrażenie lżejszych niż powietrze, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a giętka wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-sg', '', '', '', 'Buty X Crazyfast+ SG', '', '', '', ''),
(466, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(467, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II FG', '', '', '', ''),
(468, 1, 1, 'Nie da się uderzyć tego, czego nie widać. Dzięki butom bokserskim adidas Box Hog będziesz tańczyć na ringu za sprawą lekkiej cholewki z siateczki, supercienkiej podeszwy środkowej z pianki EVA i przyczepnej gumowej podeszwy zewnętrznej. Średniowysoki profil i wewnętrzne wzmocnienia zapewniają stabilizację, gdy osiągasz najwyższy poziom pracy nóg.', '', 'box-hog-20-boots', '', '', '', 'Box Hog 2.0 Boots', '', '', '', ''),
(469, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(470, 1, 1, 'Zmień zasady gry w butach piłkarskich X Crazyfast+ FG do gry na naturalnych nawierzchniach. Buty stworzone, aby zapewniać poczucie wyjątkowej lekkości, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-fg', '', '', '', 'Buty X CRAZYFAST+ FG', '', '', '', ''),
(471, 1, 1, 'Uniwersalne niczym multi-tool buty hikingowe adidas Terrex zapewniają trwałość i funkcjonalność w każdym terenie. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody, pozwala stopom oddychać i gwarantuje im wygodę w każdych warunkach. Lekki, a jednocześnie wytrzymały model pozwoli Ci szybko stawić czoła wielu przygodom. Podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną przyczepność w każdych warunkach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-swift-r2-gore-tex-hiking', '', '', '', 'Buty Terrex Swift R2 GORE-TEX Hiking', '', '', '', ''),
(472, 1, 1, 'Zmień zasady gry w butach piłkarskich X Crazyfast+ FG do gry na naturalnych nawierzchniach. Buty stworzone, aby zapewniać poczucie wyjątkowej lekkości, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-fg', '', '', '', 'Buty X CRAZYFAST+ FG', '', '', '', ''),
(473, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niesznurowane buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-sg', '', '', '', 'Buty Predator Accuracy+ SG', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(474, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(475, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(476, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te niesznurowane buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-laceless-sg', '', '', '', 'Buty X Crazyfast.1 Laceless SG', '', '', '', ''),
(477, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(478, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy-fg', '', '', '', 'Buty PREDATOR ACCURACY+ FG', '', '', '', ''),
(479, 1, 1, 'Znajdź swój rytm w dobrym stylu dzięki butom Earthlight z kolekcji adidas by Stella McCartney, które są równie efektowne jak efektywne. \n\nButy będące doskonałym wyborem na miejskie biegi na dystansie do 10 km mają przyczepną, gumową podeszwę zewnętrzną o unikalnym designie. Została zaprojektowana tak, aby zapewniać optymalne wsparcie przy wybiciu do przodu i płynne przetaczanie stopy podczas pokonywania kolejnych kilometrów. \n\nCholewka z przewiewnej siateczki gwarantuje chłód podczas biegu, a podeszwa środkowa z pianki EVA wspiera każdy Twój krok. \n\nAby zyskać jak najlepszy efekt, zestaw buty z innymi modelami z kolekcji adidas by Stella McCartney.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% składu przędy stanowi poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-earthlight-mesh-shoes', '', '', '', 'adidas by Stella McCartney Earthlight Mesh Shoes', '', '', '', ''),
(480, 1, 1, 'Najnowsza, jedenasta odsłona butów adidas Boston widziana oczami Y-3 prezentuje charakterystyczną, potrójnie czarną kolorystykę. Perspektywa Y-3 jest wyraźnie widoczna na butach sportowych za sprawą przeszyć i detali z nici, które ozdabiają zewnętrzną stronę buta — niepowtarzalny znak Yohjiego Yamamoto. Podpis Yamamoto widnieje na drugiej stronie. Y-3 maluje klasyczne 3 paski, burząc oczekiwaną estetykę. Funkcjonalne i techniczne, lekkie i trwałe buty do biegania mają zaawansowaną amortyzację Lightstrike i ENERGYRODS, które pomagają ograniczyć utratę energii.', '', 'y-3-boston-11-shoes', '', '', '', 'Y-3 Boston 11 Shoes', '', '', '', ''),
(481, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niesznurowane buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-sg', '', '', '', 'Buty Predator Accuracy+ SG', '', '', '', ''),
(482, 1, 1, 'W tym sezonie stylowa kolekcja adidas by Stella McCartney przypomina nam o radości, jaką daje ruch na łonie natury. Techniczne detale łączą się z modnymi, inspirowanymi Ziemią motywami ― od psychodelicznych drzew i kamuflażowych wzorów po wzory słojów w przekroju drzewa. Kolekcja oddaje hołd niezrównanemu pięknu przyrody, inspirując Cię do przeniesienia treningu na świeże powietrze. \n\nWysokowydajne buty w modnym stylu. Przedstawiamy buty ULTRABOOST 23 — Twój nowy ulubiony towarzysz codziennych biegów. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Buty ze wspierającą cholewką z siateczki w modnych kolorach pomogą Ci się subtelnie wyróżnić, gdy pokonujesz kolejne kilometry.', '', 'adidas-by-stella-mccartney-ultraboost-speed', '', '', '', 'adidas by Stella McCartney ULTRABOOST SPEED', '', '', '', ''),
(483, 1, 1, 'Kiedy wychodzimy na zimną pogodę, ważne jest, by zachować ciepło i suchy komfort stóp. Nie musisz się martwić o chłód, wybierz TERREX FREE HIKER 2 COLD. RDY. Podeszwa zewnętrzna z gumy Continental™ zapewnia niezawodną przyczepność na każdym kroku. Dzięki membranie GORE-TEX, która gwarantuje Twoim stopom suchy komfort, oraz piance BOOST amortyzującej każdy krok, chłód już nie stanowi problemu.', '', 'terrex-free-hiker-2-coldrdy', '', '', '', 'TERREX FREE HIKER 2 COLD.RDY', '', '', '', ''),
(484, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(485, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(486, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie bez sznurowadeł do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-ag', '', '', '', 'Buty Predator Accuracy+ AG', '', '', '', ''),
(487, 1, 1, 'Od błotnistych górskich szlaków po wilgotne, leśne runo ― eksploruj każde miejsce dzięki wodoodpornej ochronie za sprawą tych butów hikingowych adidas. GORE-TEX odprowadza wodę, pozwalając jednocześnie Twoim stopom oddychać. Lekka amortyzacja z pianki EVA w połączeniu z wyjątkowo przyczepną gumą dodadzą Ci pewności na każdym szlaku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-eastrail-gore-tex-hiking', '', '', '', 'Buty Terrex Eastrail GORE-TEX Hiking', '', '', '', ''),
(488, 1, 1, 'Niezależnie od tego, co dźwigasz, te buty adidas do podnoszenia ciężarów zapewniają Ci komfort. Lekka, lecz mocna płócienna cholewka ma wstawki z siateczki o dużych oczkach, które zwiększają przewiewność. Połączenie paska i sznurowadeł zabezpiecza śródstopie, a podwyższona podeszwa środkowa gwarantuje solidną stabilizację przy dużym obciążeniu. Od spodu gumowa podeszwa zewnętrzna trzyma się maty, dając Ci dobry punkt zaczepienia.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-powerlift-5-weightlifting', '', '', '', 'Buty Powerlift 5 Weightlifting', '', '', '', ''),
(489, 1, 1, 'Poczuj płynność biegu w butach do biegania Ultra 4DFWD. Łączą cholewkę naszych kultowych butów Ultraboost z podeszwą środkową adidas 4DFWD z nadrukiem 3D, która została udoskonalona tak, aby kompresja do przodu zmniejszała siłę hamowania i przekształcała energię uderzenia w ruch naprzód. Gwarantuje to płynne przetoczenie stopy i wyjątkowe wrażenia niczym podczas szybowania. Cholewka adidas PRIMEKNIT otula stopę, zapewniając jej dynamiczne wsparcie w strategicznych obszarach, a podeszwa zewnętrzna z gumy Continental™ zwiększa przyczepność w każdych warunkach pogodowych.', '', 'ultra-4dfwd-shoes', '', '', '', 'Ultra 4DFWD Shoes', '', '', '', ''),
(490, 1, 1, 'Inspiracja, która doprowadziła do powstania tych butów hikingowych z kolekcji adidas by Stella McCartney, jest oczywista — to sprzęt górski. Sznurowadła ze sznurka do wspinaczki bezpiecznie i wygodnie blokują stopy. Dodaj do tego mocną podeszwę zewnętrzną, a zyskasz pewność siebie na każdym kroku. A skoro już mowa o nieprzewidywalności na łonie natury, to wodoodporna cholewka z siateczki sprawia, że możesz ruszać na podbój przygody, nawet gdy zmienia się pogoda. W tych butach niemal nic Cię nie powstrzyma.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'adidas-by-stella-mccartney-seeulater-shoes', '', '', '', 'adidas by Stella McCartney Seeulater Shoes', '', '', '', ''),
(491, 1, 1, 'Buty, które zadebiutowały w 1979 roku jako model dla topowych piłkarzy ręcznych, cieszą się teraz popularnością ze względu na swój klasyczny design. Ta wersja została wyposażona w delikatną w dotyku cholewkę z nubuku. Miękka podeszwa zewnętrzna z gumy pozostaje wierna swoim archiwalnym korzeniom.', '', 'buty-handball-spezial', '', '', '', 'Buty Handball Spezial', '', '', '', ''),
(492, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na sztucznej trawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-pilkarskie-x-crazyfast1-ag', '', '', '', 'Buty piłkarskie X Crazyfast.1 AG', '', '', '', ''),
(493, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na sztucznej trawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-pilkarskie-x-crazyfast1-ag', '', '', '', 'Buty piłkarskie X Crazyfast.1 AG', '', '', '', ''),
(494, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(495, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy1-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 FG', '', '', '', ''),
(496, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(497, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy1-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 FG', '', '', '', ''),
(498, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-sg', '', '', '', 'Buty Predator Accuracy.1 SG', '', '', '', ''),
(499, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(500, 1, 1, 'Eksploruj świat w tych lekkich butach hikingowych adidas na cały dzień. Błotniste szlaki czy kamieniste wspinaczki nie powstrzymają Cię w tych wygodnych butach na wędrówki. Podeszwa zewnętrzna Traxion została stworzona z myślą o trudnym terenie, a mocna, odporna na przetarcia siateczka ochroni Twoje stopy na szlaku lub na spacerze po lesie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'eastrail-20-hiking-shoes', '', '', '', 'Eastrail 2.0 Hiking Shoes', '', '', '', ''),
(501, 1, 1, 'Powstały z myślą o koszykówce, ale bardzo szybko zadomowiły się w świecie hip-hopu i skateboardingu. Klasyczne, skórzane Superstary odmieniły modę miejską, gdy po raz pierwszy opuściły koszykarski parkiet. Ząbkowane 3 paski, kultowa osłona palców w kształcie muszli i charakterystyczne logo sprawiają, że jest to jedna z gwiazd Originals.', '', 'buty-superstar', '', '', '', 'Buty Superstar', '', '', '', ''),
(502, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie, które sprawiają wrażenie lżejszych niż powietrze, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a giętka wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-sg', '', '', '', 'Buty X Crazyfast+ SG', '', '', '', ''),
(503, 1, 1, 'W butach adidas Superstar chodzi o indywidualność. Buty adidas AdiFOM SST nie boją się przełamywać schematów, czerpią inspirację z przeszłości i dostosowują ją do współczesnego stylu miejskiego. Krój butów i konstrukcja z ekologicznej pianki wybiegają w przyszłość, a kultowa osłona palców w kształcie muszli oddaje hołd ich historii. Załóż skarpetki, aby zyskać idealny komfort, a miękka pianka zajmie się resztą.\n\nTen produkt został stworzony z naturalnych i odnawialnych materiałów, a więc jest jednym z elementów naszej walki z plastikowymi odpadami.', '', 'buty-adifom-sst-boot', '', '', '', 'Buty AdiFOM SST Boot', '', '', '', ''),
(504, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(505, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl', '', '', '', 'ADIZERO SL', '', '', '', ''),
(506, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX mokre, śliskie nawierzchnie nie stanowią problemu. Wodoodporny, oddychający GORE-TEX pomaga Ci pokonywać kolejne kilometry w wilgotne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia odpowiednią przyczepność na każdym kroku. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(507, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(508, 1, 1, 'Ciesz się komfortem i pewnością siebie podczas pierwszego maratonu lub swobodnego biegu po okolicy. Te buty do biegania adidas zostały zaprojektowane zarówno dla początkujących, jak i dla zapalonych biegaczy. Podeszwa środkowa Dreamstrike+ została stworzona z myślą o komforcie, a pręty wspierające prowadzą stopę, gwarantując płynne przetoczenie stopy na wyższy poziom. Wycięcia w podeszwie zewnętrznej zmniejszają wagę, dzięki czemu możesz skoncentrować się na treningu. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-supernova-rise', '', '', '', 'Buty Supernova Rise', '', '', '', ''),
(509, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(510, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-sg', '', '', '', 'Buty Predator Accuracy.1 SG', '', '', '', ''),
(511, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nNie pozwól, by spadająca temperatura powstrzymała Cię przed długim biegiem. Buty Adistar COLD.RDY dbają o ciepły komfort stóp kilometr po kilometrze dzięki izolacji COLD.RDY. Dwa rodzaje pianki tworzą podeszwę środkową o podwójnej gęstości, która amortyzuje i wspiera każdy krok, aby pomóc Ci dotrzeć dalej niż sądzisz, że to możliwe. Wodoodporna cholewka i wyjątkowo mocna podeszwa zewnętrzna z gumy Continental™ dodadzą Ci pewności siebie w każdych warunkach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-adistar-coldrdy', '', '', '', 'Buty Adistar COLD.RDY', '', '', '', ''),
(512, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niskie buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-low-ag', '', '', '', 'Buty Predator Accuracy.1 Low AG', '', '', '', ''),
(513, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niskie buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-low-ag', '', '', '', 'Buty Predator Accuracy.1 Low AG', '', '', '', ''),
(514, 1, 1, 'W tym sezonie stylowa kolekcja adidas by Stella McCartney przypomina nam o radości, jaką daje ruch na łonie natury. Techniczne detale łączą się z modnymi, inspirowanymi Ziemią motywami ― od psychodelicznych drzew i kamuflażowych wzorów po wzory słojów w przekroju drzewa. Kolekcja oddaje hołd niezrównanemu pięknu przyrody, inspirując Cię do przeniesienia treningu na świeże powietrze. \n\nWysokowydajne buty w modnym stylu. Przedstawiamy buty ULTRABOOST 23 — Twój nowy ulubiony towarzysz codziennych biegów. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Buty ze wspierającą cholewką z siateczki w modnych kolorach pomogą Ci się subtelnie wyróżnić, gdy pokonujesz kolejne kilometry.', '', 'adidas-by-stella-mccartney-ultraboost-speed', '', '', '', 'adidas by Stella McCartney ULTRABOOST SPEED', '', '', '', ''),
(515, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-ag', '', '', '', 'Buty Predator Accuracy.1 AG', '', '', '', ''),
(516, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te niesznurowane buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-laceless-sg', '', '', '', 'Buty X Crazyfast.1 Laceless SG', '', '', '', ''),
(517, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast3-ll-fg', '', '', '', 'Buty X CRAZYFAST.3 LL FG', '', '', '', ''),
(518, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia.', '', 'buty-predator-accuracy1-l-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 L FG', '', '', '', ''),
(519, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia.', '', 'buty-predator-accuracy1-l-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 L FG', '', '', '', ''),
(520, 1, 1, 'Buty hikingowe adidas Terrex Skychaser stworzone z myślą o szybkich ruchach na szlaku i poza nim są przepustką do szybkich wędrówek i trudnych wspinaczek na szczyt. Buty inspirowane biegami przełajowymi mają ultralekką amortyzację Lightstrike, która zapewnia sprężystość i zwinną pracę nóg. Membrana GORE-TEX nie przepuszcza wilgoci, pozwalając jednocześnie stopom oddychać i regulując temperaturę. Wzmocniona płytka w podeszwie środkowej zwiększa stabilizację podczas wspinaczki po kamienistych nawierzchniach, dzięki czemu pewnie robisz każdy krok, a odporna na przetarcia siateczka gwarantuje trwałość butów. Strefa z gumy Stealth Hf zapewnia przyczepność na skałach, która sprawdzi się podczas wspinaczki po skałach i górach.', '', 'terrex-skychaser-xt-gore-tex-hiking-shoes', '', '', '', 'Terrex Skychaser XT GORE-Tex Hiking Shoes', '', '', '', ''),
(521, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(522, 1, 1, 'Ponadczasowy charakter. Wyluzowany klimat. Uniwersalność na co dzień. Od ponad 50 lat buty adidas Stan Smith pozostają ikoną stylu. Ta wersja zyskała nową konstrukcję, która jest wynikiem zobowiązania adidas, aby w procesie produkcyjnym wykorzystywać wyłącznie poliester pochodzący z recyklingu do 2024 roku. Mając wegańską cholewkę i podeszwę zewnętrzną z gumy pochodzącej z recyklingu, wciąż są kultowe, a ponadto powstały z myślą o planecie.\n\nButy są wykonane z wegańskich zamienników komponentów lub materiałów pochodzenia zwierzęcego. Ten produkt jest też wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka w 50% wykonana z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'stan-smith-shoes', '', '', '', 'Stan Smith Shoes', '', '', '', ''),
(523, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(524, 1, 1, 'Kontrola, precyzja, osiągi. W czasie treningu lub meczu te buty tenisowe adidas zapewniają amortyzację i stabilizację, których potrzebujesz. Podeszwa środkowa Bounce łączy komfort z elastycznością, a Torsion System oznacza wsparcie, gdy przemierzasz kort. Daj z siebie wszystko podczas wymiany piłek, wiedząc że Adituff chroni palce i przednią część stopy. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'courtjam-control-clay-tennis-shoes', '', '', '', 'CourtJam Control Clay Tennis Shoes', '', '', '', ''),
(525, 1, 1, 'Świętujemy trwały ślad, jaki Lionel Messi na odcisnął w świecie piłki nożnej. Te buty mają półprzezroczystą cholewkę Aeropacity Speedskin z akcentami w kolorze charakterystycznego dla Argentyny błękitu i srebra inspirowanego pucharami oraz wzmocnienia tam, gdzie są one najbardziej potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci prędkości godnej G.O.A.T. na naturalnej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-x-crazyfast-messi1-fg', '', '', '', 'Buty X Crazyfast Messi.1 FG', '', '', '', ''),
(526, 1, 1, 'Co mają ze sobą wspólnego dżinsy rurki i zwiewne spódniczki? Jedno i drugie wspaniale wygląda z modnymi butami adidas Nizza na platformie. Zrób krok naprzód, wyjdź na ulicę i nadaj każdemu strojowi styl wysokich lotów. Nawet jeśli tylko spacerujesz bez celu po mieście.', '', 'nizza-platform-shoes', '', '', '', 'Nizza Platform Shoes', '', '', '', ''),
(527, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-ag', '', '', '', 'Buty Predator Accuracy.1 AG', '', '', '', ''),
(528, 1, 1, 'Łatwiej osiągnąć swoje cele treningowe, gdy masz parę sprawdzonych, wygodnych butów na co dzień. \n\nPoznaj buty Solarboost 5. Model, który zapewnia równowagę między wsparciem, amortyzacją i zwrotem energii, łączy sprężystą piankę Light BOOST z przewiewną cholewką z siateczki. System Linear Energy Push dodaje Ci energii na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-solarboost-5', '', '', '', 'Buty Solarboost 5', '', '', '', ''),
(529, 1, 1, 'Buty adidas Retropy F2, nawiązując do przeszłości, odkrywają nostalgię za sprawą futurystycznego spojrzenia. Zainspirowaliśmy się klasycznym stylem biegowym z lat 80., a następnie wzbogaciliśmy design o nowe proporcje i akcenty, które naprawdę robią wrażenie. Poza tym nie bez powodu te buty staną się Twoim ulubionym strojem na co dzień — mocna, tekstylna cholewka i amortyzowana podeszwa środkowa z pianki EVA wspierają Twoje ruchy w pełnym komforcie.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'retropy-f2-shoes', '', '', '', 'Retropy F2 Shoes', '', '', '', ''),
(530, 1, 1, 'Przy każdej pogodzie. Na każdej nawierzchni. Buty do kolarstwa górskiego adidas Five Ten stworzone z myślą o wyprawach przełajowych i nieuczęszczanych drogach mają lekką, amortyzowaną konstrukcję typową dla butów do biegów przełajowych. Wodoodporna, oddychająca membrana GORE-TEX zapewnia stopom suchy komfort na mokrych nawierzchniach. Guma Stealth® Phantom zapewnia przyczepność do pedałów na każdym szlaku. Neoprenowe osłony nie przepuszczają brudu i żwiru. Wybieraj mało uczęszczane trasy.', '', 'five-ten-trailcross-gore-tex-mountain-bike-shoes', '', '', '', 'Five Ten Trailcross GORE-TEX Mountain Bike Shoes', '', '', '', ''),
(531, 1, 1, 'Buty adidas Five Ten Trailcross XT do kolarstwa górskiego powstały z myślą o poszukiwaczach przygód i łączą wsparcie techniczne typowe dla butów do biegów przełajowych z detalami dostosowanymi do jazdy na rowerze, co przekłada się na doskonałe połączenie stabilizacji podczas pieszych wycieczek z kontrolą w czasie jazdy na rowerze. Te buty to Twoja przepustka do odkrywania świata: od porzuconych, nieutwardzanych dróg po single-tracki i wspinaczkę poza szlakiem. Guma Stealth Phantom pewnie trzyma się pedałów, ułatwiając Ci jazdę po każdym szlaku. Oddychająca cholewka zapewnia stopom komfort przez cały czas, dzięki czemu możesz jeździć, wędrować, odkrywać i podążać mniej uczęszczaną ścieżką.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'five-ten-trailcross-xt-shoes', '', '', '', 'Five Ten Trailcross XT Shoes', '', '', '', ''),
(532, 1, 1, '1994 rok. Po raz pierwszy na boisku dostrzeżono nowe buty piłkarskie adidas. Natychmiast powstaje klasyka. Buty piłkarskie Predator Elite FT FG z limitowanej edycji to ukłon w stronę pamiętnych dni. W ramach prawdziwego potwierdzenia ich wyjątkowości dostępnych jest tylko 1994 par, z których każda ma niepowtarzalny numer.\n\nSą tu wszystkie unikalne cechy, które sprawiły, że buty adidas Predator stały się legendą, w tym charakterystyczne, przyczepne gumowe elementy zapewniające lepszą kontrolę nad piłką i odświeżona podeszwa zewnętrzna Hybridtouch2.0 do gry na naturalnej nawierzchni, gwarantująca jeszcze większą stabilizację. Kontroluj tempo gry i dominuj na boisku w ekskluzywnych butach piłkarskich adidas Predator.\n\nTen produkt został wykonany częściowo z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które mają na celu zmniejszenie ilości odpadów i śladu węglowego wytwarzanych przez nas produktów.', '', 'buty-predator-elite-ft-fg', '', '', '', 'Buty Predator Elite FT FG', '', '', '', ''),
(533, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(534, 1, 1, 'Te buty Y-3 stanowią nową odsłonę nowoczesnego kodu modowego i bazują na jednym z najbardziej wpływowych modeli sneakerów koszykarskich lat 80. — adidas Rivalry. Pozostają bliskie oryginałowi i stanowią wyrafinowany akcent koszykarski za sprawą cholewki z luksusowego nubuku wykończonej gładką skórą i neoprenowymi detalami.', '', 'buty-y-3-rivalry', '', '', '', 'Buty Y-3 Rivalry', '', '', '', ''),
(535, 1, 1, 'Od drzwi Twojego domu po szlak i z powrotem buty TERREX SOULSTRIDE FLOW są Twoim partnerem podczas długich przygód w outdoorze. Buty do biegów przełajowych z miękką amortyzacją z lekkiej pianki EVA powstały, aby zapewnić Ci swobodę ruchu. Podeszwa zewnętrzna z gumy Continental™ doskonale trzyma się korzeni, kamieni i ziemi, a cholewka z siateczki o specjalnej konstrukcji gwarantuje optymalny podział na strefy, przewiewność, elastyczność i idealne dopasowanie.', '', 'terrex-soulstride-flow-trail-running-shoes', '', '', '', 'TERREX Soulstride Flow Trail Running Shoes', '', '', '', ''),
(536, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(537, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(538, 1, 1, 'Spójność to klucz do sukcesu. Nie rezygnuj z biegania w butach do biegania adidas stworzonych z myślą o komforcie i wsparciu, które robią różnicę. Podeszwa środkowa Dreamstrike+ amortyzuje każde lądowanie. Mocna podeszwa zewnętrzna Adiwear zapewnia niezawodną przyczepność. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-supernova-rise', '', '', '', 'Buty Supernova Rise', '', '', '', ''),
(539, 1, 1, 'Trawers po górskim szczycie. Wspinaczka po głazach. Wielodniowa wędrówka. W butach hikingowych adidas Terrex do kostki świat stoi przed Tobą otworem. Wodoodporna, oddychająca konstrukcja GORE-TEX i lekki, a jednocześnie mocny design ułatwiają eksplorację i poruszanie się w górach ze zwinnością inspirowaną butami do biegania. BOOST zapewnia stabilizację i energię na każdym kroku, a otulająca stopę cholewka wspiera precyzyjną pracę nóg w technicznym terenie. Zintegrowana płytka chroniąca przed kamieniami stanowi zabezpieczenie na skalistych szlakach. Guma Continental™ pozwala Ci pewnie przemierzać strumienie i bezpiecznie zejść ze szlaku. Zasznuruj te buty i ruszaj na podbój odległych szczytów.', '', 'terrex-skychaser-mid-gore-tex-hiking-shoes-20', '', '', '', 'Terrex Skychaser Mid GORE-TEX Hiking Shoes 2.0', '', '', '', ''),
(540, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci grać z klasą na mokrej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-sg', '', '', '', 'Buty Copa Pure II SG', '', '', '', ''),
(541, 1, 1, 'Buty Adistar CS 2.0 zostały zaprojektowane, aby przenieść Twój codzienny bieg na wyższy poziom. Buty do biegania, które zrodziły się z idei perpetuum mobile, wspierają rytmiczny bieg, który pomoże Ci osiągnąć wyznaczone cele. Mają podeszwę środkową REPETITOR+ o zwiększonej gęstości, która stabilizuje każdy krok i wspiera płynne przetoczenie stopy pomiędzy krokami. Asymetryczny system sznurowania łączy się ze stabilną ramą Repetitor Plus i wzmocnioną warstwą siateczki, aby zapewnić Ci stabilizację na każdym kroku. Dodaj do tego specjalną geometrię buta i ruszaj przed siebie, aby pobić życiówkę.', '', 'buty-adistar-cs-20', '', '', '', 'Buty Adistar CS 2.0', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(542, 1, 1, 'Od niezobowiązujących spacerów po weekendowe wycieczki – buty hikingowe TERREX WMN RAIN.RDY zostały zaprojektowane przez kobiety dla kobiet. Wygodny, elastyczny kołnierz zapewnia komfort i wsparcie przy każdym ruchu. Podeszwa zewnętrzna z gumy Continental zapewnia doskonałą przyczepność na każdym terenie. Zachowaj suchy komfort dzięki wodoodpornej technologii RAIN.RDY. Te buty zawierają co najmniej 50% materiałów pochodzących z recyklingu i są naszą pomocą w walkę z zanieczyszczeniem plastikiem.', '', 'terrex-wmn-mid-rainrdy-hiking-shoes', '', '', '', 'TERREX WMN MID RAIN.RDY Hiking Shoes', '', '', '', ''),
(543, 1, 1, 'Przygody w outdoorze już na Ciebie czekają, a wodoodporne buty hikingowe adidas Terrex pomogą Ci odkrywać świat: ten bliski i ten daleki. Ich uniwersalny, sportowy design jest wystarczająco lekki, aby sprostać codziennym wędrówkom, i wystarczająco techniczny, aby wytrzymać trudy górskiej wspinaczki czy przejścia via ferrata. Ten model wspiera Twoje stopy lekkim, a jednocześnie mocnym i stabilnym designem, który ułatwia koncentrację na szlaku. Wodoodporny, oddychający GORE-TEX nie przepuszcza wody i błota, pozwalając jednocześnie stopom oddychać. Język z klinem i mankiet do kostki otulają stopę i nie przepuszczają kurzu ani brudu, gwarantując komfort inspirowany butami do biegania. Przyczepność gumy Continental™ w każdych warunkach oznacza, że możesz pewnie poruszać się po kamienistych zboczach, mokrych korzeniach i piaszczystych trasach. A więc załóż te buty i ruszaj w drogę.', '', 'terrex-ax4-mid-gore-tex-hiking-shoes', '', '', '', 'Terrex AX4 Mid GORE-TEX Hiking Shoes', '', '', '', ''),
(544, 1, 1, 'Nawiązując do adidas Rivalry, jednego z najbardziej wyrazistych designów koszykarskich z lat 80., ten model Y-3 na nowo interpretuje reguły modowe. Model pozostaje bliski oryginałowi, stanowiąc wyrafinowaną wersję koszykarskiego designu za sprawą gładkiej, skórzanej cholewki i skórzanych 3 pasków na bokach.', '', 'y-3-rivalry', '', '', '', 'Y-3 Rivalry', '', '', '', ''),
(545, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-sg', '', '', '', 'Buty X Crazyfast.1 SG', '', '', '', ''),
(546, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Innowacyjna podeszwa środkowa adidas 4D z nadrukiem 3D i nową konstrukcją przypominającą kratownicę przekształca siły uderzenia w ruch do przodu wspierana przez nadzwyczajną przyczepność podeszwy zewnętrznej z gumy Continental™. Cholewka z lekkiej, oddychającej monosiateczki z kołnierzem PRIMEKNIT wokół kostki gwarantuje stopom komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(547, 1, 1, 'Wynieś swój bieg na wyższy poziom dzięki tym butom do biegania adidas. Buty nazwane na cześć rewolucyjnej podeszwy środkowej drukowanej w technologii 3D pochłaniają siłę uderzenia i dodają Ci przyspieszenia na każdym kroku. Cholewka adidas Primeknit otula Twoją stopę, zapewniając przewiewny komfort i wspierając naturalne ruchy na ulicach miasta. Podeszwa zewnętrzna z gumy Continental™ gwarantuje przyczepność, dzięki czemu możesz biegać w deszczu lub słońcu. Niezależnie od tego, czy trenujesz na dystansie 5 kilometrów, czy po prostu biegniesz, ile sił w nogach, buty 4DFWD uprzyjemnią Ci każdy bieg.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(548, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(549, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(550, 1, 1, 'Stworzone, by uzupełniać Twoje umiejętności na hali. Niezależnie od tego, jak grasz, buty adidas Court Team Bounce 2.0 zapewnią Ci komfort dzięki podeszwie środkowej Bounce na całej długości. Wzmocniona, dwuwarstwowa cholewka z siateczki owija się wokół stopy, blokując ją, gwarantując dodatkową stabilizację podczas ruchu na boki. Od spodu przyczepna, gumowa podeszwa zewnętrzna sprawi, że wyróżnisz się podczas gry, ale nie pozostawisz po sobie śladu na parkiecie.', '', 'court-team-bounce-20-shoes', '', '', '', 'Court Team Bounce 2.0 Shoes', '', '', '', ''),
(551, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(552, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Buty w kultowym stylu zapewniają pewny kontakt dzięki pikowanej przedniej części stopy ze skóry Fusionskin z subtelną mikroteksturą. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II. FG', '', '', '', ''),
(553, 1, 1, 'Buty Copa powstały z myślą o grze. Są wykonane z elastycznych materiałów, które zapewniają amortyzację przy kontakcie z piłką i pełną kontrolę w każdej sytuacji.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II. FG', '', '', '', ''),
(554, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-sg', '', '', '', 'Buty X Crazyfast.1 SG', '', '', '', ''),
(555, 1, 1, 'Niezależnie od tego, czy wybierasz się na górski szlak, czy na wypad do ulubionej kawiarni, te buty do biegania adidas zapewnią Ci amortyzację. Podeszwa środkowa Cloudfoam oferuje natychmiastowy komfort, który nigdy się nie kończy, a tekstylna cholewka gwarantuje wsparcie i przewiewność. Gumowa podeszwa zewnętrzna trzyma się nawierzchni w zmiennym terenie, ułatwiając pewny krok.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-tr-shoes', '', '', '', 'Runfalcon 3 TR Shoes', '', '', '', ''),
(556, 1, 1, 'Zdumiewająco lekkie. Bezkompromisowo szybkie. adidas Adizero Adios Pro Evo 1 to nowa klasa butów do biegania, zaprojektowana, aby pomóc ambitnym maratończykom dać z siebie wszystko. Model jest o 40% lżejszy od wszystkich stworzonych przez nas butów do biegania, to zaledwie 138 g czystej innowacji. Pianka Lightstrike Pro łączy się z przełomową technologią podeszwy zewnętrznej, lekką jak piórko siateczką i pierwszym w swoim rodzaju elementem kołyszącym w przedniej części stopy, który został przetestowany laboratoryjnie, aby poprawić ekonomię biegania. Adizero Adios Pro Evo 1 to doskonałe narzędzie do biegania, które pomoże Ci przetrwać cały bieg i dotrzeć do linii mety. Ten model jest gotowy do wyścigu.', '', 'adizero-adios-pro-evo-1', '', '', '', 'Adizero Adios Pro Evo 1', '', '', '', ''),
(557, 1, 1, 'Dla niektórych chłód oznacza odwrót. Ale te buty z kolekcji adidas by Stella McCartney zachęcają do czegoś wręcz przeciwnego: do wyjścia na dwór, cieszenia się niższymi temperaturami i często także spokojem, który się z nimi wiąże. Technologia COLD.RDY niweluje poczucie chłodu, zapewniając Ci suchy komfort, ciepło i pewność siebie. Ruszaj więc na szlak, eksploruj miasto, rób wszystko, na co tylko masz ochotę, bo po to stworzono te śmiałe, ultranowoczesne buty. \n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-coldrdy-winter-boots', '', '', '', 'adidas by Stella McCartney COLD.RDY Winter Boots', '', '', '', ''),
(558, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(559, 1, 1, 'Jedź rowerem. Odkrywaj. Powtarzaj. Buty adidas Five Ten Trailcross Pro Clip-In do jazdy na rowerze górskim, stworzone z myślą o przygodach, zarówno na wąskich dróżkach, jak i na żwirowych drogach, są kompatybilne z technologią clip-in i oferują wyważoną elastyczność, która sprawdzi się podczas jazdy i nie tylko. Model nieco sztywniejszy od standardowego modelu Trailcross wyposażono w BOA® Fit System, który pozwala na precyzyjne i szybkie dopasowanie oraz zapewnia otulające stopę wsparcie. Oddychająca cholewka daje stopom przewiewny i suchy komfort, a neopren w mankietach chroni przed kurzem i brudem. Guma Stealth Marathon zapewnia przyczepność na każdym kroku podczas jazdy na rowerze i pieszych wypraw. Lekka amortyzacja oferuje komfort niczym w butach do biegania przełajowego.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'five-ten-trailcross-pro-clip-in-mountain-biking-shoes', '', '', '', 'Five Ten Trailcross Pro Clip-In Mountain Biking Shoes', '', '', '', ''),
(560, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(561, 1, 1, 'Zamknij za sobą drzwi i ruszaj na podbój przygody. Te buty podejściowe adidas pozwolą Ci poruszać się szybko po szlakach, uprawiać bouldering i wspinaczkę skałkową dzięki wyjątkowo przyczepnej podeszwie zewnętrznej Traxion i stabilizującej podeszwie środkowej, która zapewnia pewny krok. Lekka cholewka z tkaniny ripstop jest odporna na przetarcia, a amortyzacja z pianki EVA nie obciąża stóp.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-swift-solo-20-hiking', '', '', '', 'Buty Terrex Swift Solo 2.0 Hiking', '', '', '', ''),
(562, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-30-shoes', '', '', '', 'Adizero Adios Pro 3.0 Shoes', '', '', '', ''),
(563, 1, 1, 'Buty na wędrówki stworzone z myślą o zimnych, deszczowych dniach zapewnią ciepły i suchy komfort Twoim stopom na szlaku. Mankiet do kostki i wodoodporna konstrukcja nie przepuszczają wilgoci do środka, a izolacja na całej powierzchni zatrzymuje ciepło przy ciele. Przyczepna, gumowa podeszwa zewnętrzna gwarantuje pewny krok na śliskich lub pokrytych lodem nawierzchniach.', '', 'terrex-frozetrack-mid-winter-hiking-shoes', '', '', '', 'Terrex Frozetrack Mid Winter Hiking Shoes', '', '', '', ''),
(564, 1, 1, 'Buty adidas Ligra 7 stworzone z myślą o grze na każdym rodzaju nawierzchni pomogą Ci poprawić wyniki na hali. Gdy zmienia się przebieg gry, ich przewiewna cholewka z siateczki gwarantuje komfort i pewność siebie. Połączenie przyczepnej w różnych kierunkach podeszwy zewnętrznej ze wspierającymi nakładkami zapewnia stabilizację, gdy dajesz z siebie wszystko. Syntetyczna skóra na palcach gwarantuje trwałość.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka wykonana jest w 50% z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'ligra-7-indoor-shoes', '', '', '', 'Ligra 7 Indoor Shoes', '', '', '', ''),
(565, 1, 1, 'Buty Marathon Trail to nowa odsłona klasycznego modelu adidas Marathon widzianego z perspektywy Y-3. Buty będące ukłonem w stronę japońskiej techniki szycia Sashiko mają wyraźne choć stonowane kolorystycznie przeszycia wokół zakładki z oczkami na sznurowadła, naszywki na pięcie, podeszwy środkowej i charakterystycznych 3 pasków. Wszystkie nici w przeszyciach swobodnie zwisają.', '', 'y-3-marathon-trail', '', '', '', 'Y-3 Marathon Trail', '', '', '', ''),
(566, 1, 1, 'Klasyka adidas widziana przez pryzmat Y-3. Słynne buty Gazelle w nowej odsłonie mają wyraźne choć stonowane kolorystycznie przeszycia wokół zakładki z oczkami na sznurowadła, naszywki na pięcie, podeszwy środkowej i charakterystycznych 3 pasków. Wszystkie nici w przeszyciach swobodnie zwisają, nawiązując do japońskiej techniki szycia Sashiko. Mają design z zamszu i otok wokół całej podeszwy zewnętrznej, który lekko zachodzi na zewnętrzny bok, nadając modelowi subtelny, a jednocześnie wyróżniający się look.', '', 'y-3-gazelle', '', '', '', 'Y-3 Gazelle', '', '', '', ''),
(567, 1, 1, 'Stworzone z myślą o błyskawicznej mobilności na pierwszej linii. Najlżejsze, profesjonalne buty do rugby od adidas wyróżniają się przyciągającą wzrok cholewką z tkaniny ripstop. Wewnętrzny system wsparcia zwiększa ich stabilność, co pozwala na skuteczną grę podczas młyna i w polu punktowym. Dzielona podeszwa zewnętrzna z ośmioma kołkami zapewnia elastyczność, której potrzebujesz, aby stawiać czoła wyzwaniom.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'kakari-z1-sg-boots', '', '', '', 'Kakari Z.1 SG Boots', '', '', '', ''),
(568, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(569, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(570, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II FG', '', '', '', ''),
(571, 1, 1, 'Najlepszy widok jest z góry, a buty trekkingowe Terrex Skychaser 2.0 GORE-TEX zostały stworzone, aby pomóc Ci tam dotrzeć. Inspirowane bieganiem buty hikingowe dla tych, którzy chcą poruszać się szybko w technicznym terenie. Zapewniają równowagę między trwałością i doskonałą stabilizacją za sprawą zwracającej energię adidas BOOST, która pomoże Ci iść jeszcze dalej i dotrzeć jeszcze wyżej. Wodoodporny GORE-TEX nie przepuszcza wody, a płytka chroniąca przed kamieniami stanowi zabezpieczenie w skalistym terenie. Zasznuruj otulającą stopę cholewkę i zacznij odkrywać świat.', '', 'terrex-skychaser-20-gore-tex-hiking-shoes', '', '', '', 'Terrex Skychaser 2.0 GORE-TEX Hiking Shoes', '', '', '', ''),
(572, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(573, 1, 1, 'Przygotuj się na każdą wędrówkę. Buty hikingowe adidas Terrex Swift R3 GORE-TEX łączą lekki design i amortyzację butów do biegów przełajowych z uniwersalnością i stabilnością butów hikingowych. \n\nMembrana GORE-TEX zapewnia wodoodporne, oddychające okrycie i ochronę przed zachlapaniem i wilgotnymi szlakami, a formowana wkładka gwarantuje wygodne dopasowanie na każdym kroku. Podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną przyczepność — na leśnym szlaku, podczas górskich wędrówek lub epickiej przygody poza szlakiem.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-terrex-swift-r3-gore-tex-hiking', '', '', '', 'Buty Terrex Swift R3 GORE-TEX Hiking', '', '', '', ''),
(574, 1, 1, 'Buty X Crazyfast Injection.1 FG są znane z tego, że pomagają zawodnikom osiągać maksymalną szybkość i zwinność na boisku, i powstały z myślą o momentach, które decydują o grze.\n\nButy piłkarskie z grafiką w jodełkę mają konstrukcję, która zapewnia niesamowitą szybkość. AEROPACITY SPEEDSKIN zapewnia maksymalną szybkość i optymalne wyczucie piłki, a superlekka cholewka dopasowuje się do stopy, wspierając ją. PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE została zaprojektowana z myślą o dynamicznych ruchach i przyspieszeniu. Konstrukcja kołków optymalizuje przyczepność podczas szybkiego przyspieszania. Cienki, swobodnie ulokowany język i sznurowadła zapewniają regulowane dopasowanie i bezpieczną blokadę stopy podczas gry.\n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-x-crazyfast-injection1-fg', '', '', '', 'Buty X Crazyfast Injection.1 FG', '', '', '', ''),
(575, 1, 1, 'Od ponad dwóch dekad współpraca adidas i Yohjiego Yamamoto jest pionierem w branży, prezentując unikalne podejście do awangardowej odzieży sportowej.\n\nŚwiętując tę współpracę, adidas i Yohji Yamamoto ponownie łączą siły, tworząc nową odsłonę kultowego modelu adidas: Stan Smith.\n\nModel tenisowy w nowej odsłonie, stworzonej z myślą o buntowniczych projektach Yohjiego Yamamoto, po raz pierwszy zaprezentowany na wybiegu w sezonie Jesień/Zima 2023-24 w Paryżu, został wykonany z wysokiej jakości, gładkiej skóry z kontrastowymi detalami.', '', 'yohji-stan', '', '', '', 'Yohji Stan', '', '', '', ''),
(576, 1, 1, 'Spodnie Y-3 Tech Silk Cuffed są ucieleśnieniem elegancji dzięki materiałowi, z którego zostały uszyte, i detalom. Swobodny krój z gładkiego materiału ma elastyczną talię regulowaną sznurkiem, kieszenie na suwak i elastyczne mankiety. Kontrastowe 3 paski uzupełniają całość.', '', 'spodnie-y-3-tech-silk-3-stripes-cuffed', '', '', '', 'Spodnie Y-3 Tech Silk 3-Stripes Cuffed', '', '', '', ''),
(577, 1, 1, 'Zabłyśnij sportowym stylem dzięki dopasowanej koszulce. 3 paski w kontrastowym kolorze wzdłuż obu rękawów przyciągają wzrok. Koszulka ma klasyczny look, który pasuje niemal do wszystkiego ― od dżinsów poprzez spódniczkę tenisową aż po legginsy treningowe.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-slim-3-stripes-tee', '', '', '', 'Essentials Slim 3-Stripes Tee', '', '', '', ''),
(578, 1, 1, 'Miła w dotyku, ciepła i stylowa warstwa okrycia na chłodne dni? To brzmi niemal zbyt dobrze, żeby było prawdziwe. Ta wyściełana kurtka z kolekcji adidas by Stella McCartney została stworzona z myślą o chłodnym powietrzu bez szkody dla dobrego wyglądu. Ma mocną warstwę wierzchnią z tkaniny i technologię WIND.RDY, która chroni przed kaprysami pogody. Podwójne zapięcie na suwaki z przodu i zatrzaski oraz regulowany kaptur ułatwiają zdejmowanie, gdy zdecydujesz, że już nie potrzebujesz tego okrycia. Mnóstwo kieszeni pomieści niezbędne drobiazgi w zasięgu ręki, a regulowany dół i mankiety pozwolą Ci podkreślić sylwetkę. Luźny krój pomieści pod spodem sweter lub szalik.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'kurtka-adidas-by-stella-mccartney-truenature-long-padded', '', '', '', 'Kurtka adidas by Stella McCartney TrueNature Long Padded', '', '', '', ''),
(579, 1, 1, 'Nie ma nic lepszego niż zaufana koszulka. To podstawa każdej garderoby, a ten model zapewnia wygodę i styl. Logo adidas Badge of Sport podkręca look tej koszulki do noszenia na co dzień. Miękka, bawełniana dzianina sprawdzi się w noszeniu przez cały dzień. \n\nKupując nasze produkty z bawełny, wspierasz zrównoważony rozwój sektora bawełnianego.', '', 'essentials-logo-tee-plus-size', '', '', '', 'Essentials Logo Tee (Plus Size)', '', '', '', ''),
(580, 1, 1, 'Wybierz legginsy adidas, które dodadzą Ci pewności siebie. Zabudowana talia i przylegający krój zapewniają Ci wsparcie przez cały dzień, a 3 paski nawiązują do sportowego stylu. Miękka, elastyczna bawełna zapewnia całkowity komfort w domu i w drodze.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-3-stripes-leggings', '', '', '', 'Adicolor Classics 3-Stripes Leggings', '', '', '', ''),
(581, 1, 1, 'Zrób wrażenie, nie rezygnując z komfortu, dzięki sukience adidas Adicolor Classics 3-Stripes o długości maxi. Miękka dzianina z dużą zawartością bawełny zapewnia wygodę i otula ciało. Dekolt w serek i 3 paski wzdłuż rękawów nadają całości sportowy charakter. Ten model doskonale nadaje się do noszenia na co dzień, dzięki czemu Twój styl jest zawsze na czasie.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton sprawia, że globalna produkcja bawełny jest lepsza dla osób, które ją produkują, lepsza dla środowiska, w którym się rozwija, i lepsza dla przyszłości sektora. \n\nBetter Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji znajdziesz tutaj:bettercotton.org/learnmore', '', 'adicolor-classics-3-stripes-maxi-dress', '', '', '', 'Adicolor Classics 3-Stripes Maxi Dress', '', '', '', ''),
(582, 1, 1, 'Ponadczasowy styl i niezrównany komfort termiczny, jaki daje puch. Puchowa kurtka adidas na zimę zapewnia ciepło, które poczujesz, gdy tylko ją zapniesz. Elastyczne mankiety i regulowany dół zatrzymują ciepłe powietrze, gwarantując Ci komfort przez całą zimę. Naciągnij kaptur i ciesz się okryciem. W kieszeniach na suwak ogrzejesz ręce, a klucze i telefon będziesz mieć zawsze pod ręką.', '', 'helionic-hooded-down-jacket', '', '', '', 'Helionic Hooded Down Jacket', '', '', '', ''),
(583, 1, 1, 'Zadbaj o komfort w tych spodniach dresowych adidas. Dopasowany krój ma proste linie, a elastyczna dzianina o podwójnym splocie gwarantuje swobodę ruchu. Długie 3 paski wzdłuż nogawek nawiązują do sportowego dziedzictwa. Uzupełnij swój look o bluzę dresową i kontrastowy, krótki top, aby przygotować się na dzień — niezależnie od tego, co masz w planach. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'spodnie-dresowe-adicolor-sst', '', '', '', 'Spodnie dresowe Adicolor SST', '', '', '', ''),
(584, 1, 1, 'Co to za szafa bez klasycznej koszulki? Ta koszulka adidas nadaje swobodny styl Twojemu codziennemu lookowi, nawiązując do sportowego klimatu OG. Konstrukcja z dzianiny zapewnia miękkie i wygodne dopasowanie, a 3 paski wzdłuż rękawów stanowią akcent w ponadczasowym stylu. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'koszulka-adicolor-classics-3-stripes', '', '', '', 'Koszulka Adicolor Classics 3-Stripes', '', '', '', ''),
(585, 1, 1, 'When it\'s too cool for your shorts, these adidas running pants keep you striding in comfort. AEROREADY wicks moisture so you stay dry as your heart rate rises. Zippered side pockets keep small essentials nearby. When you\'re out before the sun comes up, reflective details shine bright.\n\nThis product is made with at least 70% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.', '', 'own-the-run-joggers', '', '', '', 'Own the Run Joggers', '', '', '', ''),
(586, 1, 1, 'Poszukując inspiracji w outdoorze, Y-3 zgłębiał funkcjonalność i nieprzewidywalność, odnajdując połączenie między tymi dwoma elementami w technicznej estetyce. Spodnie z szerokiego nylonu od Y-3 zostały uszyte z lekkiego, marszczonego nylonu i mają luźny krój. Dzięki sznurkom do regulacji na dole możesz nadać całości swobodny lub obszerny look.', '', 'spodnie-y-3-wide-nylon', '', '', '', 'Spodnie Y-3 Wide Nylon', '', '', '', ''),
(587, 1, 1, 'Długa kurtka adidas Puffed z jasną wizją nowoczesnej mody i progresywnego designu prezentuje nową odsłonę odzieży wierzchniej za sprawą starannie wykonanych wykończeń i wysokiej jakości materiałów. Dbałość o detale jest oczywista dzięki suwakom po bokach, które zapewniają zarówno wentylację oraz dają różne opcje stylizacji, które pozwolą Ci odmienić swój look. Gęsi puch chroni przed chłodem. Puchowe, ściągaczowe panele prezentują odważne proporcje.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'kurtka-puffed-long', '', '', '', 'Kurtka Puffed Long', '', '', '', ''),
(588, 1, 1, 'Załóż te spodnie adidas, aby się rozgrzać przed treningiem, a potem ciesz się swobodą, nosząc je przez resztę dnia. Dopasowany krój nadaje całości sportowy look, a elastyczna talia regulowana sznurkiem zabezpiecza model na swoim miejscu. Całość została uszyta z bawełnianego materiału frotté, który zapewni Ci komfort niezależnie od tego, co przyniesie dzień.', '', 'essentials-3-stripes-french-terry-cuffed-pants', '', '', '', 'Essentials 3-Stripes French Terry Cuffed Pants', '', '', '', ''),
(589, 1, 1, 'Szukasz czegoś w wyrazistym, niezobowiązującym stylu do noszenia na co dzień? Sięgnij po tę koszulkę adidas. Ma proste linie i gładki styl adidas, co sprawia, że doskonale pasuje do spodni dresowych, dżinsów i legginsów.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'loungewear-essentials-slim-logo-tee', '', '', '', 'LOUNGEWEAR Essentials Slim Logo Tee', '', '', '', ''),
(590, 1, 1, 'Jeden z wyróżników stylu adidas — 3 paski — został podkreślony na koszulce z długim rękawem Y-3 Stripes. Koszulka ma luźny krój z miękkiej bawełny wykończony raglanowymi szwami, wkomponowanymi 3 paskami i rozcięciami po bokach.', '', 'y-3-stripes-long-sleeve-tee', '', '', '', 'Y-3 Stripes Long Sleeve Tee', '', '', '', ''),
(591, 1, 1, 'Spodnie Y-3 z grafiką uszyte z materiału frotté zapewniają harmonijną równowagę między modą a sportem. Luźny krój swobodnie układa się na ciele, zapewniając miękki komfort. Całość uzupełnia naszywka z grafiką Y-3.\n\nTen produkt został wykonany z naturalnych i pozyskanych z odnawialnych źródeł materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'spodnie-y-3-graphic-french-terry', '', '', '', 'Spodnie Y-3 Graphic French Terry', '', '', '', ''),
(592, 1, 1, 'adidas Terrex nawiązuje wieloletnią współpracę z japońską awangardową marką outdoorową and wander z myślą o eksplorowaniu relacji łączących ludzkość z naturą. Obie marki łączy zamiłowanie do outdooru, dlatego szukają kreatywnych sposobów na przeniesienie estetyki do współczesnego życia w mieście i przygód na świeżym powietrzu. Marka and wander została założona w 2011 roku w Tokio przez Keitę Ikeuchiego i Mihoko Mori, którzy poznali się, pracując jako projektanci dla Issey Miyake. Ich wiedza o modzie połączona z zamiłowaniem do outdooru podkręca charakter adidas Terrex, dając w rezultacie unikalną kolekcję, w której splata się nowoczesność i funkcjonalność gotowa na górskie szlaki.\n\nWybierz kurtkę adidas, aby móc docenić piękno świata także w chłodne dni. Jej design łączy DNA naszej kurtki XPLORIC z kreatywną wizją japońskiej marki outdoorowej and wander. Liczne kieszenie oznaczają, że masz dużo miejsca na niezbędne drobiazgi, a konstrukcja 3-w-1 oferuje uniwersalne okrycie odpowiednie na chłodne dni. Załóż wewnętrzną kurtkę, aby chronić się przed chłodem i zewnętrzną kurtkę z RAIN.RDY dla osłony przed deszczem. Oba modele noszone rzeczy razem gwarantują maksymalną ochronę przed kaprysami pogody. Jest Twoja i tylko Twoja.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'kurtka-adidas-terrex-and-wander-xploric', '', '', '', 'Kurtka adidas Terrex + and wander XPLORIC', '', '', '', ''),
(593, 1, 1, 'W dni, gdy potrzebujesz dodatkowej ochrony, załóż tę wiatrówkę do biegania adidas i ruszaj w nieznane. AEROREADY zapewnia Ci suchy komfort, gdy temperatura biegu rośnie, a kieszeń na suwak pomieści niezbędne drobiazgi. Biegaj pewnie niezależnie od pogody w tej technicznej wiatrówce.\n\nTen produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'run-it-windbreaker', '', '', '', 'Run It Windbreaker', '', '', '', ''),
(594, 1, 1, 'Wybierz koszulkę bez rękawów adidas, która sprawdzi się zarówno podczas wymagającego treningu, jak też do noszenia na co dzień, będąc elementem swobodnego, sportowego stylu. Ma standardowy krój, który nie jest ani zbyt obcisły, ani zbyt luźny oraz zabudowany dekolt, który zapewni odpowiednie okrycie. Bawełniana dzianina gwarantuje wygodę przez cały dzień.\n\nNasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'loungewear-essentials-loose-logo-tank-top', '', '', '', 'LOUNGEWEAR Essentials Loose Logo Tank Top', '', '', '', ''),
(595, 1, 1, 'Podstawowy element garderoby stworzony z myślą o komforcie. Prosty, minimalistyczny look tych legginsów adidas zyskuje sportowy akcent dzięki linearnemu logo na nogawce. Krój z wysoką talią nadaje im miejski styl.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-high-waisted-logo-leggings', '', '', '', 'ESSENTIALS HIGH-WAISTED LOGO LEGGINGS', '', '', '', ''),
(596, 1, 1, 'Nie ma znaczenia, jak się czujesz, wchodząc na salę zajęć. Liczy się to, jak się czujesz, gdy z niej wychodzisz. Wybierz biustonosz sportowy adidas o niskim wsparciu, aby móc się zrelaksować. Design z krzyżującymi się na plecach ramiączkami odsłania nieco ciała. Gładki, oddychający materiał i wzmocniona siateczka zapewniają chłodną ulgę. Pochłaniająca wilgoć technologia AEROREADY gwarantuje Ci suchy komfort i wygodę przy każdym ruchu.', '', 'aeroreact-training-light-support-bra', '', '', '', 'Aeroreact Training Light-Support Bra', '', '', '', ''),
(597, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nBluza dresowa Statement Nylon została uszyta z gładkiej, nylonowej tkaniny o splocie płóciennym i łączy sportową funkcjonalność z luksusowymi detalami. Ma elegancki look z asymetrycznymi zatrzaskami z przodu i półgolfem ze ściągaczem.', '', 'bluza-dresowa-wales-bonner-statement-nylon', '', '', '', 'Bluza dresowa Wales Bonner Statement Nylon', '', '', '', ''),
(598, 1, 1, 'Pętelkowy materiał frotté z organicznej bawełny sprawia, że sweter Y-3 Graphic Crew jest wyjątkowo miękki w dotyku. Luźny krój umożliwia warstwowe stylizacje, a ściągacz na dole i w mankietach dopasowuje się do sylwetki. Logo Y-3 prezentuje się w formie offsetu po jednej stronie z przodu.', '', 'sweter-y-3-graphic-crew', '', '', '', 'Sweter Y-3 Graphic Crew', '', '', '', ''),
(599, 1, 1, 'Podstawowy element garderoby stworzony z myślą o komforcie. Prosty, minimalistyczny look tych legginsów adidas zyskuje sportowy akcent dzięki linearnemu logo na nogawce. Krój z wysoką talią nadaje im miejski styl.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-high-waisted-logo-leggings', '', '', '', 'ESSENTIALS HIGH-WAISTED LOGO LEGGINGS', '', '', '', ''),
(600, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nSpodnie dresowe zostały uszyte z nylonowej tkaniny o splocie płóciennym i mają kieszenie w szwach bocznych. Regulowane mankiety zwężają sylwetkę lub pozwalają jej swobodnie się poruszać.', '', 'spodnie-wales-bonner-track-suit', '', '', '', 'Spodnie Wales Bonner Track Suit', '', '', '', ''),
(601, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji dziennej dawki endorfin. \n\nI tu na scenę wkracza spódniczka do biegania Run Icons 3-Stripes. Wnieś subtelny styl do swojego stroju do biegania w tym skorcie. Elastyczne, wewnętrzne legginsy zapobiegają otarciom i zapewniają wsparcie, a odprowadzający pot materiał AEROREADY zapewnia Ci suchy komfort. Schowaj telefon do wygodnej kieszeni bocznej i ruszaj przed siebie.', '', 'skort-run-icons-3-stripes-running', '', '', '', 'Skort Run Icons 3-Stripes Running', '', '', '', ''),
(602, 1, 1, 'Dwustronny bezrękawnik adidas Premium odkrywa nowe perspektywy stylu i uniwersalności za sprawą połączenia wyszukanych materiałów. Zmień swój look w drodze: od nylonu z subtelnymi 3 paskami po jednej stronie, po poliestrową tkaninę ripstop i pikowane logo Trefoil na drugiej. Odpinany kaptur pozwoli Ci do woli bawić się stylem. Puchowe proporcje są wypełnione gęsim puchem, co nadaje całości wyróżniający się kształt, nowoczesny look i luksusowy charakter.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bezrekawnik-reversible-premium', '', '', '', 'Bezrękawnik Reversible Premium', '', '', '', ''),
(603, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nPrzedłużone mankiety nadają wyszukany akcent wyróżniającym się spodniom z dzianiny. Są uszyte z luksusowej mieszanki wełny merynosowej, która jest miękka w dotyku i nadaje wyszukany look codziennemu stylowi.', '', 'spodnie-wales-bonner-statement-knit', '', '', '', 'Spodnie Wales Bonner Statement Knit', '', '', '', ''),
(604, 1, 1, 'Wygoda i wsparcie przy każdym ruchu. Dokładnie to oferują legginsy adidas Techfit 7/8. Otulają Twoje mięśnie, dzięki czemu możesz podkręcić tempo i eliminują czynniki rozpraszające za sprawą AEROREADY, który zapewnia suchy komfort. Wysoka talia pozostaje na swoim miejscu, więc możesz skupić się na przysiadach i rozciąganiu, a nie na tym, co nosisz.', '', 'techfit-7-8-leggings', '', '', '', 'Techfit 7/8 Leggings', '', '', '', ''),
(605, 1, 1, 'Długa kurtka adidas Puffed z jasną wizją nowoczesnej mody i progresywnego designu prezentuje nową odsłonę odzieży wierzchniej za sprawą starannie wykonanych wykończeń i wysokiej jakości materiałów. Dbałość o detale jest oczywista dzięki suwakom po bokach, które zapewniają zarówno wentylację oraz dają różne opcje stylizacji, które pozwolą Ci odmienić swój look. Gęsi puch chroni przed chłodem. Puchowe, ściągaczowe panele prezentują odważne proporcje.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'kurtka-puffed-long', '', '', '', 'Kurtka Puffed Long', '', '', '', ''),
(606, 1, 1, 'Y-3 powraca do jednego z najbardziej kultowych designów adidas w tej bluzie dresowej Firebird, odświeżonej przy pomocy akcentu Y-3. Konstrukcja z mieszanki materiałów premium zapewnia poczucie gładkiego komfortu. Luźny krój sprawia, że model idealnie nadaje się do warstwowych stylizacji. Wkomponowane 3 paski uzupełniają całość.', '', 'y-3-firebird-track-top', '', '', '', 'Y-3 Firebird Track Top', '', '', '', ''),
(607, 1, 1, 'Wykonuj przysiady i wykroki lub relaksuj się podczas długiej sesji rozciągania w spodniach treningowych adidas z elastycznej tkaniny. Zachowasz suchy komfort dzięki pochłaniającemu wilgoć AEROREADY. Zaszewki i lamówka z przodu nogawek nadają im gładki look, który sprawdzi się na siłowni i poza nią.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'aeroready-train-essentials-minimal-branding-woven-pants', '', '', '', 'AEROREADY Train Essentials Minimal Branding Woven Pants', '', '', '', ''),
(608, 1, 1, 'Kurtka adidas Puffed Throw-Over na nowo definiuje standard codziennej odzieży wierzchniej. Kurtka z wysokiej jakości materiałów ma subtelny kształt w kształcie litery A, dzięki czemu zachwyca Twoją wyobraźnię stylem i nie wychodzi z mody. Suwaki w rękawach nie tylko zapewniają wentylację, ale również dają różne opcje stylizacji, dzięki którym możesz pięknie podkreślić swój unikalny look. Luksusowe wypełnienie z gęsiego puchu zapewnia ciepło i modeluje sylwetkę.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'kurtka-puffed-throw-over', '', '', '', 'Kurtka Puffed Throw-Over', '', '', '', ''),
(609, 1, 1, 'Trenuj intensywniej. Ten biustonosz adidas o lekkim wsparciu zapewni Ci dobre samopoczucie dzięki detalom z oddychającej siateczki i pochłaniającemu wilgoć AEROREADY. Cienkie ramiączka są regulowane z przodu, co z pewnością docenisz podczas robienia brzuszków lub ćwiczeń na ławce.', '', 'adidas-aeroreact-training-light-support-3-stripes-bra', '', '', '', 'adidas Aeroreact Training Light-Support 3-Stripes Bra', '', '', '', ''),
(610, 1, 1, 'Bluza z kapturem adidas prezentuje klasyczny, obszerny design ze śmiałym akcentem i wzorem w paski zebry na całej powierzchni. Miękki polar i obszerny krój otulają Cię natychmiastowym komfortem. Zestaw ten model ze spodniami dresowymi lub dżinsami i pokaż swój styl. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-z-kapturem-allover-zebra-animal-print-essentials', '', '', '', 'Bluza z kapturem Allover Zebra Animal Print Essentials', '', '', '', ''),
(611, 1, 1, 'Minimalistyczna konstrukcja bluzy z kapturem Y-3 Organic Cotton Terry to idealne połączenie wygody i funkcjonalności na co dzień. Model z materiału frotté o dużej zawartości bawełny organicznej ma luźny, swobodny krój.\n\nTen produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'y-3-organic-cotton-terry-hoodie', '', '', '', 'Y-3 Organic Cotton Terry Hoodie', '', '', '', ''),
(612, 1, 1, 'Nie pozwól, aby cokolwiek stanęło Ci na drodze. Od sesji sparingowych po najcięższe treningi HIIT – ten biustonosz sportowy adidas został zaprojektowany, aby pomóc Ci pewnie się poruszać. Biustonosz o mocnym wsparciu jest uszyty z gładkiego materiału, który jest chłodny w dotyku. AEROREADY zarządza wilgocią podczas intensywnych treningów. Szerokie, wyściełane ramiączka równomiernie rozkładają obciążenie i nie wpijają się w skórę.', '', 'adidas-tlrd-impact-training-high-support-bra', '', '', '', 'adidas TLRD Impact Training High-Support Bra', '', '', '', ''),
(613, 1, 1, 'Y-3 powraca do jednego z najbardziej kultowych designów adidas w postaci spodni dresowych Firebird z szerokimi nogawkami. Mają swobodny krój z mieszanki poliestru pochodzącego z recyklingu. Ukryte i wyeksponowane zatrzaski, regulowane sznurki i wkomponowane 3 paski podkreślają nowoczesną sylwetkę.', '', 'y-3-firebird-wide-leg-track-pants', '', '', '', 'Y-3 Firebird Wide-Leg Track Pants', '', '', '', ''),
(614, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nPunkt styku pomiędzy sportem i modą był zawsze podstawą stylu Y-3. Eksplorując oba światy, spodnie cargo Wool Flannel mają luźny, elegancki flanel z udoskonalonej mieszanki wełnianej. Pasek zwisa ze sprzączki FIDLOCK®, a kieszenie dopełniają funkcjonalny look.', '', 'spodnie-y-3-wool-flannel-cargo', '', '', '', 'Spodnie Y-3 Wool Flannel Cargo', '', '', '', ''),
(615, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nBluza dresowa Statement Knit, która czerpie inspirację z minionych dekad, łączy archiwalne detale z ultranowoczesnym nastrojem. Połączenie tych cech powstało dzięki miękkiemu, przypominającemu sweter materiałowi z kontrastowymi detalami na dole i mankietach oraz wyróżniającym się, stawianym kołnierzem.', '', 'bluza-dresowa-statement-knit', '', '', '', 'Bluza dresowa Statement Knit', '', '', '', ''),
(616, 1, 1, 'Pętelkowy materiał frotté z organicznej bawełny sprawia, że bluza z kapturem Y-3 Graphic jest wyjątkowo miękka w dotyku. Kaptur i kieszeń kangurka zapewniają komfort na co dzień, a ściągacz na dole i w mankietach dopasowuje się do sylwetki. Logo Y-3 prezentuje się w formie offsetu po jednej stronie z przodu.', '', 'bluza-z-kapturem-y-3-graphic', '', '', '', 'Bluza z kapturem Y-3 Graphic', '', '', '', ''),
(617, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nWyróżniająca się, nylonowa bluza dresowa ma elegancki look z gładkiej tkaniny o splocie płóciennym. Kołnierz i dół regulują sylwetkę, a rozcięcie wentylacyjne z tyłu zwiększa przewiewność i zapewnia wygodę noszenia. Odblaskowe detale zwiększają Twoją widoczność w słabym oświetleniu.', '', 'bluza-dresowa-wales-bonner-statement-nylon', '', '', '', 'Bluza dresowa Wales Bonner Statement Nylon', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(618, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nIndywidualny styl i kreatywność w wyrażaniu siebie nadają spodniom dresowym unikalny rytm. Model z wygodnymi detalami i suwakami w kostkach został uszyty z miłego w dotyku, przypominającego sweter materiału i ma elastyczną talię ze ściągaczem.', '', 'spodnie-wales-bonner-track-suit', '', '', '', 'Spodnie Wales Bonner Track Suit', '', '', '', ''),
(619, 1, 1, 'Uniwersalność na co dzień plus klasyczny styl. Te legginsy adidas mają charakterystyczny, sportowy look z 3 paskami i logo adidas Badge of Sport na biodrze. Elastyczny i wygodny model został uszyty z miękkiej bawełny.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'loungewear-essentials-3-stripes-leggings', '', '', '', 'LOUNGEWEAR Essentials 3-Stripes Leggings', '', '', '', ''),
(620, 1, 1, 'Uniwersalna bluza adidas z kapturem i suwakiem to zawsze strzał w dziesiątkę. Miękka warstwa z materiału frotté zapewni Ci okrycie przez cały dzień, niezależnie od tego, czy po prostu załatwiasz swoje sprawy, czy szykujesz się na wieczór w domu. Nie zapomnij skorzystać z kaptura. Ma sznurek do regulacji, który pozwoli Ci się wyciszyć. Możesz go nawet wykorzystać w czasie spontanicznej drzemki po południu. Jak tu nie kochać bluzy, w której możesz na chwilkę zapomnieć o świecie?\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-3-stripes-french-terry-regular-full-zip-hoodie', '', '', '', 'Essentials 3-Stripes French Terry Regular Full-Zip Hoodie', '', '', '', ''),
(621, 1, 1, 'Zachowasz suchy komfort w ruchu dzięki przeciwdeszczowej kurtce adidas, niezależnie od tego, dokąd zaprowadzi Cię dzień. Od codziennych dojazdów do pracy po weekendowe przygody — ta kurtka sprawdzi się zawsze, gdy prognoza pogody wydaje się niepewna. RAIN.RDY nie przepuszcza deszczu i wiatru, zapewniając suchy komfort. Regulowane mankiety i dół pozwalają nosić ten model na różne sposoby. Chowany kaptur oznacza, że możesz wybrać styl odpowiedni do noszenia w mieście lub na szlaku. Odblaskowe detale zwiększają widoczność w słabym świetle.', '', 'terrex-multi-rainrdy-2-layer-rain-jacket', '', '', '', 'Terrex Multi RAIN.RDY 2-Layer Rain Jacket', '', '', '', ''),
(622, 1, 1, 'Może to zabudowany dekolt. A może obszerny krój. Cokolwiek najbardziej lubisz w tym swetrze adidas, to powód, aby założyć go na chłodne dni. Wysokiej jakości materiały i ząbkowane 3 paski wokół jednego ramienia nadają całości wyjątkowy charakter. Ściągaczowy dół podkreśla klasyczny styl. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'adicolor-neuclassics-oversized-high-neck-sweater', '', '', '', 'Adicolor Neuclassics Oversized High Neck Sweater', '', '', '', ''),
(623, 1, 1, 'Zacznij dzień w śmiałym stylu dzięki przyciągającej wzrok sukience adidas. Ma przylegający do ciała krój i została uszyta z wyjątkowo miękkiej dzianiny z domieszką streczu, która otula Cię tam, gdzie powinna. Żywy wzór na całej powierzchni czerpie inspirację kolorystyczną z zamglonej panoramy Los Angeles, a ściągaczowe wycięcia na ramiona i 3 paski wzdłuż boków nawiązują do sportowego stylu. Załóż ją na dzień na plaży lub na wieczór na wieczorne tańce. Gdziekolwiek się nie wybierzesz, zrobisz wrażenie.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego.\n\nBetter Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”.\n\nWięcej informacji można znaleźć pod adresem: bettercotton.org/learnmore', '', 'sukienka-color-fade-bodycon', '', '', '', 'Sukienka Color Fade Bodycon', '', '', '', ''),
(624, 1, 1, 'Oto Twoje prawdziwe płótno, na którym możesz wyrazić siebie. Ta koszulka adidas jest tak prosta i minimalistyczna, że zmienia się za każdym razem, gdy spotyka się z nowym punktem widzenia. Może być odważna lub dyskretna, ekstrawagancka lub niewidzialna. Ta koszulka jest gotowa na każdą okazję.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-essentials-regular-tee', '', '', '', 'Adicolor Essentials Regular Tee', '', '', '', ''),
(625, 1, 1, 'Jeśli na wakacje na plaży możesz spakować tylko jeden strój do pływania, wybierz ten uniwersalny strój od adidas. Ma regulowany pasek, który chowa się na karku. Odepnij go, a będziesz mieć bandeau. Przyczepna silikonowa taśma wewnątrz górnej cześci zapobiega zsuwaniu się modelu.\n\nW przypadku tego produktu sięgnęliśmy po technologię gazów cieplarnianych. Wykorzystujemy wychwycone emisje przemysłowe jako nowy materiał wsadowy. W procesie fermentacji dwutlenek węgla ulega redukcji do etanolu, który stanowi 30% masy przędzy poliestrowej. Przędza ta służy nam do tworzenia różnych produktów, a etanol uzyskany na bazie węgla stanowi co najmniej 15% masy tego stroju. Innowacyjne podejście umożliwia nam wykorzystanie nowych źródeł i zasobów.', '', 'stroj-do-plywania-versatile', '', '', '', 'Strój do pływania Versatile', '', '', '', ''),
(626, 1, 1, 'Basen wzywa, słyszysz? Ten strój do pływania adidas jest gotowy, aby Cię tam zabrać, niezależnie od tego, czy pokonujesz kolejne długości basenu, czy po prostu relaksujesz się w wodzie. Charakterystyczne 3 paski biegną wzdłuż boków, podkreślając Twój dumny styl adidas. A ponieważ zechcesz nosić go na okrągło, odporny na działanie chloru materiał pochodzący z recyklingu sprawi, że Twój strój do pływania pozostanie w najlepszej formie na każdą przygodę.', '', 'adidas-3-stripes-swimsuit', '', '', '', 'adidas 3-Stripes Swimsuit', '', '', '', ''),
(627, 1, 1, 'Zaprezentuj swój sportowy styl na basenie. Ten strój do pływania adidas jest wygodny i lekki, dzięki czemu sprawdzi się w każdej sytuacji: od pokonywania kolejnych długości basenu po lekcje nurkowania. Charakterystyczne 3 paski po bokach akcentują talię, podkreślając sylwetkę.\n\nModel został wykonany z odpornego na działanie chloru materiału z pochodzącą z odzysku przędzą ECONYL®.', '', 'mid-3-stripes-swimsuit', '', '', '', 'Mid 3-Stripes Swimsuit', '', '', '', ''),
(628, 1, 1, 'Jeśli chodzi o stroje do pływania, najważniejszy jest krój. Inspirowany kultową, małą czarną uniwersalny strój do pływania adidas podkreśla sylwetkę. Wycięcie na plecach i stylowy przód zapewniają odpowiednie okrycie. Wbudowany biustonosz zapewnia średnie wsparcie. Wyjmowane wkładki umożliwiają indywidualne dopasowanie.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'iconisea-3-stripes-swimsuit', '', '', '', 'Iconisea 3-Stripes Swimsuit', '', '', '', ''),
(629, 1, 1, 'Poruszaj się w wodzie, ciesząc się siłą i mocą w tym stroju do pływania adidas. Miękki, odporny na działanie chloru materiał stawi czoła silnym chemikaliom stosowanym na basenach i da Ci pewność siebie na pokładzie. Logo z 3 paskami podkreśla Twoją dumę z marki.', '', '3-bar-logo-swimsuit', '', '', '', '3 Bar Logo Swimsuit', '', '', '', ''),
(630, 1, 1, 'Szukasz czegoś w wyrazistym, niezobowiązującym stylu do noszenia na co dzień? Sięgnij po tę koszulkę adidas. Ma proste linie i gładki styl adidas, co sprawia, że doskonale pasuje do spodni dresowych, dżinsów i legginsów.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'loungewear-essentials-slim-logo-tee', '', '', '', 'LOUNGEWEAR Essentials Slim Logo Tee', '', '', '', ''),
(631, 1, 1, 'Ptaszki śpiewają. Słońce świeci. Nie ma powodu, aby zostać w domu, gdy możesz pokazać się w tej sukience adidas. Jej dopasowana i elastyczna konstrukcja oddaje hołd Twojej sylwetce przy pomocy bawełny, która jest wyjątkowo miękka w dotyku. Autentyczne 3 paski na plecach nadają całości nowoczesny charakter.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-tight-summer-dress-plus-size', '', '', '', 'Adicolor Classics Tight Summer Dress (Plus Size)', '', '', '', ''),
(632, 1, 1, 'Stwórz look, który będzie Cię wyróżniał dzięki dołowi od bikini adidas. Stylowy dół od bikini z wysoką talią możesz zestawić z różnymi częściami górnymi, zgodnie z własnym stylem. Miękki, elastyczny materiał zapewnia swobodę ruchów w wodzie i na lądzie.\n\nModel został wykonany z odpornego na działanie chloru materiału z pochodzącą z odzysku przędzą ECONYL®.', '', 'high-waist-bikini-bottoms', '', '', '', 'High-Waist Bikini Bottoms', '', '', '', ''),
(633, 1, 1, 'Reprezentuj styl życia adidas Originals w pełnej krasie. Te kultowe spodnie dresowe Firebird powstały z myślą o komforcie, swobodzie ruchu i długotrwałym użytkowaniu dzięki konstrukcji z wyjątkowo miękkiego trykotu. 3 paski wzdłuż nogawek i wyszywane logo Trefoil nadają całości charakterystyczny, znany od lat charakter. Swobodne spodnie w swobodnym stylu, które są niezbędnym elementem w każdej szafie. \n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'spodnie-dresowe-firebird-loose', '', '', '', 'Spodnie dresowe Firebird Loose', '', '', '', ''),
(634, 1, 1, 'Ta bluza z kapturem adidas zdobywa punkty za komfort. Luźny krój i miękki polar zapewnią Ci wygodę w sam raz na swobodne dni. Detale takie jak mankiety ze ściągaczem podkręcają swobodny look, a mieszanka bawełniana nadaje całości swobodny charakter. Suwak na całej długości i regulowany kaptur uzupełniają design. \n\nBawełna w tym produkcie została pozyskana z bawełny Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji znajdziesz tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'bluza-z-kapturem-essentials-zip', '', '', '', 'BLUZA Z KAPTUREM ESSENTIALS ZIP', '', '', '', ''),
(635, 1, 1, 'W koszykówce chodzi zarówno o wydajność, jak i styl. Ta bluza z zaokrąglonym dekoltem od adidas Koszykówka została uszyta z bawełniano-poliestrowej dzianiny o podwójnym splocie, która zapewnia ciepło i komfort, a do tego jest miękka w dotyku. Ściągacze w mankietach i u dołu gwarantują pewne dopasowanie, a naszywki z przodu, z tyłu i na rękawach stanowią charakterystyczne wykończenie.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'adidas-basketball-hoodie', '', '', '', 'adidas Basketball Hoodie', '', '', '', ''),
(636, 1, 1, 'Przedstawiamy Twoją nową, nieodzowną na co dzień bluzę. Tę, którą będziesz nosić przez następny miesiąc. Ta bluza z kapturem adidas została uszyta z bawełnianego materiału frotté, dzięki czemu zapewnia komfort. Luźny krój i suwak na całej długości sprawiają, że idealnie nadaje się do warstwowych stylizacji.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-3-stripes-french-terry-bomber-full-zip-hoodie', '', '', '', 'Essentials 3-Stripes French Terry Bomber Full-Zip Hoodie', '', '', '', ''),
(637, 1, 1, 'Bluza z kapturem adidas została uszyta z rozciągającego się w czterech kierunkach materiału, który nie ogranicza Twoich ruchów i nie utrudnia koncentracji. Miękka i obszerna bluza z kapturem z technologią AEROREADY, która gwarantuje suchy komfort, dba o Twoją wygodę niezależnie od czekających Cię wyzwań. Ukryta kieszeń na suwak pomieści Twój telefon dokładnie tam, gdzie go potrzebujesz. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-z-kapturem-adidas-zne-full-zip-plus-size', '', '', '', 'Bluza z kapturem adidas Z.N.E. Full-Zip (Plus Size)', '', '', '', ''),
(638, 1, 1, 'Nie pozwól, by mżawka przeszkodziła Ci w realizacji planów. Ta kurtka adidas MYSHELTER zapewni Ci suchy komfort, gdy siąpi deszcz albo zrywa się ulewa. RAIN.RDY odprowadza wilgoć, dzięki czemu możesz wybrać się na swój planowy poranny spacer lub na weekendową wycieczkę. Dwuwarstwowe uszczelnienie szwów chroni Ciebie i Twoje wyposażenie. Kiedy deszcz ustanie, możesz schować kaptur lub zdjąć kurtkę i nosić ją na plecach za sprawą odpinanych pasków.', '', 'myshelter-rainrdy-jacket', '', '', '', 'MYSHELTER RAIN.RDY Jacket', '', '', '', ''),
(639, 1, 1, 'Skoncentruj się na biciu rekordów życiowych, zamiast rozpraszać się ubraniami. Treningowe legginsy adidas zostały stworzone, aby poruszać się razem z Tobą podczas sesji cardio i ćwiczeń nóg. Gładki, miękki materiał podkreśla atuty sylwetki i zapewnia wygodę. Zabudowana talia pozostaje na swoim miejscu, dzięki czemu możesz zachować pewność siebie w ruchu. Model ma ograniczoną liczbę szwów i wyjątkowo gładką konstrukcję.', '', 'training-essentials-high-waisted-7-8-leggings', '', '', '', 'Training Essentials High-Waisted 7/8 Leggings', '', '', '', ''),
(640, 1, 1, 'Te spodnie dresowe z szerokimi nogawkami nawiązują do tradycji adidas, wybiegając w przyszłość. Luźny, zwiewny krój, który tworzy swobodny fason, zapewni Ci swobodę ruchu. Model z luksusowej satyny emanuje elegancją, idealną na wieczorne wyjście lub lunch w niezobowiązującym stylu. Charakterystyczne 3 paski biegną wzdłuż boków nogawek, stanowiąc detal tak ponadczasowy jak sam look. \n\nTen produkt został wykonany co najmniej w 70% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych opadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'spodnie-satin-wide-leg-track', '', '', '', 'Spodnie Satin Wide Leg Track', '', '', '', ''),
(641, 1, 1, 'Pokaż swoje prawdziwe oblicze na boisku treningowym. Ta koszulka piłkarska adidas Tiro 23 Club ma odprowadzający wilgoć AEROREADY, który zapewni Ci suchy komfort i pozwoli skoncentrować się na grze. Model z lekkiego materiału z odrobiną streczu pomoże Ci perfekcyjnie wykonywać wszystkie najlepsze ruchy.\n\nTen produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-23-club-training-jersey', '', '', '', 'Tiro 23 Club Training Jersey', '', '', '', ''),
(642, 1, 1, 'Wybierz spodnie golfowe adidas zapewniające optymalny komfort na polu golfowym. Mocny materiał rozciąga się w czterech kierunkach, gwarantując elastyczność. Szeroka talia ze wzmocnionej siateczki daje wsparcie, gdy wykonujesz zamachy, skłony i rozciągasz się przez całą rundę. Długość do kostek pozwala Ci się skupić na grze.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'pull-on-ankle-pants', '', '', '', 'Pull-On Ankle Pants', '', '', '', ''),
(643, 1, 1, 'Każdy potrzebuje dresu, na który może liczyć w codziennym życiu — podczas pracy z domu, w weekendowe wieczory i we wszystkim, co dzieje się pomiędzy. Ten model od adidas ma dopasowany krój z miękkiego trykotu. Ma wszystkie detale, których potrzebujesz, takie jak ściągaczowy dół i mankiety, elastyczna talia i suwak na całej długości, dzięki którym możesz założyć pod spód ulubioną koszulkę.  \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'dres-essentials-3-stripes', '', '', '', 'Dres Essentials 3-Stripes', '', '', '', ''),
(644, 1, 1, 'Niewiele rzeczy nosi się lepiej niż tę bluzę z kapturem z kolekcji adidas by Stella McCartney. W ciągu kilku sekund (bo tyle potrzebujesz, żeby ją założyć) poczujesz się komfortowo dzięki miękkiej mieszance bawełny organicznej. Luźny kształt nie tylko świetnie się układa, ale również tworzy wyszukany look dzięki minimalistycznej konstrukcji i kolorystyce. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'adidas-by-stella-mccartney-full-zip-hoodie', '', '', '', 'adidas by Stella McCartney Full-Zip Hoodie', '', '', '', ''),
(645, 1, 1, 'Staw czoła chłodowi w tym płaszczu adidas. Design z dużymi przegrodami gwarantuje niezrównaną miękkość i bezkompromisowo wygodny krój. Izolacja z kaczego puchu zapewnia totalne ciepło. Ukryte, elastyczne mankiety po wewnętrznej stronie chronią przed chłodem. Luźny krój ułatwia zakładanie na inne ubrania.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'plaszcz-big-baffle', '', '', '', 'Płaszcz Big Baffle', '', '', '', ''),
(646, 1, 1, 'Minisukienka w stylu zaczerpniętym z archiwów adidas, która pozwoli Ci się wyróżnić. Otulający ciało krój i miękki, elastyczny materiał poruszają się razem z Tobą od rana do nocy. Kwadratowy dekolt sprawia, że możesz założyć do niej kilka naszyjników lub nosić ją samodzielnie. Nawiązująca do autentycznego, sportowego ducha adidas, sukienka pozwoli Ci wyrazić siebie i powrócić do korzeni marki. \n\nBawełna wykorzystana w tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'sukienka-mini-3-stripes', '', '', '', 'Sukienka mini 3-Stripes', '', '', '', ''),
(647, 1, 1, 'Nie pozwól, aby cokolwiek stanęło Ci na drodze. Od sesji sparingowych po najcięższe treningi HIIT biustonosz treningowy adidas TLRD Impact High-Support został zaprojektowany, aby pomóc Ci pewnie się poruszać. \n\nBiustonosz o mocnym wsparciu jest uszyty z gładkiego, chłodnego w dotyku materiału adiflex. Odprowadzający pot AEROREADY zapewnia suchy komfort, a szerokie, wyściełane ramiączka równomiernie rozkładają ciężar, stanowiąc wygodne wykończenie designu. Zapięcie na haftki ułatwia zakładanie i zdejmowanie.', '', 'biustonosz-adidas-tlrd-impact-training-high-support-plus-size', '', '', '', 'Biustonosz adidas TLRD Impact Training High-Support (Plus Size)', '', '', '', ''),
(648, 1, 1, 'Kiedy przygotowujesz się do biegu, potrzebujesz ubrań, które pomogą Ci biec szybciej i dalej. Legginsy do biegania z kolekcji adidas by Stella McCartney zapewniają komfort bez czynników rozpraszających dzięki pochłaniającej wilgoć technologii AEROREADY i wspierającemu, elastycznemu krojowi. Biegasz wczesnym rankiem albo późnym wieczorem? Odblaskowe detale dodadzą Ci blasku. Tylna kieszeń na suwak pomieści niezbędne drobiazgi, a nadrukowane linie TruePace nadają całości styl.\n\nPrzędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', '', 'legginsy-adidas-by-stella-mccartney-truepace-running', '', '', '', 'Legginsy adidas by Stella McCartney TruePace Running', '', '', '', ''),
(649, 1, 1, 'Niezbędny sprzęt treningowy od adidas. Zanim wyjdziesz na boisko na zimową sesję, załóż spodnie piłkarskie Tiro 23 Club. Opływowy krój i pochłaniający wilgoć AEROREADY zapewnią Ci swobodę ruchu podczas sprintów i okrążeń. Gdy już się rogrzejesz, suwaki w kostkach ułatwią Ci zdejmowanie tej warstwy bez ściągania butów.\n\nTen produkt został wykonany w całości z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-23-club-training-pants', '', '', '', 'Tiro 23 Club Training Pants', '', '', '', ''),
(650, 1, 1, 'Spodnie dresowe adidas od dziesięcioleci są uwielbiane za niezobowiązujący komfort i sportowy charakter. Spodnie z gładkiej tkaniny mają obszerny krój, który dodaje stylu. Sznurek ze stoperami na dole pozwala dopasować długość i uzyskać efekt marszczenia. Talia regulowana sznurkiem zapewnia komfort.', '', 'spodnie-dresowe-adilenium-oversized', '', '', '', 'Spodnie dresowe Adilenium Oversized', '', '', '', ''),
(651, 1, 1, 'Przygotuj się, aby zrobić wrażenie na mieście w tej dynamicznej bluzie dresowej. Kultowy dres Firebird, który od lat 80. wywołuje poruszenie swoim nowoczesnym, a jednocześnie autentycznym stylem, jest obowiązkowym elementem garderoby każdego miłośnika marki adidas. Bluza z połyskującego trykotu pochodzącego z recyklingu pozostaje wierna swoim sportowym korzeniom dzięki stawianemu kołnierzowi i klasycznym 3 paskom wzdłuż rękawów. Noś ją do ulubionych dżinsów lub spodni dresowych, aby zyskać swobodny look, który z pewnością zostanie zauważony.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'bluza-dresowa-adicolor-classics-loose-firebird', '', '', '', 'Bluza dresowa Adicolor Classics Loose Firebird', '', '', '', ''),
(652, 1, 1, 'Trudno o coś bardziej autentycznego. Zaprezentuj swój oryginalny styl adidas w tych swobodnych spodniach. Dopasowany krój zapewnia nowoczesny look, który daje wiele możliwości stylizacji. Miękki materiał frotté zapewnia odpowiednią wygodę i pozwala Ci poruszać się bez wysiłku przez cały dzień.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-slim-cuffed-pants', '', '', '', 'Adicolor Classics Slim Cuffed Pants', '', '', '', ''),
(653, 1, 1, 'Noś je, jak chcesz. Minimalistyczny design tych legginsów adidas oznacza, że łatwo nosić je w swoim własnym stylu.  Zestaw ten model z obszernymi bluzami z kapturem, masywnymi butami treningowymi lub prześwitującą koszulką. Niezależnie od tego, w czym czujesz się dobrze, ten model ze wszystkim wygląda świetnie. Miękki, otulający ciało materiał sięga talii.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-essentials-leggings-plus-size', '', '', '', 'Adicolor Essentials Leggings (Plus Size)', '', '', '', ''),
(654, 1, 1, 'Zabłyśnij sportowym stylem dzięki dopasowanej koszulce. 3 paski w kontrastowym kolorze wzdłuż obu rękawów przyciągają wzrok. Koszulka ma klasyczny look, który pasuje niemal do wszystkiego ― od dżinsów poprzez spódniczkę tenisową aż po legginsy treningowe.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-slim-3-stripes-tee', '', '', '', 'Essentials Slim 3-Stripes Tee', '', '', '', ''),
(655, 1, 1, 'Załóż ten biustonosz treningowy adidas solo lub noś go jako warstwę. Tak czy tak, sprawdzi się podczas intensywnych treningów. Ma gładki, kompresyjny design, który zapewnia komfort bez czynników rozpraszających i wsparcie przez cały dzień. Pochłaniający wilgoć AEROREADY dba o suchy komfort niezależnie od tego, jak intensywnie ćwiczysz. Detale z siateczki gwarantują przepływ powietrza w strefach najbardziej narażonych na pocenie, dając Ci uczucie przewiewnego komfortu. W zależności od potrzeb możesz wyjąć wkładki lub je zostawić.', '', 'powerreact-training-medium-support-techfit-bra', '', '', '', 'Powerreact Training Medium-Support Techfit Bra', '', '', '', ''),
(656, 1, 1, 'Piłkarska elegancja. Trudno to opisać, ale zrozumiesz, kiedy to zobaczysz. Trzecia koszulka adidas, będąca uzupełnieniem pełnych blasku meczów wyjazdowych Realu Madryt, zachowuje klasyczny styl za sprawą czarnej podstawy, 3 pasków z włókna węglowego i złotego napisu \"RMCF\" wyszytego w kołnierzu. Model, który zapewnia komfort poza boiskiem, łączy pochłaniający wilgoć AEROREADY z detalami z siateczki.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'koszulka-real-madrid-23-24-third', '', '', '', 'Koszulka Real Madrid 23/24 Third', '', '', '', ''),
(657, 1, 1, 'Model idealny do kibicowania swojej drużynie i odpoczynku. Bluza dresowa reprezentacji Hiszpanii Beckenbauer została uszyta z miękkiego materiału o dużej zawartości bawełny, który zapewnia komfort w niezobowiązującym stylu. Śmiałe 3 paski na rękawach i zamszowe logo Trefoil podkreślają Twoją sportową pasję, a wyrazisty nadruk na plecach pozwoli Ci się wyróżnić. W kieszeniach na suwak bezpiecznie przechowasz niezbędne drobiazgi, dzięki czemu możesz skoncentrować się na meczu, a godło federacji na sercu pokazuje wszystkim, komu kibicujesz. Uniwersalna koszulka dla kibiców, którzy żyją piłką nożną i oddychają nią, jest obowiązkowym elementem Twojej garderoby.\n\nWybierając materiały pochodzące z recyklingu, możemy ponownie wykorzystać materiały, które już zostały wyprodukowane, co pomaga zmniejszyć ilość odpadów. Wybór materiałów odnawialnych pomoże nam wyeliminować zależność od ograniczonych zasobów. Nasze produkty wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych materiałów zawierają co najmniej 70% wszystkich tych materiałów.', '', 'bluza-dresowa-spain-beckenbauer', '', '', '', 'Bluza dresowa Spain Beckenbauer', '', '', '', ''),
(658, 1, 1, 'Prawie jak bez biustonosza, tylko lepiej. Ten biustonosz adidas to wygodny, podstawowy element garderoby, który będziesz chciała nosić bez przerwy – jego prosty design bez wkładek i drutów oznacza czysty komfort. Jest wykonany z miękkiego w dotyku materiału z pochłaniającym wilgoć AEROREADY. Wyreguluj cienkie ramiączka, aby znaleźć najlepsze dopasowanie.', '', 'adidas-purebare-light-support-bra', '', '', '', 'adidas Purebare Light-Support Bra', '', '', '', ''),
(659, 1, 1, 'Zawsze były czerwono-białe. Ale nie zawsze wyglądały tak jak dzisiaj. Tworząc tę koszulkę podstawową Bayernu Monachium, adidas czerpał inspirację z zestawu, jaki klub nosił w swoim pierwszym sezonie w najwyższej lidze. Biały model z czerwonymi detalami nadaje świeży look drużynie, która słynie z piłkarskiej jedności. Za kulisami AEROREADY usuwa wilgoć, zapewniając komfort kibicom.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'koszulka-podstawowa-fc-bayern-23-24-women-team', '', '', '', 'Koszulka podstawowa FC Bayern 23/24 Women Team', '', '', '', ''),
(660, 1, 1, 'Wybierz legginsy adidas, które dodadzą Ci pewności siebie. Zabudowana talia i przylegający krój zapewniają Ci wsparcie przez cały dzień, a 3 paski nawiązują do sportowego stylu. Miękka, elastyczna bawełna gwarantuje całkowity komfort w domu i w drodze.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-classics-3-stripes-leggings-plus-size', '', '', '', 'Adicolor Classics 3-Stripes Leggings (Plus Size)', '', '', '', ''),
(661, 1, 1, 'Miła w dotyku, ciepła i stylowa warstwa na chłodne dni? To wcale nie \"zbyt dobre, by było prawdziwe\". Ta wyściełana kurtka z kolekcji adidas by Stella McCartney została stworzona z myślą o chłodnym powietrzu, nie rezygnując z dobrego wyglądu. Model z mocną warstwą wierzchnią z tkaniny ma ciepłą izolację, która chroni przed kaprysami pogody. Regulowany kaptur zapewnia lepsze okrycie, gdy go potrzebujesz. Kieszenie z przodu pomieszczą niezbędne drobiazgi, a regulowany dół i mankiety zapobiegają przedostawaniu się chłodu do rękawów. Luźny krój pozwoli Ci założyć pod spód bluzę lub szalik.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'kurtka-adidas-by-stella-mccartney-padded-mid-length-printed', '', '', '', 'Kurtka adidas by Stella McCartney Padded Mid-Length Printed', '', '', '', ''),
(662, 1, 1, 'Wybierz biustonosz adidas, który nie będzie Cię ograniczał. Wręcz przeciwnie, zapewni Ci swobodę i bezpieczne dopasowanie podczas treningu. Supermiękki adisoft dopasowuje się do ciała, dbając o Twoją wygodę i pewność przy każdym skłonie, skręcie i rozciąganiu. AEROREADY odprowadza wilgoć, zapewniając Ci przewiewny i suchy komfort od początku do końca treningu.', '', 'coreflow-medium-support-bra', '', '', '', 'CoreFlow Medium-Support Bra', '', '', '', ''),
(663, 1, 1, 'Temperatura może spadać, ale to nie powód, aby narażać swój styl na szwank. Puchowy płaszcz z kolekcji adidas by Stella McCartney zapewni Ci śmiały look i wyjątkowy komfort. Uniwersalny design jest stworzony do eksperymentów ze stylem i noszenia po swojemu — wyreguluj talię, rozepnij suwak na rękawach, odepnij kaptur lub noś go na swój własny sposób. Ty decydujesz, ile potrzebujesz okrycia.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych opadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'kurtka-adidas-by-stella-mccartney-long-padded-winter', '', '', '', 'Kurtka adidas by Stella McCartney Long Padded Winter', '', '', '', ''),
(664, 1, 1, 'Zajęcia taneczne lub całodzienna wędrówka. Trening HIIT lub worek treningowy. Te legginsy treningowe adidas wspierają każdy Twój ruch. Są wyjątkowo gładkie, mają minimalistyczne szwy i są uszyte z gładkiego materiału. Bez względu na to, jak intensywnie ćwiczysz, AEROREADY pochłania wilgoć, zapewniając Ci suchy komfort, a zabudowana talia pozostaje na swoim miejscu. Przed wyjściem schowaj klucze do kieszeni w talii.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'train-essentials-3-stripes-high-waisted-7-8-leggings', '', '', '', 'Train Essentials 3-Stripes High-Waisted 7/8 Leggings', '', '', '', ''),
(665, 1, 1, 'Legginsy 7/8 Optime TrainIcons to połączenie stylu i sportu na najwyższym poziomie. Te stylowe legginsy z idealnie wpisują się w trend do athleisure, a jednocześnie są wykonane z technicznych materiałów, które wspierają Cię podczas aktywności i na macie, i na siłowni.\n \nFunkcjonalne detale sprawiają, że to doskonały wybór dla grających i trenujących na maksa. Produkty adidas AEROREADY zostały wykonane z odprowadzających pot lub pochłaniających wilgoć materiałów i zapewniają suchy komfort, dzięki czemu nie musisz przerywać ćwiczeń.\n \nKultowe 3 paski robią wrażenie, podkreślając nowoczesny, otulający ciało design z kieszenią w talii, w której przechowasz cenne drobiazgi w zasięgu ręki. Przywitaj się ze swoimi nowymi legginsami treningowymi.', '', 'optime-trainicons-7-8-tights', '', '', '', 'Optime TrainIcons 7/8 Tights', '', '', '', ''),
(666, 1, 1, 'Y-3 powraca do jednego z najbardziej kultowych designów adidas w postaci spodni SST. Mają luźny, układający się krój z elastycznej mieszanki nylonu.', '', 'y-3-sst-track-pants', '', '', '', 'Y-3 SST Track Pants', '', '', '', ''),
(667, 1, 1, 'Biustonosz CoreFlow Luxe Studio Medium-Support zapewni Ci pewność siebie na macie i przy drążku. Biustonosz stworzony, aby dopasowywać się do Twojego unikalnego kształtu i ruchu, jest uszyty z miękkiego w dotyku materiału i ma krój, który sprawia wrażenie drugiej skóry. Biustonosz inspirowany strojami baletowymi dopasowuje się do Twojego ciała za sprawą szwów, które zapewniają pełną swobodę ruchu. Wyjmowane wkładki umożliwiają indywidualne dopasowanie stopnia okrycia. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'biustonosz-coreflow-luxe-studio-medium-support', '', '', '', 'Biustonosz CoreFlow Luxe Studio Medium-Support', '', '', '', ''),
(668, 1, 1, 'Powrót z przeszłości. Zrób wrażenie za sprawą kultowego looku, który zdefiniował piłkę nożną w latach 90. Legendarna koszulka podstawowa La Roja z 1996 roku powraca zarówno dla kibiców piłkarskich, jak i dla poszukiwaczy stylu retro.\n\nKoszulka podstawowa reprezentacji Hiszpanii z krótkim rękawem 1996 prezentuje Twoją miłość do piłkarskiego dziedzictwa w ponadczasowym stylu. Luźny krój, logo adidas i flagi Hiszpanii naszyte na rękawach nadają modelowi autentyczny styl lat 90. Naszywka hiszpańskiej reprezentacji na dole jest ostatnim detalem, który uzupełnia piłkarski look w stylu retro.\n\nWybierając materiały pochodzące z recyklingu, możemy ponownie wykorzystać materiały, które już zostały stworzone, co pomaga zmniejszyć ilość odpadów i nasze uzależnienie od ograniczonych zasobów.', '', 'koszulka-spain-1996-home', '', '', '', 'Koszulka Spain 1996 Home', '', '', '', ''),
(669, 1, 1, 'Niezależnie od tego, czy relaksujesz się w domu, czy załatwiasz sprawy w mieście, te polarowe spodnie adidas pozwolą Ci się zrelaksować za sprawą luźnego, wygodnego kroju. Kieszenie cargo na nogawkach pomieszczą niezbędne drobiazgi. Obszerna sylwetka zwęża się w kostkach i ma elastyczne mankiety, dzięki czemu możesz zaprezentować swoją ulubioną parę butów. \n\nBawełna wykorzystana w tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'spodnie-dresowe-essentials-fleece-cargo', '', '', '', 'Spodnie dresowe Essentials Fleece Cargo', '', '', '', ''),
(670, 1, 1, 'Gdy najważniejsze jest odpowiednie okrycie, sięgnij po spodnie do pływania adidas. Materiał Infinitex Fitness Eco jest odporny na działanie chloru i wykonany z materiałów pochodzących z recyklingu. Wysoka talia zapewnia komfort i bezpieczne dopasowanie, gdy się poruszasz. Zatrzaski po obu stronach bioder umożliwiają przymocowanie spodni do pasującego topu, dzięki czemu pozostają na swoim miejscu. Trzy zatrzaski umieszczone są na różnych wysokościach, co daje Ci różne możliwości optymalnego dopasowania. \n\nModel został wykonany z odpornego na działanie chloru materiału z pochodzącą z odzysku przędzą ECONYL®.', '', '3-stripes-swim-pants', '', '', '', '3-Stripes Swim Pants', '', '', '', ''),
(671, 1, 1, 'Niezależnie od tego, czy wybierasz się na górską wyprawę, czy jeździsz na nartach w lesie, kurtka adidas Terrex sprawdzi się w aktywne dni. Lekka i oddychająca, syntetyczna izolacja PrimaLoft® zatrzymuje ciepło, pozwalając jednocześnie Twojemu ciału regulować temperaturę. Unikalny, pikowany wzór wykorzystuje mapowanie ciała, aby lepiej zarządzać temperaturą i zapewnić Ci ciepły komfort. Regulowany kaptur i mankiety oraz elastyczny dół chronią przed chłodem, gdy poruszasz się w górach.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'kurtka-terrex-xperior-varilite-primaloft', '', '', '', 'Kurtka Terrex Xperior Varilite PrimaLoft', '', '', '', ''),
(672, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nSpodnie cargo Statement mają liczne kieszenie i są uszyte z mocnego nylonu. Mankiety regulowane stoperami pozwalają eksperymentować z dopasowaniem, a wygodna, elastyczna talia ma zapięcie na rozporek z zatrzaskami, które nadają całości inspirowany odzieżą roboczą motyw. Szlufki na pasek umożliwiają dodanie akcesoriów, gdy zestawisz ten look z wpuszczoną koszulką lub obszerną bluzą.', '', 'spodnie-statement-cargo', '', '', '', 'Spodnie Statement Cargo', '', '', '', ''),
(673, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nWyróżniająca się bluza dresowa czerpie z archiwalnych modeli, wzbogacając je o nowoczesne akcenty. Konstrukcja z mieszanki bawełnianej została wykończona kieszeniami na suwak w szwach bocznych, ściągaczowym dołem i mankietami oraz kołnierzem ze ściągaczem.', '', 'bluza-dresowa-wales-bonner-statement', '', '', '', 'Bluza dresowa Wales Bonner Statement', '', '', '', ''),
(674, 1, 1, 'Nawet w bluzie prezentujesz swój unikalny styl. Uznaj tę bluzę z kapturem adidas za podstawę do wyrażania siebie i wygody. Zestaw ją ze spodniami z dżinsu lub szerokimi nogawkami albo noś na co dzień ze spodniami dresowymi, aby zyskać wyszukany look na co dzień. Miękki polar pozwoli Ci się zrelaksować.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-essentials-fleece-hoodie', '', '', '', 'Adicolor Essentials Fleece Hoodie', '', '', '', ''),
(675, 1, 1, 'Kolekcja adidas i Wales Bonner jesień/zima 2023 to ukłon w stronę beztroskiej ekspresji, która odświeża archiwalne sylwetki piłkarskie przy pomocy technicznych udoskonaleń i elegancji. \n\nKoszulka z długim rękawem ma wydłużone, ściągaczowe mankiety i przedłużony tył w wyszukanym stylu. Miękka i luksusowa mieszanka wełny merynosowej jest miła w dotyku i podkręca codzienny styl.', '', 'koszulka-wales-bonner-long-sleeve-knit', '', '', '', 'Koszulka Wales Bonner Long Sleeve Knit', '', '', '', ''),
(676, 1, 1, 'Trzymaj się ciepło w luźnych spodniach dresowych adidas. Uszyto je z solidnego, szczotkowanego od spodu polaru, który jest puszysty w dotyku, dzięki czemu idealnie nadają się na weekendowy maraton filmowy albo na zimowy spacer z psem. Bo dzięki neutralnemu stylowi zawsze prezentują się doskonale, więc nie musisz się przebierać. Dopasuj sznurek do regulacji w talii, aby zapewnić wygodę podczas wkładania rzeczy do kieszeni. \n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'all-szn-fleece-pants', '', '', '', 'ALL SZN Fleece Pants', '', '', '', ''),
(677, 1, 1, 'Zrealizuj plan dnia, ciesząc się miękkością elastycznych legginsów, które dotrzymają Ci kroku przez cały dzień. Klasyczne logotypy adidas stanowią stylowy akcent. Wysoka talia nadaje im nowoczesny styl, który pasuje do wszystkiego, co masz w szafie.\n\nNasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-high-waisted-logo-leggings-plus-size', '', '', '', 'Essentials High-Waisted Logo Leggings (Plus Size)', '', '', '', ''),
(678, 1, 1, 'Wybierz koszulkę do biegania adidas przeznaczoną zarówno na krótkie biegi, jak i na długie dystanse. Oddychający materiał z AEROREADY pochłania wilgoć, zapewniając Ci suchy komfort. Sportowa sylwetka prezentuje prosty styl z 3 paskami i odblaskowymi detalami, które świecą, gdy światło zanika.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'own-the-run-tee', '', '', '', 'Own the Run Tee', '', '', '', ''),
(679, 1, 1, 'Nawet w bluzie prezentujesz swój unikalny styl. Uznaj tę wkładaną przez głowę bluzę adidas za podstawę do wyrażania siebie i wygody. Zestaw ją ze spodniami z dżinsu lub szerokimi nogawkami albo noś na co dzień ze spodniami dresowymi, aby zyskać wyszukany look na co dzień. Miękki polar pozwoli Ci się zrelaksować.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-essentials-crew-sweatshirt', '', '', '', 'Adicolor Essentials Crew Sweatshirt', '', '', '', ''),
(680, 1, 1, 'Nigdy do końca nie wiesz, co czeka Cię podczas aktywności na świeżym powietrzu, dlatego stworzyliśmy puchową kurtkę Y-3. Puchowa kurtka ma swobodny krój, który zapewnia wygodę w warstwowych stylizacjach, oraz sznurki ściągające przy kapturze i na dole, które pomagają dopasować kształt i chronią przed chłodem. Dzięki zatrzaskom możesz łatwo odpiąć kaptur, gdy nie jest potrzebny.', '', 'kurtka-puchowa-y-3', '', '', '', 'Kurtka puchowa Y-3', '', '', '', ''),
(681, 1, 1, 'Ta koszulka adidas łączy klasyczny styl z 3 paskami z miękką dzianiną bawełnianą, tworząc swobodny, nieskończenie wygodny look na co dzień. Dopasowany krój otula i podkreśla sylwetkę. Model Idealny na dzień załatwiania spraw lub relaksu w domu. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć pod adresem: bettercotton.org/learnmore', '', 'koszulka-adicolor-classics-slim-3-stripes', '', '', '', 'Koszulka Adicolor Classics Slim 3-Stripes', '', '', '', ''),
(682, 1, 1, 'Zawsze jesteś sobą. Bez kompromisów. Pokaż swoją oryginalność w tej bluzie z kapturem adidas stworzonej z myślą o każdym ciele i każdej chwili. Jej minimalistyczny styl sprawia, że łatwo jest ją łączyć i zestawiać z innymi elementami stroju, a bawełna zapewnia komfort w każdej sytuacji. Wybierz monochromatyczny look lub skontrastuj ją z bardziej szalonymi kolorami. Po prostu noś ją w swoim stylu.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-essentials-regular-hoodie', '', '', '', 'Adicolor Essentials Regular Hoodie', '', '', '', ''),
(683, 1, 1, 'Legginsy kolarskie z kolekcji adidas by Stella McCartney powstały, aby poruszać się razem z Tobą podczas zajęć tańca czy martwych ciągów. Wysoka, elastyczna talia gwarantuje pewne wsparcie, a technologia HEAT.RDY daje przewiewny komfort, gdy trening lub dzień nabiera tempa. Tylna kieszeń umożliwia dyskretne przechowywanie drobiazgów, a wycinane laserowo perforacje zapewniają cyrkulację powietrza, zwiększając przewiewność i komfort. Gotowa? Jasne, że tak!\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'legginsy-adidas-by-stella-mccartney-truepurpose-optime-training-bike', '', '', '', 'Legginsy adidas by Stella McCartney TruePurpose Optime Training Bike', '', '', '', ''),
(684, 1, 1, 'Niezależnie od tego, czy odpoczywasz w domu, czy załatwiasz swoje sprawy, możesz cieszyć się przytulnym komfortem tej bluzy z kapturem. Model inspirowany bogatą tradycją adidas ma luźny krój z miękkiego materiału frotté, który tworzy swobodny look i nadaje teksturę. Ściągaczowe mankiety zapewniają dodatkowe ocieplenie, a subtelne logo Trefoil wyróżnia się na przodzie. \n\nBawełna wykorzystana w tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'bluza-z-kapturem-trefoil-oversized', '', '', '', 'Bluza z kapturem Trefoil Oversized', '', '', '', ''),
(685, 1, 1, 'Cyfrowy, kwiatowy wzór na tej bluzie dresowej adidas zmienia klasyczny styl w zupełnie nowy look. Ale nadal rozpoznasz charakterystyczny design w postaci 3 pasków wzdłuż każdego ramienia. Miękki trykot pozwoli Ci komfortowo przejść przez cały dzień, a kieszenie na suwaki uwolnią Twoje dłonie. \n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'bluza-dresowa-flower-firebird', '', '', '', 'Bluza dresowa Flower Firebird', '', '', '', ''),
(686, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nNiezbędny design od Y-3 zyskuje nowe oblicze. Bluza z zaokrąglonym dekoltem Organic Cotton Terry ma swobodny, obszerny krój z miękkiego, bawełnianego materiału frotté. Stonowane, miękkie w dotyku logo Y-3 stanowi wyrózniający się akcent.\n\nTen produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'y-3-organic-cotton-terry-crew-sweater', '', '', '', 'Y-3 Organic Cotton Terry Crew Sweater', '', '', '', ''),
(687, 1, 1, 'Szukasz czegoś w wyrazistym, niezobowiązującym stylu do noszenia na co dzień? Sięgnij po tę koszulkę adidas. Ma proste linie i gładki styl adidas, co sprawia, że doskonale pasuje do spodni dresowych, dżinsów i legginsów.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'loungewear-essentials-slim-logo-tee', '', '', '', 'LOUNGEWEAR Essentials Slim Logo Tee', '', '', '', ''),
(688, 1, 1, 'Basen wzywa, słyszysz? Ten strój do pływania adidas jest gotowy, aby Cię tam zabrać, niezależnie od tego, czy pokonujesz kolejne długości basenu, czy po prostu relaksujesz się w wodzie. Charakterystyczne 3 paski biegną wzdłuż boków, podkreślając Twój dumny styl adidas. A ponieważ zechcesz nosić go na okrągło, odporny na działanie chloru materiał pochodzący z recyklingu sprawi, że Twój strój do pływania pozostanie w najlepszej formie na każdą przygodę.', '', 'adidas-3-stripes-swimsuit', '', '', '', 'adidas 3-Stripes Swimsuit', '', '', '', ''),
(689, 1, 1, 'Postaw na dobry styl. Ocieplana kurtka z kapturem adidas Essentials  zatrzymuje ciepło dzięki syntetycznej izolacji, sprawiając, że możesz pewnie przemierzać dzień, nie rezygnując przy tym ze stylu. Od zabudowanego dekoltu poprzez kaptur, aż po materiały pochodzące z recyklingu, ta kurtka pozwoli Ci czuć się dobrze w każdym aspekcie.', '', 'essentials-insulated-hooded-jacket', '', '', '', 'Essentials Insulated Hooded Jacket', '', '', '', ''),
(690, 1, 1, 'Gdziekolwiek zaprowadzi Cię Twoje piłkarskie wsparcie, spodnie dresowe Germany Beckenbauer zapewnią Ci klasyczny styl. Dopasowany krój i konstrukcja z mieszanki bawełnianej dbają o lekki komfort na co dzień. Kieszenie na suwak bezpiecznie pomieszczą niezbędne drobiazgi, dzięki czemu możesz skoncentrować się na akcji na akcji na boisku, a zamszowe godło drużyny i logo Trefoil stanowią wykończenie godne mistrzów. Te legendarne spodnie dresowe prosto z archiwów adidas sprawdzą się zawsze i wszędzie.\n\nWybierając materiały pochodzące z recyklingu, możemy ponownie wykorzystać materiały, które już zostały wyprodukowane, co pomaga zmniejszyć ilość odpadów. Co najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'spodnie-dresowe-germany-beckenbauer', '', '', '', 'Spodnie dresowe Germany Beckenbauer', '', '', '', ''),
(691, 1, 1, 'Staw czoła deszczowej aurze w tej wyszukanej, wodoodpornej parce od adidas. Syntetyczna izolacja zapewnia ciepło bez obciążenia. Odpinane wykończenie z futra pozwoli Ci podkręcić swój look. Regulowane mankiety zapewniają idealne dopasowanie.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'parka-hooded-fur', '', '', '', 'Parka Hooded Fur', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(692, 1, 1, 'Daj z siebie wszystko, ciesząc się pełnym komfortem. Te legginsy adidas zapewnią Ci doskonałą wydajność podczas najbardziej intensywnych treningów. Możesz bez przeszkód przekraczać własne granice, ponieważ HEAT.RDY pomoże Ci dać z siebie wszystko przez całą sesję treningową. Model dopasowuje się do ruchów Twojego ciała i rozciąga w czterech kierunkach oraz zapewnia wentylację tam, gdzie najbardziej jej potrzebujesz. Są gładkie i zapewniają wsparcie, więc poczujesz moc od razu, gdy tylko je założysz. Schowaj niezbędne drobiazgi do kieszeni i skoncentruj się na swoich ruchach.\n\nTen produkt został wykonany w 100% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tailored-hiit-training-7-8-leggings', '', '', '', 'Tailored HIIT Training 7/8 Leggings', '', '', '', ''),
(693, 1, 1, 'Jest coś szczególnego w spodniach dresowych z polaru, prawda? Miękkie, miłe w dotyku i idealne do noszenia na co dzień. Ta luźna para od adidas by Stella McCartney to strzał w dziesiątkę w każdym detalu, od ściągaczowych mankietów po kieszenie po bokach. To swobodny sposób na dopracowanie wygody, która towarzyszy Ci przez cały dzień.\n\nTen produkt został wykonany z naturalnych i odnawialnych materiałów w ramach naszego dążenia do ograniczenia wykorzystania kurczących się zasobów surowców i wyeliminowania zanieczyszczenia plastikiem.', '', 'spodnie-dresowe-adidas-by-stella-mccartney-fleece', '', '', '', 'Spodnie dresowe adidas by Stella McCartney Fleece', '', '', '', ''),
(694, 1, 1, 'Miła w dotyku, ciepła i stylowa warstwa okrycia na chłodne dni? To brzmi niemal zbyt dobrze, żeby było prawdziwe. Ta wyściełana kurtka z kolekcji adidas by Stella McCartney została stworzona z myślą o chłodnym powietrzu bez szkody dla dobrego wyglądu. Ma mocną warstwę wierzchnią z tkaniny i technologię WIND.RDY, która chroni przed kaprysami pogody. Podwójne zapięcie na suwaki z przodu i zatrzaski oraz regulowany kaptur ułatwiają zdejmowanie, gdy zdecydujesz, że już nie potrzebujesz tego okrycia. Mnóstwo kieszeni pomieści niezbędne drobiazgi w zasięgu ręki, a regulowany dół i mankiety pozwolą Ci podkreślić sylwetkę. Luźny krój pomieści pod spodem sweter lub szalik.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'kurtka-adidas-by-stella-mccartney-truenature-long-padded', '', '', '', 'Kurtka adidas by Stella McCartney TrueNature Long Padded', '', '', '', ''),
(695, 1, 1, 'Zabłyśnij sportowym stylem dzięki dopasowanej koszulce. 3 paski w kontrastowym kolorze wzdłuż obu rękawów przyciągają wzrok. Koszulka ma klasyczny look, który pasuje niemal do wszystkiego ― od dżinsów poprzez spódniczkę tenisową aż po legginsy treningowe.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-slim-3-stripes-tee-plus-size', '', '', '', 'Essentials Slim 3-Stripes Tee (Plus Size)', '', '', '', ''),
(696, 1, 1, 'Śmiały, gumowany napis prezentuje nazwę Twojego ulubionego miasta, a 3 paski podkreślają Twój dumny styl adidas. Ta bluza z kapturem adidas została uszyta z miłego w dotyku materiału i wykończona wygodnymi, ściągaczowymi detalami. Kieszenie pomieszczą Twój telefon w zasięgu ręki, gdy spacerujesz po bulwarach. Ten model został uszyty z wykorzystaniem UNITEFIT — uniwersalnego systemu dopasowania uwzględniającego różne rozmiary, płcie i typy sylwetki.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'bluza-z-kapturem-graphic-gender-neutral', '', '', '', 'Bluza z kapturem Graphic (Gender Neutral)', '', '', '', ''),
(697, 1, 1, 'Nie potrzebujesz biustonosza sportowego, który wygląda jak średniowieczne narzędzie tortur. Nie musisz też zakładać dwóch lub trzech biustonoszy, aby uzyskać wsparcie na odpowiednim poziomie. Wszystko, czego potrzebujesz, to biustonosz treningowy adidas AEROREADY. Minimalistyczny design i solidne wsparcie sprawiają, że jesteś gotowa na trening ze skakanką czy sparing.', '', 'adidas-tlrd-move-training-high-support-bra-plus-size', '', '', '', 'adidas TLRD Move Training High-Support Bra (Plus Size)', '', '', '', ''),
(698, 1, 1, 'Załóż ten biustonosz treningowy adidas solo lub noś go jako warstwę. Tak czy tak, sprawdzi się podczas intensywnych treningów. Ma gładki, kompresyjny design, który zapewnia komfort bez czynników rozpraszających i wsparcie przez cały dzień. Pochłaniający wilgoć AEROREADY dba o suchy komfort niezależnie od tego, jak intensywnie ćwiczysz. Detale z siateczki gwarantują przepływ powietrza w strefach najbardziej narażonych na pocenie, dając Ci uczucie przewiewnego komfortu. W zależności od potrzeb możesz wyjąć wkładki lub je zostawić.', '', 'powerreact-training-medium-support-techfit-bra', '', '', '', 'Powerreact Training Medium-Support Techfit Bra', '', '', '', ''),
(699, 1, 1, 'Zadbaj o siebie w tych wygodnych legginsach Adicolor. Konstrukcja z miękkiej i elastycznej dzianiny o gęstym splocie łączy naszą bogatą tradycję adidas z nowym, świeżym designem. Nasze kultowe 3 paski wyróżniają się wzdłuż nogawek. Legginsy idealne na spotkania w klubie czytelników lub wieczory filmowe z pewnością szybko staną się podstawowym elementem garderoby. \n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'legginsy-adicolor-classics-3-stripes-v-waistband', '', '', '', 'Legginsy Adicolor Classics 3-Stripes V-Waistband', '', '', '', ''),
(700, 1, 1, 'Zabłyśnij sportowym stylem dzięki dopasowanej koszulce. 3 paski w kontrastowym kolorze wzdłuż obu rękawów przyciągają wzrok. Koszulka ma klasyczny look, który pasuje niemal do wszystkiego ― od dżinsów poprzez spódniczkę tenisową aż po legginsy treningowe.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-slim-3-stripes-tee', '', '', '', 'Essentials Slim 3-Stripes Tee', '', '', '', ''),
(701, 1, 1, 'Wybierz sportowe spodnie adidas o dopasowanym kroju i w klasycznym klimacie, które sprawdzą się także w codziennych stylizacjach. Elastyczna talia ze sznurkiem do regulacji i mankiety w kostkach sprawiają, że spodnie pozostają na swoim miejscu, bez względu na intensywność treningu. \n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-single-jersey-3-stripes-pants', '', '', '', 'Essentials Single Jersey 3-Stripes Pants', '', '', '', ''),
(702, 1, 1, 'Zrealizuj plan dnia, ciesząc się miękkością elastycznych legginsów, które dotrzymają Ci kroku przez cały dzień. Klasyczne logotypy adidas stanowią stylowy akcent. Wysoka talia nadaje im nowoczesny styl, który pasuje do wszystkiego, co masz w szafie.\n\nNasze bawełniane produkty wspierają uprawę bawełny ze zrównoważonych źródeł. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'essentials-high-waisted-logo-leggings-plus-size', '', '', '', 'Essentials High-Waisted Logo Leggings (Plus Size)', '', '', '', ''),
(703, 1, 1, 'Kiedy praktycznie nie zdejmujesz legginsów, lepiej, aby były one wygodne. Te legginsy treningowe adidas otulają ciało, wspierając Twoje ruchy przez cały dzień. Strategicznie rozmieszczona siateczka zapewnia przepływ powietrza w miejscach najbardziej narażonych na pocenie. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'techfit-stash-pocket-full-length-leggings', '', '', '', 'Techfit Stash Pocket Full-Length Leggings', '', '', '', ''),
(704, 1, 1, 'Ruszaj na pole golfowe i wykonuj zamachy bez ograniczeń w szortach adidas do gry w golfa. Są uszyte z miękkiego, elastycznego materiału i mają wsuwaną konstrukcję, dzięki czemu łatwo się je zakłada i zdejmuje po skończonej rundzie. Subtelne zaszewki nadają im teksturowany look, który możesz nosić na polu golfowym i poza nim.', '', 'pintuck-5-inch-pull-on-golf-shorts', '', '', '', 'Pintuck 5-Inch Pull-On Golf Shorts', '', '', '', ''),
(705, 1, 1, 'Y-3 powraca do jednego z najbardziej kultowych designów adidas w postaci spodni dresowych Firebird z szerokimi nogawkami. Mają swobodny krój z mieszanki poliestru pochodzącego z recyklingu. Ukryte i wyeksponowane zatrzaski, regulowane sznurki i wkomponowane 3 paski podkreślają nowoczesną sylwetkę.', '', 'y-3-firebird-wide-leg-track-pants', '', '', '', 'Y-3 Firebird Wide-Leg Track Pants', '', '', '', ''),
(706, 1, 1, 'Załóż te spodnie adidas, aby się rozgrzać przed treningiem, a potem ciesz się swobodą, nosząc je przez resztę dnia. Dopasowany krój nadaje całości sportowy look, a elastyczna talia regulowana sznurkiem zabezpiecza model na swoim miejscu. Całość została uszyta z bawełnianego materiału frotté, który zapewni Ci komfort niezależnie od tego, co przyniesie dzień.', '', 'essentials-3-stripes-french-terry-cuffed-pants', '', '', '', 'Essentials 3-Stripes French Terry Cuffed Pants', '', '', '', ''),
(707, 1, 1, 'Nie pozwól, aby cokolwiek stanęło Ci na drodze. Od sesji sparingowych po najcięższe treningi HIIT – ten biustonosz sportowy adidas został zaprojektowany, aby pomóc Ci pewnie się poruszać. Biustonosz o mocnym wsparciu jest uszyty z gładkiego materiału, który jest chłodny w dotyku. AEROREADY zarządza wilgocią podczas intensywnych treningów. Szerokie, wyściełane ramiączka równomiernie rozkładają obciążenie i nie wpijają się w skórę.', '', 'adidas-tlrd-impact-training-high-support-bra', '', '', '', 'adidas TLRD Impact Training High-Support Bra', '', '', '', ''),
(708, 1, 1, 'Dzień treningu nóg. Dzień treningu cardio. Na każdy dzień. Poczuj blokujące dopasowanie i wsparcie podczas sesji dzięki legginsom adidas. Są lekkie i przylegające niczym druga skóra. Pochłaniają wilgoć dzięki AEROREADY i mają panele z siateczki, które zapewniają przepływ powietrza w kluczowych obszarach. Oznacza to, że możesz dać z siebie wszystko w każdej chwili. Bez żadnych kompromisów. Bez przeszkód.', '', 'techfit-long-leggings', '', '', '', 'Techfit Long Leggings', '', '', '', ''),
(709, 1, 1, 'Uniwersalna bluza adidas z kapturem i suwakiem to zawsze strzał w dziesiątkę. Miękka warstwa z materiału frotté zapewni Ci okrycie przez cały dzień, niezależnie od tego, czy po prostu załatwiasz swoje sprawy, czy szykujesz się na wieczór w domu. Nie zapomnij skorzystać z kaptura. Ma sznurek do regulacji, który pozwoli Ci się wyciszyć. Możesz go nawet wykorzystać w czasie spontanicznej drzemki po południu. Jak tu nie kochać bluzy, w której możesz na chwilkę zapomnieć o świecie?\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-3-stripes-french-terry-regular-full-zip-hoodie', '', '', '', 'Essentials 3-Stripes French Terry Regular Full-Zip Hoodie', '', '', '', ''),
(710, 1, 1, 'Niezależnie od tego, czy wybierasz się do parku dla psów, czy do księgarni, ta bluza dresowa Adicolor zapewni Ci komfort i stylowy look. Klasyczny design adidas prezentuje przemyślane detale, takie jak 3 paski wzdłuż rękawów i wyszywane logo Trefoil na piersi. Wykonana z wygodnej mieszanki bawełnianej nowa odsłona popularnego stylu jest idealnym dodatkiem do każdej garderoby.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'bluza-dresowa-adicolor-classics-sst', '', '', '', 'Bluza dresowa Adicolor Classics SST', '', '', '', ''),
(711, 1, 1, 'Y-3 stale zgłębia to, co znane, skupiając się na odzieży roboczej i funkcjonalnych fasonach, nieustannie poszerzając granice przewidywalności. Parka typu bomber od Y-3 została uszyta z luksusowego diagonalu z bawełny i nylonu, dzięki czemu ma swobodny krój wykończony ściągaczowymi detalami. Elastyczna talia dodaje całości charakteru i zwiększa objętość.', '', 'parka-y-3-long-bomber', '', '', '', 'Parka Y-3 Long Bomber', '', '', '', ''),
(712, 1, 1, 'Jeśli chodzi o Twój dzień, nie pozostawiaj niczego przypadkowi. Te legginsy adidas do gry w golfa są elastyczne i zapewniają wsparcie przez całą poranną rundę. Wyglądają na tyle stylowo, że możesz w nich wyjść na lunch po meczu, i zapewniają całkowity komfort, gdy załatwiasz popołudniowe sprawy. Model z COLD.RDY zapewni Ci ciepło, gdy na dworze jest chłodno. Ściągaczowa talia zapewnia idealne, pewne dopasowanie przez cały dzień, a boczne kieszenie pomieszczą Twoje rzeczy. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 70% materiałów z odzysku, stanowiąc tylko jedno proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'legginsy-coldrdy', '', '', '', 'Legginsy COLD.RDY', '', '', '', ''),
(713, 1, 1, 'Uniwersalność na co dzień plus klasyczny styl. Te legginsy adidas mają charakterystyczny, sportowy look z 3 paskami i logo adidas Badge of Sport na biodrze. Elastyczny i wygodny model został uszyty z miękkiej bawełny.\n\nNasze bawełniane produkty wspierają zrównoważoną uprawę bawełny. To część naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów.', '', 'loungewear-essentials-3-stripes-leggings', '', '', '', 'LOUNGEWEAR Essentials 3-Stripes Leggings', '', '', '', ''),
(714, 1, 1, 'Model stworzony z myślą o pięknej grze. Spodnie piłkarskie adidas, będące częścią kolekcji Tiro 23 League, wykorzystują AEROREADY, aby odprowadzać wilgoć od skóry i umożliwić Ci dynamiczną grę na pełnych obrotach. Suwaki w kostkach ułatwiają zdejmowanie spodni po zakończeniu sesji.', '', 'tiro-23-league-pants', '', '', '', 'Tiro 23 League Pants', '', '', '', ''),
(715, 1, 1, 'Uniwersalna bluza adidas z kapturem i suwakiem to zawsze strzał w dziesiątkę. Miękka warstwa z materiału frotté zapewni Ci okrycie przez cały dzień, niezależnie od tego, czy po prostu załatwiasz swoje sprawy, czy szykujesz się na wieczór w domu. Nie zapomnij skorzystać z kaptura. Ma sznurek do regulacji, który pozwoli Ci się wyciszyć. Możesz go nawet wykorzystać w czasie spontanicznej drzemki po południu. Jak tu nie kochać bluzy, w której możesz na chwilkę zapomnieć o świecie?\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'essentials-3-stripes-french-terry-regular-full-zip-hoodie', '', '', '', 'Essentials 3-Stripes French Terry Regular Full-Zip Hoodie', '', '', '', ''),
(716, 1, 1, 'Wsłuchanie się w siebie jest częścią procesu. Pomiędzy momentami, gdy dajesz z siebie wszystko, pozwól, aby te wyjątkowo wygodne szorty adidas z zabudowaną talią pomogły Ci znaleźć strefę komfortu. Twoją strefę. Rozciągający się w czterech kierunkach materiał nie krępuje ruchów. Ukryta, elastyczna talia i zwiewny krój nadają im futurystyczny look. Ukryta kieszeń na suwak bezpiecznie przechowa niezbędne drobiazgi.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'szorty-zne', '', '', '', 'Szorty Z.N.E.', '', '', '', ''),
(717, 1, 1, 'Noś je, jak chcesz. Minimalistyczny design tych legginsów adidas oznacza, że łatwo nosić je w swoim własnym stylu.  Zestaw ten model z obszernymi bluzami z kapturem, masywnymi butami treningowymi lub prześwitującą koszulką. Niezależnie od tego, w czym czujesz się dobrze, ten model ze wszystkim wygląda świetnie. Miękki, otulający ciało materiał sięga talii.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'adicolor-essentials-leggings', '', '', '', 'Adicolor Essentials Leggings', '', '', '', ''),
(718, 1, 1, 'Na siłowni czy w słońcu te dopasowane szorty ułatwiają trening bez dekoncentracji. Uszyto je z miękkiego, elastycznego materiału, który usuwa wilgoć z powierzchni Twojej skóry, dbając o Twój suchy komfort. Przedłużony tył zapewnia dodatkową osłonę.', '', 'pacer-3-stripes-knit-shorts', '', '', '', 'Pacer 3-Stripes Knit Shorts', '', '', '', ''),
(719, 1, 1, 'Torba adidas Festival to połączenie stylu i funkcjonalności. Torba idealna na codzienne dojazdy lub jednodniową wycieczkę pomoże Ci uporządkować rzeczy i świetnie wyglądać. W przedniej kieszeni na suwak bezpiecznie przechowasz niezbędne drobiazgi, a wszystko inne zmieścisz w komorze głównej na suwak. Regulowany, przewieszany przez tułów pasek sprawia, że model idealnie się układa, a tkanina o splocie płóciennym z nadrukiem Trefoil jest trwała i stylowa.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'monogram-festival-bag', '', '', '', 'Monogram Festival Bag', '', '', '', ''),
(720, 1, 1, 'Czapka beanie z wywijanym brzegiem zyskała w tym sezonie świeżą kolorystykę. Naszywka z logo Trefoil nadaje jej subtelny akcent adidas. Szew na górze zapewnia jej odpowiedni kształt.', '', 'adicolor-cuff-beanie', '', '', '', 'Adicolor Cuff Beanie', '', '', '', ''),
(721, 1, 1, 'Noś swój sprzęt piłkarski w dobrym stylu dzięki torbie-workowi adidas Tiro League. Mały rozmiar idealnie nadaje się na krótkie wyjazdy lub wyjście na siłownię, a wyściełany pasek na ramię zadba o Twój komfort w każdej podróży. Zapięcie w kształcie litery U gwarantuje łatwy dostęp do rzeczy, a wentylowana przegroda na buty dba o ich świeżość.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-small', '', '', '', 'Tiro League Duffel Bag Small', '', '', '', ''),
(722, 1, 1, 'Od stoków po miejskie wyprawy, ta czapka beanie adidas pomoże Ci pokonać chłód za sprawą klasycznego looku. Wywijany brzeg i ściągaczowy materiał zapewniają wygodę. Logo Badge of Sport uzupełnia ponadczasowy look.', '', 'czapka-logo', '', '', '', 'Czapka Logo', '', '', '', ''),
(723, 1, 1, 'Czapki robią dwie rzeczy: zapewniają ciepło Twojej głowie i uzupełniają Twój strój. Wnieś tę łagodną energię do swojego stylu dzięki czapce beanie adidas. Lekka, jednowarstwowa konstrukcja sprawia, że model idealnie sprawdzi się w każdych warunkach pogodowych. Śmiała grafika adidas nawiązuje do Twojego ducha oryginalności.', '', 'czapka-daily-light', '', '', '', 'Czapka Daily Light', '', '', '', ''),
(724, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(725, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(726, 1, 1, 'Szalik Y-3 Mixed Yarn łączy dwie różne konstrukcje — jednobarwną, ściągaczową strukturę skontrastowaną z puszystą przędzą na końcach. Wyszywane logotypy Y-3 uzupełniają całość.', '', 'szalik-y-3-mixed-yarn', '', '', '', 'Szalik Y-3 Mixed Yarn', '', '', '', ''),
(727, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(728, 1, 1, 'Kij Fabela ma klasyczny kształt odpowiedni na uniwersalnych zawodniczek i gwarantujący średni poziom mocy. Geometria 3D i łopatka Pure Control zapewniają poczucie równowagi i precyzję podczas gry. Częściowa osłona Kromaskin w strefie uderzenia zapewnia doskonały kontakt z piłką i dodaje mocy.', '', 'kij-do-hokeja-fabela-kromaskin-92-cm-field', '', '', '', 'Kij do hokeja Fabela Kromaskin 92 cm Field', '', '', '', ''),
(729, 1, 1, 'Czapka Y-3 Knitted ma klasyczny fason wykonany w całości z dzianej przędzy. Wkomponowane 3 paski biegną z przodu do tyłu, a całość uzupełnia naszywka Y-3 na wywijanym brzegu.', '', 'czapka-y-3-knitted', '', '', '', 'Czapka Y-3 Knitted', '', '', '', ''),
(730, 1, 1, 'Czapka-kapelusik, która jest synonimem miejskiej mody, łączy szyk ze swobodą. Kapelusz Y-3 pozostaje wierny swoim miejskim korzeniom, jednocześnie podkreślając dbałość o detale. Monochromatyczne logo Y-3 uzupełnia całość.', '', 'kapelusz-y-3-staple-bucket', '', '', '', 'Kapelusz Y-3 Staple Bucket', '', '', '', ''),
(731, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(732, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(733, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(734, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(735, 1, 1, 'Torba-worek adidas Tiro League idealna na Twój sprzęt piłkarski ma mocną przegrodę na dole i boczną kieszeń z siateczki, w której przechowasz przekąski i bidon. Wyściełany, regulowany pasek na ramię sprawia, że można ją nosić wygodnie na wiele sposobów. Uchwyty ułatwiają przenoszenie, gdy spieszysz się na trening.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-small', '', '', '', 'Tiro League Duffel Bag Small', '', '', '', ''),
(736, 1, 1, 'Położenie kresu plastikowym odpadom to nie tylko marzenie. Dla adidas jest to cel. Ten stalowy bidon Parley for the Oceans pokaże, kogo wspierasz. Bo razem możemy to zrobić.', '', 'parley-for-the-oceans-steel-water-bottle', '', '', '', 'Parley for the Oceans Steel Water Bottle', '', '', '', ''),
(737, 1, 1, 'Niezależnie od tego, czy wychodzisz na miasto załatwiać swoje sprawy, czy ruszasz w poszukiwaniu przygód, ta czapka adidas zapewni Ci okrycie. Wyreguluj pasek z tyłu, aby uzyskać indywidualne dopasowanie i cieszyć się komfortem przez cały dzień. Niezbędny element codziennej garderoby, który doda stylu każdemu Twojemu strojowi. \n\nBawełna wykorzystana w tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'czapka', '', '', '', 'Czapka', '', '', '', ''),
(738, 1, 1, 'Chociaż przed Tobą może nie być długiego dnia spędzonego na morzu, ta rybacka czapka w stylu Adicolor to idealny towarzysz na wietrzne dni. Wywijany brzeg i stonowana kolorystycznie naszywka z logo Trefoil nadają całości wyrazisty look, a konstrukcja z dzianiny o gładkim splocie zapewnia komfort przez cały dzień. Wrzuć tę czapkę od adidas do torby, a następnym razem, gdy zrobi się chłodno, nic nie powstrzyma Cię przed wyjściem. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-adicolor-short', '', '', '', 'Czapka Adicolor Short', '', '', '', ''),
(739, 1, 1, 'Powitaj jesień w dobrym stylu. Gotowa na chłodniejsze dni czapka beanie adidas zapewni Ci komfort, ciepło i zachęci do wyjścia na dwór. Design z mankietami prezentuje 3 paski z tyłu i ponadczasowe logo Trefoil z przodu. Model z mieszanki bawełny i akrylu jest miękki i elastyczny, dzięki czemu zapewnia idealne dopasowanie. \n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć pod adresem: bettercotton.org/learnmore', '', 'czapka-adicolor-cuff-knit', '', '', '', 'Czapka Adicolor Cuff Knit', '', '', '', ''),
(740, 1, 1, 'Torba adidas łącząca urok stylu retro z praktycznością na co dzień. Model z gładkiej, sztucznej skóry z dużym logo Trefoil wytłoczonym z przodu ma regulowany pasek, który zapewni Ci wygodę, oraz srebrne, metalowe akcenty, które dodają mu blasku. Minimalistyczny design idealnie pasuje do każdego stroju i pomoże Ci się wyróżniać albo wtapiać w tło.', '', 'torba-polyurethane-embossed-trefoil-mini-airliner', '', '', '', 'Torba Polyurethane Embossed Trefoil Mini Airliner', '', '', '', ''),
(741, 1, 1, 'Model idealny na siłownię i weekendowe wypady. Ta torba adidas ma solidny spód, który ochroni Twoje rzeczy. Komora główna z dwukierunkowym suwakiem daje łatwy dostęp do wyposażenia z obu stron. Model ma mnóstwo kieszeni i wbudowaną przegrodę na buty, w której oddzielisz sneakery od reszty.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-linear-duffel-bag-medium', '', '', '', 'Essentials Linear Duffel Bag Medium', '', '', '', ''),
(742, 1, 1, 'Monochromatyczna czapka adidas w minimalistycznym stylu. Subtelna naszywka z brandingiem nadaje jej przyciągający wzrok design, który odbija światło. Wyreguluj pasek z tyłu, aby znaleźć perfekcyjne dopasowanie.  \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-metal-badge-lightweight-baseball', '', '', '', 'Czapka Metal Badge Lightweight Baseball', '', '', '', ''),
(743, 1, 1, 'Ciesz się ciepłem i wyglądaj świeżo. Ta czapka adidas typu beanie zapewnia ciepły komfort i śmiały look, który wyjątkowo do Ciebie pasuje. Pompon wnosi tę zabawną energię. Duża grafika adidas podkreśla oryginalność.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-pompom', '', '', '', 'Czapka Pompom', '', '', '', ''),
(744, 1, 1, 'Torba-nerka z kolekcji adidas by Stella McCartney odświeża podstawowy element codziennego stroju przy pomocy dodatkowych, funkcjonalnych kieszeni na suwaki z przodu. Załóż ją na plecy, gdy planujesz wędrówkę lub bieg, lub noś jako przewieszoną przez tułów koszulkę, gdy trening obejmuje przetaczanie się przez burzę na festiwalu muzycznym.\n\nAby ograniczyć zużycie nowo produkowanych materiałów, dbamy o to, aby w naszych wegańskich zamiennikach znajdowało się co najmniej 25% materiałów pochodzących z recyklingu.', '', 'adidas-by-stella-mccartney-bum-bag', '', '', '', 'adidas by Stella McCartney Bum Bag', '', '', '', ''),
(745, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nProstota czapki Y-3 z tkaniny ripstop odpowiada za jej uniwersalność. Jednobarwna konstrukcja jest przewiewna dzięki oczkom wentylacyjnym na główce. Duże, stonowane kolorystycznie logo Y-3 zdobi przód.', '', 'y-3-logo-cap', '', '', '', 'Y-3 Logo Cap', '', '', '', ''),
(746, 1, 1, 'Model idealny na siłownię i weekendowe wypady. Ta torba adidas ma solidny spód, który ochroni Twoje rzeczy. Komora główna z dwukierunkowym suwakiem daje łatwy dostęp do wyposażenia z obu stron. Model ma mnóstwo kieszeni i wbudowaną przegrodę na buty, w której oddzielisz sneakery od reszty.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-linear-duffel-bag-medium', '', '', '', 'Essentials Linear Duffel Bag Medium', '', '', '', ''),
(747, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(748, 1, 1, 'Niewidoczne w butach skarpetki adidas idealnie nadają się do noszenia ze sneakerami. Wsparcie łuku stopy i lekka konstrukcja zapewniają wygodne dopasowanie, gdy odpoczywasz na kanapie lub wychodzisz pobiegać. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-no-show-socks-3-pairs', '', '', '', 'Thin and Light No-Show Socks 3 Pairs', '', '', '', ''),
(749, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(750, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(751, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(752, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(753, 1, 1, 'Noś te skarpetki adidas do kostki z niskimi sneakerami, aby pokazać subtelne, a jednocześnie wyróżniające się logo. Skarpety z mieszanki bawełny i poliestru powstały z myślą o komforcie przez cały dzień. Amortyzacja w pięcie i palcach wspiera każdy krok, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-3-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 3 Pairs', '', '', '', ''),
(754, 1, 1, 'Skarpety adidas do łydki uszyte z miękkiej w dotyku bawełny i poliestru. Wspierające podbicie, amortyzacja w pięcie i palcach komfortowo otulają Twoją stopę, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-crew-socks-6-pairs', '', '', '', 'Cushioned Sportswear Crew Socks 6 Pairs', '', '', '', ''),
(755, 1, 1, 'Skarpety adidas do łydki uszyte z miękkiej w dotyku bawełny i poliestru. Wspierające podbicie, amortyzacja w pięcie i palcach komfortowo otulają Twoją stopę, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-crew-socks-6-pairs', '', '', '', 'Cushioned Sportswear Crew Socks 6 Pairs', '', '', '', ''),
(756, 1, 1, 'Znajdź swoje ulubione miejsce między piętą a łydką. Skarpety adidas do pół łydki nie są ani za krótkie, ani za długie. Zapewnią Ci świetny look podczas treningu lub odpoczynku. Bawełniana konstrukcja gwarantuje idealny komfort i dopasowanie.', '', 'mid-cut-crew-socks-3-pairs', '', '', '', 'Mid-Cut Crew Socks 3 Pairs', '', '', '', ''),
(757, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(758, 1, 1, 'Niewidoczne w butach skarpetki adidas idealnie nadają się do noszenia ze sneakerami. Wsparcie łuku stopy i lekka konstrukcja zapewniają wygodne dopasowanie, gdy odpoczywasz na kanapie lub wychodzisz pobiegać. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-no-show-socks-3-pairs', '', '', '', 'Thin and Light No-Show Socks 3 Pairs', '', '', '', ''),
(759, 1, 1, 'Niezobowiązujący spacer lub intensywny trening — te niskie skarpetki adidas pozostaną na swoim miejscu tak długo, jak tego potrzebujesz. Uszyto je z mieszanki bawełny, poliestru i nylonu, która jest miękka i przewiewna i wzbogacona o odrobinę streczu. Amortyzacja w piętach i palcach łączy się ze wsparciem śródstopia, zapewniając komfort nawet podczas intensywnych ćwiczeń. Od kultowego logo adidas Badge of Sport po stonowane kolorystycznie 3 paski — to niepowtarzalny styl adidas.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-low-cut-socks-3-pairs', '', '', '', 'Cushioned Low-Cut Socks 3 Pairs', '', '', '', ''),
(760, 1, 1, 'Logo Trefoil stało się czymś więcej niż tylko rozpoznawalną ikoną. Nosili je nasi ulubieni sportowcy, muzycy i artyści. Oznacza styl i komfort nawet w skarpetkach. Skarpety adidas Trefoil Cushion Crew są dostępne w opakowaniu po 3 par, aby zapewnić Ci świeży komfort.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'trefoil-cushion-crew-socks-3-pairs', '', '', '', 'Trefoil Cushion Crew Socks 3 Pairs', '', '', '', ''),
(761, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(762, 1, 1, 'Dodaj sportowy akcent za sprawą tych skarpet adidas do kostki. Konstrukcja z mieszanki bawełny i poliestru jest miękka i przewiewna, a zintegrowane szwy w palcach zapobiegają otarciom. Amortyzacja w pięcie i palcach oraz wspierające dopasowanie w łuku stopy zapewniają komfort przez cały dzień. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-6-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(763, 1, 1, 'Skarpety adidas o długości do kostki zostały uszyte z miękkiej, oddychającej mieszanki bawełny i nylonu poliestrowego. Amortyzacja w pięcie i palcach dba o Twój komfort, gdy idziesz na siłownię lub po prostu odpoczywasz. Ten zestaw trzech par ma branding wzdłuż kostek w sportowym stylu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-ankle-socks-cushioned-socks-3-pairs', '', '', '', 'Linear Ankle Socks Cushioned Socks 3 Pairs', '', '', '', ''),
(764, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', '', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(765, 1, 1, 'Niskie skarpetki adidas miękko przylegają do Twoich stóp. Konstrukcja z mieszanki lekkiej bawełny i poliestru idealnie dopasowuje się do łuku stopy, a zintegrowane szwy w palcach zapobiegają otarciom. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-sportswear-low-cut-socks-3-pairs', '', '', '', 'Thin and Light Sportswear Low-Cut Socks 3 Pairs', '', '', '', ''),
(766, 1, 1, 'Krótkie skarpetki adidas mają krój sięgający poniżej kostek i mankiety ze ściągaczem, które utrzymują je na miejscu. Skarpety z mieszanki bawełny i poliestru są lekkie i miękkie w dotyku. Dyskretny design dostępny w opakowaniach po trzy pary idealnie pasuje do wszystkich Twoich sneakerów.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-linear-low-cut-socks-3-pairs', '', '', '', 'Thin Linear Low-Cut Socks 3 Pairs', '', '', '', ''),
(767, 1, 1, 'Noś te skarpetki adidas do kostki z niskimi sneakerami, aby pokazać subtelne, a jednocześnie wyróżniające się logo. Skarpety z mieszanki bawełny i poliestru powstały z myślą o komforcie przez cały dzień. Amortyzacja w pięcie i palcach wspiera każdy krok, a zintegrowane szwy w palcach zapobiegają otarciom.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-3-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 3 Pairs', '', '', '', ''),
