(769, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
