(796, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(797, 1, 1, 'Podstawowe elementy garderoby nigdy Cię nie zawiodą. A dzięki tym skarpetkom adidas do łydki zyskasz swobodny wybór na co dzień, który sprawdzi się w biurze, skate parku i w każdym innym otoczeniu. Wygodna mieszanka bawełniana zapewnia lekką amortyzację, a wkomponowane 3 paski i logo Trefoil nadają klasyczny look Twojej garderobie. W te wszystkie dni, kiedy nie wiesz, co na siebie włożyć, zacznij od tych skarpet i buduj swój look od podstaw.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mid-cut-crew-3-pairs', '', '', '', 'Skarpety Mid Cut Crew 3 Pairs', '', '', '', ''),
(798, 1, 1, 'Nie pozwól, by gniecenie, opadanie lub podsuwanie się do góry skarpetek spowolniło Twoje tempo. Te krótkie skarpetki adidas pozostają na miejscu pod Twoimi sneakerami bez względu na wszystko. Czujesz tylko komfort.', '', 'no-show-socks-3-pairs', '', '', '', 'No-Show Socks 3 Pairs', '', '', '', ''),
(799, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(800, 1, 1, 'Skarpetki adidas o długości do kostki mają subtelnie ściągaczowe brzegi, które utrzymują je na swoim miejscu. Model wykonany z mieszanki lekkiego, miękkiego materiału jest dostępny w opakowaniach po trzy pary i stanowi sportowe uzupełnienie Twojej szuflady na skarpetki.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'think-linear-ankle-socks-3-pairs', '', '', '', 'Think Linear Ankle Socks 3 Pairs', '', '', '', ''),
(801, 1, 1, 'Dodaj sportowy akcent za sprawą tych skarpet adidas do kostki. Konstrukcja z mieszanki bawełny i poliestru jest miękka i przewiewna, a zintegrowane szwy w palcach zapobiegają otarciom. Amortyzacja w pięcie i palcach oraz wspierające dopasowanie w łuku stopy zapewniają komfort przez cały dzień. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-sportswear-ankle-socks-6-pairs', '', '', '', 'Cushioned Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(802, 1, 1, 'Niskie skarpetki adidas miękko przylegają do Twoich stóp. Konstrukcja z mieszanki lekkiej bawełny i poliestru idealnie dopasowuje się do łuku stopy, a zintegrowane szwy w palcach zapobiegają otarciom. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-sportswear-low-cut-socks-3-pairs', '', '', '', 'Thin and Light Sportswear Low-Cut Socks 3 Pairs', '', '', '', ''),
(803, 1, 1, 'Lekkie skarpety do kostki ze wsparciem łuku stopy, bezszwową konstrukcją w palcach i odrobiną streczu idealnie nadają się do noszenia na co dzień. Kontrastowe logo adidas Badge of Sport wyróżnia się w kostce. Trzy pary w opakowaniu oznaczają, że nie musisz się martwić, co założyć, gdy jedna para jest w praniu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-ankle-socks-3-pairs', '', '', '', 'Thin and Light Ankle Socks 3 Pairs', '', '', '', ''),
(804, 1, 1, 'W tym modelu znajdziesz wiele detali, które zapewnią Ci komfort przez cały trening. Załóż te skarpetki do kostki i ruszaj na podbój świata. Elementy z siateczki usprawniają przepływ powietrza. Ciesz się suchym komfortem dzięki adidas AEROREADY. Elastyczne strefy tam, gdzie ich potrzebujesz i wsparcie w podbiciu sprawiają, że możesz się ruszać, jak tylko zechcesz. Każde opakowanie zawiera trzy pary skarpet.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-cushioned-mid-cut-socks-3-pairs', '', '', '', 'Performance Cushioned Mid-Cut Socks 3 Pairs', '', '', '', ''),
(805, 1, 1, 'Najbardziej utytułowana drużyna Ligi Mistrzów, Real Madryt, lepiej niż większość rozumie znaczenie słów hymnu turnieju. Minipiłka inspirowana oficjalną piłką meczową Ligi Mistrzów UEFA adidas idealnie nadaje się do zaprezentowania Twoich umiejętności w drodze dzięki niewielkiej sylwetce i piankowemu wnętrzem. Napis \"The Champions\" i subtelne nuty muzyczne sprawiają, że te 12 gwiazdek błyszczy dzięki mocnej, poliuretanowej powłoce.', '', 'pilka-ucl-real-madrid-mini-23-24-group-stage', '', '', '', 'Piłka UCL Real Madrid Mini 23/24 Group Stage', '', '', '', ''),
(806, 1, 1, 'Logo Trefoil stało się czymś więcej niż tylko rozpoznawalną ikoną. Nosili je nasi ulubieni sportowcy, muzycy i artyści. Oznacza styl i komfort nawet w skarpetkach. Skarpety adidas Trefoil Cushion Crew są dostępne w opakowaniu po 6 par, aby zapewnić Ci świeżość przez cały tydzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'trefoil-cushion-crew-socks-6-pairs', '', '', '', 'Trefoil Cushion Crew Socks 6 Pairs', '', '', '', ''),
(807, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
