(811, 1, 1, 'Skarpety adidas do łydki są klasyczne i wygodne. Mają sportowe, ściągaczowe mankiety, które utrzymują je na miejscu, oraz amortyzację w piętach i palcach. Wybierz zestaw trzech par, aby przygotować się na trening i weekend.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'linear-crew-cushioned-socks-3-pairs', '', '', '', 'Linear Crew Cushioned Socks 3 Pairs', '', '', '', ''),
(812, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(813, 1, 1, 'Skarpetki adidas do kostki, które idealnie pasują do sneakerów.c Uszyto je z mieszanki bawełny i poliestru, dzięki czemu są miękkie i niemal niewyczuwalne w dotyku. Zintegrowane szwy w palcach zapobiegają otarciom, a idealnie dopasowany krój wokół łuku stopy zapewnia wsparcie.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'thin-and-light-sportswear-ankle-socks-6-pairs', '', '', '', 'Thin and Light Sportswear Ankle Socks 6 Pairs', '', '', '', ''),
(814, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(815, 1, 1, 'Zapewnij swoim stopom wygodną podstawę. Te niskie skarpety treningowe adidas oferują wsparcie w podbiciu, a także miękką amortyzację w pięcie i palcach. AEROREADY reguluje wilgoć, gdy biegasz, spacerujesz lub trenujesz. W opakowaniu znajdują się trzy pary.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-cushioned-low-socks-3-pairs', '', '', '', 'Performance Cushioned Low Socks 3 Pairs', '', '', '', ''),
(816, 1, 1, 'Nie zwalniaj tempa, gdy dajesz z siebie wszystko. Krótkie skarpety treningowe adidas mają AEROREADY, który zarządza wilgocią, zapewniając Ci suchy komfort na siłowni, korcie lub szlaku. Miękki, elastyczny i cienki model w naturalny sposób dopasowuje się do ciała. W opakowaniu znajdują się trzy pary.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-light-low-socks-3-pairs', '', '', '', 'Performance Light Low Socks 3 Pairs', '', '', '', ''),
(817, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(818, 1, 1, 'Wybierz skarpety do łydki dla kobiet w sportowym stylu, który aż się skrzy. Mają lśniące akcenty z wkomponowanych 3 pasków i logo Trefoil. Subtelna, połyskliwa nuta nadaje zabawny, kobiecy akcent każdemu strojowi.', '', 'mid-cut-glitter-crew-socks-2-pairs', '', '', '', 'Mid-Cut Glitter Crew Socks 2 Pairs', '', '', '', ''),
(819, 1, 1, 'Zadbaj o swoje stopy, a reszta ułoży się sama. Skarpety do łydki adidas powstały z myślą o komforcie przez cały dzień i zostały uszyte z miękkiego, elastycznego materiału o dużej zawartości bawełny. Idealnie dopasowany i wspierający śródstopie model z amortyzacją w piętach i palcach będzie odpowiedni dla każdego sportowca.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-crew-socks-3-pairs', '', '', '', '3-Stripes Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(820, 1, 1, 'Od codziennych treningów po wielkie okazje, skarpety adidas do łydki zapewnią Ci komfort w ruchu. Otulają śródstopie i amortyzują obszary narażone na duży nacisk w piętach i palcach. Dlatego możesz skoncentrować się na wynikach, niezależnie od tego, czy biegasz, podnosisz ciężary, czy uprawiasz sport.\n\nCo najmniej 70% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'cushioned-crew-socks-3-pairs', '', '', '', 'Cushioned Crew Socks 3 Pairs', '', '', '', ''),
(821, 1, 1, 'Wnieś nieco stylu piłkarskiej elity do meczów i sesji treningowych. Ta piłka adidas League łączy bezszwową konstrukcję TSBE z wytrzymałym, butylowym pęcherzem, gwarantując niezawodną wydajność na boisku. Kolorowa grafika wyróżniająca się na powierzchni nawiązuje do oficjalnej piłki meczowej najważniejszego międzynarodowego turnieju w Europie.\n\nModel zawiera co najmniej 20% materiałów z odzysku, co pozwala uniknąć dużego wpływu na środowisko, jaki ma produkcja nowo powstałych materiałów.', '', 'pilka-fussballiebe-league', '', '', '', 'Piłka Fussballiebe League', '', '', '', ''),
(822, 1, 1, 'Torba na kije adidas VS.6 zaprojektowana specjalnie dla zawodników hokeja na trawie ma kieszeń na cały sprzęt hokejowy, w tym ochraniacze na golenie, ubrania, buty i kij. Ergonomicznie zaprojektowany system pasków oznacza, że model jest wygodny w noszeniu, więc możesz spakować się na mecz i trening tylko w tę jedną torbę.', '', 'vs6-black-gold-hockey-stick-bag', '', '', '', 'VS.6 Black/Gold Hockey Stick Bag', '', '', '', ''),
(823, 1, 1, 'Załóż czapkę beanie od adidas i pokonaj chłód. Konstrukcja ze ściągaczowego materiału zapewnia miękkie, przytulne ciepło. Wyszywane logo Badge of Sport wykończone subtelnym cieniowaniem nadaje całości luksusowy look.', '', 'czapka-essentials', '', '', '', 'Czapka Essentials', '', '', '', ''),
(824, 1, 1, 'Based on classic shapes, these adidas sport sunglasses mix performance and versatile style. Easy to wear, comfortable and durable, these sunglasses are ideal and practical during and after any type of athletic activity.', '', 'sport-sunglasses-sp0047', '', '', '', 'Sport Sunglasses SP0047', '', '', '', ''),
(825, 1, 1, '„Kolekcja Y-3 to mocne połączenie sportu i stylu oraz elektryzujący miks tradycji z nowoczesnością”. — Yohji Yamamoto \n\nProstota czapki Y-3 z tkaniny ripstop odpowiada za jej uniwersalność. Jednobarwna konstrukcja jest przewiewna dzięki oczkom wentylacyjnym na główce. Duże, stonowane kolorystycznie logo Y-3 zdobi przód.', '', 'y-3-logo-cap', '', '', '', 'Y-3 Logo Cap', '', '', '', ''),
(826, 1, 1, 'Długie skarpety Y-3 prezentują wkomponowany napis „Y” z tyłu. Miękki i wygodny model jest lekko elastyczny i ma mankiety ze ściągaczem.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i pozyskanych z odnawialnych źródeł', '', 'y-3-hi-socks', '', '', '', 'Y-3 Hi Socks', '', '', '', ''),
(827, 1, 1, 'Zadbaj o porządek podczas kolejnej przygody dzięki plecakowi adidas Adventure. Model stworzony z myślą o maksymalnej wygodzie ma zapięcie na suwak na górze i przednią kieszeń na suwak, w której przechowasz niezbędne drobiazgi, a także dwie otwarte kieszenie boczne ułatwiające dostęp do rzeczy. Regulowane szelki zapewniają bezpieczne dopasowanie, a poliestrowa podszewka i konstrukcja z tkaniny o splocie płóciennym gwarantują trwałość podczas podróży. Gdziekolwiek się udasz, zabierz ze sobą uniwersalny, funkcjonalny look.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'plecak-adidas-adventure', '', '', '', 'Plecak adidas Adventure', '', '', '', ''),
(828, 1, 1, 'Masz sporo sprzętu do noszenia. Ta torba-worek adidas go pomieści. Trwała torba ma idealną pojemność na zawody i treningi szkoleniowe poza miastem. W zamykanej na suwak przegrodzie możesz schować mokre ubrania z dala od butów. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', '4athlts-duffel-bag-medium', '', '', '', '4ATHLTS Duffel Bag Medium', '', '', '', ''),
(829, 1, 1, 'Znajdź równowagę między przewiewnym komfortem a okryciem kostek w tych skarpetkach adidas o długości do łydki. Model z mieszanki bawełny i poliestru ma gładkie w dotyku, zintegrowane szwy w palcach, które powstały z myślą o komforcie przez cały dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', '3-stripes-cushioned-sportswear-mid-cut-socks-3-pairs', '', '', '', '3-Stripes Cushioned Sportswear Mid-Cut Socks 3 Pairs', '', '', '', ''),
(830, 1, 1, 'Sprytne pakowanie to klucz do podróżowania z lekkim bagażem. Ta bardzo mała torba-worek adidas jest wystarczająco pojemna, aby szybko ją zabrać na siłownię. W siateczkowej kieszeni na suwak możesz schować mokre ubrania z dala od butów. \n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', '4athlts-duffel-bag-small', '', '', '', '4ATHLTS Duffel Bag Small', '', '', '', ''),
(831, 1, 1, 'Rękawice treningowe adidas dbają o detale, dzięki czemu możesz skupić się na ciężarze, z którym się mierzysz. Model z mocnego materiału sprawdzi się podczas intensywnych sesji treningowych: od rozgrzewki do ostatniej serii. Zapięcie na rzepy w nadgarstkach gwarantuje idealne dopasowanie, a antypoślizgowa część dłoni doskonale trzyma się hantli, sztangi i uchwytów maszyny. Materiał do wycierania nosa na kciukach to detal, który od tej pory będzie Twoim must-have, a wstawki z siateczki na plecach zwiększają przewiewność.', '', 'rekawice-training', '', '', '', 'Rękawice Training', '', '', '', ''),
(832, 1, 1, 'Dwa słowa stają się źródłem inspiracji na tle słynnego hymnu, gdy najlepsze kluby piłkarskie Europy szykują się do starcia. Ta minipiłka adidas UCL League prezentuje grafikę inspirowaną oficjalną piłką meczową Ligi Mistrzów UEFA. Napis „The Champions” i subtelny nadruk z nutami sprawiają, że te 12 gwiazdek błyszczy na bezszwowej powłoce TSBE stworzonej z myślą o perfekcyjnej grze na boisku. Piłka z certyfikatem jakości FIFA jest idealna na treningi i mecze.', '', 'ucl-league-23-24-group-stage-ball', '', '', '', 'UCL League 23/24 Group Stage Ball', '', '', '', ''),
(833, 1, 1, 'Wybierz sposób noszenia zestawu piłkarskiego. Torba adidas Tiro Competition ma pojemną komorę główną z łatwym dostępem, dzięki czemu ochraniacze na golenie nie będą Ci przeszkadzać w szatni. Ma nawet specjalną przegrodę z dodatkową wentylacją na wilgotne buty. Nie martw się też, że w drodze do domu zmęczysz się — uchwyt może posłużyć również jako paski do noszenia na ramionach.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-competition-duffel-bag-medium', '', '', '', 'Tiro Competition Duffel Bag Medium', '', '', '', ''),
(834, 1, 1, 'Chociaż przed Tobą może nie być długiego dnia spędzonego na morzu, ta rybacka czapka w stylu Adicolor to idealny towarzysz na wietrzne dni. Wywijany brzeg i stonowana kolorystycznie naszywka z logo Trefoil nadają całości wyrazisty look, a konstrukcja z dzianiny o gładkim splocie zapewnia komfort przez cały dzień. Wrzuć tę czapkę od adidas do torby, a następnym razem, gdy zrobi się chłodno, nic nie powstrzyma Cię przed wyjściem. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-adicolor-short', '', '', '', 'Czapka Adicolor Short', '', '', '', ''),
(835, 1, 1, 'Pokaż wszystkim, że jesteś w drużynie z 3 paskami, nosząc te śmiałe rękawiczki adidas. Bez względu na to, czy założysz je w chłodny poranek czy na górską wędrówkę, zapewnią Twoim dłoniom ciepło i wygodę aż po czubki palców z przewodzącymi końcówkami.', '', '3-stripes-conductive-gloves', '', '', '', '3-Stripes Conductive Gloves', '', '', '', ''),
(836, 1, 1, 'Eksploruj ulice. Wędruj do ulubionej kawiarni. Gdy wychodzisz na świeże powietrze, zabierz ze sobą czapkę adidas typu beanie. Design z dzianiny, który zapewnia komfort, czerpie elementy z naszych outdoorowych archiwów. Dwustronny fason sprawia, że pasuje do wszystkich Twoich ubrań.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to tylko jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'adidas-adventure-beanie', '', '', '', 'adidas Adventure Beanie', '', '', '', ''),
(837, 1, 1, 'Czapki to niezaprzeczalne deklaracje stylu. A dziś czujesz się wyjątkowo wymownie. Choć może po prostu jest zimno. Tak czy inaczej, ta czapka adidas typu beanie zapewni Ci ciepło i pozwoli dopełnić Twój look. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-wide-cuff', '', '', '', 'Czapka Wide Cuff', '', '', '', ''),
(838, 1, 1, 'Model stworzony z myślą o pięknej grze. Uniwersalna torba piłkarska adidas, będąca częścią kolekcji Tiro League, idealnie nadaje się zarówno na dzień meczu, jak i na weekendowy wyjazd. Model z mocnej, plecionej tkaniny osadzony na trwałej, powlekanej podstawie poradzi sobie z chaosem panującym w szatni. Kiedy nadejdzie czas powrotu do domu, schowaj wilgotny sprzęt do specjalnej, wentylowanej przegrody, aby go przewietrzyć.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-medium', '', '', '', 'Tiro League Duffel Bag Medium', '', '', '', ''),
(839, 1, 1, 'Model stworzony z myślą o pięknej grze. Uniwersalna torba piłkarska adidas, będąca częścią kolekcji Tiro League, idealnie nadaje się zarówno na dzień meczu, jak i na weekendowy wyjazd. Model z mocnej, plecionej tkaniny osadzony na trwałej, powlekanej podstawie poradzi sobie z chaosem panującym w szatni. Kiedy nadejdzie czas powrotu do domu, schowaj wilgotny sprzęt do specjalnej, wentylowanej przegrody, aby go przewietrzyć.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-medium', '', '', '', 'Tiro League Duffel Bag Medium', '', '', '', ''),
(840, 1, 1, 'Wybierz lekki bagaż. Ta bardzo mała torba-worek adidas pomoże Ci przenosić niezbędne drobiazgi w stylu z 3 paskami. Niezależnie od tego, czy wybierasz się do studia, czy na ściankę wspinaczkową duże logo jasno pokazuje, że sport jest tym, co kochasz. Regulowany pasek na ramię zapewni Ci komfort podczas noszenia.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-linear-duffel-bag-extra-small', '', '', '', 'Essentials Linear Duffel Bag Extra Small', '', '', '', ''),
(841, 1, 1, 'Im dalej biegasz, tym więcej rzeczy potrzebujesz na trasie. Noś wszystko w torbie-nerce adidas z paskiem. Jest w niej miejsce na smartfona, klucze i żele, a całość wygodnie układa się na ciele, pozwalając Ci skupić się wyłącznie na treningu. Odblaskowe detale sprawdzą się, gdy zachodzi słońce.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'running-belt-waist-bag', '', '', '', 'Running Belt Waist Bag', '', '', '', ''),
(842, 1, 1, 'Zaprezentuj swoją osobowość dzięki torbie-nerce adidas z kwiatowym wzorem. Uniwersalny model idealny na plażę lub na miasto ma wyszywane, kwiatowe detale na satynowym materiale. Zapięcie na suwak pomieści wszystkie Twoje rzeczy w zasięgu ręki, a regulowany pasek ze sprzączką w talii gwarantuje idealne dopasowanie. To lekki i praktyczny model, który sprawdzi się podczas Twoich codziennych przygód.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'torba-flower-waist', '', '', '', 'Torba Flower Waist', '', '', '', ''),
(843, 1, 1, 'Wybierz torbę adidas, która przyda się podczas rozgrywek czy załatwiania spraw na mieście. Dwukierunkowy suwak sprawia, że dostęp do potrzebnych rzeczy jest bardzo łatwy, a trwały, powlekany spód chroni Twoje przedmioty. Schowaj telefon do przedniej kieszeni na suwak, a mniejsze drobiazgi do wewnętrznej kieszeni, aby być w gotowości do akcji. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'torba-linear-essentials-bowling', '', '', '', 'Torba Linear Essentials Bowling', '', '', '', ''),
(844, 1, 1, 'Poczuj magiczny dreszczyk międzynarodowego futbolu na najwyższym poziomie. Powitaj nową oficjalną piłkę meczową Euro 2024, Fussballiebe Pro.\n\nRuszaj na największą piłkarską scenę w Europie, grając piłką wykonaną z wysokiej jakości materiałów, które zapewniają doskonałą wydajność na boisku. Innowacyjna, wytłaczana konstrukcja została zaprojektowana z myślą o dokładności, a bezszwowa, zgrzewana termicznie konstrukcja zapewnia precyzyjną kontrolę. Śmiała grafika czerpie inspirację z barw 24 krajów uczestniczących w programie, przywołując prawdziwe poczucie zachwytu, które daje ta piękna gra.', '', 'pilka-fussballiebe-pro', '', '', '', 'Piłka Fussballiebe Pro', '', '', '', ''),
(845, 1, 1, 'Koniec końców to detale robią różnicę. Skarpety adidas Originals uzupełniają każdy strój klasycznym, wygodnym akcentem. Niezależnie od tego, czy wybierasz gładki czy bardziej swobodny look, te skarpetki do łydki są idealnym wyborem dzięki konstrukcji z miękkiej mieszanki bawełnianej. Wyróżniające się 3 paski nadają sportowy charakter mankietowi. Każda para łączy modę i funkcjonalność w jednym, dopracowanym designie, gwarantującym wygodę noszenia na co dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-adidas-solid-crew-3-pary', '', '', '', 'Skarpety adidas Solid Crew – 3 pary', '', '', '', ''),
(846, 1, 1, 'Nie zwalniaj tempa, gdy dajesz z siebie wszystko. Krótkie skarpety treningowe adidas mają AEROREADY, który zarządza wilgocią, zapewniając Ci suchy komfort na siłowni, korcie lub szlaku. Miękki, elastyczny i cienki model w naturalny sposób dopasowuje się do ciała. W opakowaniu znajdują się trzy pary.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-light-low-socks-3-pairs', '', '', '', 'Performance Light Low Socks 3 Pairs', '', '', '', ''),
(847, 1, 1, 'Zapewnij swoim stopom wygodną podstawę. Te niskie skarpety treningowe adidas oferują wsparcie w podbiciu, a także miękką amortyzację w pięcie i palcach. AEROREADY reguluje wilgoć, gdy biegasz, spacerujesz lub trenujesz. W opakowaniu znajdują się trzy pary.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'performance-cushioned-low-socks-3-pairs', '', '', '', 'Performance Cushioned Low Socks 3 Pairs', '', '', '', ''),
(848, 1, 1, 'Koniec końców to detale robią różnicę. Skarpety adidas Originals uzupełniają każdy strój klasycznym, wygodnym akcentem. Niezależnie od tego, czy wybierasz gładki czy bardziej swobodny look, te skarpetki do łydki są idealnym wyborem dzięki konstrukcji z miękkiej mieszanki bawełnianej. Wyróżniające się 3 paski nadają sportowy charakter mankietowi. Każda para łączy modę i funkcjonalność w jednym, dopracowanym designie, gwarantującym wygodę noszenia na co dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-adidas-solid-crew-3-pary', '', '', '', 'Skarpety adidas Solid Crew – 3 pary', '', '', '', ''),
(849, 1, 1, 'Czapka adidas w swobodnym stylu ma łatwy do spakowania, minimalistyczny design. Wysokiej jakości bawełna i odprowadzająca wilgoć opaska przeciwpotna zapewnią Ci komfort.\n\nNasze bawełniane produkty wspierają uprawę bawełny z bardziej zrównoważonych źródeł.', '', 'premium-essentials-dad-cap', '', '', '', 'Premium Essentials Dad Cap', '', '', '', ''),
(850, 1, 1, 'Dzięki swojej miękkiej, elastycznej konstrukcji sportowa torba jest wyjątkowo uniwersalna. W kieszeni bocznej na suwak przechowasz swoje drobiazgi w zasięgu ręki. Torba prezentuje duże logo Trefoil z przodu.', '', 'sportowa-torba-worek-trefoil', '', '', '', 'Sportowa torba-worek Trefoil', '', '', '', ''),
(851, 1, 1, 'Dodaj sportowy charakter do każdego looku dzięki tej torbie adidas. Lekka torba z solidną podstawą ochroni Twój sprzęt, a pasek na ramię można regulować, co gwarantuje komfortowe noszenie. Oddzielna przegroda na buty oraz kieszenie z przodu i po bokach ułatwiają organizację.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-duffel-bag', '', '', '', 'Essentials Duffel Bag', '', '', '', ''),
(852, 1, 1, 'Logo Trefoil stało się czymś więcej niż tylko rozpoznawalną ikoną. Nosili je nasi ulubieni sportowcy, muzycy i artyści. Oznacza styl i komfort nawet w skarpetkach. Skarpety adidas Trefoil Cushion Crew są dostępne w opakowaniu po 3 par, aby zapewnić Ci świeży komfort.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'trefoil-cushion-crew-socks-3-pairs', '', '', '', 'Trefoil Cushion Crew Socks 3 Pairs', '', '', '', ''),
(853, 1, 1, 'Model stworzoy z myślą o wyjątkowych chwilach. Grafika na piłce adidas Final Oceaunz w kolorach ziemi symbolizujących unikalne krajobrazy Australii i Nowej Zelandii naśladuje look piłki używanej na ostatnich etapach Mistrzostw Świata w Piłce Nożnej Kobiet FIFA 2023™. Doskonała na mecze i sesje treningowe piłka z certyfikatem jakości FIFA ma bezszwową konstrukcję TSBE, która zapewnia pewny kontakt z piłką, oraz butylowy pęcherz, dzięki któremu dłużej trzyma powietrze.', '', 'pilka-final-oceaunz-league', '', '', '', 'Piłka Final Oceaunz League', '', '', '', ''),
(854, 1, 1, 'Nadaj nowy styl butom dzięki zestawowi skarpet farbowanych techniką  tie-dye od adidas. Dwie pary skarpetek w opakowaniu dodadzą Twoim stopom żywego koloru. Skarpety z mieszanki bawełnianej z klasycznymi 3 paskami i brandingiem Trefoil zapewniają komfort przez cały dzień. Niezależnie od tego, czy jest to dzień relaksu, czy wieczorne wyjście, te skarpetki są gotowe.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-tie-dye-2-pairs', '', '', '', 'Skarpety Tie Dye 2 Pairs', '', '', '', ''),
(855, 1, 1, 'Zyskaj swobodę rąk dzięki tej stylowej torbie-nerce adidas. Mocny i idealny do noszenia na co dzień model ma monochromatyczny look, który pasuje praktycznie do każdego stroju. Noś ją wszędzie, w dzień lub w nocy. Odblaskowe detale dodają blasku.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'torba-nerka', '', '', '', 'Torba-nerka', '', '', '', ''),
(856, 1, 1, 'Koniec końców to detale robią różnicę. Skarpety adidas Originals uzupełniają każdy strój klasycznym, wygodnym akcentem. Niezależnie od tego, czy wybierasz gładki czy bardziej swobodny look, te skarpetki do łydki są idealnym wyborem dzięki konstrukcji z miękkiej mieszanki bawełnianej. Wyróżniające się 3 paski nadają sportowy charakter mankietowi. Każda para łączy modę i funkcjonalność w jednym, dopracowanym designie, gwarantującym wygodę noszenia na co dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-adidas-solid-crew-3-pary', '', '', '', 'Skarpety adidas Solid Crew – 3 pary', '', '', '', ''),
(857, 1, 1, 'Model stworzony z myślą o płynnej grze. Grafika na piłce meczowej adidas Oceaunz odzwierciedla naturalne piękno Australii i Nowej Zelandii, a zarazem nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Model stworzony z myślą o meczach ma bezszwową, zgrzewaną termicznie powierzchnię, która gwarantuje przewidywalną trajektorię lotu piłki, oraz wysokiej jakości butylowy pęcherz, który ogranicza konieczność jej dopompowywania. Znak jakości Quality Pro to najwyższa ocena FIFA.', '', 'oceaunz-competition-ball', '', '', '', 'Oceaunz Competition Ball', '', '', '', ''),
(858, 1, 1, 'Zaprezentuj swoje uwielbienie dla ulubionej hiszpańskiej drużyny. Czapka adidas z gładkiego diagonalu prezentuje barwy wyjazdowe potężnego Realu Madryt. Regulowany pasek z tyłu i miękka, pochłaniająca wilgoć opaska przeciwpotna wewnątrz współpracują, aby zapewnić Ci komfort, gdy wspierasz swoją drużynę.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'czapka-real-madrid-away-dad', '', '', '', 'Czapka Real Madrid Away Dad', '', '', '', ''),
(859, 1, 1, 'Gdy temperatura spada, a chłód się wzmaga, sięgnij po czapkę adidas typu beanie. To idealny towarzysz na biegi w chłodne dni, długie sesje na desce lub zimowe biwakowanie, którego zawsze chciałeś zabrać ze sobą. Konstrukcja z ocieplanego polaru ogrzewa głowę i uszy nawet w najzimniejsze dni. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-fleece', '', '', '', 'Czapka Fleece', '', '', '', ''),
(860, 1, 1, 'Bidon na wodę i buty do wspinaczki. Rękawice do podnoszenia ciężarów i przekąski po treningu. Niezależnie od tego, czego potrzebujesz na sesję treningową, możesz nosić swoje rzeczy w dobrym stylu dzięki tej torbie-workowi adidas. Zamknięcie na ściągany sznurek ułatwia sprawne pakowanie rzeczy i wyjście.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'essentials-gym-sack', '', '', '', 'Essentials Gym Sack', '', '', '', ''),
(861, 1, 1, 'Torba-worek adidas Tiro League sprawdzi się do przenoszenia sprzętu piłkarskiego na mecz i z powrotem. W kieszeni na dole bezpiecznie uporządkujesz niezbędne drobiazgi, a w bocznej kieszeni z siateczki możesz schować bidon lub przekąski. Duży otwór w kształcie litery U oznacza, że masz łatwy dostęp do całej zawartości.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tiro-league-duffel-bag-medium', '', '', '', 'Tiro League Duffel Bag Medium', '', '', '', ''),
(862, 1, 1, 'Nigdy nie trać koncentracji na korcie. Ta tenisowa wiązana opaska adidas ma odprowadzający wilgoć AEROREADY, który pomoże Ci zachować koncentrację się na piłce. Konstrukcja z miękkiej dzianiny zapewnia Ci komfort i eliminuje czynniki rozpraszające.\n\nPrzędza wykorzystana w tym produkcie zawiera 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Ten produkt zawiera co najmniej 70% materiałów pochodzących z recyklingu.', '', 'aeroready-tennis-tie-band', '', '', '', 'AEROREADY Tennis Tie Band', '', '', '', ''),
(863, 1, 1, 'Czerpiąc elementy designu z linii biegowej adidas ZX, model ZX 22 narodził się dzięki wykorzystaniu wirtualnej i rozszerzonej rzeczywistości. Te buty dla młodzieży mają minimalistyczny, prosty look, który pasuje do wszystkiego, co masz w swojej garderobie.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'zx-22-shoes', '', '', '', 'ZX 22 Shoes', '', '', '', ''),
(864, 1, 1, 'Jeśli wszystko musi się gdzieś zacząć, to uważamy, że lata 90. to całkiem solidny punkt startowy. Na przykład te młodzieżowe buty Ozelia. Wywodzą się prosto z archiwów adidas, ale ich gładka, monochromatyczna konstrukcja zyskała futurystyczny look. Amortyzacja Adiprene sprawia, że każdy krok jest czystą przyjemnością. \n\nTen produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', '', 'ozelia-shoes', '', '', '', 'Ozelia Shoes', '', '', '', ''),
(865, 1, 1, 'Klasyczne sneakery adidas Superstar przechodzą w stan hibernacji, a te zimowe buty dla najmłodszych są gotowe, aby zaszaleć. Izolacja PrimaLoft® zapewnia ciepło nawet w mokrych warunkach, chroniąc palce i stopy przed mrozem. Gdy robi się zimno, gumowa podeszwa zewnętrzna zapewnia dzieciom stabilność podczas poślizgnięć i celowych ślizgów  Wiedzieć, że Twojemu maluszkowi jest ciepło i jest bezpieczny? To więcej zabawy dla wszystkich.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(866, 1, 1, 'Klasyczne sneakery adidas Superstar przechodzą w stan hibernacji, a te zimowe buty dla najmłodszych są gotowe, aby zaszaleć. Izolacja PrimaLoft® zapewnia ciepło nawet w mokrych warunkach, chroniąc palce i stopy przed mrozem. Gdy robi się zimno, gumowa podeszwa zewnętrzna zapewnia dzieciom stabilność podczas poślizgnięć i celowych ślizgów  Wiedzieć, że Twojemu maluszkowi jest ciepło i jest bezpieczny? To więcej zabawy dla wszystkich.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(867, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Miękka, syntetyczna cholewka tych młodzieżowych butów piłkarskich ma teksturę High Definition na powierzchni całej strefy uderzenia. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Specjalistyczna podeszwa zewnętrzna pozwoli Ci dominować na naturalnej nawierzchni.', '', 'buty-predator-accuracy3-fg', '', '', '', 'Buty Predator Accuracy.3 FG', '', '', '', ''),
(868, 1, 1, 'Chłodny dzień oznacza mnóstwo zabawy na dworze. Te buty adidas dla dzieci szybko się zakłada i zapewniają pełne okrycie, dzięki czemu dzieci mogą bawić się tak długo, jak chcą. I oczywiście disnejowska Myszka Minnie idzie wszędzie razem z nimi. Miękka cholewka ma wygodną podszewkę, a pasek na rzep ułatwia szybkie i łatwe zapięcie. Solidna, gumowa podeszwa zewnętrzna pomaga dzieciom utrzymać się na śliskich i błotnistych nawierzchniach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-winterplay-x-disney-kids', '', '', '', 'Buty Winterplay x Disney Kids', '', '', '', ''),
(869, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(870, 1, 1, 'Outdoorowe dzieci nie dadzą się pogodzie, podobnie jak te buty adidas dla dzieci. Solidna cholewka jest wykonana z pianki izolującej i ma podszewkę z polaru, która zapewnia ciepło i ochronę stopom, gdy temperatura spada. Podeszwa zewnętrzna Traxion gwarantuje dzieciom stabilność na śliskich i wilgotnych nawierzchniach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-fortatrail-kids', '', '', '', 'Buty Fortatrail Kids', '', '', '', ''),
(871, 1, 1, 'Maluchy uwielbiają badać każdą powierzchnię ― od puszystego dywanu po rabatki z kwiatami. Te solidne buty adidas dla najmłodszych mają wygodne paski na rzepy, które utrzymują je na miejscu. Gumowa podeszwa zewnętrzna nie pozostawia  czarnych śladów — dobra wiadomość, jeśli Twój maluszek odkryje parkiet. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(872, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(873, 1, 1, 'Model Gazelle od końca lat 60. był „tymi” butami piłkarskimi, a następnie przekroczył granice świata sportu, zyskując status międzynarodowej ikony stylu. Te młodzieżowe buty są wierną repliką autentycznego designu. Mają konstrukcję z miękkiej skóry z ząbkowanymi 3 paskami i teksturowaną, gumową podeszwą zewnętrzną.', '', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(874, 1, 1, 'W tych butach PrimaLoft® dzieci nie będą zwalniać tempa z powodu zimowego chłodu. Buty z charakterystyczną osłoną palców w kształcie muszli i 3 paskami jak oryginał nawiązują do kultowych elementów modelu adidas Superstar w wersji na śnieg. Dziecięce stopy będą cieszyć się ciepłem i wsparciem przez cały dzień.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-20-kids', '', '', '', 'Buty Superstar 360 2.0 Kids', '', '', '', ''),
(875, 1, 1, 'Jeśli cofniesz się w czasie do lat 60., zobaczysz profesjonalnych piłkarzy w butach adidas Samba, takich jak te buty dla dzieci. Cóż, prawie takie same. Odświeżone z myślą o kolejnym pokoleniu buty mają miękką wkładkę, która zapewnia komfort podczas całodziennej zabawy. Skórzana cholewka, gumowa podeszwa i 3 paski pozostają klasyczne.', '', 'buty-samba-og-kids', '', '', '', 'Buty Samba OG Kids', '', '', '', ''),
(876, 1, 1, 'Jeśli cofniesz się w czasie do lat 60., zobaczysz profesjonalnych piłkarzy w butach adidas Samba, takich jak te buty dla dzieci. Cóż, prawie takie same. Odświeżone z myślą o kolejnym pokoleniu buty mają miękką wkładkę, która zapewnia komfort podczas całodziennej zabawy. Skórzana cholewka, gumowa podeszwa i 3 paski pozostają klasyczne.', '', 'buty-samba-og-kids', '', '', '', 'Buty Samba OG Kids', '', '', '', ''),
(877, 1, 1, 'Getting up and down the field with speed is the name of the indoor game. The Samba has dominated indoor football for decades for a reason. This juniors\' version of the legendary football boots features a leather upper and a lightweight EVA midsole for better response on indoor surfaces.', '', 'samba-classic-boots', '', '', '', 'Samba Classic Boots', '', '', '', ''),
(878, 1, 1, 'Styl retro. Młodzieżowe buty adidas Campus 00s są wzorowane na modelu Campus z lat 80., ale mają nowoczesny design inspirowany stylem Y2K. Gładki kształt i połączenie różnych materiałów nadają im świeży look. Zestaw te buty z ulubionymi dżinsami i ruszaj w drogę.', '', 'campus-00s-shoes', '', '', '', 'Campus 00s Shoes', '', '', '', ''),
(879, 1, 1, 'Styl retro. Młodzieżowe buty adidas Campus 00s są wzorowane na modelu Campus z lat 80., ale mają nowoczesny design inspirowany stylem Y2K. Gładki kształt i połączenie różnych materiałów nadają im świeży look. Zestaw te buty z ulubionymi dżinsami i ruszaj w drogę.', '', 'campus-00s-shoes', '', '', '', 'Campus 00s Shoes', '', '', '', ''),
(880, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć całodzienną zabawę. Jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(881, 1, 1, 'Zabierz je na zewnątrz i pozwól odkrywać świat. Buty hikingowe adidas Terrex Trailmaker sprawią, że dzieci będą pewnie poruszać się po szlaku. Wytrzymałe, lekkie i z przyczepną podeszwą zewnętrzną zapewniają komfort i wsparcie podczas wędrówek. Małe dłonie poradzą sobie z paskiem na rzep. Tradycyjne sznurowadła gwarantują idealne dopasowanie.', '', 'terrex-trailmaker-hiking-shoes', '', '', '', 'Terrex Trailmaker Hiking Shoes', '', '', '', ''),
(882, 1, 1, 'Klasyczne sneakery adidas Superstar przechodzą w stan hibernacji, a te zimowe buty dla najmłodszych są gotowe, aby zaszaleć. Izolacja PrimaLoft® zapewnia ciepło nawet w mokrych warunkach, chroniąc palce i stopy przed mrozem. Gdy robi się zimno, gumowa podeszwa zewnętrzna zapewnia dzieciom stabilność podczas poślizgnięć i celowych ślizgów  Wiedzieć, że Twojemu maluszkowi jest ciepło i jest bezpieczny? To więcej zabawy dla wszystkich.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(883, 1, 1, 'Dla każdego pokolenia buty Stan Smith są jedyne w swoim rodzaju. Teraz kolej na Ciebie. Te buty dla młodzieży mają ten sam minimalistyczny look i design, co oryginał. Co je różni? Materiały.  Elementy pochodzące z recyklingu są częścią zaangażowania adidas w ograniczanie ilości odpadów. Czas założyć buty i dopisać kolejny rozdział historii. \n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka w 50% wykonana z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'stan-smith-shoes', '', '', '', 'Stan Smith Shoes', '', '', '', ''),
(884, 1, 1, 'Inspirowane klasycznymi klapkami Adilette sandały adidas dla dzieci są idealne na słoneczne dni zabawy w wodzie i poza nią. Pasek na rzep ułatwia zakładanie i zdejmowanie. Szybkoschnąca cholewka pozwala maluchom cieszyć się komfortem, aż powrócą na suchy ląd.', '', 'adilette-sandals', '', '', '', 'adilette Sandals', '', '', '', ''),
(885, 1, 1, 'Maluchy pokażą swoją postawę w stylu adidas przy pomocy tych klapków dla dzieci. Klapki pod prysznic mają jednoczęściową, formowaną część górną z 3 paskami na wierzchu. Wyjątkowo miękka wkładka w bucie została wyposażona w szybkoschnącą, komfortową amortyzację.', '', 'adilette-aqua-slides', '', '', '', 'adilette Aqua Slides', '', '', '', ''),
(886, 1, 1, 'Wybierz wygodę dla małych stóp. Sandały adidas dla najmłodszych zapewniają miękką, wspierającą amortyzację w wodzie i poza nią za sprawą profilowanej podeszwy wewnętrznej z pianki EVA. Design z zakrytymi palcami osłania je w trakcie wodnych szaleństw. Zapięcie na rzepy ułatwia zakładanie i zdejmowanie.', '', 'closed-toe-summer-water-sandals', '', '', '', 'Closed-Toe Summer Water Sandals', '', '', '', ''),
(887, 1, 1, 'Maluchy pokażą swoją postawę w stylu adidas przy pomocy tych klapków dla dzieci. Klapki pod prysznic mają jednoczęściową, formowaną część górną z 3 paskami na wierzchu. Wyjątkowo miękka wkładka w bucie została wyposażona w szybkoschnącą, komfortową amortyzację.', '', 'adilette-aqua-slides', '', '', '', 'adilette Aqua Slides', '', '', '', ''),
(888, 1, 1, 'Stworzone do ruchu, zupełnie jak Twój skarb.  Załóż swojemu maluszkowi inspirowane bieganiem w stylu lat 90. buty OZWEEGO dla najmłodszych i pozwól mu szaleć. Odblaskowe elementy i półprzezroczyste rurki zapewniają autentyczny look. Podwójna amortyzacja gwarantuje wygodę.', '', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(889, 1, 1, 'Oryginalny model Gazelle wyrobił sobie markę jako uniwersalne buty treningowe, a dziś cieszy się popularnością jako klasyk stylu miejskiego. Te młodzieżowe buty są dokładną repliką butów Gazelle z 1991 roku. Prezentują autentyczny styl z teksturowaną, zamszową cholewką w kolorach vintage.', '', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(890, 1, 1, 'Model, który sprawdzi się zawsze i wszędzie. W szkole, w pracy czy podczas weekendu młodzieżowe buty NMD_R1 zapewnią Ci świetny wygląd dzięki gładkiemu, potrójnie czarnemu designowi. Buty łączące codzienny styl z zaawansowaną technologią adidas powstały z inspiracji bieganiem i gwarantują Ci komfort w ruchu za sprawą zwracającej energię amortyzacji Boost pod stopą.', '', 'nmdr1-shoes', '', '', '', 'NMD_R1 Shoes', '', '', '', ''),
(891, 1, 1, 'Najbardziej zaawansowane buty do koszykówki sprzed lat, adidas Forum, powracają z archiwów i są gotowe na podbój świata. Wybierz młodzieżowe buty do kostki, które dodadzą Ci energii w każdej sytuacji: w szkole, podczas weekendowych wypraw i na spotkaniu ze znajomymi. Możesz na nie liczyć.', '', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(892, 1, 1, 'Nowa odsłona ulubionych Twoich ulubionych butów. Te młodzieżowe buty adidas Forum Low pasują praktycznie do wszystkiego i dodadzą Twojej garderobie energii w stylu retro. Cholewka ze skóry i nubuku z wytłaczanym detalem X z logo Trefoil stanowi luksusowy akcent. Idealne dla aktywnych, przyszłych ikon mody.', '', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(893, 1, 1, 'Tenisowy design retro w stylu lat 80. stał się inspiracją dla modelu Continental 80. Te niskie buty mają nostalgiczny look z zakrzywionym, dwukolorowym paskiem na boku i okienkiem z logo w pobliżu sznurowania. Dzielona, gumowa podeszwa z wstawką z pianki EVA zapewnia poczucie giętkiego komfortu', '', 'buty-continental-80', '', '', '', 'Buty Continental 80', '', '', '', ''),
(894, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Przewiewna i elastyczna cholewka z siateczki w tych młodzieżowych butach piłkarskich została zaprojektowana z myślą o komforcie podczas intensywnych rozgrywek. Specjalistyczna, niebrudząca, gumowa podeszwa zewnętrzna pozwoli Ci dominować na hali.', '', 'buty-predator-accuracy3-in', '', '', '', 'Buty Predator Accuracy.3 IN', '', '', '', ''),
(895, 1, 1, 'Wybierzcie się na pieszą wędrówkę, a góry zajmą się resztą. Lekkie buty hikingowe adidas zapewniają dzieciom komfort podczas odkrywania nowych szlaków. Gumowa podeszwa zewnętrzna Traxion zapewnia przyczepność potrzebną do poruszania się po śliskich kamieniach i korzeniach. Mocne buty hikingowe z amortyzowaną podeszwą środkową i cholewką z tkaniny ripstop dbają o suchy komfort, ochronę i wygodę w lesie.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-mid-hiking-shoes', '', '', '', 'Terrex Hyperhiker Mid Hiking Shoes', '', '', '', ''),
(896, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(897, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(898, 1, 1, 'Wędruj z miasta na szlak. Zimowe buty adidas Terrex dla dzieci zapewniają ciepło, komfort i przyczepność w śnieżnym klimacie. Izolacja PrimaLoft® i miła w dotyku podszewka tworzą idealne, ciepłe dopasowanie podczas eksploracji w chłodne dni. COLD.RDY chroni przed śniegiem i błotem, a gumowa podeszwa zewnętrzna z wypustkami zapewnia maksymalną przyczepność na oblodzonej nawierzchni. Odblaskowe detale wyróżniają się w słabym świetle typowym dla zimowych dni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-snowpitch-coldrdy-winter', '', '', '', 'Buty Terrex Snowpitch COLD.RDY Winter', '', '', '', ''),
(899, 1, 1, 'Z koszykarskiego parkietu do klasy. Każdy zasługuje na parę butów adidas Superstar. Te buty dla dzieci świętują 50. rocznicę klasycznego designu z osłoną palców w kształcie muszli. Od wyróżniających się ząbkowanych 3 pasków po komfortową, gumową podeszwę, ta rocznicowa edycja oddaje hołd kultowemu modelowi. Niezależnie od tego, czy mają kolor biały, czarny, czy jakiś inny – dzieci wyglądają w nich zawsze świeżo.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(900, 1, 1, 'Przygotuj dzieci na deszczowe dni i trudny teren. Gdy zaczyna padać, buty hikingowe adidas dla dzieci zapewnią suchy komfort stopom. RAIN.RDY nie przepuszcza błota i wody, dzięki czemu dzieci mogą nadal komfortowo wędrować, bawić się i odkrywać świat. BOA® Fit System ułatwia regulację dopasowania. Lekka podeszwa środkowa z pianki EVA chroni przed kamieniami na szlaku, a gumowa podeszwa zewnętrzna Traxion ułatwia pewny krok podczas przygód. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-boa-mid-rainrdy-hiking', '', '', '', 'Buty Terrex BOA Mid RAIN.RDY Hiking', '', '', '', ''),
(901, 1, 1, 'Profesjonalni gracze w nie wierzyli. Legendy hip hopu pisały o nich piosenki. A każdy je kocha. Buty adidas Superstar prezentują takie same klasyczne linie, jak pierwsze modele z lat 70. Zapięcie na paski, które zastąpiło sznurowadła, sprawia, że łatwo je założyć i zdjąć.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(902, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(903, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Miękka, syntetyczna cholewka tych młodzieżowych butów piłkarskich ma teksturę High Definition na powierzchni całej strefy uderzenia. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Gumowa podeszwa zewnętrzna z wypustkami pozwoli Ci dominować na sztucznej murawie.', '', 'buty-predator-accuracy3-tf', '', '', '', 'Buty Predator Accuracy.3 TF', '', '', '', ''),
(904, 1, 1, 'Malutka replika kultowych koszykarskich butów w klasycznym stylu. Wybierz dla swojego malucha buty o miękkiej konstrukcji z siateczki z gumową osłoną palców i wygodnym zapięciem na rzep, ułatwiającym zdejmowanie i zakładanie.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(905, 1, 1, 'Od weekendowych spacerów po epickie górskie przygody te buty hikingowe adidas dla dzieci gwarantują stopom ciepło i suchy komfort, aby nic nie rozpraszało maluchów na szlaku. Te buty zostały wyposażone w technologię COLD.RDY i izolację PrimaLoft®, która zatrzymuje ciepło, a lekka amortyzacja zapewnia komfort przez cały dzień. Przyczepna podeszwa zewnętrzna z gumy Continental™ pomaga dzieciom utrzymać równowagę na oblodzonych nawierzchniach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-winter-mid-boa-rainrdy-hiking', '', '', '', 'Buty Terrex Winter Mid BOA RAIN.RDY Hiking', '', '', '', ''),
(906, 1, 1, 'Odkrywanie świata na dworze jest o wiele fajniejsze niż siedzenie w domu. Przygotuj swojego małego poszukiwacza przygód na zimę dzięki tym butom hikingowym adidas. Model łączy lekkość sneakerów ze wsparciem i ciepłą izolacją butów hikingowych. COLD.RDY zapewnia ciepło, suchość i wygodę stopom. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody. Głęboko żłobiona podeszwa gwarantuje pewną przyczepność na zaśnieżonej i nierównej nawierzchni. Zachowaj ciepły komfort. Odkrywaj jeszcze więcej.', '', 'terrex-trailmaker-high-coldrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker High COLD.RDY Hiking Shoes', '', '', '', ''),
(907, 1, 1, 'W tych butach hikingowych adidas AX2R dla dzieci przygoda nie zna granic. Dzieci mogą pewnie odkrywać świat od placu zabaw po szlak w tych butach, które są lekkie, stabilne i solidnie przyczepne. Podeszwa środkowa z pianki EVA zapewnia długotrwałą amortyzację, a podeszwa zewnętrzna Traxion maksymalizuje przyczepność we wszystkich kierunkach. Zapięcie na rzepy ułatwia zakładanie i zdejmowanie, niezależnie od tego, czy maluchy wracają do domu, czy z niego wychodzą.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-ax2r-hook-and-loop-hiking', '', '', '', 'Buty Terrex AX2R Hook-and-Loop Hiking', '', '', '', ''),
(908, 1, 1, 'Młodzieżowe sneakery adidas Rivalry są przede wszystkim odważne. Klasyczna sylwetka, skórzana cholewka i kultowy branding sprawiają, że tym inspirowanym koszykówką butom nie brakuje kreatywnej ekspresji. Zestaw je z ulubionymi ubraniami, aby podkręcić swój codzienny look. Tak jak Ty, są gwiazdami stylu.', '', 'buty-rivalry-low-kids', '', '', '', 'Buty Rivalry Low Kids', '', '', '', ''),
(909, 1, 1, 'Wybierz buty adidas dla najmłodszych, które pasują do wszystkich ubrań, od ogrodniczek po pozostałe części dziecięcej garderoby. Solidna podeszwa i paski na rzepy zapewniają dopasowanie i wsparcie małych stóp, dzięki czemu sprawdzą się podczas zabawy, zajęć sensorycznych czy drugiego śniadania. A to dopiero przedpołudnie...\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-hook-and-loop', '', '', '', 'Buty Grand Court Lifestyle Hook and Loop', '', '', '', ''),
(910, 1, 1, 'Wnieś nieco stylu z parkietu do garderoby Twojego malutkiego kibica. Te sneakery adidas dla najmłodszych na co dzień zapewniają wsparcie i stabilizację butów do koszykówki. Cholewka z syntetycznej skóry nadaje im wyszukany look, a jednocześnie zapewnia lekkość małym stopom. Średniowysoka sylwetka nawiązuje do złotej ery koszykarskich gwiazd.', '', 'hoops-mid-shoes', '', '', '', 'Hoops Mid Shoes', '', '', '', ''),
(911, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(912, 1, 1, 'Lekki komfort i styl gotowy na wszystko. Wybierz buty adidas dla dzieci, które sprawdzą się w każdej sytuacji. Podeszwa środkowa Cloudfoam amortyzuje każdy krok, a przewiewna cholewka z siateczki zapewnia stopom przewiewny komfort. Podeszwa zewnętrzna z pianki EVA gwarantuje elastyczność, dzięki czemu dzieci mogą przejść od placu zabaw do pizzerii, nie tracąc rytmu. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-xplr-kids', '', '', '', 'Buty X_PLR Kids', '', '', '', ''),
(913, 1, 1, 'Gdy masz w planach lunch lub podbój świata, potrzebujesz uniwersalnych sneakerów. Wybierz te młodzieżowe buty adidas w klasycznym stylu. Półprzezroczyste 3 paski nadają designowi nowoczesny charakter, a połączenie amortyzacji BOOST i Bounce zapewnia niewiarygodny komfort na co dzień.  \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'xplrphase-shoes-kids', '', '', '', 'X_PLRPHASE Shoes Kids', '', '', '', ''),
(914, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają gładką, lekką cholewkę, która sprawdzi się przy energicznych ruchach. Amortyzacja Cloudfoam zapewnia dziecku komfort od rana do nocy.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-elastic-lace-top-strap-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Elastic Lace Top Strap Shoes', '', '', '', ''),
(915, 1, 1, 'Zabawa jest na wyciągnięcie ręki dziecka — lub o krok od niego. Buty adidas dla dzieci z charakterystyczną podeszwą inspirowaną klockami LEGO® i w charakterystycznych dla nich kolorach przyciągną wzrok w każdej sytuacji. Cholewka z siateczki z paskiem na rzep zapewnia przewiewny komfort i bezpieczne dopasowanie, gdy maluchy skaczą i biegają. Gumowa podeszwa zewnętrzna gwarantuje niezawodną trakcję.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'adidas-sport-dna-x-legolifestyle-elastic-lace-and-top-strap-shoes', '', '', '', 'adidas Sport DNA x LEGO®Lifestyle Elastic Lace and Top Strap Shoes', '', '', '', ''),
(916, 1, 1, 'Dzieci, które uczą się nowych umiejętności, potrzebują butów, które dotrzymają im kroku. Te klasyczne buty adidas mają gumową podeszwę zewnętrzną, która jest gładka w dotyku podczas biegania, ale nie pozostawia śladów na drewnianych podłogach. Dlatego buty sprawdzą się zarówno w szkole, jak i podczas treningu.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tensaur-sport-training-lace-shoes', '', '', '', 'Tensaur Sport Training Lace Shoes', '', '', '', ''),
(917, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(918, 1, 1, 'Zabawa jest na wyciągnięcie ręki dziecka — lub o krok od niego. Buty adidas dla dzieci z charakterystyczną podeszwą inspirowaną klockami LEGO® i w charakterystycznych dla nich kolorach przyciągną wzrok w każdej sytuacji. Cholewka z siateczki z paskiem na rzep zapewnia przewiewny komfort i bezpieczne dopasowanie, gdy maluchy skaczą i biegają. Gumowa podeszwa zewnętrzna gwarantuje niezawodną trakcję.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'adidas-sport-dna-x-legolifestyle-elastic-lace-and-top-strap-shoes', '', '', '', 'adidas Sport DNA x LEGO®Lifestyle Elastic Lace and Top Strap Shoes', '', '', '', ''),
(919, 1, 1, 'Wybierzcie się na pieszą wędrówkę, a góry zajmą się resztą. Lekkie buty hikingowe adidas zapewniają dzieciom komfort podczas odkrywania nowych szlaków. Gumowa podeszwa zewnętrzna Traxion zapewnia przyczepność potrzebną do poruszania się po śliskich kamieniach i korzeniach. Mocne buty hikingowe z amortyzowaną podeszwą środkową i cholewką z tkaniny ripstop dbają o suchy komfort, ochronę i wygodę w lesie.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-mid-hiking-shoes', '', '', '', 'Terrex Hyperhiker Mid Hiking Shoes', '', '', '', ''),
(920, 1, 1, 'Nigdy nie jest za wcześnie, by stworzyć dziecięcą kolekcję butów. Zrób wielkie pierwsze wrażenie przy pomocy tych butów adidas dla dzieci. Mają solidną i elastyczną, gumową podeszwę, która wspiera każdy krok i skok. Elastyczne sznurowadła, które rozciągają się, gdy dzieci je zakładają, oraz pasek na rzepy na górze, dzięki któremu dzieci mogą odpowiednio dopasować krój, sprawiają, że te klasyczne sneakery długo nie zagrzeją miejsca w pudełku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-elastic-lace-and-top-strap', '', '', '', 'Buty Grand Court Elastic Lace and Top Strap', '', '', '', ''),
(921, 1, 1, 'Maluchy uwielbiają badać każdą powierzchnię ― od puszystego dywanu po rabatki z kwiatami. Te solidne buty adidas dla najmłodszych mają wygodne paski na rzepy, które utrzymują je na miejscu. Gumowa podeszwa zewnętrzna nie pozostawia  czarnych śladów — dobra wiadomość, jeśli Twój maluszek odkryje parkiet. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(922, 1, 1, 'Kiedy Twoje dziecko daje z siebie wszystko podczas treningu, upewnij się, że ma buty, które pasują do jego entuzjazmu i energii. Buty adidas dla dzieci mają miękką podeszwę środkową Cloudfoam, która zapewnia dziecku komfort podczas biegu, gwarantując wsparcie przy każdym wybiciu i lądowaniu. Po skończonym treningu nie musi zmieniać butów. Klasyczny, sportowy look pasuje do wszystkiego. Jedna rzecz mniej do zapamiętania.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'runfalcon-30-elastic-lace-top-strap-shoes', '', '', '', 'RunFalcon 3.0 Elastic Lace Top Strap Shoes', '', '', '', ''),
(923, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie bez sznurowadeł dla młodzieży, które zapewnią Ci stabilizację przy pełnym przechyle na suchej, naturalnej trawie, osadzone są na gwarantującej szybkość podeszwie zewnętrznej do gry na naturalnej nawierzchni. Lekka, powlekana, tekstylna cholewka z dodatkowymi warstwami tylko tam, gdzie potrzebne jest wzmocnienie konstrukcji, ma kołnierz o płaskim splocie, który pewnie blokuje stopę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast3-laceless-fg', '', '', '', 'Buty X Crazyfast.3 Laceless FG', '', '', '', ''),
(924, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(925, 1, 1, 'Nadeszły chłodne dni, ale dzieci nadal mogą wyjść na dwór i bawić się ze swoim ulubionym kumplem — disnejowską Myszką Mickey. Stworzone z myślą o komforcie w chłodne dni buty adidas dla dzieci mają gumową podeszwę zewnętrzną, która pewnie trzyma się podłoża. Zapięcia na rzepy ułatwiają zakładanie i zdejmowanie butów, dzięki czemu maluchy mogą w kilka sekund wyjść z domu. Podczas biegania i zabawy grafika z Myszką Mickey emanuje pozytywną energią, która wywołuje uśmiech na wszystkich twarzach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-winterplay-x-disney-kids', '', '', '', 'Buty Winterplay x Disney Kids', '', '', '', ''),
(926, 1, 1, 'Wybierz buty do biegania, które przewodzą stawce na wiele sposobów. Model stworzony z myślą o komforcie ma lekką amortyzację Bounce. Oddychająca cholewka z siateczki zapewnia stopom świeżość, a niebrudząca, gumowa podeszwa zewnętrzna pewnie trzyma się trzeszczących kortów i śliskich ulic. Jeśli chodzi o styl, to na pierwszy rzut oka widać, że o co najmniej o kilka kroków wyprzedzają inne modele.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'ultrabounce-shoes-junior', '', '', '', 'Ultrabounce Shoes Junior', '', '', '', ''),
(927, 1, 1, 'Wspaniałe przygody zaczynają się od wygody. Zabierz swojego małego odkrywcę na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, lecz zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia małym stopom ciepły i suchy komfort w mokrych warunkach. Podeszwa zewnętrzna Traxion daje przyczepność na śliskich nawierzchniach.', '', 'terrex-trailmaker-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker RAIN.RDY Hiking Shoes', '', '', '', ''),
(928, 1, 1, 'Maluszki poruszają się zaskakująco szybko. Te buty w stylu biegowym dla najmłodszych zapewnią niewielkim stopom wsparcie podczas szybkich ruchów. Solidna, gumowa podeszwa zewnętrzna oznacza pewne kroki na śliskim chodniku. Regulowane paski na rzepy gwarantują bezpieczne dopasowanie. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'vs-switch-3-lifestyle-running-hook-and-loop-strap-shoes', '', '', '', 'VS Switch 3 Lifestyle Running Hook and Loop Strap Shoes', '', '', '', ''),
(929, 1, 1, 'Dawno temu były niskimi butami do koszykówki. Dzisiaj królują na ulicach miast. Buty dla młodzieży świętują 50. rocznicę modelu adidas Superstar. Od klasycznej osłony palców w kształcie muszli po ząbkowane 3 paski, ta rocznicowa edycja oddaje hołd niepowtarzalnemu designowi adidas. Konstrukcja z wygodną, gumową podeszwą prezentuje się świeżo i zabawnie, niezależnie od wersji kolorystycznej.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(930, 1, 1, 'Pozwól swojemu maluchowi odkrywać świat w dobrym stylu, gdy robi pierwsze chwiejne kroki. Te buty adidas dla najmłodszych zapewniają im komfort, którego potrzebują delikatne stopy. Podeszwa środkowa Cloudfoam miękko amortyzuje każdy krok. Stylowy look sprawia, że model zawsze wygląda świeżo.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(931, 1, 1, 'Przygotuj dzieci na deszczowe dni i trudny teren. Gdy zaczyna padać, buty hikingowe adidas dla dzieci zapewnią suchy komfort stopom. RAIN.RDY nie przepuszcza błota i wody, dzięki czemu dzieci mogą nadal komfortowo wędrować, bawić się i odkrywać świat. BOA® Fit System ułatwia regulację dopasowania. Lekka podeszwa środkowa z pianki EVA chroni przed kamieniami na szlaku, a gumowa podeszwa zewnętrzna Traxion ułatwia pewny krok podczas przygód. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-boa-mid-rainrdy-hiking', '', '', '', 'Buty Terrex BOA Mid RAIN.RDY Hiking', '', '', '', ''),
(932, 1, 1, 'Kiedy Twoje dziecko daje z siebie wszystko podczas treningu, upewnij się, że ma buty, które pasują do jego entuzjazmu i energii. Buty adidas dla dzieci mają miękką podeszwę środkową Cloudfoam, która zapewnia dziecku komfort podczas biegu, gwarantując wsparcie przy każdym wybiciu i lądowaniu. Po skończonym treningu nie musi zmieniać butów. Klasyczny, sportowy look pasuje do wszystkiego. Jedna rzecz mniej do zapamiętania.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'runfalcon-30-elastic-lace-top-strap-shoes', '', '', '', 'RunFalcon 3.0 Elastic Lace Top Strap Shoes', '', '', '', ''),
(933, 1, 1, 'Niezależnie od tego, czy chodzi o zabawę w parku, czy rodzinne wizyty, buty adidas Advantage dla najmłodszych zapewniają małym stopom komfort przez cały dzień. Zapięcie na rzepy sprawia, że zakładanie i zdejmowanie tych lekkich butów jest łatwe zarówno dla maluszków, jak i rodziców. Jednoczęściowa podeszwa środkowa i podeszwa zewnętrzna z pianki EVA amortyzują każdy krok, a cholewka z materiałów syntetycznych pochodzących z recyklingu zwiększa trwałość i dodaje stylu.\n \nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-advantage-kids', '', '', '', 'Buty Advantage Kids', '', '', '', ''),
(934, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(935, 1, 1, 'Odkrywanie świata na dworze jest o wiele fajniejsze niż siedzenie w domu. Przygotuj swojego małego poszukiwacza przygód na zimę dzięki tym butom hikingowym adidas. Model łączy lekkość sneakerów ze wsparciem i ciepłą izolacją butów hikingowych. COLD.RDY zapewnia ciepło, suchość i wygodę stopom. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody. Głęboko żłobiona podeszwa gwarantuje pewną przyczepność na zaśnieżonej i nierównej nawierzchni. Zachowaj ciepły komfort. Odkrywaj jeszcze więcej.', '', 'terrex-trailmaker-high-coldrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker High COLD.RDY Hiking Shoes', '', '', '', ''),
(936, 1, 1, 'Design inspirowany butami Grand Court sprawia, że sneakery adidas dla dzieci mają prosty, przyciągający uwagę styl. Logotypy na języku i pięcie nadają im klasyczny look. Paski z rzepami ułatwiają zakładanie i zdejmowanie butów. Solidna, gumowa podeszwa sprawdzi się podczas zajęć pozaszkolnych.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'advantage-court-lifestyle-hook-and-loop-shoes', '', '', '', 'Advantage Court Lifestyle Hook-and-Loop Shoes', '', '', '', ''),
(937, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć całodzienną zabawę. Jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(938, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(939, 1, 1, 'Twój mały sportowiec będzie gotowy do wejścia na parkiet w okamgnieniu dzięki butom koszykarskim adidas dla dzieci. Idealnie dopasowane wsparcie w kostkach umożliwia błyskawiczną zmianę kierunku. Lekka amortyzacja zapewnia wygodę na siłowni, na placu zabaw i w każdym innym miejscu.\n\nTen produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', '', 'ownthegame-20-shoes', '', '', '', 'Ownthegame 2.0 Shoes', '', '', '', ''),
(940, 1, 1, 'Gdy pod stopami jest moc z Gwiezdnych wojen, przygoda wzywa. Te buty adidas Star Wars Runner dodadzą mocy Twojemu małemu Jedi podczas wypraw po galaktyce. Kultowe grafiki stanowią nieziemski akcent. A klasyczne, sznurowane zapięcie oznacza, że dzieciaki mogą się ubrać i wystartować z prędkością światła. Niezależnie od tego, czy maluchy spieszą zniszczyć Gwiazdę Śmierci czy ćwiczą używanie mocy na podwórku, podeszwa środkowa z wtryskiwanej pianki EVA i mocna, gumowa podeszwa zewnętrzna zapewnią im potrzebne wsparcie.\n \nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-star-wars-runner-kids', '', '', '', 'Buty Star Wars Runner Kids', '', '', '', ''),
(941, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
