(943, 1, 1, 'Maluchy uwielbiają badać każdą powierzchnię ― od puszystego dywanu po rabatki z kwiatami. Te solidne buty adidas dla najmłodszych mają wygodne paski na rzepy, które utrzymują je na miejscu. Gumowa podeszwa zewnętrzna nie pozostawia  czarnych śladów — dobra wiadomość, jeśli Twój maluszek odkryje parkiet. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(944, 1, 1, 'Niezależnie od tego, czy maluchy wybierają się do szkoły, czy z przyjaciółmi zwiedzają park, Ty chcesz dać im najlepsze warunki. Te buty adidas dla dzieci zapewniają komfort, którego potrzebują, aby iść naprzód. Podeszwa środkowa Cloudfoam zapewnia optymalną amortyzację, dzięki czemu każdy krok jest łatwy. Szybka sylwetka dodaje energii do ich codziennego stylu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(945, 1, 1, 'Spraw, aby podążały śladami najlepszych tenisistów. Te buty adidas dla dzieci mają gładki look inspirowany stylem tenisowym z lat 70. Gumowa podeszwa wygina się i zapewnia przyczepność, gwarantując płynny, pewny krok. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-tennis-lace-up', '', '', '', 'Buty Grand Court Lifestyle Tennis Lace-Up', '', '', '', ''),
(946, 1, 1, 'Lata 80. były punktem zwrotnym w stylu koszykarskim, a buty adidas Forum szybko stały się legendą ― najpierw na parkiecie, a następnie na ulicach. Te młodzieżowe buty mają skórzaną cholewkę, solidną podeszwę zewnętrzną i pasek w kostce. Poczuj energię dekady za każdym razem, gdy je zakładasz.', '', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(947, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(948, 1, 1, 'Dzieci mają swoje zdanie na wiele tematów. Ale jedno jest pewne. Te buty adidas stanowią idealne połączenie komfortu i stylu. Giętka podeszwa środkowa Bounce dba o komfort, podobnie jak oddychająca cholewka z mieszanki materiałów. A styl? To jest niezaprzeczalne. Ponadto kolory pasują do każdego stroju. Sprzedane. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'rapidasport-bounce-sport-running-lace-shoes', '', '', '', 'Rapidasport Bounce Sport Running Lace Shoes', '', '', '', ''),
(949, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają gładką, lekką cholewkę, która sprawdzi się przy energicznych ruchach. Amortyzacja Cloudfoam zapewnia dziecku komfort od rana do nocy.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-elastic-lace-top-strap-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Elastic Lace Top Strap Shoes', '', '', '', ''),
(950, 1, 1, 'Młodzieżowe buty adidas Ligra 7 stworzone z myślą o grze na każdym rodzaju nawierzchni pomogą Ci poprawić wyniki na hali. Gdy zmienia się przebieg gry, ich przewiewna cholewka z siateczki gwarantuje komfort i pewność siebie. Połączenie przyczepnej w różnych kierunkach podeszwy zewnętrznej ze wspierającymi nakładkami zapewnia stabilizację, gdy dajesz z siebie wszystko. Syntetyczna skóra na palcach oznacza, że wymagające rozgrywki nie stanowią problemu.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka wykonana jest w 50% z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'ligra-7-indoor-shoes', '', '', '', 'Ligra 7 Indoor Shoes', '', '', '', ''),
(951, 1, 1, 'adidas odrobił swoją pracę domową i stworzył nową odsłonę klasycznych sneakerów Grand Court dla dzieci. Gładka, syntetyczna cholewka jest odporna na uderzenia i wstrząsy, a giętka, gumowa podeszwa wspiera i chroni rosnące stopy, dlatego te sznurowane buty zyskają uznanie zarówno wśród dzieci, jak i rodziców. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-lace-tennis', '', '', '', 'Buty Grand Court Lifestyle Lace Tennis', '', '', '', ''),
(952, 1, 1, 'Wybierz buty do biegania, które przewodzą stawce na wiele sposobów. Model stworzony z myślą o komforcie ma lekką amortyzację Bounce. Oddychająca cholewka z siateczki zapewnia stopom świeżość, a niebrudząca, gumowa podeszwa zewnętrzna pewnie trzyma się trzeszczących kortów i śliskich ulic. Jeśli chodzi o styl, to na pierwszy rzut oka widać, że o co najmniej o kilka kroków wyprzedzają inne modele.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'ultrabounce-shoes-junior', '', '', '', 'Ultrabounce Shoes Junior', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(953, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(954, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(955, 1, 1, 'Dzieci, które uczą się nowych umiejętności, potrzebują butów, które dotrzymają im kroku. Te klasyczne buty adidas mają gumową podeszwę zewnętrzną, która jest gładka w dotyku podczas biegania, ale nie pozostawia śladów na drewnianych podłogach. Dlatego buty sprawdzą się zarówno w szkole, jak i podczas treningu.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tensaur-sport-training-lace-shoes', '', '', '', 'Tensaur Sport Training Lace Shoes', '', '', '', ''),
(956, 1, 1, 'Od małego zabieraj swoje dziecko na wycieczki. Odkrywanie nowych szlaków to świetna zabawa, gdy ma na stopach te buty hikingowe adidas. Model lekki niczym buty do biegów przełajowych oferuje dodatkową stabilizację i trwałość typową dla butów hikingowych, dzięki którym Twoje dziecko chętnie rozpocznie eksplorację outdooru. Odblaskowe detale błyszczą w słabym oświetleniu. Żłobiona, gumowa podeszwa pewnie trzyma się każdej nawierzchni.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-low-hiking-shoes', '', '', '', 'Terrex Hyperhiker Low Hiking Shoes', '', '', '', ''),
(957, 1, 1, 'Spraw, aby podążały śladami najlepszych tenisistów. Te buty adidas dla dzieci mają gładki look inspirowany stylem tenisowym z lat 70. Gumowa podeszwa wygina się i zapewnia przyczepność, gwarantując płynny, pewny krok. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-tennis-lace-up', '', '', '', 'Buty Grand Court Lifestyle Tennis Lace-Up', '', '', '', ''),
(958, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają idealnie dopasowany krój, dzięki czemu dzięki czemu pozostaną na miejscu i przetrwają każdą przygodę. Gładka cholewka bezpiecznie otula rosnące stopy. Amortyzacja Cloudfoam zapewnia wyjątkowy komfort, a przyczepna podeszwa zewnętrzna pewnie trzyma się różnych nawierzchni, od mokrej trawy po żwir.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-lace-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Lace Shoes', '', '', '', ''),
(959, 1, 1, 'Gdy dodasz stopom lekkości, możesz zrobić więcej w tych wyjątkowo wygodnych butach adidas dla młodzieży. Lekka podeszwa środkowa Bounce dodaje sprężystości na każdym kroku, jednocześnie zapewniając wsparcie przez cały dzień. Pleciona cholewka porusza się razem z Twoją stopą, otulając ją we właściwych miejscach. Kultowa klatka z TPU zapewnia styl i stabilizację podczas każdej przygody.\n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-ubounce-dna-kids', '', '', '', 'Buty Ubounce DNA Kids', '', '', '', ''),
(960, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te młodzieżowe buty piłkarskie bez sznurowadeł mają miękką, syntetyczną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Gumowa podeszwa zewnętrzna z wypustkami zapewnia Ci dominację na sztucznej murawie.', '', 'buty-predator-accuracy3-laceless-tf', '', '', '', 'Buty Predator Accuracy.3 Laceless TF', '', '', '', ''),
(961, 1, 1, 'Pozwól swojemu maluchowi zabrać ze sobą klocki LEGO® wszędzie, gdzie się wybierze. Zobacz uśmiech na twarzy swojego dziecka, gdy założy buty do biegania adidas. Elastyczne sznurowadła i pasek na rzep zapewniają idealne, bezpieczne dopasowanie. Przyczepna podeszwa zewnętrzna ma wzór znany z klocków LEGO®.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'adidas-x-lego-sport-pro-shoes', '', '', '', 'adidas x LEGO® Sport Pro Shoes', '', '', '', ''),
(962, 1, 1, 'Mali odkrywcy mogą cieszyć się wygodą. Zabierz swojego malucha na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, a jednocześnie zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia ciepło i suchy komfort w mokrych warunkach, a profil do kostki chroni przed zabrudzeniami.', '', 'terrex-trailmaker-mid-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(963, 1, 1, 'Komfort wykracza poza kort. Inspirowane tenisem buty dla dzieci mają gładką cholewkę z syntetycznej skóry z perforowanymi 3 paskami. Pluszowo miękka wkładka amortyzuje każdy krok.', '', 'advantage-shoes', '', '', '', 'Advantage Shoes', '', '', '', ''),
(964, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Młodzieżowe buty piłkarskie, które zapewnią Ci stabilizację przy pełnym przechyle na suchej, naturalnej trawie, osadzone są na gwarantującej szybkość podeszwie zewnętrznej do gry na naturalnej nawierzchni. Lekka, powlekana, tekstylna cholewka z dodatkowymi warstwami tylko tam, gdzie potrzebne jest wzmocnienie konstrukcji, ma kołnierz o płaskim splocie, który pewnie blokuje stopę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast3-fg', '', '', '', 'Buty X Crazyfast.3 FG', '', '', '', ''),
(965, 1, 1, 'Pozwól swojemu maluchowi zabrać ze sobą klocki LEGO® wszędzie, gdzie się wybierze. Zobacz uśmiech na twarzy swojego dziecka, gdy założy buty do biegania adidas. Elastyczne sznurowadła i pasek na rzep zapewniają idealne, bezpieczne dopasowanie. Przyczepna podeszwa zewnętrzna ma wzór znany z klocków LEGO®.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'adidas-x-lego-sport-pro-shoes', '', '', '', 'adidas x LEGO® Sport Pro Shoes', '', '', '', ''),
(966, 1, 1, 'Obecne od 50 lat i gotowe na kolejne 50. Te buty adidas Superstar pozostają wierne kultowemu, uwielbianemu od lat koszykarskiemu charakterowi. Zapięcia na paski, które zastąpiły sznurowadła sprawiają, że dzieci samodzielnie mogą je założyć i zdjąć.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(967, 1, 1, 'Sznurowane sneakery adidas dla dzieci idealnie nadają się do szkoły, klubu sportowego i ulubionych zabaw. Mają gładką, syntetyczną cholewkę, która zapewnia poczucie komfortu. Solidna, gumowa podeszwa zewnętrzna oznacza niezawodną trakcję.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'advantage-lifestyle-court-lace-shoes', '', '', '', 'Advantage Lifestyle Court Lace Shoes', '', '', '', ''),
(968, 1, 1, 'Niezależnie od tego, czy Twój mały sportowiec w pośpiechu wybiega do szkoły, wybiera się na obóz softballowy czy po prostu bawi się na podwórku, trwałe sneakery adidas dla dzieci zapewnią mu wsparcie i komfort. Oddychająca cholewka z siateczki gwarantuje przewiewny komfort stopom, gdy codzienne przygody nabierają tempa. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'runfalcon-20-shoes', '', '', '', 'Runfalcon 2.0 Shoes', '', '', '', ''),
(969, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Młodzieżowe buty piłkarskie, które zapewnią Ci stabilizację przy pełnym przechyle na suchej, naturalnej trawie, osadzone są na gwarantującej szybkość podeszwie zewnętrznej do gry na naturalnej nawierzchni. Lekka, powlekana, tekstylna cholewka z dodatkowymi warstwami tylko tam, gdzie potrzebne jest wzmocnienie konstrukcji, ma kołnierz o płaskim splocie, który pewnie blokuje stopę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast3-fg', '', '', '', 'Buty X Crazyfast.3 FG', '', '', '', ''),
(970, 1, 1, 'Buty adidas dla dzieci, które dotrzymają kroku każdej przygodzie każdego dnia. Cloudfoam zapewnia doskonałą amortyzację, dzięki czemu maluchy mogą biegać dłużej, odkrywać świat i czuć się komfortowo przez cały dzień. Przyczepna, gumowa podeszwa zewnętrzna gwarantuje pewny krok. 3 paski uzupełniają całość w tradycyjnym stylu. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(971, 1, 1, 'Najbardziej zaawansowane buty do koszykówki sprzed lat, adidas Forum, powracają z archiwów i są gotowe na podbój świata. Wybierz młodzieżowe buty do kostki, które dodadzą Ci energii w każdej sytuacji: w szkole, podczas weekendowych wypraw i na spotkaniu ze znajomymi. Możesz na nie liczyć.', '', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(972, 1, 1, 'Kultowe buty adidas Superstar dla najmłodszych w wersji dostosowanej do zmiennych warunków pogodowych zapewniają stopom ciepło i suchy komfort dzięki jednoczęściowej, tekstylnej cholewce, wygodnej, tekstylnej wyściółce i przyczepnej podeszwie zewnętrznej z pianki EVA. Osłona przeciwbłotna na obwodzie i pięcie nie przepuszcza brudu. Konstrukcja z systemem szybkiego sznurowania sprawia, że możesz z łatwością przetrwać każde przejście z hali na zewnątrz i znowu na halę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(973, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć całodzienną zabawę. Jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(974, 1, 1, 'Które dziecko na placu zabaw jest najmodniej ubrane? Z pewnością Twoje. Dzięki tym butom Twoja pociecha może się cieszyć stylem adidas i zaawansowaną technologią butów treningowych. Jednoczęściowy design łatwo jest założyć, a amortyzacja z pianki EVA ma głębokie, elastyczne żłobienia, które zapewniają maluchom pewność siebie podczas biegania i zabawy. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'nmd-360-shoes', '', '', '', 'NMD 360 Shoes', '', '', '', ''),
(975, 1, 1, 'Zaprojektowane z myślą o młodych amatorach przygód buty outdoorowe dla dzieci mają niski profil z wygodnym zapięciem na pasek. Tekstylna cholewka z nakładkami chroni stopy i wspiera je na szlaku, a elastyczne sznurowanie ułatwia zakładanie i zdejmowanie butów. Podeszwa zewnętrzna Traxion zapewnia przyczepność w terenie skalistym i na szlaku.', '', 'terrex-ax2r-cf-hiking-shoes', '', '', '', 'Terrex AX2R CF Hiking Shoes', '', '', '', ''),
(976, 1, 1, 'Zapnij rzepy butów adidas dla najmłodszych i pozwól Twojemu maluchowi na ruch i zabawę. Jednoczęściowa podeszwa z pianki EVA zapewnia wsparcie podczas raczkowania, a później prób stania. Tak jak ulubiony miś czy pies, te buty są idealnym towarzyszem codziennych przygód Twojego maluszka.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(977, 1, 1, 'Zabawa w kałuży to podstawa. Gdy szlaki stają się wilgotne, te buty hikingowe adidas dla dzieci zapewnią im suchy komfort. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody. Lekka amortyzacja z pianki EVA zapewnia wygodę. Guma Continental™ zapewnia doskonałą przyczepność na każdym szlaku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-gore-tex-hiking', '', '', '', 'Buty Terrex GORE-TEX Hiking', '', '', '', ''),
(978, 1, 1, 'Sznurowane sneakery adidas dla dzieci idealnie nadają się do szkoły, klubu sportowego i ulubionych zabaw. Mają gładką, syntetyczną cholewkę, która zapewnia poczucie komfortu. Solidna, gumowa podeszwa zewnętrzna oznacza niezawodną trakcję.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'advantage-lifestyle-court-lace-shoes', '', '', '', 'Advantage Lifestyle Court Lace Shoes', '', '', '', ''),
(979, 1, 1, 'Mali odkrywcy mogą cieszyć się wygodą. Zabierz swojego malucha na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, a jednocześnie zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia ciepło i suchy komfort w mokrych warunkach, a profil do kostki chroni przed zabrudzeniami.', '', 'terrex-trailmaker-mid-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(980, 1, 1, 'W tych butach PrimaLoft® dzieci nie będą zwalniać tempa z powodu zimowego chłodu. Buty z charakterystyczną osłoną palców w kształcie muszli i 3 paskami jak oryginał nawiązują do kultowych elementów modelu adidas Superstar w wersji na śnieg. Dziecięce stopy będą cieszyć się ciepłem i wsparciem przez cały dzień.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-20-kids', '', '', '', 'Buty Superstar 360 2.0 Kids', '', '', '', ''),
(981, 1, 1, 'Twój mały sportowiec będzie gotowy do wejścia na parkiet w okamgnieniu dzięki butom koszykarskim adidas dla dzieci. Idealnie dopasowane wsparcie w kostkach umożliwia błyskawiczną zmianę kierunku. Lekka amortyzacja zapewnia wygodę na siłowni, na placu zabaw i w każdym innym miejscu.\n\nTen produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', '', 'ownthegame-20-shoes', '', '', '', 'Ownthegame 2.0 Shoes', '', '', '', ''),
(982, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te młodzieżowe buty piłkarskie bez sznurowadeł mają miękką, syntetyczną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Podeszwa zewnętrzna do gry na naturalnej nawierzchni powstała, aby zapewnić Ci kontrolę na suchych, naturalnych nawierzchniach trawiastych.', '', 'buty-predator-accuracy3-laceless-fg', '', '', '', 'Buty Predator Accuracy.3 Laceless FG', '', '', '', ''),
(983, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te młodzieżowe buty piłkarskie bez sznurowadeł mają miękką, syntetyczną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Gumowa podeszwa zewnętrzna z wypustkami zapewnia Ci dominację na sztucznej murawie.', '', 'buty-predator-accuracy3-laceless-tf', '', '', '', 'Buty Predator Accuracy.3 Laceless TF', '', '', '', ''),
(984, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(985, 1, 1, 'Wspaniałe przygody zaczynają się od wygody. Zabierz swojego małego odkrywcę na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, lecz zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia małym stopom ciepły i suchy komfort w mokrych warunkach. Podeszwa zewnętrzna Traxion daje przyczepność na śliskich nawierzchniach.', '', 'terrex-trailmaker-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker RAIN.RDY Hiking Shoes', '', '', '', ''),
(986, 1, 1, 'Dawno temu były niskimi butami do koszykówki. Dzisiaj królują na ulicach miast. Buty dla młodzieży świętują 50. rocznicę modelu adidas Superstar. Od klasycznej osłony palców w kształcie muszli po ząbkowane 3 paski, ta rocznicowa edycja oddaje hołd niepowtarzalnemu designowi adidas. Konstrukcja z wygodną, gumową podeszwą prezentuje się świeżo i zabawnie, niezależnie od wersji kolorystycznej.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(987, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają idealnie dopasowany krój, dzięki czemu dzięki czemu pozostaną na miejscu i przetrwają każdą przygodę. Gładka cholewka bezpiecznie otula rosnące stopy. Amortyzacja Cloudfoam zapewnia wyjątkowy komfort, a przyczepna podeszwa zewnętrzna pewnie trzyma się różnych nawierzchni, od mokrej trawy po żwir.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-lace-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Lace Shoes', '', '', '', ''),
(988, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(989, 1, 1, 'Od weekendowych spacerów po epickie górskie przygody te buty hikingowe adidas dla dzieci gwarantują stopom ciepło i suchy komfort, aby nic nie rozpraszało maluchów na szlaku. Te buty zostały wyposażone w technologię COLD.RDY i izolację PrimaLoft®, która zatrzymuje ciepło, a lekka amortyzacja zapewnia komfort przez cały dzień. Przyczepna podeszwa zewnętrzna z gumy Continental™ pomaga dzieciom utrzymać równowagę na oblodzonych nawierzchniach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-winter-mid-boa-rainrdy-hiking', '', '', '', 'Buty Terrex Winter Mid BOA RAIN.RDY Hiking', '', '', '', ''),
(990, 1, 1, 'Nie pozwól, by ból stóp stanął na drodze stopom Twojego malucha. Te buty adidas dla dzieci zapewniają optymalny komfort. Lekka amortyzacja chroni stopy, nie obciążając ich. Mocna, gumowa podeszwa zewnętrzna zapewnia przyczepność podczas biegania i zabawy przez cały dzień.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-duramo-sl-kids', '', '', '', 'Buty Duramo SL Kids', '', '', '', ''),
(991, 1, 1, 'W tych butach hikingowych adidas AX2R dla dzieci przygoda nie zna granic. Dzieci mogą pewnie odkrywać świat od placu zabaw po szlak w tych butach, które są lekkie, stabilne i solidnie przyczepne. Podeszwa środkowa z pianki EVA zapewnia długotrwałą amortyzację, a podeszwa zewnętrzna Traxion maksymalizuje przyczepność we wszystkich kierunkach. Zapięcie na rzepy ułatwia zakładanie i zdejmowanie, niezależnie od tego, czy maluchy wracają do domu, czy z niego wychodzą.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-ax2r-hook-and-loop-hiking', '', '', '', 'Buty Terrex AX2R Hook-and-Loop Hiking', '', '', '', ''),
(992, 1, 1, 'Od małego zabieraj swoje dziecko na wycieczki. Odkrywanie nowych szlaków to świetna zabawa, gdy ma na stopach te buty hikingowe adidas. Model lekki niczym buty do biegów przełajowych oferuje dodatkową stabilizację i trwałość typową dla butów hikingowych, dzięki którym Twoje dziecko chętnie rozpocznie eksplorację outdooru. Odblaskowe detale błyszczą w słabym oświetleniu. Żłobiona, gumowa podeszwa pewnie trzyma się każdej nawierzchni.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-low-hiking-shoes', '', '', '', 'Terrex Hyperhiker Low Hiking Shoes', '', '', '', ''),
(993, 1, 1, 'Kultowe buty adidas Superstar dla dzieci w wersji dostosowanej do zmiennych warunków pogodowych zapewniają stopom ciepło i suchy komfort dzięki jednoczęściowej, tekstylnej cholewce, wygodnej, tekstylnej wyściółce i przyczepnej podeszwie zewnętrznej z pianki EVA. Osłona przeciwbłotna na obwodzie i pięcie nie przepuszcza brudu. Konstrukcja z systemem szybkiego sznurowania sprawia, że możesz z łatwością przetrwać każde przejście z hali na zewnątrz i znowu na halę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(994, 1, 1, 'Lata 80. były punktem zwrotnym w stylu koszykarskim, a buty adidas Forum szybko stały się legendą ― najpierw na parkiecie, a następnie na ulicach. Te młodzieżowe buty mają skórzaną cholewkę, solidną podeszwę zewnętrzną i pasek w kostce. Poczuj energię dekady za każdym razem, gdy je zakładasz.', '', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(995, 1, 1, 'Nigdy nie jest za wcześnie, by stworzyć dziecięcą kolekcję butów. Zrób wielkie pierwsze wrażenie przy pomocy tych butów adidas dla dzieci. Mają solidną i elastyczną, gumową podeszwę, która wspiera każdy krok i skok. Elastyczne sznurowadła, które rozciągają się, gdy dzieci je zakładają, oraz pasek na rzepy na górze, dzięki któremu dzieci mogą odpowiednio dopasować krój, sprawiają, że te klasyczne sneakery długo nie zagrzeją miejsca w pudełku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-elastic-lace-and-top-strap', '', '', '', 'Buty Grand Court Elastic Lace and Top Strap', '', '', '', ''),
(996, 1, 1, 'Oryginalny model Gazelle wyrobił sobie markę jako uniwersalne buty treningowe, a dziś cieszy się popularnością jako klasyk stylu miejskiego. Te młodzieżowe buty są dokładną repliką butów Gazelle z 1991 roku. Prezentują autentyczny styl z teksturowaną, zamszową cholewką w kolorach vintage.', '', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(997, 1, 1, 'Niezależnie od tego, czy maluchy wybierają się do szkoły, czy z przyjaciółmi zwiedzają park, Ty chcesz dać im najlepsze warunki. Te buty adidas dla dzieci zapewniają komfort, którego potrzebują, aby iść naprzód. Podeszwa środkowa Cloudfoam zapewnia optymalną amortyzację, dzięki czemu każdy krok jest łatwy. Szybka sylwetka dodaje energii do ich codziennego stylu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(998, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(999, 1, 1, 'Dzieci mają swoje zdanie na wiele tematów. Ale jedno jest pewne. Te buty adidas stanowią idealne połączenie komfortu i stylu. Giętka podeszwa środkowa Bounce dba o komfort, podobnie jak oddychająca cholewka z mieszanki materiałów. A styl? To jest niezaprzeczalne. Ponadto kolory pasują do każdego stroju. Sprzedane. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'rapidasport-bounce-sport-running-lace-shoes', '', '', '', 'Rapidasport Bounce Sport Running Lace Shoes', '', '', '', ''),
(1000, 1, 1, 'Twój mały Jedi będzie gotowy na przygodę w butach Racer TR23 od adidas. Wzór na cholewce przedstawiający młodego Jedi i świecące w ciemności 3 paski wzdłuż boków dodają mocy temu modelowi. Podeszwa środkowa Cloudfoam zapewnia amortyzowany komfort, który sprawdzi się podczas zabawy w odległej galaktyce. Elastyczne sznurowadła i pasek ułatwiają zakładanie i zdejmowanie, gdy nadchodzi czas, aby włączyć miecz świetlny lub wziąć przekąskę z kuchni.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-disney-racer-tr23-kids', '', '', '', 'Buty Disney Racer TR23 Kids', '', '', '', ''),
(1001, 1, 1, 'Buty adidas Superstar, które kiedyś królowały na koszykarskich parkietach, a teraz są ikoną stylu miejskiego, nie mają sobie równych, jeśli chodzi o swobodny, pewny styl. Te młodzieżowe buty adidas kontynuują tę tradycję za sprawą solidnej podeszwy, ząbkowanych 3 pasków i charakterystycznej osłony palców w kształcie muszli. Klasyczne kolory sprawiają, że łatwo je zestawić z ulubionymi ubraniami. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-kids', '', '', '', 'Buty Superstar Kids', '', '', '', ''),
(1002, 1, 1, 'Dawno temu były niskimi butami do koszykówki. Dzisiaj królują na ulicach miast. Buty dla młodzieży świętują 50. rocznicę modelu adidas Superstar. Od klasycznej osłony palców w kształcie muszli po ząbkowane 3 paski, ta rocznicowa edycja oddaje hołd niepowtarzalnemu designowi adidas. Konstrukcja z wygodną, gumową podeszwą prezentuje się świeżo i zabawnie, niezależnie od wersji kolorystycznej.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1003, 1, 1, 'Ponadczasowe sneakery adidas Superstar stały się inspiracją dla tych wygodnych i klasycznych butów dla młodzieży. Model zachowuje najlepsze detale designu imiennika, takie jak kultowa osłona palców w kształcie muszli i 3 paski. Podwyższona podeszwa środkowa dodaje lekkości, a wyściełany kołnierz zapewnia wygodne wsparcie kostki na każdym kroku. Prosty styl właśnie zyskał nową odsłonę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-kids', '', '', '', 'Buty Superstar Kids', '', '', '', ''),
(1004, 1, 1, 'Mali odkrywcy mogą cieszyć się wygodą. Zabierz swojego malucha na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, a jednocześnie zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia ciepło i suchy komfort w mokrych warunkach, a profil do kostki chroni przed zabrudzeniami.', '', 'terrex-trailmaker-mid-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(1005, 1, 1, 'Lekkie, szybkie i stabilne buty adidas Terrex Agravic BOA Hiking są przeznaczone dla dzieci, które lubią przyspieszać tempo. Podziel się swoją miłością do fitnessu i przygody. Znajdź najlepsze dopasowanie i pozwól dzieciom swobodnie odkrywać świat.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-agravic-boa-trail-running-shoes', '', '', '', 'Terrex Agravic BOA Trail Running Shoes', '', '', '', ''),
(1006, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają gładką, lekką cholewkę, która sprawdzi się przy energicznych ruchach. Amortyzacja Cloudfoam zapewnia dziecku komfort od rana do nocy.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-elastic-lace-top-strap-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Elastic Lace Top Strap Shoes', '', '', '', ''),
(1007, 1, 1, 'Chłodny dzień oznacza mnóstwo zabawy na dworze. Te buty adidas dla dzieci szybko się zakłada i zapewniają pełne okrycie, dzięki czemu dzieci mogą bawić się tak długo, jak chcą. I oczywiście disnejowska Myszka Minnie idzie wszędzie razem z nimi. Miękka cholewka ma wygodną podszewkę, a pasek na rzep ułatwia szybkie i łatwe zapięcie. Solidna, gumowa podeszwa zewnętrzna pomaga dzieciom utrzymać się na śliskich i błotnistych nawierzchniach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-winterplay-x-disney-kids', '', '', '', 'Buty Winterplay x Disney Kids', '', '', '', ''),
(1008, 1, 1, 'Wędruj z miasta na szlak. Zimowe buty adidas Terrex dla dzieci zapewniają ciepło, komfort i przyczepność w śnieżnym klimacie. Izolacja PrimaLoft® i miła w dotyku podszewka tworzą idealne, ciepłe dopasowanie podczas eksploracji w chłodne dni. COLD.RDY chroni przed śniegiem i błotem, a gumowa podeszwa zewnętrzna z wypustkami zapewnia maksymalną przyczepność na oblodzonej nawierzchni. Odblaskowe detale wyróżniają się w słabym świetle typowym dla zimowych dni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-snowpitch-coldrdy-winter', '', '', '', 'Buty Terrex Snowpitch COLD.RDY Winter', '', '', '', ''),
(1009, 1, 1, 'Od weekendowych spacerów po epickie górskie przygody te buty hikingowe adidas dla dzieci gwarantują stopom ciepło i suchy komfort, aby nic nie rozpraszało maluchów na szlaku. Te buty zostały wyposażone w technologię COLD.RDY i izolację PrimaLoft®, która zatrzymuje ciepło, a lekka amortyzacja zapewnia komfort przez cały dzień. Przyczepna podeszwa zewnętrzna z gumy Continental™ pomaga dzieciom utrzymać równowagę na oblodzonych nawierzchniach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-winter-mid-boa-rainrdy-hiking', '', '', '', 'Buty Terrex Winter Mid BOA RAIN.RDY Hiking', '', '', '', ''),
(1010, 1, 1, 'Zabawa jest na wyciągnięcie ręki dziecka — lub o krok od niego. Buty adidas dla dzieci z charakterystyczną podeszwą inspirowaną klockami LEGO® i w charakterystycznych dla nich kolorach przyciągną wzrok w każdej sytuacji. Cholewka z siateczki z paskiem na rzep zapewnia przewiewny komfort i bezpieczne dopasowanie, gdy maluchy skaczą i biegają. Gumowa podeszwa zewnętrzna gwarantuje niezawodną trakcję.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'adidas-sport-dna-x-legolifestyle-elastic-lace-and-top-strap-shoes', '', '', '', 'adidas Sport DNA x LEGO®Lifestyle Elastic Lace and Top Strap Shoes', '', '', '', ''),
(1011, 1, 1, 'Klasyczne sneakery adidas Superstar przechodzą w stan hibernacji, a te zimowe buty dla najmłodszych są gotowe, aby zaszaleć. Izolacja PrimaLoft® zapewnia ciepło nawet w mokrych warunkach, chroniąc palce i stopy przed mrozem. Gdy robi się zimno, gumowa podeszwa zewnętrzna zapewnia dzieciom stabilność podczas poślizgnięć i celowych ślizgów  Wiedzieć, że Twojemu maluszkowi jest ciepło i jest bezpieczny? To więcej zabawy dla wszystkich.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(1012, 1, 1, 'W tych butach PrimaLoft® dzieci nie będą zwalniać tempa z powodu zimowego chłodu. Buty z charakterystyczną osłoną palców w kształcie muszli i 3 paskami jak oryginał nawiązują do kultowych elementów modelu adidas Superstar w wersji na śnieg. Dziecięce stopy będą cieszyć się ciepłem i wsparciem przez cały dzień.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-20-kids', '', '', '', 'Buty Superstar 360 2.0 Kids', '', '', '', ''),
(1013, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(1014, 1, 1, 'Malutka replika kultowych koszykarskich butów w klasycznym stylu. Wybierz dla swojego malucha buty o miękkiej konstrukcji z siateczki z gumową osłoną palców i wygodnym zapięciem na rzep, ułatwiającym zdejmowanie i zakładanie.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1015, 1, 1, 'Styl retro. Młodzieżowe buty adidas Campus 00s są wzorowane na modelu Campus z lat 80., ale mają nowoczesny design inspirowany stylem Y2K. Gładki kształt i połączenie różnych materiałów nadają im świeży look. Zestaw te buty z ulubionymi dżinsami i ruszaj w drogę.', '', 'campus-00s-shoes', '', '', '', 'Campus 00s Shoes', '', '', '', ''),
(1016, 1, 1, 'Czerpiąc elementy designu z linii biegowej adidas ZX, model ZX 22 narodził się dzięki wykorzystaniu wirtualnej i rozszerzonej rzeczywistości. Te buty dla młodzieży mają minimalistyczny, prosty look, który pasuje do wszystkiego, co masz w swojej garderobie.\n\nModel wykonany częściowo z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'zx-22-shoes', '', '', '', 'ZX 22 Shoes', '', '', '', ''),
(1017, 1, 1, 'Jeśli wszystko musi się gdzieś zacząć, to uważamy, że lata 90. to całkiem solidny punkt startowy. Na przykład te młodzieżowe buty Ozelia. Wywodzą się prosto z archiwów adidas, ale ich gładka, monochromatyczna konstrukcja zyskała futurystyczny look. Amortyzacja Adiprene sprawia, że każdy krok jest czystą przyjemnością. \n\nTen produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', '', 'ozelia-shoes', '', '', '', 'Ozelia Shoes', '', '', '', ''),
(1018, 1, 1, 'Klasyczne sneakery adidas Superstar przechodzą w stan hibernacji, a te zimowe buty dla najmłodszych są gotowe, aby zaszaleć. Izolacja PrimaLoft® zapewnia ciepło nawet w mokrych warunkach, chroniąc palce i stopy przed mrozem. Gdy robi się zimno, gumowa podeszwa zewnętrzna zapewnia dzieciom stabilność podczas poślizgnięć i celowych ślizgów  Wiedzieć, że Twojemu maluszkowi jest ciepło i jest bezpieczny? To więcej zabawy dla wszystkich.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(1019, 1, 1, 'Model Gazelle od końca lat 60. był „tymi” butami piłkarskimi, a następnie przekroczył granice świata sportu, zyskując status międzynarodowej ikony stylu. Te młodzieżowe buty są wierną repliką autentycznego designu. Mają konstrukcję z miękkiej skóry z ząbkowanymi 3 paskami i teksturowaną, gumową podeszwą zewnętrzną.', '', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(1020, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Miękka, syntetyczna cholewka tych młodzieżowych butów piłkarskich ma teksturę High Definition na powierzchni całej strefy uderzenia. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Specjalistyczna podeszwa zewnętrzna pozwoli Ci dominować na naturalnej nawierzchni.', '', 'buty-predator-accuracy3-fg', '', '', '', 'Buty Predator Accuracy.3 FG', '', '', '', ''),
(1021, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1022, 1, 1, 'Outdoorowe dzieci nie dadzą się pogodzie, podobnie jak te buty adidas dla dzieci. Solidna cholewka jest wykonana z pianki izolującej i ma podszewkę z polaru, która zapewnia ciepło i ochronę stopom, gdy temperatura spada. Podeszwa zewnętrzna Traxion gwarantuje dzieciom stabilność na śliskich i wilgotnych nawierzchniach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-fortatrail-kids', '', '', '', 'Buty Fortatrail Kids', '', '', '', ''),
(1023, 1, 1, 'Model, który sprawdzi się zawsze i wszędzie. W szkole, w pracy czy podczas weekendu młodzieżowe buty NMD_R1 zapewnią Ci świetny wygląd dzięki gładkiemu, potrójnie czarnemu designowi. Buty łączące codzienny styl z zaawansowaną technologią adidas powstały z inspiracji bieganiem i gwarantują Ci komfort w ruchu za sprawą zwracającej energię amortyzacji Boost pod stopą.', '', 'nmdr1-shoes', '', '', '', 'NMD_R1 Shoes', '', '', '', ''),
(1024, 1, 1, 'Maluchy uwielbiają badać każdą powierzchnię ― od puszystego dywanu po rabatki z kwiatami. Te solidne buty adidas dla najmłodszych mają wygodne paski na rzepy, które utrzymują je na miejscu. Gumowa podeszwa zewnętrzna nie pozostawia  czarnych śladów — dobra wiadomość, jeśli Twój maluszek odkryje parkiet. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1025, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1026, 1, 1, 'Klasyczne sneakery adidas Superstar przechodzą w stan hibernacji, a te zimowe buty dla najmłodszych są gotowe, aby zaszaleć. Izolacja PrimaLoft® zapewnia ciepło nawet w mokrych warunkach, chroniąc palce i stopy przed mrozem. Gdy robi się zimno, gumowa podeszwa zewnętrzna zapewnia dzieciom stabilność podczas poślizgnięć i celowych ślizgów  Wiedzieć, że Twojemu maluszkowi jest ciepło i jest bezpieczny? To więcej zabawy dla wszystkich.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(1027, 1, 1, 'Jeśli cofniesz się w czasie do lat 60., zobaczysz profesjonalnych piłkarzy w butach adidas Samba, takich jak te buty dla dzieci. Cóż, prawie takie same. Odświeżone z myślą o kolejnym pokoleniu buty mają miękką wkładkę, która zapewnia komfort podczas całodziennej zabawy. Skórzana cholewka, gumowa podeszwa i 3 paski pozostają klasyczne.', '', 'buty-samba-og-kids', '', '', '', 'Buty Samba OG Kids', '', '', '', ''),
(1028, 1, 1, 'Jeśli cofniesz się w czasie do lat 60., zobaczysz profesjonalnych piłkarzy w butach adidas Samba, takich jak te buty dla dzieci. Cóż, prawie takie same. Odświeżone z myślą o kolejnym pokoleniu buty mają miękką wkładkę, która zapewnia komfort podczas całodziennej zabawy. Skórzana cholewka, gumowa podeszwa i 3 paski pozostają klasyczne.', '', 'buty-samba-og-kids', '', '', '', 'Buty Samba OG Kids', '', '', '', ''),
(1029, 1, 1, 'Getting up and down the field with speed is the name of the indoor game. The Samba has dominated indoor football for decades for a reason. This juniors\' version of the legendary football boots features a leather upper and a lightweight EVA midsole for better response on indoor surfaces.', '', 'samba-classic-boots', '', '', '', 'Samba Classic Boots', '', '', '', ''),
(1030, 1, 1, 'Jeśli cofniesz się w czasie do lat 60., zobaczysz profesjonalnych piłkarzy w butach adidas Samba, takich jak te buty dla najmłodszych. Cóż, prawie takie same. Model w pomniejszonej wersji, która dopasowuje się do małych stóp, ma miękką wkładkę, która zapewnia komfort podczas całodziennej zabawy. Skórzana cholewka, gumowa podeszwa i 3 paski pozostają klasyczne.', '', 'buty-samba-og-kids', '', '', '', 'Buty Samba OG Kids', '', '', '', ''),
(1031, 1, 1, 'Styl retro. Młodzieżowe buty adidas Campus 00s są wzorowane na modelu Campus z lat 80., ale mają nowoczesny design inspirowany stylem Y2K. Gładki kształt i połączenie różnych materiałów nadają im świeży look. Zestaw te buty z ulubionymi dżinsami i ruszaj w drogę.', '', 'campus-00s-shoes', '', '', '', 'Campus 00s Shoes', '', '', '', ''),
(1032, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć całodzienną zabawę. Jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1033, 1, 1, 'Zabierz je na zewnątrz i pozwól odkrywać świat. Buty hikingowe adidas Terrex Trailmaker sprawią, że dzieci będą pewnie poruszać się po szlaku. Wytrzymałe, lekkie i z przyczepną podeszwą zewnętrzną zapewniają komfort i wsparcie podczas wędrówek. Małe dłonie poradzą sobie z paskiem na rzep. Tradycyjne sznurowadła gwarantują idealne dopasowanie.', '', 'terrex-trailmaker-hiking-shoes', '', '', '', 'Terrex Trailmaker Hiking Shoes', '', '', '', ''),
(1034, 1, 1, 'Z koszykarskiego parkietu do klasy. Każdy zasługuje na parę butów adidas Superstar. Te buty dla dzieci świętują 50. rocznicę klasycznego designu z osłoną palców w kształcie muszli. Od wyróżniających się ząbkowanych 3 pasków po komfortową, gumową podeszwę, ta rocznicowa edycja oddaje hołd kultowemu modelowi. Niezależnie od tego, czy mają kolor biały, czarny, czy jakiś inny – dzieci wyglądają w nich zawsze świeżo.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1035, 1, 1, 'Dla każdego pokolenia buty Stan Smith są jedyne w swoim rodzaju. Teraz kolej na Ciebie. Te buty dla młodzieży mają ten sam minimalistyczny look i design, co oryginał. Co je różni? Materiały.  Elementy pochodzące z recyklingu są częścią zaangażowania adidas w ograniczanie ilości odpadów. Czas założyć buty i dopisać kolejny rozdział historii. \n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka w 50% wykonana z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'stan-smith-shoes', '', '', '', 'Stan Smith Shoes', '', '', '', ''),
(1036, 1, 1, 'Inspirowane klasycznymi klapkami Adilette sandały adidas dla dzieci są idealne na słoneczne dni zabawy w wodzie i poza nią. Pasek na rzep ułatwia zakładanie i zdejmowanie. Szybkoschnąca cholewka pozwala maluchom cieszyć się komfortem, aż powrócą na suchy ląd.', '', 'adilette-sandals', '', '', '', 'adilette Sandals', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1037, 1, 1, 'Maluchy pokażą swoją postawę w stylu adidas przy pomocy tych klapków dla dzieci. Klapki pod prysznic mają jednoczęściową, formowaną część górną z 3 paskami na wierzchu. Wyjątkowo miękka wkładka w bucie została wyposażona w szybkoschnącą, komfortową amortyzację.', '', 'adilette-aqua-slides', '', '', '', 'adilette Aqua Slides', '', '', '', ''),
(1038, 1, 1, 'Wybierz wygodę dla małych stóp. Sandały adidas dla najmłodszych zapewniają miękką, wspierającą amortyzację w wodzie i poza nią za sprawą profilowanej podeszwy wewnętrznej z pianki EVA. Design z zakrytymi palcami osłania je w trakcie wodnych szaleństw. Zapięcie na rzepy ułatwia zakładanie i zdejmowanie.', '', 'closed-toe-summer-water-sandals', '', '', '', 'Closed-Toe Summer Water Sandals', '', '', '', ''),
(1039, 1, 1, 'Maluchy pokażą swoją postawę w stylu adidas przy pomocy tych klapków dla dzieci. Klapki pod prysznic mają jednoczęściową, formowaną część górną z 3 paskami na wierzchu. Wyjątkowo miękka wkładka w bucie została wyposażona w szybkoschnącą, komfortową amortyzację.', '', 'adilette-aqua-slides', '', '', '', 'adilette Aqua Slides', '', '', '', ''),
(1040, 1, 1, 'Stworzone do ruchu, zupełnie jak Twój skarb.  Załóż swojemu maluszkowi inspirowane bieganiem w stylu lat 90. buty OZWEEGO dla najmłodszych i pozwól mu szaleć. Odblaskowe elementy i półprzezroczyste rurki zapewniają autentyczny look. Podwójna amortyzacja gwarantuje wygodę.', '', 'ozweego-shoes', '', '', '', 'OZWEEGO Shoes', '', '', '', ''),
(1041, 1, 1, 'Oryginalny model Gazelle wyrobił sobie markę jako uniwersalne buty treningowe, a dziś cieszy się popularnością jako klasyk stylu miejskiego. Te młodzieżowe buty są dokładną repliką butów Gazelle z 1991 roku. Prezentują autentyczny styl z teksturowaną, zamszową cholewką w kolorach vintage.', '', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(1042, 1, 1, 'Które dziecko na placu zabaw jest najmodniej ubrane? Z pewnością Twoje. Dzięki tym butom Twoja pociecha może się cieszyć stylem adidas i zaawansowaną technologią butów treningowych. Jednoczęściowy design łatwo jest założyć, a amortyzacja z pianki EVA ma głębokie, elastyczne żłobienia, które zapewniają maluchom pewność siebie podczas biegania i zabawy. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'nmd-360-shoes', '', '', '', 'NMD 360 Shoes', '', '', '', ''),
(1043, 1, 1, 'Najbardziej zaawansowane buty do koszykówki sprzed lat, adidas Forum, powracają z archiwów i są gotowe na podbój świata. Wybierz młodzieżowe buty do kostki, które dodadzą Ci energii w każdej sytuacji: w szkole, podczas weekendowych wypraw i na spotkaniu ze znajomymi. Możesz na nie liczyć.', '', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', ''),
(1044, 1, 1, 'Nowa odsłona ulubionych Twoich ulubionych butów. Te młodzieżowe buty adidas Forum Low pasują praktycznie do wszystkiego i dodadzą Twojej garderobie energii w stylu retro. Cholewka ze skóry i nubuku z wytłaczanym detalem X z logo Trefoil stanowi luksusowy akcent. Idealne dla aktywnych, przyszłych ikon mody.', '', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(1045, 1, 1, 'Tenisowy design retro w stylu lat 80. stał się inspiracją dla modelu Continental 80. Te niskie buty mają nostalgiczny look z zakrzywionym, dwukolorowym paskiem na boku i okienkiem z logo w pobliżu sznurowania. Dzielona, gumowa podeszwa z wstawką z pianki EVA zapewnia poczucie giętkiego komfortu', '', 'buty-continental-80', '', '', '', 'Buty Continental 80', '', '', '', ''),
(1046, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Przewiewna i elastyczna cholewka z siateczki w tych młodzieżowych butach piłkarskich została zaprojektowana z myślą o komforcie podczas intensywnych rozgrywek. Specjalistyczna, niebrudząca, gumowa podeszwa zewnętrzna pozwoli Ci dominować na hali.', '', 'buty-predator-accuracy3-in', '', '', '', 'Buty Predator Accuracy.3 IN', '', '', '', ''),
(1047, 1, 1, 'Wybierzcie się na pieszą wędrówkę, a góry zajmą się resztą. Lekkie buty hikingowe adidas zapewniają dzieciom komfort podczas odkrywania nowych szlaków. Gumowa podeszwa zewnętrzna Traxion zapewnia przyczepność potrzebną do poruszania się po śliskich kamieniach i korzeniach. Mocne buty hikingowe z amortyzowaną podeszwą środkową i cholewką z tkaniny ripstop dbają o suchy komfort, ochronę i wygodę w lesie.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-mid-hiking-shoes', '', '', '', 'Terrex Hyperhiker Mid Hiking Shoes', '', '', '', ''),
(1048, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(1049, 1, 1, 'Przygotuj dzieci na deszczowe dni i trudny teren. Gdy zaczyna padać, buty hikingowe adidas dla dzieci zapewnią suchy komfort stopom. RAIN.RDY nie przepuszcza błota i wody, dzięki czemu dzieci mogą nadal komfortowo wędrować, bawić się i odkrywać świat. BOA® Fit System ułatwia regulację dopasowania. Lekka podeszwa środkowa z pianki EVA chroni przed kamieniami na szlaku, a gumowa podeszwa zewnętrzna Traxion ułatwia pewny krok podczas przygód. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-boa-mid-rainrdy-hiking', '', '', '', 'Buty Terrex BOA Mid RAIN.RDY Hiking', '', '', '', ''),
(1050, 1, 1, 'Profesjonalni gracze w nie wierzyli. Legendy hip hopu pisały o nich piosenki. A każdy je kocha. Buty adidas Superstar prezentują takie same klasyczne linie, jak pierwsze modele z lat 70. Zapięcie na paski, które zastąpiło sznurowadła, sprawia, że łatwo je założyć i zdjąć.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1051, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(1052, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Miękka, syntetyczna cholewka tych młodzieżowych butów piłkarskich ma teksturę High Definition na powierzchni całej strefy uderzenia. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Gumowa podeszwa zewnętrzna z wypustkami pozwoli Ci dominować na sztucznej murawie.', '', 'buty-predator-accuracy3-tf', '', '', '', 'Buty Predator Accuracy.3 TF', '', '', '', ''),
(1053, 1, 1, 'Odkrywanie świata na dworze jest o wiele fajniejsze niż siedzenie w domu. Przygotuj swojego małego poszukiwacza przygód na zimę dzięki tym butom hikingowym adidas. Model łączy lekkość sneakerów ze wsparciem i ciepłą izolacją butów hikingowych. COLD.RDY zapewnia ciepło, suchość i wygodę stopom. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody. Głęboko żłobiona podeszwa gwarantuje pewną przyczepność na zaśnieżonej i nierównej nawierzchni. Zachowaj ciepły komfort. Odkrywaj jeszcze więcej.', '', 'terrex-trailmaker-high-coldrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker High COLD.RDY Hiking Shoes', '', '', '', ''),
(1054, 1, 1, 'W tych butach hikingowych adidas AX2R dla dzieci przygoda nie zna granic. Dzieci mogą pewnie odkrywać świat od placu zabaw po szlak w tych butach, które są lekkie, stabilne i solidnie przyczepne. Podeszwa środkowa z pianki EVA zapewnia długotrwałą amortyzację, a podeszwa zewnętrzna Traxion maksymalizuje przyczepność we wszystkich kierunkach. Zapięcie na rzepy ułatwia zakładanie i zdejmowanie, niezależnie od tego, czy maluchy wracają do domu, czy z niego wychodzą.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-ax2r-hook-and-loop-hiking', '', '', '', 'Buty Terrex AX2R Hook-and-Loop Hiking', '', '', '', ''),
(1055, 1, 1, 'Młodzieżowe sneakery adidas Rivalry są przede wszystkim odważne. Klasyczna sylwetka, skórzana cholewka i kultowy branding sprawiają, że tym inspirowanym koszykówką butom nie brakuje kreatywnej ekspresji. Zestaw je z ulubionymi ubraniami, aby podkręcić swój codzienny look. Tak jak Ty, są gwiazdami stylu.', '', 'buty-rivalry-low-kids', '', '', '', 'Buty Rivalry Low Kids', '', '', '', ''),
(1056, 1, 1, 'Wybierz buty adidas dla najmłodszych, które pasują do wszystkich ubrań, od ogrodniczek po pozostałe części dziecięcej garderoby. Solidna podeszwa i paski na rzepy zapewniają dopasowanie i wsparcie małych stóp, dzięki czemu sprawdzą się podczas zabawy, zajęć sensorycznych czy drugiego śniadania. A to dopiero przedpołudnie...\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-hook-and-loop', '', '', '', 'Buty Grand Court Lifestyle Hook and Loop', '', '', '', ''),
(1057, 1, 1, 'Wnieś nieco stylu z parkietu do garderoby Twojego malutkiego kibica. Te sneakery adidas dla najmłodszych na co dzień zapewniają wsparcie i stabilizację butów do koszykówki. Cholewka z syntetycznej skóry nadaje im wyszukany look, a jednocześnie zapewnia lekkość małym stopom. Średniowysoka sylwetka nawiązuje do złotej ery koszykarskich gwiazd.', '', 'hoops-mid-shoes', '', '', '', 'Hoops Mid Shoes', '', '', '', ''),
(1058, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1059, 1, 1, 'Lekki komfort i styl gotowy na wszystko. Wybierz buty adidas dla dzieci, które sprawdzą się w każdej sytuacji. Podeszwa środkowa Cloudfoam amortyzuje każdy krok, a przewiewna cholewka z siateczki zapewnia stopom przewiewny komfort. Podeszwa zewnętrzna z pianki EVA gwarantuje elastyczność, dzięki czemu dzieci mogą przejść od placu zabaw do pizzerii, nie tracąc rytmu. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-xplr-kids', '', '', '', 'Buty X_PLR Kids', '', '', '', ''),
(1060, 1, 1, 'Gdy masz w planach lunch lub podbój świata, potrzebujesz uniwersalnych sneakerów. Wybierz te młodzieżowe buty adidas w klasycznym stylu. Półprzezroczyste 3 paski nadają designowi nowoczesny charakter, a połączenie amortyzacji BOOST i Bounce zapewnia niewiarygodny komfort na co dzień.  \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'xplrphase-shoes-kids', '', '', '', 'X_PLRPHASE Shoes Kids', '', '', '', ''),
(1061, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają gładką, lekką cholewkę, która sprawdzi się przy energicznych ruchach. Amortyzacja Cloudfoam zapewnia dziecku komfort od rana do nocy.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-elastic-lace-top-strap-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Elastic Lace Top Strap Shoes', '', '', '', ''),
(1062, 1, 1, 'Dzieci, które uczą się nowych umiejętności, potrzebują butów, które dotrzymają im kroku. Te klasyczne buty adidas mają gumową podeszwę zewnętrzną, która jest gładka w dotyku podczas biegania, ale nie pozostawia śladów na drewnianych podłogach. Dlatego buty sprawdzą się zarówno w szkole, jak i podczas treningu.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tensaur-sport-training-lace-shoes', '', '', '', 'Tensaur Sport Training Lace Shoes', '', '', '', ''),
(1063, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(1064, 1, 1, 'Zabawa jest na wyciągnięcie ręki dziecka — lub o krok od niego. Buty adidas dla dzieci z charakterystyczną podeszwą inspirowaną klockami LEGO® i w charakterystycznych dla nich kolorach przyciągną wzrok w każdej sytuacji. Cholewka z siateczki z paskiem na rzep zapewnia przewiewny komfort i bezpieczne dopasowanie, gdy maluchy skaczą i biegają. Gumowa podeszwa zewnętrzna gwarantuje niezawodną trakcję.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'adidas-sport-dna-x-legolifestyle-elastic-lace-and-top-strap-shoes', '', '', '', 'adidas Sport DNA x LEGO®Lifestyle Elastic Lace and Top Strap Shoes', '', '', '', ''),
(1065, 1, 1, 'Wybierzcie się na pieszą wędrówkę, a góry zajmą się resztą. Lekkie buty hikingowe adidas zapewniają dzieciom komfort podczas odkrywania nowych szlaków. Gumowa podeszwa zewnętrzna Traxion zapewnia przyczepność potrzebną do poruszania się po śliskich kamieniach i korzeniach. Mocne buty hikingowe z amortyzowaną podeszwą środkową i cholewką z tkaniny ripstop dbają o suchy komfort, ochronę i wygodę w lesie.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-mid-hiking-shoes', '', '', '', 'Terrex Hyperhiker Mid Hiking Shoes', '', '', '', ''),
(1066, 1, 1, 'Nigdy nie jest za wcześnie, by stworzyć dziecięcą kolekcję butów. Zrób wielkie pierwsze wrażenie przy pomocy tych butów adidas dla dzieci. Mają solidną i elastyczną, gumową podeszwę, która wspiera każdy krok i skok. Elastyczne sznurowadła, które rozciągają się, gdy dzieci je zakładają, oraz pasek na rzepy na górze, dzięki któremu dzieci mogą odpowiednio dopasować krój, sprawiają, że te klasyczne sneakery długo nie zagrzeją miejsca w pudełku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-elastic-lace-and-top-strap', '', '', '', 'Buty Grand Court Elastic Lace and Top Strap', '', '', '', ''),
(1067, 1, 1, 'Maluchy uwielbiają badać każdą powierzchnię ― od puszystego dywanu po rabatki z kwiatami. Te solidne buty adidas dla najmłodszych mają wygodne paski na rzepy, które utrzymują je na miejscu. Gumowa podeszwa zewnętrzna nie pozostawia  czarnych śladów — dobra wiadomość, jeśli Twój maluszek odkryje parkiet. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1068, 1, 1, 'Kiedy Twoje dziecko daje z siebie wszystko podczas treningu, upewnij się, że ma buty, które pasują do jego entuzjazmu i energii. Buty adidas dla dzieci mają miękką podeszwę środkową Cloudfoam, która zapewnia dziecku komfort podczas biegu, gwarantując wsparcie przy każdym wybiciu i lądowaniu. Po skończonym treningu nie musi zmieniać butów. Klasyczny, sportowy look pasuje do wszystkiego. Jedna rzecz mniej do zapamiętania.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'runfalcon-30-elastic-lace-top-strap-shoes', '', '', '', 'RunFalcon 3.0 Elastic Lace Top Strap Shoes', '', '', '', ''),
(1069, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie bez sznurowadeł dla młodzieży, które zapewnią Ci stabilizację przy pełnym przechyle na suchej, naturalnej trawie, osadzone są na gwarantującej szybkość podeszwie zewnętrznej do gry na naturalnej nawierzchni. Lekka, powlekana, tekstylna cholewka z dodatkowymi warstwami tylko tam, gdzie potrzebne jest wzmocnienie konstrukcji, ma kołnierz o płaskim splocie, który pewnie blokuje stopę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast3-laceless-fg', '', '', '', 'Buty X Crazyfast.3 Laceless FG', '', '', '', ''),
(1070, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1071, 1, 1, 'Nadeszły chłodne dni, ale dzieci nadal mogą wyjść na dwór i bawić się ze swoim ulubionym kumplem — disnejowską Myszką Mickey. Stworzone z myślą o komforcie w chłodne dni buty adidas dla dzieci mają gumową podeszwę zewnętrzną, która pewnie trzyma się podłoża. Zapięcia na rzepy ułatwiają zakładanie i zdejmowanie butów, dzięki czemu maluchy mogą w kilka sekund wyjść z domu. Podczas biegania i zabawy grafika z Myszką Mickey emanuje pozytywną energią, która wywołuje uśmiech na wszystkich twarzach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-winterplay-x-disney-kids', '', '', '', 'Buty Winterplay x Disney Kids', '', '', '', ''),
(1072, 1, 1, 'Wybierz buty do biegania, które przewodzą stawce na wiele sposobów. Model stworzony z myślą o komforcie ma lekką amortyzację Bounce. Oddychająca cholewka z siateczki zapewnia stopom świeżość, a niebrudząca, gumowa podeszwa zewnętrzna pewnie trzyma się trzeszczących kortów i śliskich ulic. Jeśli chodzi o styl, to na pierwszy rzut oka widać, że o co najmniej o kilka kroków wyprzedzają inne modele.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'ultrabounce-shoes-junior', '', '', '', 'Ultrabounce Shoes Junior', '', '', '', ''),
(1073, 1, 1, 'Wspaniałe przygody zaczynają się od wygody. Zabierz swojego małego odkrywcę na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, lecz zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia małym stopom ciepły i suchy komfort w mokrych warunkach. Podeszwa zewnętrzna Traxion daje przyczepność na śliskich nawierzchniach.', '', 'terrex-trailmaker-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker RAIN.RDY Hiking Shoes', '', '', '', ''),
(1074, 1, 1, 'Maluszki poruszają się zaskakująco szybko. Te buty w stylu biegowym dla najmłodszych zapewnią niewielkim stopom wsparcie podczas szybkich ruchów. Solidna, gumowa podeszwa zewnętrzna oznacza pewne kroki na śliskim chodniku. Regulowane paski na rzepy gwarantują bezpieczne dopasowanie. \n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'vs-switch-3-lifestyle-running-hook-and-loop-strap-shoes', '', '', '', 'VS Switch 3 Lifestyle Running Hook and Loop Strap Shoes', '', '', '', ''),
(1075, 1, 1, 'Dawno temu były niskimi butami do koszykówki. Dzisiaj królują na ulicach miast. Buty dla młodzieży świętują 50. rocznicę modelu adidas Superstar. Od klasycznej osłony palców w kształcie muszli po ząbkowane 3 paski, ta rocznicowa edycja oddaje hołd niepowtarzalnemu designowi adidas. Konstrukcja z wygodną, gumową podeszwą prezentuje się świeżo i zabawnie, niezależnie od wersji kolorystycznej.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1076, 1, 1, 'Pozwól swojemu maluchowi odkrywać świat w dobrym stylu, gdy robi pierwsze chwiejne kroki. Te buty adidas dla najmłodszych zapewniają im komfort, którego potrzebują delikatne stopy. Podeszwa środkowa Cloudfoam miękko amortyzuje każdy krok. Stylowy look sprawia, że model zawsze wygląda świeżo.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(1077, 1, 1, 'Przygotuj dzieci na deszczowe dni i trudny teren. Gdy zaczyna padać, buty hikingowe adidas dla dzieci zapewnią suchy komfort stopom. RAIN.RDY nie przepuszcza błota i wody, dzięki czemu dzieci mogą nadal komfortowo wędrować, bawić się i odkrywać świat. BOA® Fit System ułatwia regulację dopasowania. Lekka podeszwa środkowa z pianki EVA chroni przed kamieniami na szlaku, a gumowa podeszwa zewnętrzna Traxion ułatwia pewny krok podczas przygód. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-boa-mid-rainrdy-hiking', '', '', '', 'Buty Terrex BOA Mid RAIN.RDY Hiking', '', '', '', ''),
(1078, 1, 1, 'Kiedy Twoje dziecko daje z siebie wszystko podczas treningu, upewnij się, że ma buty, które pasują do jego entuzjazmu i energii. Buty adidas dla dzieci mają miękką podeszwę środkową Cloudfoam, która zapewnia dziecku komfort podczas biegu, gwarantując wsparcie przy każdym wybiciu i lądowaniu. Po skończonym treningu nie musi zmieniać butów. Klasyczny, sportowy look pasuje do wszystkiego. Jedna rzecz mniej do zapamiętania.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'runfalcon-30-elastic-lace-top-strap-shoes', '', '', '', 'RunFalcon 3.0 Elastic Lace Top Strap Shoes', '', '', '', ''),
(1079, 1, 1, 'Niezależnie od tego, czy chodzi o zabawę w parku, czy rodzinne wizyty, buty adidas Advantage dla najmłodszych zapewniają małym stopom komfort przez cały dzień. Zapięcie na rzepy sprawia, że zakładanie i zdejmowanie tych lekkich butów jest łatwe zarówno dla maluszków, jak i rodziców. Jednoczęściowa podeszwa środkowa i podeszwa zewnętrzna z pianki EVA amortyzują każdy krok, a cholewka z materiałów syntetycznych pochodzących z recyklingu zwiększa trwałość i dodaje stylu.\n \nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-advantage-kids', '', '', '', 'Buty Advantage Kids', '', '', '', ''),
(1080, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1081, 1, 1, 'Odkrywanie świata na dworze jest o wiele fajniejsze niż siedzenie w domu. Przygotuj swojego małego poszukiwacza przygód na zimę dzięki tym butom hikingowym adidas. Model łączy lekkość sneakerów ze wsparciem i ciepłą izolacją butów hikingowych. COLD.RDY zapewnia ciepło, suchość i wygodę stopom. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody. Głęboko żłobiona podeszwa gwarantuje pewną przyczepność na zaśnieżonej i nierównej nawierzchni. Zachowaj ciepły komfort. Odkrywaj jeszcze więcej.', '', 'terrex-trailmaker-high-coldrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker High COLD.RDY Hiking Shoes', '', '', '', ''),
(1082, 1, 1, 'Design inspirowany butami Grand Court sprawia, że sneakery adidas dla dzieci mają prosty, przyciągający uwagę styl. Logotypy na języku i pięcie nadają im klasyczny look. Paski z rzepami ułatwiają zakładanie i zdejmowanie butów. Solidna, gumowa podeszwa sprawdzi się podczas zajęć pozaszkolnych.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'advantage-court-lifestyle-hook-and-loop-shoes', '', '', '', 'Advantage Court Lifestyle Hook-and-Loop Shoes', '', '', '', ''),
(1083, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć całodzienną zabawę. Jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1084, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1085, 1, 1, 'Twój mały sportowiec będzie gotowy do wejścia na parkiet w okamgnieniu dzięki butom koszykarskim adidas dla dzieci. Idealnie dopasowane wsparcie w kostkach umożliwia błyskawiczną zmianę kierunku. Lekka amortyzacja zapewnia wygodę na siłowni, na placu zabaw i w każdym innym miejscu.\n\nTen produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', '', 'ownthegame-20-shoes', '', '', '', 'Ownthegame 2.0 Shoes', '', '', '', ''),
(1086, 1, 1, 'Gdy pod stopami jest moc z Gwiezdnych wojen, przygoda wzywa. Te buty adidas Star Wars Runner dodadzą mocy Twojemu małemu Jedi podczas wypraw po galaktyce. Kultowe grafiki stanowią nieziemski akcent. A klasyczne, sznurowane zapięcie oznacza, że dzieciaki mogą się ubrać i wystartować z prędkością światła. Niezależnie od tego, czy maluchy spieszą zniszczyć Gwiazdę Śmierci czy ćwiczą używanie mocy na podwórku, podeszwa środkowa z wtryskiwanej pianki EVA i mocna, gumowa podeszwa zewnętrzna zapewnią im potrzebne wsparcie.\n \nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-star-wars-runner-kids', '', '', '', 'Buty Star Wars Runner Kids', '', '', '', ''),
(1087, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1088, 1, 1, 'Gdy pod stopami jest moc z Gwiezdnych wojen, przygoda wzywa. Te buty adidas Star Wars Runner dodadzą mocy Twojemu małemu Jedi podczas wypraw po galaktyce. Kultowe grafiki stanowią nieziemski akcent. A klasyczne, sznurowane zapięcie oznacza, że dzieciaki mogą się ubrać i wystartować z prędkością światła. Niezależnie od tego, czy maluchy spieszą zniszczyć Gwiazdę Śmierci czy ćwiczą używanie mocy na podwórku, podeszwa środkowa z wtryskiwanej pianki EVA i mocna, gumowa podeszwa zewnętrzna zapewnią im potrzebne wsparcie.\n \nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-star-wars-runner-kids', '', '', '', 'Buty Star Wars Runner Kids', '', '', '', ''),
(1089, 1, 1, 'Maluchy uwielbiają badać każdą powierzchnię ― od puszystego dywanu po rabatki z kwiatami. Te solidne buty adidas dla najmłodszych mają wygodne paski na rzepy, które utrzymują je na miejscu. Gumowa podeszwa zewnętrzna nie pozostawia  czarnych śladów — dobra wiadomość, jeśli Twój maluszek odkryje parkiet. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1090, 1, 1, 'Niezależnie od tego, czy maluchy wybierają się do szkoły, czy z przyjaciółmi zwiedzają park, Ty chcesz dać im najlepsze warunki. Te buty adidas dla dzieci zapewniają komfort, którego potrzebują, aby iść naprzód. Podeszwa środkowa Cloudfoam zapewnia optymalną amortyzację, dzięki czemu każdy krok jest łatwy. Szybka sylwetka dodaje energii do ich codziennego stylu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(1091, 1, 1, 'Spraw, aby podążały śladami najlepszych tenisistów. Te buty adidas dla dzieci mają gładki look inspirowany stylem tenisowym z lat 70. Gumowa podeszwa wygina się i zapewnia przyczepność, gwarantując płynny, pewny krok. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-tennis-lace-up', '', '', '', 'Buty Grand Court Lifestyle Tennis Lace-Up', '', '', '', ''),
(1092, 1, 1, 'Lata 80. były punktem zwrotnym w stylu koszykarskim, a buty adidas Forum szybko stały się legendą ― najpierw na parkiecie, a następnie na ulicach. Te młodzieżowe buty mają skórzaną cholewkę, solidną podeszwę zewnętrzną i pasek w kostce. Poczuj energię dekady za każdym razem, gdy je zakładasz.', '', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(1093, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(1094, 1, 1, 'Dzieci mają swoje zdanie na wiele tematów. Ale jedno jest pewne. Te buty adidas stanowią idealne połączenie komfortu i stylu. Giętka podeszwa środkowa Bounce dba o komfort, podobnie jak oddychająca cholewka z mieszanki materiałów. A styl? To jest niezaprzeczalne. Ponadto kolory pasują do każdego stroju. Sprzedane. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'rapidasport-bounce-sport-running-lace-shoes', '', '', '', 'Rapidasport Bounce Sport Running Lace Shoes', '', '', '', ''),
(1095, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają gładką, lekką cholewkę, która sprawdzi się przy energicznych ruchach. Amortyzacja Cloudfoam zapewnia dziecku komfort od rana do nocy.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-elastic-lace-top-strap-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Elastic Lace Top Strap Shoes', '', '', '', ''),
(1096, 1, 1, 'Młodzieżowe buty adidas Ligra 7 stworzone z myślą o grze na każdym rodzaju nawierzchni pomogą Ci poprawić wyniki na hali. Gdy zmienia się przebieg gry, ich przewiewna cholewka z siateczki gwarantuje komfort i pewność siebie. Połączenie przyczepnej w różnych kierunkach podeszwy zewnętrznej ze wspierającymi nakładkami zapewnia stabilizację, gdy dajesz z siebie wszystko. Syntetyczna skóra na palcach oznacza, że wymagające rozgrywki nie stanowią problemu.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu. Cholewka wykonana jest w 50% z materiałów pochodzących z recyklingu. Model nie zawiera nowo wyprodukowanego poliestru.', '', 'ligra-7-indoor-shoes', '', '', '', 'Ligra 7 Indoor Shoes', '', '', '', ''),
(1097, 1, 1, 'adidas odrobił swoją pracę domową i stworzył nową odsłonę klasycznych sneakerów Grand Court dla dzieci. Gładka, syntetyczna cholewka jest odporna na uderzenia i wstrząsy, a giętka, gumowa podeszwa wspiera i chroni rosnące stopy, dlatego te sznurowane buty zyskają uznanie zarówno wśród dzieci, jak i rodziców. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-lace-tennis', '', '', '', 'Buty Grand Court Lifestyle Lace Tennis', '', '', '', ''),
(1098, 1, 1, 'Wybierz buty do biegania, które przewodzą stawce na wiele sposobów. Model stworzony z myślą o komforcie ma lekką amortyzację Bounce. Oddychająca cholewka z siateczki zapewnia stopom świeżość, a niebrudząca, gumowa podeszwa zewnętrzna pewnie trzyma się trzeszczących kortów i śliskich ulic. Jeśli chodzi o styl, to na pierwszy rzut oka widać, że o co najmniej o kilka kroków wyprzedzają inne modele.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'ultrabounce-shoes-junior', '', '', '', 'Ultrabounce Shoes Junior', '', '', '', ''),
(1099, 1, 1, 'Buty do biegania adidas dla dzieci, które można nosić codziennie lub schować do torby sportowej, pozwolą maluchom nieustannie iść naprzód. Oddychająca cholewka osadzona jest na miękkiej amortyzacji Cloudfoam, która otula stopy pełnym komfortem. Przyczepna podeszwa zewnętrzna pewnie trzyma się wszystkich nawierzchni, od mokrej murawy po gładkie parkiety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-sport-running-lace-shoes', '', '', '', 'RunFalcon 3 Sport Running Lace Shoes', '', '', '', ''),
(1100, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1101, 1, 1, 'Dzieci, które uczą się nowych umiejętności, potrzebują butów, które dotrzymają im kroku. Te klasyczne buty adidas mają gumową podeszwę zewnętrzną, która jest gładka w dotyku podczas biegania, ale nie pozostawia śladów na drewnianych podłogach. Dlatego buty sprawdzą się zarówno w szkole, jak i podczas treningu.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'tensaur-sport-training-lace-shoes', '', '', '', 'Tensaur Sport Training Lace Shoes', '', '', '', ''),
(1102, 1, 1, 'Od małego zabieraj swoje dziecko na wycieczki. Odkrywanie nowych szlaków to świetna zabawa, gdy ma na stopach te buty hikingowe adidas. Model lekki niczym buty do biegów przełajowych oferuje dodatkową stabilizację i trwałość typową dla butów hikingowych, dzięki którym Twoje dziecko chętnie rozpocznie eksplorację outdooru. Odblaskowe detale błyszczą w słabym oświetleniu. Żłobiona, gumowa podeszwa pewnie trzyma się każdej nawierzchni.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-low-hiking-shoes', '', '', '', 'Terrex Hyperhiker Low Hiking Shoes', '', '', '', ''),
(1103, 1, 1, 'Spraw, aby podążały śladami najlepszych tenisistów. Te buty adidas dla dzieci mają gładki look inspirowany stylem tenisowym z lat 70. Gumowa podeszwa wygina się i zapewnia przyczepność, gwarantując płynny, pewny krok. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-lifestyle-tennis-lace-up', '', '', '', 'Buty Grand Court Lifestyle Tennis Lace-Up', '', '', '', ''),
(1104, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają idealnie dopasowany krój, dzięki czemu dzięki czemu pozostaną na miejscu i przetrwają każdą przygodę. Gładka cholewka bezpiecznie otula rosnące stopy. Amortyzacja Cloudfoam zapewnia wyjątkowy komfort, a przyczepna podeszwa zewnętrzna pewnie trzyma się różnych nawierzchni, od mokrej trawy po żwir.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-lace-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Lace Shoes', '', '', '', ''),
(1105, 1, 1, 'Gdy dodasz stopom lekkości, możesz zrobić więcej w tych wyjątkowo wygodnych butach adidas dla młodzieży. Lekka podeszwa środkowa Bounce dodaje sprężystości na każdym kroku, jednocześnie zapewniając wsparcie przez cały dzień. Pleciona cholewka porusza się razem z Twoją stopą, otulając ją we właściwych miejscach. Kultowa klatka z TPU zapewnia styl i stabilizację podczas każdej przygody.\n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-ubounce-dna-kids', '', '', '', 'Buty Ubounce DNA Kids', '', '', '', ''),
(1106, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te młodzieżowe buty piłkarskie bez sznurowadeł mają miękką, syntetyczną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Gumowa podeszwa zewnętrzna z wypustkami zapewnia Ci dominację na sztucznej murawie.', '', 'buty-predator-accuracy3-laceless-tf', '', '', '', 'Buty Predator Accuracy.3 Laceless TF', '', '', '', ''),
(1107, 1, 1, 'Pozwól swojemu maluchowi zabrać ze sobą klocki LEGO® wszędzie, gdzie się wybierze. Zobacz uśmiech na twarzy swojego dziecka, gdy założy buty do biegania adidas. Elastyczne sznurowadła i pasek na rzep zapewniają idealne, bezpieczne dopasowanie. Przyczepna podeszwa zewnętrzna ma wzór znany z klocków LEGO®.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'adidas-x-lego-sport-pro-shoes', '', '', '', 'adidas x LEGO® Sport Pro Shoes', '', '', '', ''),
(1108, 1, 1, 'Mali odkrywcy mogą cieszyć się wygodą. Zabierz swojego malucha na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, a jednocześnie zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia ciepło i suchy komfort w mokrych warunkach, a profil do kostki chroni przed zabrudzeniami.', '', 'terrex-trailmaker-mid-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(1109, 1, 1, 'Komfort wykracza poza kort. Inspirowane tenisem buty dla dzieci mają gładką cholewkę z syntetycznej skóry z perforowanymi 3 paskami. Pluszowo miękka wkładka amortyzuje każdy krok.', '', 'advantage-shoes', '', '', '', 'Advantage Shoes', '', '', '', ''),
(1110, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Młodzieżowe buty piłkarskie, które zapewnią Ci stabilizację przy pełnym przechyle na suchej, naturalnej trawie, osadzone są na gwarantującej szybkość podeszwie zewnętrznej do gry na naturalnej nawierzchni. Lekka, powlekana, tekstylna cholewka z dodatkowymi warstwami tylko tam, gdzie potrzebne jest wzmocnienie konstrukcji, ma kołnierz o płaskim splocie, który pewnie blokuje stopę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast3-fg', '', '', '', 'Buty X Crazyfast.3 FG', '', '', '', ''),
(1111, 1, 1, 'Pozwól swojemu maluchowi zabrać ze sobą klocki LEGO® wszędzie, gdzie się wybierze. Zobacz uśmiech na twarzy swojego dziecka, gdy założy buty do biegania adidas. Elastyczne sznurowadła i pasek na rzep zapewniają idealne, bezpieczne dopasowanie. Przyczepna podeszwa zewnętrzna ma wzór znany z klocków LEGO®.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować plastikowe odpady.', '', 'adidas-x-lego-sport-pro-shoes', '', '', '', 'adidas x LEGO® Sport Pro Shoes', '', '', '', ''),
(1112, 1, 1, 'Obecne od 50 lat i gotowe na kolejne 50. Te buty adidas Superstar pozostają wierne kultowemu, uwielbianemu od lat koszykarskiemu charakterowi. Zapięcia na paski, które zastąpiły sznurowadła sprawiają, że dzieci samodzielnie mogą je założyć i zdjąć.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1113, 1, 1, 'Sznurowane sneakery adidas dla dzieci idealnie nadają się do szkoły, klubu sportowego i ulubionych zabaw. Mają gładką, syntetyczną cholewkę, która zapewnia poczucie komfortu. Solidna, gumowa podeszwa zewnętrzna oznacza niezawodną trakcję.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'advantage-lifestyle-court-lace-shoes', '', '', '', 'Advantage Lifestyle Court Lace Shoes', '', '', '', ''),
(1114, 1, 1, 'Niezależnie od tego, czy Twój mały sportowiec w pośpiechu wybiega do szkoły, wybiera się na obóz softballowy czy po prostu bawi się na podwórku, trwałe sneakery adidas dla dzieci zapewnią mu wsparcie i komfort. Oddychająca cholewka z siateczki gwarantuje przewiewny komfort stopom, gdy codzienne przygody nabierają tempa. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'runfalcon-20-shoes', '', '', '', 'Runfalcon 2.0 Shoes', '', '', '', ''),
(1115, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Młodzieżowe buty piłkarskie, które zapewnią Ci stabilizację przy pełnym przechyle na suchej, naturalnej trawie, osadzone są na gwarantującej szybkość podeszwie zewnętrznej do gry na naturalnej nawierzchni. Lekka, powlekana, tekstylna cholewka z dodatkowymi warstwami tylko tam, gdzie potrzebne jest wzmocnienie konstrukcji, ma kołnierz o płaskim splocie, który pewnie blokuje stopę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast3-fg', '', '', '', 'Buty X Crazyfast.3 FG', '', '', '', ''),
(1116, 1, 1, 'Buty adidas dla dzieci, które dotrzymają kroku każdej przygodzie każdego dnia. Cloudfoam zapewnia doskonałą amortyzację, dzięki czemu maluchy mogą biegać dłużej, odkrywać świat i czuć się komfortowo przez cały dzień. Przyczepna, gumowa podeszwa zewnętrzna gwarantuje pewny krok. 3 paski uzupełniają całość w tradycyjnym stylu. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(1117, 1, 1, 'Najbardziej zaawansowane buty do koszykówki sprzed lat, adidas Forum, powracają z archiwów i są gotowe na podbój świata. Wybierz młodzieżowe buty do kostki, które dodadzą Ci energii w każdej sytuacji: w szkole, podczas weekendowych wypraw i na spotkaniu ze znajomymi. Możesz na nie liczyć.', '', 'forum-mid-shoes', '', '', '', 'Forum Mid Shoes', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1118, 1, 1, 'Kultowe buty adidas Superstar dla najmłodszych w wersji dostosowanej do zmiennych warunków pogodowych zapewniają stopom ciepło i suchy komfort dzięki jednoczęściowej, tekstylnej cholewce, wygodnej, tekstylnej wyściółce i przyczepnej podeszwie zewnętrznej z pianki EVA. Osłona przeciwbłotna na obwodzie i pięcie nie przepuszcza brudu. Konstrukcja z systemem szybkiego sznurowania sprawia, że możesz z łatwością przetrwać każde przejście z hali na zewnątrz i znowu na halę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(1119, 1, 1, 'Pozwól swojemu dziecku założyć buty adidas i rozpocząć całodzienną zabawę. Jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1120, 1, 1, 'Zaprojektowane z myślą o młodych amatorach przygód buty outdoorowe dla dzieci mają niski profil z wygodnym zapięciem na pasek. Tekstylna cholewka z nakładkami chroni stopy i wspiera je na szlaku, a elastyczne sznurowanie ułatwia zakładanie i zdejmowanie butów. Podeszwa zewnętrzna Traxion zapewnia przyczepność w terenie skalistym i na szlaku.', '', 'terrex-ax2r-cf-hiking-shoes', '', '', '', 'Terrex AX2R CF Hiking Shoes', '', '', '', ''),
(1121, 1, 1, 'Zapnij rzepy butów adidas dla najmłodszych i pozwól Twojemu maluchowi na ruch i zabawę. Jednoczęściowa podeszwa z pianki EVA zapewnia wsparcie podczas raczkowania, a później prób stania. Tak jak ulubiony miś czy pies, te buty są idealnym towarzyszem codziennych przygód Twojego maluszka.\n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1122, 1, 1, 'Zabawa w kałuży to podstawa. Gdy szlaki stają się wilgotne, te buty hikingowe adidas dla dzieci zapewnią im suchy komfort. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wody. Lekka amortyzacja z pianki EVA zapewnia wygodę. Guma Continental™ zapewnia doskonałą przyczepność na każdym szlaku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-gore-tex-hiking', '', '', '', 'Buty Terrex GORE-TEX Hiking', '', '', '', ''),
(1123, 1, 1, 'Sznurowane sneakery adidas dla dzieci idealnie nadają się do szkoły, klubu sportowego i ulubionych zabaw. Mają gładką, syntetyczną cholewkę, która zapewnia poczucie komfortu. Solidna, gumowa podeszwa zewnętrzna oznacza niezawodną trakcję.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'advantage-lifestyle-court-lace-shoes', '', '', '', 'Advantage Lifestyle Court Lace Shoes', '', '', '', ''),
(1124, 1, 1, 'Mali odkrywcy mogą cieszyć się wygodą. Zabierz swojego malucha na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, a jednocześnie zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia ciepło i suchy komfort w mokrych warunkach, a profil do kostki chroni przed zabrudzeniami.', '', 'terrex-trailmaker-mid-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(1125, 1, 1, 'W tych butach PrimaLoft® dzieci nie będą zwalniać tempa z powodu zimowego chłodu. Buty z charakterystyczną osłoną palców w kształcie muszli i 3 paskami jak oryginał nawiązują do kultowych elementów modelu adidas Superstar w wersji na śnieg. Dziecięce stopy będą cieszyć się ciepłem i wsparciem przez cały dzień.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-360-20-kids', '', '', '', 'Buty Superstar 360 2.0 Kids', '', '', '', ''),
(1126, 1, 1, 'Twój mały sportowiec będzie gotowy do wejścia na parkiet w okamgnieniu dzięki butom koszykarskim adidas dla dzieci. Idealnie dopasowane wsparcie w kostkach umożliwia błyskawiczną zmianę kierunku. Lekka amortyzacja zapewnia wygodę na siłowni, na placu zabaw i w każdym innym miejscu.\n\nTen produkt zawiera materiały pochodzące z recyklingu w ramach naszych wysiłków zmierzających do rozwiązania problemu plastikowych odpadów. 20% elementów użytych do wykonania cholewki zawiera co najmniej 50% materiałów pochodzących z recyklingu.', '', 'ownthegame-20-shoes', '', '', '', 'Ownthegame 2.0 Shoes', '', '', '', ''),
(1127, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te młodzieżowe buty piłkarskie bez sznurowadeł mają miękką, syntetyczną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Podeszwa zewnętrzna do gry na naturalnej nawierzchni powstała, aby zapewnić Ci kontrolę na suchych, naturalnych nawierzchniach trawiastych.', '', 'buty-predator-accuracy3-laceless-fg', '', '', '', 'Buty Predator Accuracy.3 Laceless FG', '', '', '', ''),
(1128, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te młodzieżowe buty piłkarskie bez sznurowadeł mają miękką, syntetyczną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Gumowa podeszwa zewnętrzna z wypustkami zapewnia Ci dominację na sztucznej murawie.', '', 'buty-predator-accuracy3-laceless-tf', '', '', '', 'Buty Predator Accuracy.3 Laceless TF', '', '', '', ''),
(1129, 1, 1, 'Obroty, trucht, skoki i sprinty ― dzieci nieustannie testują swoje buty. Buty adidas z solidną, niebrudzącą podeszwą zewnętrzną z gumy trzymają się podłoża, ale nie pozostawiają śladów. Zapięcie na dwa paski na rzepy ułatwia dopasowanie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tensaur-hook-and-loop-shoes', '', '', '', 'Tensaur Hook and Loop Shoes', '', '', '', ''),
(1130, 1, 1, 'Wspaniałe przygody zaczynają się od wygody. Zabierz swojego małego odkrywcę na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, lecz zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia małym stopom ciepły i suchy komfort w mokrych warunkach. Podeszwa zewnętrzna Traxion daje przyczepność na śliskich nawierzchniach.', '', 'terrex-trailmaker-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker RAIN.RDY Hiking Shoes', '', '', '', ''),
(1131, 1, 1, 'Dawno temu były niskimi butami do koszykówki. Dzisiaj królują na ulicach miast. Buty dla młodzieży świętują 50. rocznicę modelu adidas Superstar. Od klasycznej osłony palców w kształcie muszli po ząbkowane 3 paski, ta rocznicowa edycja oddaje hołd niepowtarzalnemu designowi adidas. Konstrukcja z wygodną, gumową podeszwą prezentuje się świeżo i zabawnie, niezależnie od wersji kolorystycznej.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1132, 1, 1, 'Buty adidas dla dzieci w stylu biegowym mają idealnie dopasowany krój, dzięki czemu dzięki czemu pozostaną na miejscu i przetrwają każdą przygodę. Gładka cholewka bezpiecznie otula rosnące stopy. Amortyzacja Cloudfoam zapewnia wyjątkowy komfort, a przyczepna podeszwa zewnętrzna pewnie trzyma się różnych nawierzchni, od mokrej trawy po żwir.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'fortarun-20-cloudfoam-lace-shoes', '', '', '', 'FortaRun 2.0 Cloudfoam Lace Shoes', '', '', '', ''),
(1133, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1134, 1, 1, 'Od weekendowych spacerów po epickie górskie przygody te buty hikingowe adidas dla dzieci gwarantują stopom ciepło i suchy komfort, aby nic nie rozpraszało maluchów na szlaku. Te buty zostały wyposażone w technologię COLD.RDY i izolację PrimaLoft®, która zatrzymuje ciepło, a lekka amortyzacja zapewnia komfort przez cały dzień. Przyczepna podeszwa zewnętrzna z gumy Continental™ pomaga dzieciom utrzymać równowagę na oblodzonych nawierzchniach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-winter-mid-boa-rainrdy-hiking', '', '', '', 'Buty Terrex Winter Mid BOA RAIN.RDY Hiking', '', '', '', ''),
(1135, 1, 1, 'Nie pozwól, by ból stóp stanął na drodze stopom Twojego malucha. Te buty adidas dla dzieci zapewniają optymalny komfort. Lekka amortyzacja chroni stopy, nie obciążając ich. Mocna, gumowa podeszwa zewnętrzna zapewnia przyczepność podczas biegania i zabawy przez cały dzień.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-duramo-sl-kids', '', '', '', 'Buty Duramo SL Kids', '', '', '', ''),
(1136, 1, 1, 'W tych butach hikingowych adidas AX2R dla dzieci przygoda nie zna granic. Dzieci mogą pewnie odkrywać świat od placu zabaw po szlak w tych butach, które są lekkie, stabilne i solidnie przyczepne. Podeszwa środkowa z pianki EVA zapewnia długotrwałą amortyzację, a podeszwa zewnętrzna Traxion maksymalizuje przyczepność we wszystkich kierunkach. Zapięcie na rzepy ułatwia zakładanie i zdejmowanie, niezależnie od tego, czy maluchy wracają do domu, czy z niego wychodzą.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-ax2r-hook-and-loop-hiking', '', '', '', 'Buty Terrex AX2R Hook-and-Loop Hiking', '', '', '', ''),
(1137, 1, 1, 'Od małego zabieraj swoje dziecko na wycieczki. Odkrywanie nowych szlaków to świetna zabawa, gdy ma na stopach te buty hikingowe adidas. Model lekki niczym buty do biegów przełajowych oferuje dodatkową stabilizację i trwałość typową dla butów hikingowych, dzięki którym Twoje dziecko chętnie rozpocznie eksplorację outdooru. Odblaskowe detale błyszczą w słabym oświetleniu. Żłobiona, gumowa podeszwa pewnie trzyma się każdej nawierzchni.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-hyperhiker-low-hiking-shoes', '', '', '', 'Terrex Hyperhiker Low Hiking Shoes', '', '', '', ''),
(1138, 1, 1, 'Kultowe buty adidas Superstar dla dzieci w wersji dostosowanej do zmiennych warunków pogodowych zapewniają stopom ciepło i suchy komfort dzięki jednoczęściowej, tekstylnej cholewce, wygodnej, tekstylnej wyściółce i przyczepnej podeszwie zewnętrznej z pianki EVA. Osłona przeciwbłotna na obwodzie i pięcie nie przepuszcza brudu. Konstrukcja z systemem szybkiego sznurowania sprawia, że możesz z łatwością przetrwać każde przejście z hali na zewnątrz i znowu na halę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-superstar-360-kids', '', '', '', 'Buty Superstar 360 Kids', '', '', '', ''),
(1139, 1, 1, 'Lata 80. były punktem zwrotnym w stylu koszykarskim, a buty adidas Forum szybko stały się legendą ― najpierw na parkiecie, a następnie na ulicach. Te młodzieżowe buty mają skórzaną cholewkę, solidną podeszwę zewnętrzną i pasek w kostce. Poczuj energię dekady za każdym razem, gdy je zakładasz.', '', 'forum-low-shoes', '', '', '', 'Forum Low Shoes', '', '', '', ''),
(1140, 1, 1, 'Nigdy nie jest za wcześnie, by stworzyć dziecięcą kolekcję butów. Zrób wielkie pierwsze wrażenie przy pomocy tych butów adidas dla dzieci. Mają solidną i elastyczną, gumową podeszwę, która wspiera każdy krok i skok. Elastyczne sznurowadła, które rozciągają się, gdy dzieci je zakładają, oraz pasek na rzepy na górze, dzięki któremu dzieci mogą odpowiednio dopasować krój, sprawiają, że te klasyczne sneakery długo nie zagrzeją miejsca w pudełku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku.', '', 'buty-grand-court-elastic-lace-and-top-strap', '', '', '', 'Buty Grand Court Elastic Lace and Top Strap', '', '', '', ''),
(1141, 1, 1, 'Oryginalny model Gazelle wyrobił sobie markę jako uniwersalne buty treningowe, a dziś cieszy się popularnością jako klasyk stylu miejskiego. Te młodzieżowe buty są dokładną repliką butów Gazelle z 1991 roku. Prezentują autentyczny styl z teksturowaną, zamszową cholewką w kolorach vintage.', '', 'gazelle-shoes', '', '', '', 'Gazelle Shoes', '', '', '', ''),
(1142, 1, 1, 'Niezależnie od tego, czy maluchy wybierają się do szkoły, czy z przyjaciółmi zwiedzają park, Ty chcesz dać im najlepsze warunki. Te buty adidas dla dzieci zapewniają komfort, którego potrzebują, aby iść naprzód. Podeszwa środkowa Cloudfoam zapewnia optymalną amortyzację, dzięki czemu każdy krok jest łatwy. Szybka sylwetka dodaje energii do ich codziennego stylu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-racer-tr23-kids', '', '', '', 'Buty Racer TR23 Kids', '', '', '', ''),
(1143, 1, 1, 'Pozwól swojemu dziecku zapiąć paski na rzepy w tych butach adidas i rozpocząć zabawę. Mocna, jednoczęściowa podeszwa z pianki EVA daje im wszystko, czego potrzebują, aby wspinać się na drzewa czy ścigać po trawie. Te buty są idealnym towarzyszem codziennych przygód. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 50% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'tensaur-run-shoes', '', '', '', 'Tensaur Run Shoes', '', '', '', ''),
(1144, 1, 1, 'Dzieci mają swoje zdanie na wiele tematów. Ale jedno jest pewne. Te buty adidas stanowią idealne połączenie komfortu i stylu. Giętka podeszwa środkowa Bounce dba o komfort, podobnie jak oddychająca cholewka z mieszanki materiałów. A styl? To jest niezaprzeczalne. Ponadto kolory pasują do każdego stroju. Sprzedane. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'rapidasport-bounce-sport-running-lace-shoes', '', '', '', 'Rapidasport Bounce Sport Running Lace Shoes', '', '', '', ''),
(1145, 1, 1, 'Twój mały Jedi będzie gotowy na przygodę w butach Racer TR23 od adidas. Wzór na cholewce przedstawiający młodego Jedi i świecące w ciemności 3 paski wzdłuż boków dodają mocy temu modelowi. Podeszwa środkowa Cloudfoam zapewnia amortyzowany komfort, który sprawdzi się podczas zabawy w odległej galaktyce. Elastyczne sznurowadła i pasek ułatwiają zakładanie i zdejmowanie, gdy nadchodzi czas, aby włączyć miecz świetlny lub wziąć przekąskę z kuchni.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-disney-racer-tr23-kids', '', '', '', 'Buty Disney Racer TR23 Kids', '', '', '', ''),
(1146, 1, 1, 'Buty adidas Superstar, które kiedyś królowały na koszykarskich parkietach, a teraz są ikoną stylu miejskiego, nie mają sobie równych, jeśli chodzi o swobodny, pewny styl. Te młodzieżowe buty adidas kontynuują tę tradycję za sprawą solidnej podeszwy, ząbkowanych 3 pasków i charakterystycznej osłony palców w kształcie muszli. Klasyczne kolory sprawiają, że łatwo je zestawić z ulubionymi ubraniami. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-kids', '', '', '', 'Buty Superstar Kids', '', '', '', ''),
(1147, 1, 1, 'Dawno temu były niskimi butami do koszykówki. Dzisiaj królują na ulicach miast. Buty dla młodzieży świętują 50. rocznicę modelu adidas Superstar. Od klasycznej osłony palców w kształcie muszli po ząbkowane 3 paski, ta rocznicowa edycja oddaje hołd niepowtarzalnemu designowi adidas. Konstrukcja z wygodną, gumową podeszwą prezentuje się świeżo i zabawnie, niezależnie od wersji kolorystycznej.', '', 'superstar-shoes', '', '', '', 'Superstar Shoes', '', '', '', ''),
(1148, 1, 1, 'Ponadczasowe sneakery adidas Superstar stały się inspiracją dla tych wygodnych i klasycznych butów dla młodzieży. Model zachowuje najlepsze detale designu imiennika, takie jak kultowa osłona palców w kształcie muszli i 3 paski. Podwyższona podeszwa środkowa dodaje lekkości, a wyściełany kołnierz zapewnia wygodne wsparcie kostki na każdym kroku. Prosty styl właśnie zyskał nową odsłonę.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-superstar-kids', '', '', '', 'Buty Superstar Kids', '', '', '', ''),
(1149, 1, 1, 'Mali odkrywcy mogą cieszyć się wygodą. Zabierz swojego malucha na szlak w tych butach trekkingowych adidas. Te buty są lekkie niczym buty biegowe, a jednocześnie zapewniają trwałe wsparcie i przyczepność na śliskich kamieniach i błocie. Technologia RAIN.RDY zapewnia ciepło i suchy komfort w mokrych warunkach, a profil do kostki chroni przed zabrudzeniami.', '', 'terrex-trailmaker-mid-rainrdy-hiking-shoes', '', '', '', 'Terrex Trailmaker Mid RAIN.RDY Hiking Shoes', '', '', '', ''),
(1150, 1, 1, 'Lekkie, szybkie i stabilne buty adidas Terrex Agravic BOA Hiking są przeznaczone dla dzieci, które lubią przyspieszać tempo. Podziel się swoją miłością do fitnessu i przygody. Znajdź najlepsze dopasowanie i pozwól dzieciom swobodnie odkrywać świat.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-agravic-boa-trail-running-shoes', '', '', '', 'Terrex Agravic BOA Trail Running Shoes', '', '', '', ''),
(1151, 1, 1, 'Dyskretny i prosty styl. Ten plecak adidas dla dzieci pomieści wszystko, czego maluchy potrzebują do szkoły, na trening i na codzienne przygody. Główna komora na suwak przechowa duże przedmioty, a przednia kieszeń na suwak zapewnia szybki dostęp do telefonów, kluczy i innych niezbędnych drobiazgów. Wyściełane paski oznaczają, że ciężkie rzeczy nie stanowią problemu.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'graphic-backpack', '', '', '', 'Graphic Backpack', '', '', '', ''),
(1152, 1, 1, 'Idealny plecak dla aktywnych dzieci. Schowaj bidon i przekąskę do bocznych kieszeni, aby dzieci miały pod ręką wszystko, czego potrzebują, by iść na wycieczkę lub do szkoły na dzień pełen zajęć. Wyściełane, regulowane szelki zapewniają komfort, a regulowany pasek na piersi sprawia, że ciężar rozkłada się równomiernie i bezpiecznie. Dzięki zabawnemu designowi ten plecak adidas dla dzieci sprawdzi się wszędzie. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-printed-kids', '', '', '', 'Plecak Printed Kids', '', '', '', ''),
(1153, 1, 1, 'Niezależnie od tego, czy odkrywasz miasto, czy spotykasz się z przyjaciółmi, przechowuj cenne drobiazgi w tej młodzieżowej torbie-nerce adidas w żywych kolorach inspirowanych klockami LEGO®. Noś ją w talii lub przewieś przez tułów, aby korzystać z jej uniwersalnej konstrukcji. Przednia kieszeń na suwak i komora główna pomogą Ci uporządkować swoje rzeczy. Regulowany pasek z zapięciem na sprzączkę zapewnia wygodne dopasowanie. \n\nModel został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku.', '', 'torba-nerka-adidas-x-classic-lego', '', '', '', 'Torba-nerka adidas x Classic LEGO®', '', '', '', ''),
(1154, 1, 1, 'Maluchy mogą przechodzić w pełnym ekwipunku od jednej aktywności do drugiej dzięki temu plecakowi adidas dla dzieci. Liczne kieszenie zapewniają dzieciom mnóstwo miejsca do przechowywania rzeczy. Wyreguluj ramiączka i pasek na piersi, aby uzyskać idealne, wygodne dopasowanie. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'backpack', '', '', '', 'Backpack', '', '', '', ''),
(1155, 1, 1, 'Idealny plecak dla aktywnych dzieci. Schowaj bidon i przekąskę do bocznych kieszeni, aby dzieci miały pod ręką wszystko, czego potrzebują, by iść na wycieczkę lub do szkoły na dzień pełen zajęć. Wyściełane, regulowane szelki zapewniają komfort, a regulowany pasek na piersi sprawia, że ciężar rozkłada się równomiernie i bezpiecznie. Dzięki zabawnemu designowi ten plecak adidas dla dzieci sprawdzi się wszędzie. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-printed-kids', '', '', '', 'Plecak Printed Kids', '', '', '', ''),
(1156, 1, 1, 'Ten plecak Star Wars to zaufany towarzysz każdego dziecka eksplorującego galaktyki lub przemierzającego szkolne korytarze. Regulowane szelki zapewniają komfort podczas każdej przygody, a kieszenie z siateczki dbają o łatwy dostęp do niezbędnych drobiazgów. Plecak adidas dla dzieci ma kompresyjne uchwyty, dzięki którym łatwiej jest przenosić większe ładunki. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-star-wars-young-jedi', '', '', '', 'Plecak Star Wars Young Jedi', '', '', '', ''),
(1157, 1, 1, 'Niezależnie od tego, czy Twoje dziecko wybiera się do szkoły czy na szlak, młodzieżowy plecak adidas pomieści wszystko, czego potrzebuje. Włóż bidon do jednej z bocznych kieszeni z siateczki i schowaj telefon do przedniej kieszeni, aby Twoja pociecha miała do niego szybki dostęp. Regulowane szelki zapewnią indywidualne dopasowanie i komfort na długich dystansach. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-power-kids', '', '', '', 'Plecak Power Kids', '', '', '', ''),
(1158, 1, 1, 'Plecak adidas dla dzieci, który sprawdzi się w drodze szkoły, na plac zabaw i wszędzie indziej. W środku jest miejsce na wszystkie niezbędne na co dzień rzeczy. Połączenie wyściełanych szelek i paska na piersi pomoże zrównoważyć obciążenie, gdy dziecko jest w ruchu. Plecak z ulubioną disnejowską Myszką Mickey pobudza wyobraźnię i sprawdzi się podczas każdej przygody. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-disney-s-mickey-mouse', '', '', '', 'Plecak Disney\'s Mickey Mouse', '', '', '', ''),
(1159, 1, 1, 'Skarpetki Trefoil Liner dodają trochę oryginalności temu najbardziej powszechnemu elementowi garderoby. Mają niski krój, niewidoczny w połączeniu ze sneakerami, wykonany z lekko elastycznej bawełny i ozdobiony logo Trefoil na wierzchu stopy.', '', 'trefoil-liner-socks-3-pairs', '', '', '', 'Trefoil Liner Socks 3 Pairs', '', '', '', ''),
(1160, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', '', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(1161, 1, 1, 'Model stworzony z myślą o płynnej grze. Grafika na piłce meczowej adidas Oceaunz odzwierciedla naturalne piękno Australii i Nowej Zelandii, a zarazem nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Model stworzony z myślą o meczach ma bezszwową, zgrzewaną termicznie powierzchnię, która gwarantuje przewidywalną trajektorię lotu piłki, oraz wysokiej jakości butylowy pęcherz, który ogranicza konieczność jej dopompowywania. Znak jakości Quality Pro to najwyższa ocena FIFA.', '', 'oceaunz-competition-ball', '', '', '', 'Oceaunz Competition Ball', '', '', '', ''),
(1162, 1, 1, 'Model stworzony z myślą o płynnej grze. Odzwierciedlająca naturalne piękno Australii i Nowej Zelandii grafika na piłce adidas Oceaunz league nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Doskonała na mecze i sesje treningowe piłka z certyfikatem jakości FIFA ma bezszwową konstrukcję TSBE, która umożliwia pewny kontakt z piłką, oraz butylowy pęcherz, dzięki któremu model dłużej trzyma powietrze.', '', 'oceaunz-league-ball', '', '', '', 'Oceaunz League Ball', '', '', '', ''),
(1163, 1, 1, 'Czapka beanie z wywijanym brzegiem zyskała w tym sezonie świeżą kolorystykę. Naszywka z logo Trefoil nadaje jej subtelny akcent adidas. Szew na górze zapewnia jej odpowiedni kształt.', '', 'adicolor-cuff-beanie', '', '', '', 'Adicolor Cuff Beanie', '', '', '', ''),
(1164, 1, 1, 'Posyłaj piłki prosto do dołka w tej młodzieżowej czapce adidas do gry w golfa. Bawełniana tkanina o ukośnym splocie zapewnia lekki komfort i przewiewność na polu golfowym. Pięciopanelowy design ma płaską, doskonale dopasowaną główkę. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'par-three-novelty-hat', '', '', '', 'Par Three Novelty Hat', '', '', '', ''),
(1165, 1, 1, 'Abstrakcyjne kształty tworzą przyjazną postać na czapce bejsbolowej adidas dla dzieci w świeżym stylu. Charakterystyczny rysunek jest dziełem Jamesa Jarvisa – brytyjskiego artysty tworzącego grafiki, komiksy i animacje. Kwiatowy design w żywych kolorach wyróżnia się na czarnym tle. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-adidas-x-james-jarvis-baseball', '', '', '', 'Czapka adidas x James Jarvis Baseball', '', '', '', ''),
(1166, 1, 1, 'Przygotuj się na widywanie tej czapki bejsbolówki adidas wszędzie i przez cały czas. Wkrótce będzie ulubionym strojem Twojego dziecka, a z przodu prezentuje Hello Kitty z koszykiem pełnym świeżych kwiatów. Mocna konstrukcja z bawełnianego diagonalu wytrzyma trudy codziennego noszenia, co jest typowe dla ukochanych strojów naszych maluchów. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-adidas-originals-x-hello-kitty-baseball', '', '', '', 'Czapka adidas Originals x Hello Kitty Baseball', '', '', '', ''),
(1167, 1, 1, 'Niech Twoje buty adidas wyglądają najlepiej jak się da. Gotowe do użycia chusteczki do sneakerów są spakowane do pojemnika, który można wziąć ze sobą w podróż. Jedna strona chusteczki ma gładką powierzchnię do zwykłego czyszczenia, a druga – teksturowana – jest przeznaczona do bardziej upartych zabrudzeń.', '', 'wipes', '', '', '', 'Wipes', '', '', '', ''),
(1168, 1, 1, 'Utrzymaj świeży look. Dzięki ściereczce z mikrofibry utrzymasz swoje buty adidas w czystości. Jest miękka, wyjątkowo chłonna i szybko usuwa wilgoć oraz brud.', '', 'microfibre-cloth', '', '', '', 'Microfibre Cloth', '', '', '', ''),
(1169, 1, 1, 'Niezależnie od tego, czy wybierasz się w podróż do odległej galaktyki, czy po prostu do szkoły, ten plecak Star Wars pomieści wszystko, czego potrzebujesz. Liczne kieszenie pomogą Ci uporządkować Twoje rzeczy, a przegroda na laptopa sprawia, że Twój sprzęt jest zawsze pod ręką. Młodzieżowy plecak adidas ma tylny panel z siateczki, który zapewni Ci komfort przez cały intrygujący dzień.\n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-star-wars-kids', '', '', '', 'Plecak Star Wars Kids', '', '', '', ''),
(1170, 1, 1, 'Maluchy mogą przechodzić w pełnym ekwipunku od jednej aktywności do drugiej dzięki temu plecakowi adidas dla dzieci. Liczne kieszenie zapewniają dzieciom mnóstwo miejsca do przechowywania rzeczy. Wyreguluj ramiączka i pasek na piersi, aby uzyskać idealne, wygodne dopasowanie. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'backpack', '', '', '', 'Backpack', '', '', '', ''),
(1171, 1, 1, 'Pozwól swojemu maluchowi ruszać na podbój dnia ze wszystkim, czego potrzebuje w zasięgu ręki. Torba-nerka adidas stworzona we współpracy z legendą skateboardingu Markiem Gonzalesem prezentuje charakterystyczną grafikę Shmoofoil w skejtowym stylu. Regulowany pasek zapewnia idealne dopasowanie, a komora główna na suwak i wewnętrzna kieszeń pomieszczą niezbędne drobiazgi. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'torba-adidas-originals-x-mark-gonzales-waist', '', '', '', 'Torba adidas Originals x Mark Gonzales Waist', '', '', '', ''),
(1172, 1, 1, 'Wyjdź na dwór i odkrywaj świat z tym plecakiem adidas. Uniwersalny design zapewnia zarówno funkcjonalność, jak i komfort, dając Ci stylowy sposób na uporządkowanie dnia. Regulowane szelki design, ale nie podrażniają skóry, a lekka konstrukcja pozwoli Ci zabrać go wszędzie. Akademicka grafika dodaje energii. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'collegiate-youth-backpack', '', '', '', 'Collegiate Youth Backpack', '', '', '', ''),
(1173, 1, 1, 'Wybierz skarpetki do kostek, które zapewniają gładkie dopasowanie za sprawą szwów na pięcie i w palcach. Mają wkomponowane kultowe logo Trefoil i 3 paski wzdłuż mankietów. Każde opakowanie zawiera trzy pary.', '', 'trefoil-ankle-socks-3-pairs', '', '', '', 'Trefoil Ankle Socks 3 Pairs', '', '', '', ''),
(1174, 1, 1, 'Skarpetki Trefoil Liner dodają trochę oryginalności temu najbardziej powszechnemu elementowi garderoby. Mają niski krój, niewidoczny w połączeniu ze sneakerami, wykonany z lekko elastycznej bawełny i ozdobiony logo Trefoil na wierzchu stopy.', '', 'trefoil-liner-socks-3-pairs', '', '', '', 'Trefoil Liner Socks 3 Pairs', '', '', '', ''),
(1175, 1, 1, 'Położenie kresu plastikowym odpadom to nie tylko marzenie. Dla adidas jest to cel. Ten stalowy bidon Parley for the Oceans pokaże, kogo wspierasz. Bo razem możemy to zrobić.', '', 'parley-for-the-oceans-steel-water-bottle', '', '', '', 'Parley for the Oceans Steel Water Bottle', '', '', '', ''),
(1176, 1, 1, 'Kreatywność łączy się z komfortem w skarpetkach adidas dla dzieci zaprojektowanych we współpracy z LEGO®. Kontrastowe 3 paski w pasujących kolorach dodają wigoru, a mankiety ze ściągaczem utrzymują design na swoim miejscu. Model z miękkiej dzianiny bawełnianej ma domieszkę streczu, dzięki czemu dzieci mogą biegać i bawić się przez cały dzień.\n\nJesteśmy partnerem organizacji Better Cotton, dążącej do podniesienia standardów uprawy bawełny na świecie. Better Cotton przyczynia się do polepszenia warunków pracy osób zajmujących się produkcją bawełny i poprawy stanu środowiska, w którym jest ona uprawiana, co oznacza lepszą przyszłość sektora bawełnianego. \n\nBetter Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi. Farmerzy Better Cotton korzystają jednak z popytu na bawełnę Better Cotton w ilościach odpowiadających tym, które „pozyskujemy”. \n\nWięcej informacji można znaleźć na stronie: bettercotton.org/learnmore', '', 'skarpety-adidas-x-lego-crew-3-pairs', '', '', '', 'Skarpety adidas x LEGO® Crew 3 Pairs', '', '', '', ''),
(1177, 1, 1, 'Nawodnienie nie powinno być skomplikowane. Przynieś wodę, wypij ją, a następnie uzupełnij dzięki bidonowi adidas Performance. Szeroki ustnik sprawia, że wygodnie można dodać kostki lodu. Włóż go do zmywarki po każdym użyciu i będzie gotowy do ponownego napełnienia.', '', 'performance-bottle-5-l', '', '', '', 'Performance Bottle .5 L', '', '', '', ''),
(1178, 1, 1, 'Zbierz znajomych i przygotuj się do gry. Gładka warstwa zewnętrzna tej piłki adidas zapewnia miękki kontakt z piłką, dzięki czemu jest doskonała dla drużyn na każdym poziomie zaawansowania. Szyta maszynowo konstrukcja jest trwała, a butylowy pęcherz pomaga utrzymać ciśnienie powietrza i kształt. To wszystko, czego potrzebujesz podczas kolejnych weekendowych rozgrywek.', '', 'pilka-epp-club', '', '', '', 'Piłka EPP Club', '', '', '', ''),
(1179, 1, 1, 'Nawodnienie nie powinno być skomplikowane. Przynieś wodę, wypij ją, a następnie uzupełnij dzięki bidonowi adidas Performance. Szeroki ustnik sprawia, że wygodnie można dodać kostki lodu. Włóż go do zmywarki po każdym użyciu i będzie gotowy do ponownego napełnienia.', '', 'performance-bottle-5-l', '', '', '', 'Performance Bottle .5 L', '', '', '', ''),
(1180, 1, 1, 'Klasyczna piłka adidas Tiro Club jest idealnym towarzyszem, którego możesz zabrać wszędzie i dzięki któremu zawsze jesteś przygotowany na boisko treningowe. Model stworzony z myślą o miękkim kontakcie ma dużą trwałość, która doskonale sprawdza się podczas rozgrywek na poziomie podstawowym, spontanicznych meczów w parku lub szlifowania umiejętności. Szyta maszynowo konstrukcja i butylowy pęcherz sprawiają, że model jest gotowy do akcji, gdziekolwiek jesteś.', '', 'tiro-club-ball', '', '', '', 'Tiro Club Ball', '', '', '', ''),
(1181, 1, 1, 'Model stworzony z myślą o płynnej grze. Grafika na minipiłce adidas Oceaunz odzwierciedla naturalne piękno Australii i Nowej Zelandii, a zarazem nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Mały rozmiar oznacza, że możesz zabrać ją, gdzie chcesz. Dzięki wnętrzu z pianki nigdy nie musisz pakować pompki.', '', 'oceaunz-mini-ball', '', '', '', 'Oceaunz Mini Ball', '', '', '', ''),
(1182, 1, 1, 'Przedstawiamy inteligentny bidon z kolekcji adidas x REBO.\nREBO to inteligentny bidon z nierdzewnej stali, który ułatwia nawadnianie organizmu. Wyposażony w innowacyjną zakrętkę, monitoruje ilość wody, którą wypijasz, i wysyła dane do aplikacji REBO. Wbudowany \'osobisty trener nawodnienia\' tworzy personalizowany plan dotyczący picia wody, automatycznie dostosowywany do Twoich codziennych aktywności.\nREBO pomaga utrzymywać właściwe nawodnienie, wysyłając Ci przypomnienia w aplikacji oraz przy pomocy elementów LED na zakrętce. Na podstawie zużycia przez Ciebie wody, monitorowanego przez inteligentny bidon wielokrotnego użytku, aplikacja REBO zamienia Twoje wysiłki w finansowanie zbiórki plastikowych odpadów. REBO doskonale wpasowuje się w Twój codzienny tryb i przypomina o nawadnianiu organizmu w domu, w biurze, w szkole i na siłowni.', '', 'adidas-x-rebo-smart-bottle', '', '', '', 'adidas x REBO Smart Bottle', '', '', '', ''),
(1183, 1, 1, 'Niezależnie od tego, czy Twoje dziecko ogląda filmy na kanapie, czy trenuje jak Jedi, te skarpetki Star Wars zapewnią mu komfort. Ten zestaw 3 par skarpet z miękkiej mieszanki bawełnianej prezentuje nieziemską grafikę, którą dzieci z przyjemnością zaprezentują. Ściągaczowe mankiety utrzymują te skarpetki adidas dla dzieci na swoim miejscu, gdy podążają one za swoją wyobraźnią. \n\nBawełna wykorzystana tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'skarpetki-star-wars-kids-3-pary', '', '', '', 'Skarpetki Star Wars Kids (3 pary)', '', '', '', ''),
(1184, 1, 1, 'Piłka meczowa adidas Tiro Competition jest przeznaczona na ważne mecze piłkarskie. Model z najwyższą oceną FIFA sprawi, że nigdy nie będziesz musiał martwić się o nieudane odbicia lub dziwne tory lotu. Bezszwowa, zgrzewana termicznie powierzchnia zapewnia bardziej przewidywalną trajektorię lotu, lepszy kontakt z piłką i mniejszą absorpcję wody, co przekłada się na doskonałą wydajność za każdym razem.', '', 'tiro-competition-ball', '', '', '', 'Tiro Competition Ball', '', '', '', ''),
(1185, 1, 1, 'Wolne duchy mogą nie trzymać się ścieżki i czasem wychodzić z kolorowaniem poza linię, ale dzięki tym skarpetkom adidas dla dzieci będą pewnie stawiać stopy. Dzieci mogą przecierać własne szlaki dzięki logotypom Trefoil na dole, które dodają im stylu i zapewniają bezpieczeństwo. I dzieci są gotowe do zabawy!\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarperty-anti-slip-2-pairs-kids', '', '', '', 'Skarperty Anti-Slip 2 Pairs Kids', '', '', '', ''),
(1186, 1, 1, 'Model PROCESS_SP1 wykorzystuje nieoczekiwane materiały, aby stworzyć design o uproszczonej kolorystyce zrodzony z kultowego DNA adidas. Klasyczny design wzmocniony subtelnymi detalami w modelu PROCESS_SP1 ma przełomowy styl, zakorzeniony w codziennej funkcjonalności.', '', 'zegarek-processsp1', '', '', '', 'Zegarek PROCESS_SP1', '', '', '', ''),
(1187, 1, 1, 'Tiki-Taka, precyzyjne podania i perfekcyjnie wyważone piłki. Zadbaj o płynność gry swojej drużyny dzięki piłce adidas Tiro League. Bezszwowa, zgrzewana termicznie powierzchnia sprawia, że model zawsze zachowuje swoje parametry, gwarantując najlepszy kontakt z piłką. Znak jakości FIFA International Match Standard jest tego najlepszym dowodem. Teraz nadszedł czas, aby pokazać, co potrafisz.', '', 'tiro-league-thermally-bonded-ball', '', '', '', 'Tiro League Thermally Bonded Ball', '', '', '', ''),
(1188, 1, 1, 'Klasyczna piłka adidas Tiro Club jest idealnym towarzyszem, którego możesz zabrać wszędzie i dzięki któremu zawsze jesteś przygotowany na boisko treningowe. Model stworzony z myślą o miękkim kontakcie ma dużą trwałość, która doskonale sprawdza się podczas rozgrywek na poziomie podstawowym, spontanicznych meczów w parku lub szlifowania umiejętności. Szyta maszynowo konstrukcja i butylowy pęcherz sprawiają, że model jest gotowy do akcji, gdziekolwiek jesteś.', '', 'tiro-club-ball', '', '', '', 'Tiro Club Ball', '', '', '', ''),
(1189, 1, 1, 'Niech Twoje nowe buty adidas zawsze wyglądają jak świeżo po zakupie. Ta pianka do czyszczenia butów i sneakerów nadaje się do wszystkich materiałów, w tym do skóry, zamszu, nubuku, płótna, winylu i nylonu. Formuła na bazie wody działa szybko. Wystarczy wstrząsnąć, rozpylić i przetrzeć szczotką.', '', 'foam-cleaner', '', '', '', 'Foam Cleaner', '', '', '', ''),
(1190, 1, 1, 'Zbierz znajomych i przygotuj się do gry. Gładka warstwa zewnętrzna tej piłki adidas zapewnia miękki kontakt z piłką, dzięki czemu jest doskonała dla drużyn na każdym poziomie zaawansowania. Szyta maszynowo konstrukcja jest trwała, a butylowy pęcherz pomaga utrzymać ciśnienie powietrza i kształt. To wszystko, czego potrzebujesz podczas kolejnych weekendowych rozgrywek.', '', 'pilka-epp-club', '', '', '', 'Piłka EPP Club', '', '', '', ''),
(1191, 1, 1, 'Model stworzony z myślą o drużynach młodzieżowych i młodych zawodnikach. Młodzieżowa piłka adidas Tiro 350 League ma pełnowymiarową konstrukcję, ale jest lżejsza. Bezszwowa powłoka odpowiada za przewidywalne zachowanie na boisku. Butylowy pęcherz oznacza więcej gry i mniej pompowania.', '', 'tiro-junior-350-league-ball', '', '', '', 'Tiro Junior 350 League Ball', '', '', '', ''),
(1192, 1, 1, 'Kij Youngstar został zaprojektowany z myślą o młodych zawodnikach. Geometria 3D pomaga generować siłę i pewność uderzenia. Klasyczny kształt głowy zapewnia stałą kontrolę nad piłką. Drewniany rdzeń pomaga generować energię i redukuje wibracje od nieczystych uderzeń.', '', 'kij-do-hokeja-youngstar9-61-cm-field', '', '', '', 'Kij do hokeja Youngstar.9 61 cm Field', '', '', '', ''),
(1193, 1, 1, 'Jeśli Twoje dziecko marzy o sławie w Europie, trzeba zaopatrzyć je w sprzęt godny zawodowca. Młodzieżowa piłka adidas o designie inspirowanym oficjalną piłką meczową największego międzynarodowego turnieju w Europie waży zaledwie 290 g. Bezszwowa konstrukcja TSBE zapewnia przewidywalny kontakt z piłką i niską absorpcję wody, dzięki czemu można wejść na wyższy poziom gry.\n\nModel zawiera co najmniej 20% materiałów z odzysku, co pozwala uniknąć dużego wpływu na środowisko, jaki ma produkcja nowo powstałych materiałów.', '', 'pilka-fussballliebe-league-kids', '', '', '', 'Piłka Fussballliebe League Kids', '', '', '', ''),
(1194, 1, 1, 'Kij Youngstar został zaprojektowany z myślą o młodych zawodnikach. Geometria 3D pomaga generować siłę i pewność uderzenia. Klasyczny kształt głowy zapewnia stałą kontrolę nad piłką. Drewniany rdzeń pomaga generować energię i redukuje wibracje od nieczystych uderzeń.', '', 'kij-do-hokeja-youngstar9-61-cm-field', '', '', '', 'Kij do hokeja Youngstar.9 61 cm Field', '', '', '', ''),
(1195, 1, 1, 'Kij Youngstar został zaprojektowany z myślą o młodych zawodnikach. Geometria 3D pomaga generować siłę i pewność uderzenia. Klasyczny kształt głowy zapewnia stałą kontrolę nad piłką. Drewniany rdzeń pomaga generować energię i redukuje wibracje od nieczystych uderzeń.', '', 'kij-do-hokeja-youngstar9-61-cm-field', '', '', '', 'Kij do hokeja Youngstar.9 61 cm Field', '', '', '', ''),
