(1197, 1, 1, 'Kij Youngstar został zaprojektowany z myślą o młodych zawodnikach. Geometria 3D pomaga generować siłę i pewność uderzenia. Klasyczny kształt głowy zapewnia stałą kontrolę nad piłką. Drewniany rdzeń pomaga generować energię i redukuje wibracje od nieczystych uderzeń.', '', 'kij-do-hokeja-youngstar9-61-cm-field', '', '', '', 'Kij do hokeja Youngstar.9 61 cm Field', '', '', '', ''),
(1198, 1, 1, 'Jeśli Twoje dziecko marzy o sławie w Europie, trzeba zaopatrzyć je w sprzęt godny zawodowca. Młodzieżowa piłka adidas o designie inspirowanym oficjalną piłką meczową największego międzynarodowego turnieju w Europie waży zaledwie 350 g. Bezszwowa konstrukcja TSBE zapewnia przewidywalny kontakt z piłką i niską absorpcję wody, dzięki czemu można wejść na wyższy poziom gry.\n\nModel zawiera co najmniej 20% materiałów z odzysku, co pozwala uniknąć dużego wpływu na środowisko, jaki ma produkcja nowo powstałych materiałów.', '', 'pilka-fussballliebe-league-kids', '', '', '', 'Piłka Fussballliebe League Kids', '', '', '', ''),
(1199, 1, 1, 'Klasyczna piłka adidas Tiro Club jest idealnym towarzyszem, którego możesz zabrać wszędzie i dzięki któremu zawsze jesteś przygotowany na boisko treningowe. Model stworzony z myślą o miękkim kontakcie ma dużą trwałość, która doskonale sprawdza się podczas rozgrywek na poziomie podstawowym, spontanicznych meczów w parku lub szlifowania umiejętności. Szyta maszynowo konstrukcja i butylowy pęcherz sprawiają, że model jest gotowy do akcji, gdziekolwiek jesteś.', '', 'tiro-club-ball', '', '', '', 'Tiro Club Ball', '', '', '', ''),
(1200, 1, 1, 'Kiedy Twoje dziecko poczuje zew międzygalaktycznej przygody, pozwól mu założyć skarpetki Star Wars. Kolorowe wzory stymulują wyobraźnię, a miękki, bawełniany materiał zapewnia komfort nie z tej ziemi. Skarpety adidas dla dzieci są dostępne w opakowaniu po 3 pary, dzięki czemu Twoje dziecko może dzień po dniu pokazywać swoje oddanie dla Mocy. \n\nBawełna wykorzystana tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'skarpety-star-wars-young-jedi-3-pairs', '', '', '', 'Skarpety Star Wars Young Jedi 3 Pairs', '', '', '', ''),
(1201, 1, 1, 'Perspektywa napicia się wody może dodać Ci skrzydeł podczas ostatniego sprintu na bieżni. Zadbaj o nawodnienie dzięki bidonowi adidas i zachowaj motywację. Nie zawiera bisfenolu A i można go myć w zmywarce, dzięki czemu będzie czysty i gotowy na kolejną sesję. Napij się. Napełnij. Powtarzaj.', '', 'steel-bottle-075-l', '', '', '', 'Steel Bottle 0.75 L', '', '', '', ''),
(1202, 1, 1, 'Dodaj zabawny akcent do szuflady na skarpetki. Niezależnie od tego, czy maluchy prześlizgują się po parkiecie, czy spacerują z przyjaciółmi po parku, te skarpetki adidas dla dzieci to zabawny i kolorowy element ich stroju. Miękka bawełna sprawia, że stopy czują się dobrze przez cały dzień.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'graphic-socks-3-pairs', '', '', '', 'Graphic Socks 3 Pairs', '', '', '', ''),
(1203, 1, 1, 'Klasyczna piłka adidas Tiro Club jest idealnym towarzyszem, którego możesz zabrać wszędzie i dzięki któremu zawsze jesteś przygotowany na boisko treningowe. Model stworzony z myślą o miękkim kontakcie ma dużą trwałość, która doskonale sprawdza się podczas rozgrywek na poziomie podstawowym, spontanicznych meczów w parku lub szlifowania umiejętności. Szyta maszynowo konstrukcja i butylowy pęcherz sprawiają, że model jest gotowy do akcji, gdziekolwiek jesteś.', '', 'tiro-club-ball', '', '', '', 'Tiro Club Ball', '', '', '', ''),
(1204, 1, 1, 'Model stworzony z myślą o płynnej grze. adidas Oceaunz pro, oficjalna piłka meczowa używana podczas wczesnych etapów Mistrzostw Świata w piłce nożnej kobiet FIFA™, wyróżnia się grafiką, która odzwierciedla znaczenie Australii i malowniczego wybrzeża Nowej Zelandii, a także będących źródłem życia jezior i dróg wodnych. Bezszwowa konstrukcja zapewnia przewidywalną trajektorię lotu i odbicie. Znak jakości Quality Pro to najwyższa ocena FIFA.', '', 'oceaunz-pro-football', '', '', '', 'OCEAUNZ PRO FOOTBALL', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1205, 1, 1, 'Odkryj ciemną stronę mocy z czapką bejsbolową Star Wars. Młodzieżowa czapka adidas została uszyta z lekkiego materiału i ma delikatnie wygięty daszek, dzięki czemu zapewni Ci komfort w mieście lub w innej galaktyce. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'czapska-star-wars-kids', '', '', '', 'Czapska Star Wars Kids', '', '', '', ''),
(1206, 1, 1, 'Twoje narzędzie pracy. Punkt, na którym się koncentrujesz. Ta piłka adidas Club prezentuje klasyczny styl, w tym kultowe logo adidas Badge of Sport. Maszynowo szyta konstrukcja z miękkiego w dotyku tworzywa sztucznego ma butylowy pęcherz, który utrzymuje napełnienie powietrzem. Jej trwałość sprawia, że sprawdzi się w regularnym użytkowaniu.', '', 'epp-club-ball', '', '', '', 'EPP Club Ball', '', '', '', ''),
(1207, 1, 1, 'Muzyka oczyszcza umysł, motywuje ciało i pozwala osiągnąć pełne skupienie. Słuchawki douszne adidas Z.N.E. 01 zapewniają czysty dźwięk bez ograniczeń. Słuchawki gwarantują niezrównany komfort noszenia. Charakteryzują się opływową i prostą konstrukcją, dzięki czemu zapewniają wygodne dopasowanie w aktywne dni. Do noszenia zarówno na co dzień, jak i podczas treningu. Odporne na pot i wilgoć słuchawki sprawdzą się w każdych warunkach – od dojazdów w deszczowe dni po intensywne treningi na siłowni.', '', 'adidas-zne-01-true-wireless-earbuds', '', '', '', 'adidas Z.N.E. 01 True Wireless Earbuds', '', '', '', ''),
(1208, 1, 1, 'Rooted in Spanish culture and tradition, this adidas football takes design cues from the lion on the federation crest and the iconic mosaics found throughout the country\'s city streets. The butyl bladder keeps it inflated for longer, and seamless thermal bonding means it takes on less water on wet surfaces, so you can keep playing until the last whistle.', '', 'amberes-22-competition-football', '', '', '', 'Amberes 22 Competition Football', '', '', '', ''),
(1209, 1, 1, 'Zapewnij swojemu dziecku całodzienny komfort. Sportowe skarpetki do kostki gotowe na przygodę. Ściągaczowe mankiety utrzymują je na miejscu podczas zabawy, a miękki materiał z dużą zawartością bawełny zapewnia przytulny komfort na każdym kroku. Kolorowe i klasyczne skarpety adidas dla dzieci stanowią stylowy akcent każdego stroju.\n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 50%.', '', 'skarpety-linear-ankle-kids-5-par', '', '', '', 'Skarpety Linear Ankle Kids (5 par)', '', '', '', ''),
(1210, 1, 1, 'Zapewnij swojemu dziecku całodzienny komfort. Sportowe skarpetki do kostki gotowe na przygodę. Ściągaczowe mankiety utrzymują je na miejscu podczas zabawy, a miękki materiał z dużą zawartością bawełny zapewnia przytulny komfort na każdym kroku. Kolorowe i klasyczne skarpety adidas dla dzieci stanowią stylowy akcent każdego stroju.\n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 50%.', '', 'skarpety-linear-ankle-kids-5-par', '', '', '', 'Skarpety Linear Ankle Kids (5 par)', '', '', '', ''),
(1211, 1, 1, 'Wybierz kultowy model Tango Rosario inspirowany designem piłki używanej podczas światowego, międzynarodowego turnieju w Argentynie w 1978 roku. Szyta ręcznie powłoka dodaje piłce trwałości i zapewnia lepszy kontakt. Piłka treningowa o jakości potwierdzonej przez FIFA ma butylowy pęcherz i poliuretanową warstwę wierzchnią.', '', 'tango-rosario-ball', '', '', '', 'Tango Rosario Ball', '', '', '', ''),
(1212, 1, 1, 'Przygody stają się jeszcze fajniejsze, gdy do zabawy włączają się Myszka Miki i przyjaciele. Skarpety adidas dla dzieci ozdobione jasną grafiką dodają magii Disneya na każdym kroku. Wygodny materiał z dużą zawartością bawełny oznacza, że dziecko może komfortowo odkrywać świat przez cały dzień, a uniwersalna długość do łydki pasuje do wszystkich ulubionych ubrań. \n\nBawełna wykorzystana tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'skarpety-disney-s-mickey-mouse-3-pairs-kids', '', '', '', 'Skarpety Disney\'s Mickey Mouse 3 Pairs Kids', '', '', '', ''),
(1213, 1, 1, 'Pozwól swojemu dziecku wyjść na dwór w dobrym stylu. Dwustronny kapelusz adidas chroni je przed słońcem w miejskim stylu. Charakterystyczny dla profesjonalnego skejtera Marka Gonzalesa nadruk Shmoofoil przyciąga wzrok żywą grafiką. Odwróć kapelusz na drugą stronę, aby Twoje dziecko mogło zyskać jednobarwny, stonowany look. Lekki kapelusz z rondem dookoła i otworami wentylacyjnymi pozwoli Twojemu dziecku pokazać, że kocha skateboarding i wspierać ikonę, która pomogła go ukształtować. \n\nBawełna wykorzystana w tym produkcie została pozyskana w ramach inicjatywy Better Cotton. Bawełna Better Cotton jest pozyskiwana poprzez model łańcucha dostaw oparty na równowadze ilości. Oznacza to, że Better Cotton nie da się fizycznie powiązać z produktami końcowymi.\n\nWięcej informacji można znaleźć tutaj: https://bettercotton.org/who-we-are/our-logo/', '', 'kapelusz-adidas-originals-x-mark-gonzales-bucket', '', '', '', 'Kapelusz adidas Originals x Mark Gonzales Bucket', '', '', '', ''),
(1214, 1, 1, 'Ulubiony przyjacielski bohater z sąsiedztwa dołącza do kolejnej przygody Twojego maluszka w czapce beanie ze Spider-Manem od Marvela. Wygoda i wydajność, jakich oczekujesz od adidas dzięki zabawnej grafice od marvelowskiego Spider-Mana.', '', 'czapka-marvel-spider-man', '', '', '', 'Czapka Marvel Spider-Man', '', '', '', ''),
(1215, 1, 1, 'Model stworzony z myślą o płynnej grze. Odzwierciedlająca naturalne piękno Australii i Nowej Zelandii grafika na piłce adidas Oceaunz club nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Szyta maszynowo konstrukcja i mocna powłoka z TPU oznaczają, że jest to idealny wybór na spontaniczne rozgrywki. Za tym hipnotyzującym designem kryje się butylowy pęcherz, który sprawia, że model jest zawsze gotowy do akcji.', '', 'oceaunz-club-ball', '', '', '', 'Oceaunz Club Ball', '', '', '', ''),
(1216, 1, 1, 'Czy pijesz wystarczającą ilość wody? Dowiesz się tego dzięki bidonowi adidas Performance, który ma na boku podziałkę ułatwiającą sprawdzenie ilości wypitego płynu. Łatwo jest go trzymać, ścisnąć i napełnić. A gdy już go opróżnisz, po prostu włóż go do zmywarki i będzie gotowy do ponownego użycia.', '', 'performance-bottle-750-ml', '', '', '', 'Performance Bottle 750 ML', '', '', '', ''),
(1217, 1, 1, 'Idealne połączenie klasycznego designu zegarka, miejskiego stylu i codziennego komfortu. Zegarek Project Two dumnie prezentuje kultową paletę Adicolor i zabawną grafikę adidas Originals.', '', 'project-two-r-watch', '', '', '', 'Project Two R Watch', '', '', '', ''),
(1218, 1, 1, 'Idealne połączenie klasycznego designu zegarka, miejskiego stylu i codziennego komfortu. Zegarek Project Two dumnie prezentuje kultową paletę Adicolor i zabawną grafikę adidas Originals.', '', 'project-two-r-watch', '', '', '', 'Project Two R Watch', '', '', '', ''),
(1219, 1, 1, 'Czapka z Myszką Mickey, która wypełni plac zabaw magię Disneya. Niezależnie od tego, czy Twoje dziecko wybiera się na zjeżdżalnię, czy na podbój małpiego gaju, będzie mu wygodnie w tej czapce bejsbolówce adidas dla dzieci. Design z zatrzaskami z tyłu ułatwia regulację, a lekko wygięty daszek zapewnia dużo cienia. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'czapka-disney-s-mickey-mouse-kids', '', '', '', 'Czapka Disney\'s Mickey Mouse Kids', '', '', '', ''),
(1220, 1, 1, 'Tiki-Taka, precyzyjne podania i perfekcyjnie wyważone piłki. Zadbaj o płynność gry swojej drużyny dzięki piłce adidas Tiro League. Bezszwowa, zgrzewana termicznie powierzchnia sprawia, że model zawsze zachowuje swoje parametry, gwarantując najlepszy kontakt z piłką. Znak jakości FIFA International Match Standard jest tego najlepszym dowodem. Teraz nadszedł czas, aby pokazać, co potrafisz.', '', 'tiro-league-thermally-bonded-ball', '', '', '', 'Tiro League Thermally Bonded Ball', '', '', '', ''),
(1221, 1, 1, 'Piłka adidas Tiro League TSBE została stworzona, aby Twój zespół zawsze miał przewagę, gdziekolwiek zagra. Niezależnie od tego, czy chodzi o cotygodniowe treningi, czy kluczowe rozgrywki, bezszwowa konstrukcja TSBE zapewnia równomierny kontakt z piłką i ogranicza pobór wody, dzięki czemu zawsze będziesz w gotowości. Model ma również certyfikat FIFA Quality, który zachęca do marzeń o wielkich osiągnięciach i do dotrzymywania kroku najlepszym.', '', 'tiro-league-tsbe-ball', '', '', '', 'Tiro League TSBE Ball', '', '', '', ''),
(1222, 1, 1, 'Zabezpiecz swoje ulubione buty adidas przed wodą i plamami. Ten impregnat na bazie wody przenika przez materiał, tworząc niewidzialną barierę, która pomaga odprowadzać wodę z Twoich sneakerów i chronić je przed plamami.', '', 'protector', '', '', '', 'Protector', '', '', '', ''),
(1223, 1, 1, 'Przenieś emocje związane z Mistrzostwami Świata w piłce nożnej kobiet FIFA™ na boisko treningowe dzięki piłce adidas Oceaunz. Szyta maszynowo konstrukcja i powłoka z TPU zapewniają miękki kontakt i trwałość. Przyciągająca wzrok grafika czerpie inspirację z oficjalnej piłki meczowej używanej w Nowej Zelandii i Australii.', '', 'oceaunz-training-ball', '', '', '', 'Oceaunz Training Ball', '', '', '', ''),
(1224, 1, 1, 'Niezależnie od tego, czy Twój maluch kopie piłkę, czy po prostu bawi się z innymi dziećmi, ta czapka adidas dla dzieci pozwoli mu wyrazić siebie. Bawełniana tkanina o ukośnym splocie i wyszywane logo nadają jej klasyczny, sportowy look. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych materiałów zawierają co najmniej 50% tych materiałów.', '', 'czapka-kids', '', '', '', 'Czapka Kids', '', '', '', ''),
(1225, 1, 1, 'Piłka adidas Tiro League powstała, aby odzwierciedlać cechy piłki meczowej na trawie, i została zaprojektowana z myślą o jeszcze lepszej grze na sztucznej nawierzchni. Zgrzewana termicznie konstrukcja ogranicza pobór wody i zapewnia równomierny kontakt z piłką oraz przewidywalną trajektorię lotu piłki, dzięki czemu idealnie nadaje się zarówno na mecze, jak i treningi. Piłka jest oznaczona symbolem IMS.', '', 'tiro-league-artificial-ground-ball', '', '', '', 'Tiro League Artificial Ground Ball', '', '', '', ''),
(1226, 1, 1, 'Model stworzony z myślą o płynnej grze. Odzwierciedlająca naturalne piękno Australii i Nowej Zelandii grafika na piłce adidas Oceaunz club nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Szyta maszynowo konstrukcja i mocna powłoka z TPU oznaczają, że jest to idealny wybór na spontaniczne rozgrywki. Za tym hipnotyzującym designem kryje się butylowy pęcherz, który sprawia, że model jest zawsze gotowy do akcji.', '', 'oceaunz-club-ball', '', '', '', 'Oceaunz Club Ball', '', '', '', ''),
(1227, 1, 1, 'Niezależnie od tego, czy Twój maluch kopie piłkę, czy po prostu bawi się z innymi dziećmi, ta czapka adidas dla dzieci pozwoli mu wyrazić siebie. Bawełniana tkanina o ukośnym splocie i wyszywane logo nadają jej klasyczny, sportowy look. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane z mieszanki materiałów pochodzących z recyklingu i odnawialnych materiałów zawierają co najmniej 50% tych materiałów.', '', 'czapka-kids', '', '', '', 'Czapka Kids', '', '', '', ''),
(1228, 1, 1, 'Nie pozwól, by chłód miał wpływ na Twoją grę. Ta czapka adidas typu beanie do gry w golfa zapewni Ci ciepło, dzięki czemu możesz skoncentrować się na grze. Miękka dzianina zapewnia komfort przez całą rundę, a mankiety ze ściągaczem pozwalają indywidualnie dopasować stopień okrycia.', '', 'czapka-golf-kids', '', '', '', 'Czapka Golf Kids', '', '', '', ''),
(1229, 1, 1, 'Model stworzony z myślą o drużynach młodzieżowych i młodych zawodnikach. Młodzieżowa piłka adidas Tiro 290 League ma pełnowymiarową konstrukcję, ale jest lżejsza. Bezszwowa powłoka odpowiada za przewidywalne zachowanie na boisku. Butylowy pęcherz oznacza więcej gry i mniej pompowania.', '', 'tiro-junior-290-league-ball', '', '', '', 'Tiro Junior 290 League Ball', '', '', '', ''),
(1230, 1, 1, 'Zazwyczaj zegarki potrafią przestać działać w najmniej oczekiwanej chwili. Ale nie ta. Zasilany światłem zegarek adidas District_SM1 pozwoli Ci zapomnieć o konieczności wymiany baterii i skupić się na tym, co naprawdę istotne. Ma prosty, wyrazisty wygląd, który nawiązuje do dziedzictwa adidas, jednocześnie wybiegając w przyszłość.', '', 'districtsm1-watch', '', '', '', 'District_SM1 Watch', '', '', '', ''),
(1231, 1, 1, 'Zapomnij o braku komfortu na polu golfowym, nosząc młodzieżowy pasek adidas do golfa. Ma odpinaną sprzączkę, dzięki czemu możesz go przyciąć do odpowiedniej długości. Dwustronny design pozwoli Ci zmienić look.\n\nModel wykonany z materiałów pochodzących z recyklingu odzyskanych w trakcie procesu produkcyjnego, np. ścinków materiałów i odpadów z gospodarstw domowych, w celu uniknięcia znacznie większego wpływu na środowisko naturalne, jaki wywiera produkcja surowców.', '', 'universal-webbing-belt', '', '', '', 'Universal Webbing Belt', '', '', '', ''),
(1232, 1, 1, 'Idealne połączenie klasycznego designu zegarka, miejskiego stylu i codziennego komfortu. Zegarek Project Two dumnie prezentuje kultową paletę Adicolor i zabawną grafikę adidas Originals.', '', 'project-two-r-watch', '', '', '', 'Project Two R Watch', '', '', '', ''),
(1233, 1, 1, 'Piłka meczowa adidas Tiro została stworzona, aby pomóc drużynom doskonalić grę na boisku treningowym. Ręcznie szyte panele i mocna, powlekana powierzchnia sprawiają, że model jest wytrzymały i idealnie nadaje się do wielokrotnego użytku. Znaczek International Match Standard to oznaka najwyższego standardu.', '', 'tiro-match-ball', '', '', '', 'Tiro Match Ball', '', '', '', ''),
(1234, 1, 1, 'Accessories are what make your style your own. Level up your look with some OG attitude in this juniors\' adidas bucket hat. Bright colours bring that modern energy. Soft cotton twill keeps your head comfy and shaded through the day.\n\nMade with a series of recycled materials, and at least 40% recycled content, this product represents just one of our solutions to help end plastic waste.', '', 'dance-bucket-hat', '', '', '', 'Dance Bucket Hat', '', '', '', ''),
(1235, 1, 1, 'Model ARCHIVE_M1 czerpie inspirację z bogatej tradycji marki adidas z lat 70., stanowiąc hołd dla spokojniejszych czasów u schyłku ery cyfrowej. Jako antidotum na dzisiejsze przepełnione gadżetami i natłokiem informacji czasy, model ARCHIVE_M1 jest nowoczesną i progresywną interpretacją designu zegarka, który wydaje się znany, a mimo to zaskakuje świeżością.', '', 'zegarek-archivem1', '', '', '', 'Zegarek ARCHIVE_M1', '', '', '', ''),
(1236, 1, 1, 'Stworzony z myślą o określonej funkcji model CYPHYER_M1 jest ucieleśnieniem funkcjonalności i przemyślanej konstrukcji. Jednokierunkowa, indeksowana ramka i nowoczesna obudowa są funkcjonalne, stylowe i pozbawione zbędnych ozdobników. Będący wyrazem funkcjonalnego podejścia model CYPHER_M1 jest śmiałą, minimalistyczną wersją designu zegarka.', '', 'zegarek-cypherm1', '', '', '', 'Zegarek CYPHER_M1', '', '', '', ''),
(1237, 1, 1, 'Dopełnij swój look stylem akademickim. Ta młodzieżowa czapka-kapelusik adidas jest niezbędnym elementem stroju na niezobowiązujące weekendy i poranne biegi po kawę. Konstrukcja z bawełnianego diagonalu jest trwała, ale również wygodna, a rondo dookoła nadaje całości klasyczny fason. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów pochodzących z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'collegiate-bucket-hat-kids', '', '', '', 'Collegiate Bucket Hat Kids', '', '', '', ''),
(1238, 1, 1, 'Użyj ponownie oryginalnej buteleczki ze sprayem, napełniając ją zapasem płynu Protector. Niech Twoje buty adidas wyglądają zawsze jak nowe.', '', 'protector-refill', '', '', '', 'Protector Refill', '', '', '', ''),
(1239, 1, 1, 'Dyskretny i prosty styl. Ten plecak adidas dla dzieci pomieści wszystko, czego maluchy potrzebują do szkoły, na trening i na codzienne przygody. Główna komora na suwak przechowa duże przedmioty, a przednia kieszeń na suwak zapewnia szybki dostęp do telefonów, kluczy i innych niezbędnych drobiazgów. Wyściełane paski oznaczają, że ciężkie rzeczy nie stanowią problemu.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'graphic-backpack', '', '', '', 'Graphic Backpack', '', '', '', ''),
(1240, 1, 1, 'Niezależnie od tego, czy Twoje dziecko wybiera się do szkoły czy na szlak, młodzieżowy plecak adidas pomieści wszystko, czego potrzebuje. Włóż bidon do jednej z bocznych kieszeni z siateczki i schowaj telefon do przedniej kieszeni, aby Twoja pociecha miała do niego szybki dostęp. Regulowane szelki zapewnią indywidualne dopasowanie i komfort na długich dystansach. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'plecak-power-kids', '', '', '', 'Plecak Power Kids', '', '', '', ''),
(1241, 1, 1, 'Przestań zerkać nerwowo na nadgarstek. Zegarek Cypher_M1_SST czerpie inspirację z butów miejskich adidas Superstar, a japońska dokładność mechanizmu kwarcowego sprawi, że dotrzesz na czas. Bogata gama kolorystyczna i wodoodporność są gwarancją, że pasuje do każdej stylizacji ― nawet do stroju do pływania.', '', 'cypherm1sst-watch', '', '', '', 'Cypher_M1_SST Watch', '', '', '', ''),
(1242, 1, 1, 'Idealne połączenie klasycznego designu zegarka, miejskiego stylu i codziennego komfortu. Zegarek Project Two dumnie prezentuje kultową paletę Adicolor i zabawną grafikę adidas Originals.', '', 'project-two-f-watch', '', '', '', 'Project Two F Watch', '', '', '', ''),
(1243, 1, 1, 'Najmniejsze detale robią największą różnicę. Wybierz zegarek adidas, aby błysnąć zabawnym stylem, zachowując jednocześnie pełną kontrolę nad przebiegiem dnia.  Jest lekki ma sportowy styl, dlatego świetnie sprawdzi się podczas wypraw w słoneczne dni, gdy potrzebujesz wszystkiego, co przewiewne.', '', 'processsp2-watch', '', '', '', 'Process_SP2 Watch', '', '', '', ''),
(1244, 1, 1, 'Piłka do rugby adidas All Blacks pomoże Ci szlifować swoje umiejętności, od up-and-underów po perfekcyjne podania. Konstrukcja ozdobiona misternym wzorem inspirowanym liściem paproci powłoka z syntetycznej skóry została wykonana z przyczepnej gumy, dzięki czemu nie wyślizguje się z rąk. Ręcznie szyty design i lateksowy pęcherz zapewniają trwałość i przewidywalny tor lotu piłki.', '', 'nzru-all-blacks-replica-rugby-ball', '', '', '', 'NZRU All Blacks Replica Rugby Ball', '', '', '', ''),
(1245, 1, 1, 'Klasyczny styl z użytecznymi funkcjami, takimi jak odmierzanie godzin, minut i sekund. Zegarek adidas Edition Three wyróżnia się tarczą typu California, na której widnieją cyfry rzymskie i arabskie. Całości dopełnia bransoletka z polerowanej i szczotkowanej stali nierdzewnej o szerokości trzech ogniw.', '', 'edition-three-small-m-watch', '', '', '', 'Edition Three Small M Watch', '', '', '', ''),
(1246, 1, 1, 'Ponadczasowy i na czasie. Japoński mechanizm kwarcowy zegarka Cypher_ME1_SST sprawi, że punktualnie załatwisz wszystkie sprawy. Zegarek zainspirowany tradycyjnym modelem butów adidas Superstar zapewni Ci styl. Elegancki wygląd i funkcjonalność sprawią, że szybko stanie się Twoim ulubionym zegarkiem ze stali nierdzewnej.', '', 'cypherme1sst-watch', '', '', '', 'Cypher_ME1_SST Watch', '', '', '', ''),
(1247, 1, 1, 'Jest parę fajnych rzeczy po treningu. Energia wciąż Cię nie opuszcza.  Ciało jest rozgrzane i czujesz się dobrze. A nawet znakomicie. Gdy zamykasz za sobą drzwi siłowni, załóż tę czapkę adidas typu beanie i pozwól endorfinom krążyć. Pozostań dłużej w tej strefie. I trzymaj się ciepło.', '', 'logo-beanie', '', '', '', 'Logo Beanie', '', '', '', ''),
(1248, 1, 1, 'Niezależnie od tego, czy Twoje dziecko zdobywa punkty podczas rozgrywki na dworze, czy ślizga się na podłodze w kuchni, skarpetki do kostek adidas otulają małe stopy amortyzowaną miękkością. Trzy pary w opakowaniu stanowią gwarancję, że jeśli dwie pary ucierpiały w wyniku starcia z sokiem winogronowym lub trawą, masz jeszcze czystą, zapasową parę na zmianę. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'socks-3-pairs', '', '', '', 'Socks 3 Pairs', '', '', '', ''),
(1249, 1, 1, 'When a regular hat just doesn\'t cut it on the golf course, this juniors\' adidas beanie gives you that warm, cosy feeling with the looks to match. Put it on when it gets a little chilly and carry on with your routine. The Par 3 patch on the brim shows your love for the sport.', '', '3-stripes-golf-beanie', '', '', '', '3-Stripes Golf Beanie', '', '', '', ''),
(1250, 1, 1, 'Spakuj do tego plecaka dla dzieci książki, lunch, piórnik i kurtkę lub wszystkie klocki LEGO®, których maluchy będą potrzebować podczas zabawy po szkole. Potrzebujesz więcej miejsca? Rozepnij suwaki i powiększ design. Genialne. Podobnie jak Ty, Twoje dziecko, LEGO Group i adidas.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'adidas-x-classic-lego-backpack', '', '', '', 'adidas x Classic LEGO® Backpack', '', '', '', ''),
(1251, 1, 1, 'Dzieci prowadzą aktywne życie. Plecak dla dzieci adidas pomieści wszystko, czego Twój maluch potrzebuje. Regulowane szelki pomogą dostosować go do wzrostu. Kontrastujące kolory spodobają się dzieciom.', '', 'classic-backpack', '', '', '', 'Classic Backpack', '', '', '', ''),
(1252, 1, 1, 'Plecak... i w drogę! Ten plecak adidas dla dzieci ma wiele funkcji. Regulowane szelki zapewniają idealne dopasowanie, a pasek na piersi stabilizuje plecak z przodu i sprawia, że nie zsuwa się z ramion. Kieszeń na suwak z przodu bezpiecznie pomieści cenne drobiazgi. Uchwyt u góry pozwala nosić go na dwa sposoby.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', '', 'backpack', '', '', '', 'Backpack', '', '', '', ''),
(1253, 1, 1, 'Postaw na plecak treningowy adidas dla dzieci stworzony z myślą o młodych, aktywnych piłkarzach. Pojemna komora główna na suwak pomieści cały sprzęt, a dwie kieszenie z siateczki zapewniają łatwy dostęp do wody i przekąsek. Przegroda na mokre i suche rzeczy oddziela zabłocone buty od reszty wyposażenia. Regulowane szelki ułatwiają transport.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'football-backpack', '', '', '', 'Football Backpack', '', '', '', ''),
(1254, 1, 1, 'Niezależnie od tego, czy pakujesz się na weekendowy maraton, czy na trening przed sesją maratonu, ten plecak adidas sprosta wyzwaniu. Wyściełana, wewnętrzna kieszeń pomieści 15-calowy laptop. Oddychające szelki z przewiewnej siateczki i boczne, kompresyjne paski zapewniają Ci komfort, gdy nosisz swój sprzęt. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'power-backpack', '', '', '', 'Power Backpack', '', '', '', ''),
(1255, 1, 1, 'Dwustronny kapelusik nauczy Twojego malucha podejmować pierwsze decyzje.  Pozwól swojemu dziecku zdecydować, który design LEGO® najlepiej pasuje do jego stroju. Rondo zadba o to, aby twarz malucha była w cieniu. Uszyty z miękkiej w dotyku bawełny kapelusik adidas dla dzieci dba o komfort podczas wielogodzinnej zabawy. \n\nModel został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku.', '', 'adidas-x-lego-play-bucket-hat', '', '', '', 'adidas x LEGO® Play Bucket Hat', '', '', '', ''),
(1256, 1, 1, 'Play with the best. This adidas Ekstraklasa pro football is the one used by Poland\'s elite teams when they battle for the title. Its seamless surface is thermally bonded to ensure consistent performance on the pitch, and a butyl bladder ensures it stays inflated for longer. FIFA\'s top rating makes it the perfect ball to take into matches.', '', 'ekstraklasa-pro-football', '', '', '', 'Ekstraklasa Pro Football', '', '', '', ''),
(1257, 1, 1, 'Al Rihla oznacza podróż, a ta piłka adidas to dopiero początek. Model stworzony z myślą o szwedzkiej reprezentacji ma maszynowo szytą powłokę, która gwarantuje trwałość. Butylowy pęcherz dłużej trzyma powietrze.', '', 'al-rihla-sweden-club-ball', '', '', '', 'Al Rihla Sweden Club Ball', '', '', '', ''),
(1258, 1, 1, 'Dla Twojej gry. Dla Twojej drużyny. adidas stworzył linię produktów Tiro, aby zapewnić wszystko, czego może potrzebować Twój klub piłkarski. Zainspirowany konstrukcją oficjalnych piłek meczowych model Tiro League TB ma zgrzewaną konstrukcję zapewniającą przewidywalne wyniki. Znak IMS potwierdza jakość odpowiednią na treningi i mecze.', '', 'tiro-league-tb-ball', '', '', '', 'Tiro League TB Ball', '', '', '', ''),
(1259, 1, 1, 'Trenuj jak zawodowiec z piłką treningową adidas Predator. Dzięki maszynowemu szyciu jest miękka w dotyku i wyjątkowo wytrzymała. Wewnętrzny butylowy pęcherz dłużej trzyma powietrze, co oznacza, że możesz spędzać więcej czasu na trenowaniu kopnięć, a mniej na ławce rezerwowych, pompując piłkę.', '', 'predator-training-ball', '', '', '', 'Predator Training Ball', '', '', '', ''),
(1260, 1, 1, 'Plecak... i w drogę! Ten plecak adidas dla dzieci ma wiele funkcji. Regulowane szelki zapewniają idealne dopasowanie, a pasek na piersi stabilizuje plecak z przodu i sprawia, że nie zsuwa się z ramion. Kieszeń na suwak z przodu bezpiecznie pomieści cenne drobiazgi. Uchwyt u góry pozwala nosić go na dwa sposoby.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', '', 'backpack', '', '', '', 'Backpack', '', '', '', ''),
(1261, 1, 1, 'Niezależnie od tego, czy pakujesz się na weekendowy maraton, czy na trening przed sesją maratonu, ten plecak adidas sprosta wyzwaniu. Wyściełana, wewnętrzna kieszeń pomieści 15-calowy laptop. Oddychające szelki z przewiewnej siateczki i boczne, kompresyjne paski zapewniają Ci komfort, gdy nosisz swój sprzęt. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, jakie mogą pomóc nam położyć kres plastikowym odpadom.', '', 'power-backpack', '', '', '', 'Power Backpack', '', '', '', ''),
(1262, 1, 1, 'Dzieci prowadzą aktywne życie. Plecak dla dzieci adidas pomieści wszystko, czego Twój maluch potrzebuje. Regulowane szelki pomogą dostosować go do wzrostu. Kontrastujące kolory spodobają się dzieciom.', '', 'classic-backpack', '', '', '', 'Classic Backpack', '', '', '', ''),
(1263, 1, 1, 'Dla dzieci, które uwielbiają błyszczeć na parkiecie tanecznym. Ta czapka adidas dla dzieci jest ozdobiona jasnymi literami z napisem „adidas” na tle logotypów. Konstrukcja z bawełny jest miękka i lekka w dotyku. Wyściełana opaska przeciwpotna zapewnia dzieciom komfort podczas treningu.\n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'dance-cap', '', '', '', 'Dance Cap', '', '', '', ''),
(1264, 1, 1, 'Czapka na zatrzask z tyłu ochroni Twoje oczy przed słońcem przy pomocy wygiętego daszka. Model z mocnego diagonalu bawełnianego ma wbudowany filtr UV. Logo adidas Badge of Sport z przodu stanowi wykończenie w sportowym stylu.', '', 'graphic-cap', '', '', '', 'Graphic Cap', '', '', '', ''),
(1265, 1, 1, 'Ciesz się siłą, wytrzymałością i zwinnością marvelowskiej Czarnej Pantery, ćwicząc rzuty zza głowy lub podbijanie piłki w tej młodzieżowej czapce adidas. Regulowany pasek z tyłu sprawia, że możesz ją doskonale dopasować, niezależnie od aktywności. Odblaskowe detale błyszczą w słabym oświetleniu.', '', 'adidas-x-marvel-black-panther-cap', '', '', '', 'adidas x Marvel Black Panther Cap', '', '', '', ''),
(1266, 1, 1, 'Plecak... i w drogę! Ten plecak adidas dla dzieci ma wiele funkcji. Regulowane szelki zapewniają idealne dopasowanie, a pasek na piersi stabilizuje plecak z przodu i sprawia, że nie zsuwa się z ramion. Kieszeń na suwak z przodu bezpiecznie pomieści cenne drobiazgi. Uchwyt u góry pozwala nosić go na dwa sposoby.\n\nTen produkt jest wykonany z Primegreen, linii wysokiej jakości materiałów pochodzących z recyklingu.', '', 'backpack', '', '', '', 'Backpack', '', '', '', ''),
(1267, 1, 1, 'The adidas Adipower Junior padel racket is the racket of a future champion. With its light weight and its EVA soft performance rubber construction, it helps the little ones have a great ball output and excellent comfort on every shot. In addition, thanks to the fibreglass surface in union with the Exoskeleton technology, junior players will be able to generate a good dose of power.', '', 'adipower-junior-padel-racket', '', '', '', 'Adipower Junior Padel Racket', '', '', '', ''),
(1268, 1, 1, 'Podobnie jak disnejowska Vaiana Twoje dziecko codziennie odkrywa nowe talenty. Przygotuj swoją pociechę na przygodę i poznawanie swoich możliwości z tym plecakiem adidas dla dzieci. Niezależnie od tego, czy szlifuje idealne plié na zajęciach tanecznych, czy skacze po kałużach dla zabawy, Vaiana dopinguje ją do działania.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'disney-moana-backpack', '', '', '', 'Disney Moana Backpack', '', '', '', ''),
(1269, 1, 1, 'Posyłaj piłki prosto do dołka w tej młodzieżowej czapce adidas do gry w golfa. Bawełniana tkanina o ukośnym splocie zapewnia lekki komfort i przewiewność na polu golfowym. Pięciopanelowy design ma płaską, doskonale dopasowaną główkę. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'par-three-novelty-hat', '', '', '', 'Par Three Novelty Hat', '', '', '', ''),
(1270, 1, 1, 'Ubieranie się właśnie stało się o wiele zabawniejsze. Skarpety adidas dla dzieci z wplecioną grafiką inspirowaną disnejowską Myszką Mickey i kumplami pomogą Twojemu maluchowi powitać dzień w przyjaznym stylu. Każda para w trójpaku ma krój do łydki i mankiety ze ściągaczem, które zapewniają komfort przez cały dzień. \n\nCo najmniej 50% tego produktu to mieszanka materiałów pochodzących z recyklingu i surowców odnawialnych.', '', 'skarpety-mickey-mouse-crew-3-pairs', '', '', '', 'Skarpety Mickey Mouse Crew 3 Pairs', '', '', '', ''),
(1271, 1, 1, 'Model stworzony z myślą o płynnej grze. Odzwierciedlająca naturalne piękno Australii i Nowej Zelandii grafika na piłce adidas Oceaunz club nawiązuje do oficjalnej piłki meczowej Mistrzostw Świata w piłce nożnej kobiet FIFA™. Szyta maszynowo konstrukcja i mocna powłoka z TPU oznaczają, że jest to idealny wybór na spontaniczne rozgrywki. Za tym hipnotyzującym designem kryje się butylowy pęcherz, który sprawia, że model jest zawsze gotowy do akcji.', '', 'oceaunz-club-ball', '', '', '', 'Oceaunz Club Ball', '', '', '', ''),
(1272, 1, 1, 'Nie bez powodu uznajemy ją za klasykę gatunku. Ta młodzieżowa czapka bejsbolówka adidas wnosi ponadczasowy styl do Twojego codziennego looku. Grafika vintage nawiązuje do tradycji adidas. Wyściełana, wewnętrzna opaska przeciwpotna odprowadza wilgoć. Logo Badge of Sport stanowi dopełniający akcent.\n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'czapka-brand-love-kids', '', '', '', 'Czapka Brand Love Kids', '', '', '', ''),
(1273, 1, 1, 'Maluchy mogą przechodzić w pełnym ekwipunku od jednej aktywności do drugiej dzięki temu plecakowi adidas dla dzieci. Liczne kieszenie zapewniają dzieciom mnóstwo miejsca do przechowywania rzeczy. Wyreguluj ramiączka i pasek na piersi, aby uzyskać idealne, wygodne dopasowanie. \n\nTen model jest wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 60% materiałów z odzysku. Jest to jedno z proponowanych przez nas rozwiązań, które mogą pomóc nam położyć kres plastikowym odpadom.', '', 'backpack', '', '', '', 'Backpack', '', '', '', ''),
(1274, 1, 1, 'Wzmocnij swoją obronę na boisku piłkarskim przy pomocy designu, któremu możesz zaufać. Te młodzieżowe ochraniacze na golenie adidas Match mają twarde płytki z wyściółką z pianki EVA i dołączone osłony na kostki. Może nie są tak dyskretne jak inne ochraniacze z linii Tiro, ale zapewnią Ci pewność siebie, gdy robisz ślizgi i wypady w drodze do bramki.\n\nModel zawiera co najmniej 20% materiałów z odzysku, co pozwala uniknąć dużego wpływu na środowisko, jaki ma produkcja nowo powstałych materiałów.', '', 'tiro-match-shin-guards', '', '', '', 'Tiro Match Shin Guards', '', '', '', ''),
(1275, 1, 1, 'Wybierz plecak adidas Hello Kitty dla najmłodszych z mnóstwem kieszeni, w których schowasz niezbędne drobiazgi, gdy zabierasz swojego maluszka na plac zabaw, do parku czy na basen. Boczne, otwarte kieszenie pomieszczą niezbędne drobiazgi w zasięgu ręki, a regulowane paski zapinane na sprzączkę zapewniają idealne dopasowanie. Specjalna grafika na przodzie przyjaźnie pozdrawia przy każdym spojrzeniu. \n\nTen produkt został wykonany z serii materiałów pochodzących z recyklingu i zawiera co najmniej 40% materiałów z odzysku, co jest tylko jednym z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'plecak-adidas-x-hello-kitty-kids', '', '', '', 'Plecak adidas x Hello Kitty Kids', '', '', '', ''),
(1276, 1, 1, 'Zegarek adidas Expression One ma wyrazisty design, który idealnie oddaje ducha adidas Originals. Ten luksusowy model w eleganckim kolorze ze szklanym pierścieniem na górze jest stworzony dla każdego, kto chce wykorzystać zegarek do wyrażania siebie. Nylonowy pasek zapewnia komfort noszenia.', '', 'expression-one-watch', '', '', '', 'Expression One Watch', '', '', '', ''),
(1277, 1, 1, 'Dominuj na boisku i zmień przebieg meczu w tych ochraniaczach do getrów piłkarskich dla chłopaków. Mają wbudowaną osłonę, która zapewnia bezpieczną, stałą ochronę.', '', 'ochraniacze-do-getrow-pilkarskich', '', '', '', 'Ochraniacze do getrów piłkarskich', '', '', '', ''),
(1278, 1, 1, 'Zadbaj o komfort tej pomysłowej głowy i przygotuj ją do zabawy. Wybierz czapkę beanie dla dzieci w jasnych kolorach, która jest częścią kolekcji Grupy LEGO i adidas. Model z miękkiej przędzy ma gruby brzeg, który zapewnia podwójną porcję ciepła na uszach dzieci. Naszywka LEGO® z przodu stanowi podwójną zabawę.', '', 'czapka-adidas-x-classic-lego', '', '', '', 'Czapka adidas x Classic LEGO®', '', '', '', ''),
(1279, 1, 1, 'Silikonowe czepki do pływania powstały, aby dać dzieciom z długimi włosami swobodę i pewnośc siebie podczas wodnych szaleństw. Dzięki idealnemu, wodoszczelnemu zabezpieczeniu włosów przed chlorowaną wodą w basenie lub słoną wodą morską, dzieci będą mieć suche, nieuszkodzone włosy podczas pływania.', '', 'soul-cap-junior-volume-cap', '', '', '', 'SOUL CAP Junior Volume Cap', '', '', '', ''),
(1280, 1, 1, 'Piłka adidas Tiro League Sala to piłka w rozmiarze 3 przeznaczona do futsalu i stworzona, aby zachęcać do podań i szlifowania umiejętności drużynowych na małej przestrzeni. Konstrukcja o niskiej sprężystości została zaprojektowana z myślą o szybkich podaniach, a bezszwowa powłoka zapewnia doskonały kontakt z piłką i wygodę. Niezależnie od tego, czy dopiero zaczynasz przygodę z futsalem, jesteś doświadczonym zawodnikiem, czy po prostu chcesz popracować nad swoimi trikami, piłka Tiro League Sala to doskonały sposób na poprawę kontaktu z piłką i udoskonalenie Tiki-Taka.', '', 'tiro-league-sala-ball', '', '', '', 'Tiro League Sala Ball', '', '', '', ''),
(1281, 1, 1, 'Wygodny czepek do pływania powstał z myślą o dziewczynkach i chłopcach z różnymi rodzajami włosów. Silikonowe czepki, które stanowią wodoszczelną barierę między włosami dzieci a chlorowaną wodą w basenie lub słoną wodą morską, nie zawierają lateksu, dzięki czemu są bezpieczne dla włosów i skóry.', '', 'soul-cap-junior-regular-cap', '', '', '', 'SOUL CAP Junior Regular Cap', '', '', '', ''),
(1282, 1, 1, 'Najszybszy prezent, z którym nie możesz się pomylić. Kupuj już teraz, a produkty adidas wybierzesz później.', '', 'e-karta-podarunkowa', '', '', '', 'E-KARTA PODARUNKOWA', '', '', '', ''),
