(1293, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Buty piłkarskie z kultowymi detalami i przednią częścią stopy z cielęcej skóry wyglądają kultowo i noszą się świetnie. Gumowa podeszwa zewnętrzna z wypustkami zapewnia Ci styl podczas gdy na sztucznej murawie.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-league-tf', '', '', '', 'Buty Copa Pure II League TF', '', '', '', ''),
(1294, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Młodzieżowe buty piłkarskie z legendarnymi detalami i przednią częścią stopy z syntetycznej skóry mają kultowy look i teksturę. Podeszwa zewnętrzna dostosowana do gry na naturalnej nawierzchni zapewnia styl na suchej, naturalnej trawie. \n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-league-fg', '', '', '', 'Buty Copa Pure II League FG', '', '', '', ''),
(1295, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Buty piłkarskie łączące kultowy design z przełomową wydajnością mają pikowaną przednią część stopy ze skóry Fusionskin, która zapewnia doskonały kontakt z piłką. Specjalistyczna podeszwa zewnętrzna gwarantuje pewną grę na naturalnej nawierzchni.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-elite-fg', '', '', '', 'Buty Copa Pure II Elite FG', '', '', '', ''),
(1296, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Buty piłkarskie łączące kultowy design z przełomową wydajnością mają pikowaną przednią część stopy ze skóry Fusionskin, która zapewnia doskonały kontakt z piłką. Specjalistyczna podeszwa zewnętrzna gwarantuje pewną grę na naturalnej nawierzchni.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-elite-fg', '', '', '', 'Buty Copa Pure II Elite FG', '', '', '', ''),
(1297, 1, 1, 'Czas i przestrzeń. Wszystko jest względne, gdy grasz w innym wymiarze. Wkrocz do świata wielowymiarowej prędkości w butach adidas X Speedportal. Te buty piłkarskie powstały z myślą o błyskawicznych zmianach kierunku i szybkości na sztucznej murawie. Miękka i trwała, powlekana, tekstylna cholewka pomoże Ci kontrolować piłkę, gdy akcja na boisku nabiera tempa. Pianka EVA amortyzuje każdy krok.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-x-speedportal4-tf', '', '', '', 'Buty X Speedportal.4 TF', '', '', '', ''),
(1298, 1, 1, 'Dobrzy zawodnicy potrafią znaleźć dobrą okazję. Wybitni zawodnicy sami je tworzą. Wkrocz do świata wielowymiarowej szybkości w butach adidas X Speedportal. Te buty piłkarskie zostały stworzone z myślą o szybkich zmianach kierunku i prędkości, która pozwoli Ci zmienić przebieg meczu na naturalnej nawierzchni, twardej nawierzchni i sztucznej trawie. Miękka i trwała, powlekana, tekstylna cholewka ułatwia bliski kontakt z piłką.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-x-speedportal4-fg', '', '', '', 'Buty X Speedportal.4 FG', '', '', '', ''),
(1299, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(1300, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(1301, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Buty piłkarskie z kultowymi detalami i przednią częścią stopy z cielęcej skóry wyglądają kultowo i noszą się świetnie. Podeszwa zewnętrzna dostosowana do gry na naturalnej nawierzchni zapewnia styl na suchej, naturalnej trawie. \n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych opadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-league-fg', '', '', '', 'Buty Copa Pure II League FG', '', '', '', ''),
(1302, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Buty piłkarskie z kultowymi detalami i przednią częścią stopy z cielęcej skóry wyglądają kultowo i noszą się świetnie. Podeszwa zewnętrzna dostosowana do gry na naturalnej nawierzchni zapewnia styl na suchej, naturalnej trawie. \n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-league-fg', '', '', '', 'Buty Copa Pure II League FG', '', '', '', ''),
(1303, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy-fg', '', '', '', 'Buty PREDATOR ACCURACY+ FG', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1304, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te niesznurowane buty piłkarskie do gry na miękkiej nawierzchni mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-sg', '', '', '', 'Buty Predator Accuracy+ SG', '', '', '', ''),
(1305, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Buty piłkarskie, które sprawiają wrażenie lżejszych niż powietrze, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a giętka wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-sg', '', '', '', 'Buty X Crazyfast+ SG', '', '', '', ''),
(1306, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(1307, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Miękka, syntetyczna cholewka tych młodzieżowych butów piłkarskich ma teksturę High Definition na powierzchni całej strefy uderzenia. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Specjalistyczna podeszwa zewnętrzna pozwoli Ci dominować na naturalnej nawierzchni.', '', 'buty-predator-accuracy3-fg', '', '', '', 'Buty Predator Accuracy.3 FG', '', '', '', ''),
(1308, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast1-fg', '', '', '', 'Buty X CRAZYFAST.1 FG', '', '', '', ''),
(1309, 1, 1, '1994 rok. Po raz pierwszy na boisku dostrzeżono nowe buty piłkarskie adidas. Natychmiast powstaje klasyka. Buty piłkarskie Predator Elite FT FG z limitowanej edycji to ukłon w stronę pamiętnych dni. W ramach prawdziwego potwierdzenia ich wyjątkowości dostępnych jest tylko 1994 par, z których każda ma niepowtarzalny numer.\n\nSą tu wszystkie unikalne cechy, które sprawiły, że buty adidas Predator stały się legendą, w tym charakterystyczne, przyczepne gumowe elementy zapewniające lepszą kontrolę nad piłką i odświeżona podeszwa zewnętrzna Hybridtouch2.0 do gry na naturalnej nawierzchni, gwarantująca jeszcze większą stabilizację. Kontroluj tempo gry i dominuj na boisku w ekskluzywnych butach piłkarskich adidas Predator.\n\nTen produkt został wykonany częściowo z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które mają na celu zmniejszenie ilości odpadów i śladu węglowego wytwarzanych przez nas produktów.', '', 'buty-predator-elite-ft-fg', '', '', '', 'Buty Predator Elite FT FG', '', '', '', ''),
(1310, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Przewiewna i elastyczna cholewka z siateczki w tych młodzieżowych butach piłkarskich została zaprojektowana z myślą o komforcie podczas intensywnych rozgrywek. Specjalistyczna, niebrudząca, gumowa podeszwa zewnętrzna pozwoli Ci dominować na hali.', '', 'buty-predator-accuracy3-in', '', '', '', 'Buty Predator Accuracy.3 IN', '', '', '', ''),
(1311, 1, 1, 'Zapomnij o tym, co do tej pory było wiadomo o szybkości. Buty X Crazyfast zostały zaprojektowane z wykorzystaniem lekkich komponentów, zaprojektowanych specjalnie z myślą o przyspieszeniu i dryblingu przy dużej prędkości. Dlatego kiedy wchodzisz na boisko, do klatki lub gdziekolwiek grasz, w X Crazyfast jedyną granicą szybkości jest ta, którą wyznaczasz.', '', 'buty-x-crazyfast3-ll-fg', '', '', '', 'Buty X CRAZYFAST.3 LL FG', '', '', '', ''),
(1312, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Miękka, powlekana, tekstylna cholewka tych butów piłkarskich ma teksturę High Definition w całej strefie kontaktu z piłką. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Specjalistyczna podeszwa zewnętrzna pozwoli Ci dominować na naturalnej nawierzchni.', '', 'buty-predator-accuracy3-fg', '', '', '', 'Buty Predator Accuracy.3 FG', '', '', '', ''),
(1313, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Powlekana, tekstylna cholewka bez sznurowadeł w tych butach piłkarskich ma teksturę High Definition na całej powierzchni strefy uderzenia. Ma wytłaczane elementy i wypukły nadruk, które pomogą Ci przy każdym podaniu i strzale. Gumowa podeszwa zewnętrzna z wypustkami pozwoli Ci dominować na sztucznej murawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-predator-accuracy3-laceless-tf', '', '', '', 'Buty Predator Accuracy.3 Laceless TF', '', '', '', ''),
(1314, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie bez sznurowadeł mają mocną, powlekaną, tekstylną przednią część stopy pokrytą teksturą High Definition, która zwiększa przyczepność do piłki. Podeszwa zewnętrzna do gry na naturalnej nawierzchni powstała, aby zapewnić Ci kontrolę na suchych, naturalnych nawierzchniach trawiastych.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy3-laceless-fg', '', '', '', 'Buty Predator Accuracy.3 Laceless FG', '', '', '', ''),
