(1317, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie bez sznurowadeł do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy-ag', '', '', '', 'Buty Predator Accuracy+ AG', '', '', '', ''),
(1318, 1, 1, 'Buty Predator powstały z myślą o strzelaniu goli. Konstrukcja jest precyzyjna i ma moc, dzięki czemu nie przegapisz żadnego uderzenia. Precyzyjne, gumowe elementy 3D wysokiej jakości są rozmieszczone w strefach uderzenia, aby zapewnić precyzyjne podkręcenie i rozmieszczenie piłki. Podeszwa zewnętrzna została zaprojektowana tak, aby przenosić moc na przednią część stopy, co umożliwia perfekcyjne uderzenie, a amortyzacja w kluczowych obszarach kontaktu zwiększa komfort i umożliwia miękki kontakt z piłką.', '', 'buty-predator-accuracy1-fg', '', '', '', 'Buty PREDATOR ACCURACY.1 FG', '', '', '', ''),
(1319, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci pokazać klasę na suchej, naturalnej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-fg', '', '', '', 'Buty Copa Pure II FG', '', '', '', ''),
