(1321, 1, 1, 'Zmień zasady gry w butach piłkarskich X Crazyfast+ FG do gry na naturalnych nawierzchniach. Buty stworzone, aby zapewniać poczucie wyjątkowej lekkości, mają półprzezroczystą cholewkę Aeropacity Speedskin+ ze wzmocnieniami tylko tam, gdzie są potrzebne. Lekkie sznurowadła ułatwiają zakładanie, a PODESZWA ZEWNĘTRZNA SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nZmniejszyliśmy ślad węglowy tego produktu o co najmniej 10% w porównaniu z jego poprzednią wersją. Mniejsza emisja gazów cieplarnianych, w tym CO2, przez cały cykl życia produktu — od jego powstania aż do końca okresu użytkowania.', '', 'buty-x-crazyfast-fg', '', '', '', 'Buty X CRAZYFAST+ FG', '', '', '', ''),
(1322, 1, 1, 'Zmień zasady gry w butach X Crazyfast.1 FG. Gładka, półprzezroczysta cholewka Aeropacity Speedskin sprawia, że te buty piłkarskie mają wzmocnienia tylko tam, gdzie są potrzebne. adidas PRIMEKNIT bez sznurowadeł gwarantuje pewne i wygodne dopasowanie, a podeszwa zewnętrzna SPEEDFRAME z AEROPLATE powstała z myślą o przyspieszeniu i dynamicznych ruchach. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-ll-fg', '', '', '', 'Buty X CRAZYFAST.1 LL FG', '', '', '', ''),
(1323, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te niesznurowane buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci maksymalnej prędkości na miękkiej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-laceless-sg', '', '', '', 'Buty X Crazyfast.1 Laceless SG', '', '', '', ''),
