(1339, 1, 1, 'Świętujemy trwały ślad, jaki Lionel Messi na odcisnął w świecie piłki nożnej. Te buty mają półprzezroczystą cholewkę Aeropacity Speedskin z akcentami w kolorze charakterystycznego dla Argentyny błękitu i srebra inspirowanego pucharami oraz wzmocnienia tam, gdzie są one najbardziej potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a elastyczna wkładka Aeroplate w podeszwie zewnętrznej Speedframe dodaje Ci prędkości godnej G.O.A.T. na naturalnej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-x-crazyfast-messi1-fg', '', '', '', 'Buty X Crazyfast Messi.1 FG', '', '', '', ''),
(1340, 1, 1, 'Górny róg. Dolny róg. Każdy róg. Model adidas Predator Accuracy powstał z myślą o celnych strzałach i daje Ci pewność, że piłka trafi do bramki. Haczyk tkwi w wyborze sposobu. Te buty piłkarskie do gry na sztucznej trawie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip, które zapewniają doskonałą przyczepność do piłki, nie ograniczając elastyczności przedniej części stopy. Power Facet w dzielonej podeszwie zewnętrznej dodaje energii każdemu kopnięciu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-ag', '', '', '', 'Buty Predator Accuracy.1 AG', '', '', '', ''),
(1341, 1, 1, 'Wyrusz w podróż z butami 11Pro i świętuj ich 10. rocznicę, wybierając tę ekskluzywną, limitowaną edycję.\n\nButy 11Pro FG są częścią kolekcji, która oddaje hołd niezniszczalnej więzi między piłkarzem a jego butami. Wykonana z wyjątkową dbałością o szczegóły, nowoczesna podeszwa zewnętrzna Copa Pure do gry na naturalnej nawierzchni stabilizuje ruchy, a cholewka ze skóry Taurus zapewnia miękki kontakt z piłką i optymalny komfort. Design z zapięciem na sznurowadła zapewnia bezpieczne dopasowanie i odtwarza design butów, w których niemiecki piłkarz Toni Kroos zakochał się przed laty.', '', 'buty-11pro-fg', '', '', '', 'Buty 11Pro FG', '', '', '', ''),
(1342, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Te buty premium stawiają na luksus dzięki elastycznemu kołnierzowi adidas PRIMEKNIT i pikowanej przedniej części stopy ze skóry Fusionskin, rozciągniętej na warstwach giętkiej pianki. Specjalistyczna podeszwa zewnętrzna pomoże Ci grać z klasą na mokrej trawie. Dopracowane detale na całej powierzchni, w tym kontrastowa osłona pięty, podkreślają Twój piłkarski styl.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-copa-pure-ii-sg', '', '', '', 'Buty Copa Pure II SG', '', '', '', ''),
