(1419, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te niesznurowane buty piłkarskie dla młodzieży mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Kołnierz adidas PRIMEKNIT blokuje stopę, a dodatkowe kołki w przedniej części podeszwy zewnętrznej z TPU ułatwiają przyspieszanie na naturalnej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-laceless-fg', '', '', '', 'Buty X Crazyfast.1 Laceless FG', '', '', '', ''),
(1420, 1, 1, 'Kiedy te buty dotykają piłki dzieje się historia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Wyglądaj i czuj się jak ikona stylu w butach piłkarskich z pikowaną przednią częścią stopy ze skóry Fusionskin, która zapewnia dobre wyczucie piłki. Specjalistyczna podeszwa zewnętrzna zapewnia Ci klasę na naturalnej nawierzchni. Wyróżniające się detale obejmują opalizujące 3 paski i kontrastowy migający element na pięcie.', '', 'buty-copa-pure-ii2-fg', '', '', '', 'Buty Copa Pure II.2 FG', '', '', '', ''),
(1421, 1, 1, 'Już po meczu? Eee, nie. Ty przecież tylko czekasz na dobry moment, aby odwrócić jego przebieg. Znowu. I jeszcze raz, i jeszcze. Lubisz trzymać rywali w niepewności? Pokaż swoją dziką naturę w butach adidas X Crazyfast. Te buty piłkarskie mają półprzezroczystą cholewkę Aeropacity Speedskin i wzmocnienia tylko tam, gdzie są potrzebne. Niskoprofilowa podeszwa środkowa Lightstrike daje dobre wyczucie podłoża, a przyczepna, gumowa podeszwa zewnętrzna z wypustkami wbija się w murawę, gdy wykonujesz szybkie zwroty i ruchy w bok na sztucznej murawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-x-crazyfast1-tf', '', '', '', 'Buty X Crazyfast.1 TF', '', '', '', ''),
