(1425, 1, 1, 'Pamiętasz, dlaczego nazywamy ten sport piękną grą? Buty adidas Copa Pure eliminują czynniki rozpraszające, zapewniając Ci niczym niezakłócony komfort i doskonały kontakt z piłką. Cholewka tych młodzieżowych butów piłkarskich ma look inspirowany bogatą tradycją Copa i miękką przednią część stopy z syntetycznej skóry, która zapewnia natychmiastowy komfort i pozwala na grę bez czynników rozpraszających. Specjalistyczna podeszwa zewnętrzna zapewnia stabilizację na suchej, naturalnej trawie, dzięki czemu wyróżnisz się z tłumu.', '', 'buty-copa-pure3-fg', '', '', '', 'Buty Copa Pure.3 FG', '', '', '', ''),
(1426, 1, 1, 'adidas Predator ― dla zawodników, którzy nigdy nie pudłują.  Chcesz przenieść moc, aby wykonać perfekcyjne uderzenie? Lubisz kontrolować rotację i położenie piłki, a jednocześnie chciałbyś cieszyć się komfortem i miękkim kontaktem z piłką? Te buty Predator Accuracy są dla Ciebie. Design wykorzystujący zaawansowane technologie gwarantuje doskonale wyniki za każdym razem.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-fg', '', '', '', 'Buty Predator Accuracy.1 FG', '', '', '', ''),
(1427, 1, 1, 'Kiedy te buty dotykają piłki nic innego nie ma znaczenia. Klasyczne i wygodne. Kiedy zakładasz adidas Copa Pure, wszystko staje się możliwe. Cofnij się do przeszłości w młodzieżowych butach piłkarskich, które wyglądają i czują się jak kultowy model. Przednia część stopy z miękkiej, syntetycznej skóry i specjalistyczna podeszwa zewnętrzna współpracują, dając Ci jedwabiście gładki kontakt z piłką na naturalnej nawierzchni. Kontrastowe migawki na pięcie, nawiązujące do bogatego dziedzictwa Copa, zajmują centralne miejsce wśród wielu subtelnych detali.', '', 'buty-copa-pure-ii3-fg', '', '', '', 'Buty Copa Pure II.3 FG', '', '', '', ''),
(1428, 1, 1, 'Aby rozgrywać dobry mecz, musisz mieć wsparcie kolegów z drużyny i kontrolę nad piłką. Ciesz się swobodą ruchów w wygodnych, klasycznych butach adidas Copa Pure II. Młodzieżowe buty piłkarskie z legendarnymi detalami i przednią częścią stopy z syntetycznej skóry mają kultowy look i teksturę. Podeszwa zewnętrzna dostosowana do gry na naturalnej nawierzchni zapewnia styl na suchej, naturalnej trawie. \n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-copa-pure-ii-league-fg', '', '', '', 'Buty Copa Pure II League FG', '', '', '', ''),
(1429, 1, 1, 'Kontrola + precyzja = pewność siebie. Kiedy masz przed oczami cel, postaw na perfekcyjne rozwiązania z adidas Predator Accuracy. Te młodzieżowe buty piłkarskie mają miękką cholewkę HybridTouch z gumowymi elementami High Definition Grip w strefie uderzenia. Zapewniają solidną przyczepność do piłki, a także elastyczność przedniej części stopy, gwarantując komfort w ruchu. Specjalistyczna podeszwa zewnętrzna zapewnia kontrolę na naturalnej nawierzchni.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-predator-accuracy1-fg', '', '', '', 'Buty Predator Accuracy.1 FG', '', '', '', ''),
