(1432, 1, 1, 'Serce i dusza klasowej piłki nożnej. Wzorowane na legendarnym modelu Copa Mundial buty adidas Copa Icon utrzymują piłkę przy stopie dzięki miękkiej, otulającej przedniej części buta wykonanej z cielęcej skóry i wykończonej klasycznymi przeszyciami. W środku wyściółka kołnierza i język z syntetycznego zamszu zapewniają Ci komfort, gdy pokazujesz światu, jak to się robi. Lekka podeszwa zewnętrzna do gry na naturalnej nawierzchni oferuje stabilizację na suchej, naturalnej trawie.', '', 'buty-copa-icon-fg', '', '', '', 'Buty Copa Icon FG', '', '', '', ''),
(1433, 1, 1, 'Pasja zmienia zwykły sport w piękną grę. Zakochaj się ponownie w piłce nożnej w butach adidas Copa Gloro. Pokaż swoją klasę dzięki miękkiej cholewce ze skóry, która dopasowuje się do stopy, zapewniając pewny kontakt z piłką zmierzającą w Twoją stronę. Podeszwa środkowa z pianki EVA osadzona na gumowej podeszwie zewnętrznej z wypustkami amortyzuje każdy krok na sztucznej murawie. Przeszycia nadają całości ponadczasowy look.', '', 'buty-copa-gloro-tf', '', '', '', 'Buty Copa Gloro TF', '', '', '', ''),
(1434, 1, 1, 'adidas Predator ― dla zawodników, którzy nigdy nie pudłują.  Chcesz przenieść moc, aby wykonać perfekcyjne uderzenie? Lubisz kontrolować rotację i położenie piłki, a jednocześnie chciałbyś cieszyć się komfortem i miękkim kontaktem z piłką? Te buty Predator Accuracy są dla Ciebie. Design wykorzystujący zaawansowane technologie gwarantuje doskonale wyniki za każdym razem.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-predator-accuracy1-low-fg', '', '', '', 'Buty Predator Accuracy.1 Low FG', '', '', '', ''),
(1435, 1, 1, 'Buty Adistar CS 2.0 zostały zaprojektowane, aby przenieść Twój codzienny bieg na wyższy poziom. Buty do biegania, które zrodziły się z idei perpetuum mobile, wspierają rytmiczny bieg, który pomoże Ci osiągnąć wyznaczone cele. Mają podeszwę środkową REPETITOR+ o zwiększonej gęstości, która stabilizuje każdy krok i wspiera płynne przetoczenie stopy pomiędzy krokami. Asymetryczny system sznurowania łączy się ze stabilną ramą Repetitor Plus i wzmocnioną warstwą siateczki, aby zapewnić Ci stabilizację na każdym kroku. Dodaj do tego specjalną geometrię buta i ruszaj przed siebie, aby pobić życiówkę.', '', 'buty-adistar-cs-20', '', '', '', 'Buty Adistar CS 2.0', '', '', '', ''),
