(1443, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(1444, 1, 1, 'Niczym szybkie przewijanie do przodu. Buty adidas Adizero Avanti redukują zmęczenie, dzięki czemu możesz swobodnie pokonać dystans 5 i 10 kilometrów. Połączyliśmy nasze dwie najlepsze technologie biegowe i dostosowaliśmy je do wymogów bieżni. Warstwa Lightstrike Pro nad płytką z kolcami zapewnia maksymalną amortyzację, a ENERGYRODS gwarantują odpowiednią dynamikę biegu i wysoką przyczepność.', '', 'adizero-avanti-tyo-shoes', '', '', '', 'Adizero Avanti TYO Shoes', '', '', '', ''),
(1445, 1, 1, 'Do biegu. Gotowi. Start. Ruszaj do akcji w butach do biegania adidas stworzonych z myślą o biegach na bieżni na średnich i długich dystansach. Redukujący zmęczenie model łączy superlekką i sprężystą amortyzację Lightstrike z ENERGYRODS, które ograniczają utratę energii. Całość osadzona jest na syntetycznej podeszwie zewnętrznej z płytką z kolcami, aby zapewnić Ci dynamiczny bieg do linii mety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-adizero-avanti-tyo-track-and-field-lightstrike', '', '', '', 'Buty Adizero Avanti Tyo Track and Field Lightstrike', '', '', '', ''),
(1446, 1, 1, 'Do biegu. Gotowi. Start. Ruszaj do akcji w butach do biegania adidas stworzonych z myślą o biegach na bieżni na średnich i długich dystansach. Redukujący zmęczenie model łączy superlekką i sprężystą amortyzację Lightstrike z ENERGYRODS, które ograniczają utratę energii. Całość osadzona jest na syntetycznej podeszwie zewnętrznej z płytką z kolcami, aby zapewnić Ci dynamiczny bieg do linii mety.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-adizero-avanti-tyo-track-and-field-lightstrike', '', '', '', 'Buty Adizero Avanti Tyo Track and Field Lightstrike', '', '', '', ''),
(1447, 1, 1, 'Wybierz szlak i znajdź swój szczyt. Wybierz buty adidas do biegów przełajowych, które sprawdzą się zarówno na wyżynach, jak i na nizinach oraz na mokrych i suchych nawierzchniach. Mocna konstrukcja łączy niezrównaną przyczepność podeszwy zewnętrznej z gumy Continental™ z lekkim, ale trwałym designem, który sprawdzi się na ulicy, szlaku i w drodze powrotnej. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a cholewka z siateczki zapewnia otulający stopę komfort na każdym kroku. W połączeniu ze sprężystą amortyzacją Lightstrike w podeszwie środkowej model zapewnia Ci pewny krok i przedłużony komfort, gdy biegasz po szlaku.', '', 'terrex-agravic-flow-gore-tex-trail-running-shoes-20', '', '', '', 'Terrex Agravic Flow GORE-TEX Trail Running Shoes 2.0', '', '', '', ''),
(1448, 1, 1, 'Szlaki leśne lub zróżnicowany teren. Wybierz to, co pasuje Ci najbardziej. Buty adidas do biegów przełajowych sprawdzą się zarówno na wyżynach, jak i na nizinach oraz na mokrych i suchych nawierzchniach. Mocny design łączy niezrównaną przyczepność podeszwy zewnętrznej z gumy Continental™ z mocną, zapewniającą zwinne ruchy konstrukcją, która sprawdzi się zarówno na ulicy, jak i na szlaku. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a cholewka z siateczki zapewnia otulający stopę komfort na każdym kroku. Sprężysta amortyzacja Lightstrike w podeszwie środkowej gwarantuje pewny krok i długotrwały komfort, gdy biegasz po szlaku.', '', 'terrex-agravic-flow-20-gore-tex-trail-running-shoes', '', '', '', 'Terrex Agravic Flow 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(1449, 1, 1, 'Te buty adidas do biegów przełajowych sprawdzą się w każdej sytuacji. Tylko wybierz szlak. Lekka i wygodna, bardzo sprężysta podeszwa środkowa zapewnia amortyzację, która sprawdzi się podczas biegu w dół. Guma Continental™ zapewnia nadzwyczajną przyczepność na nierównym terenie, na mokrych i suchych nawierzchniach, a podeszwa środkowa chroni przed kamieniami, dzięki czemu te buty sprawdzą się na technicznych szlakach.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'terrex-agravic-flow-trail-running-shoes-20', '', '', '', 'Terrex Agravic Flow Trail Running Shoes 2.0', '', '', '', ''),
(1450, 1, 1, 'Wybierz szlak i znajdź swój szczyt. Wybierz buty adidas do biegów przełajowych, które sprawdzą się zarówno na wyżynach, jak i na nizinach oraz na mokrych i suchych nawierzchniach. Mocna konstrukcja łączy niezrównaną przyczepność podeszwy zewnętrznej z gumy Continental™ z lekkim, ale trwałym designem, który sprawdzi się na ulicy, szlaku i w drodze powrotnej. Wodoodporna, oddychająca membrana GORE-TEX nie przepuszcza wilgoci, a cholewka z siateczki zapewnia otulający stopę komfort na każdym kroku. W połączeniu ze sprężystą amortyzacją Lightstrike w podeszwie środkowej model zapewnia Ci pewny krok i przedłużony komfort, gdy biegasz po szlaku.', '', 'terrex-agravic-flow-gore-tex-trail-running-shoes-20', '', '', '', 'Terrex Agravic Flow GORE-TEX Trail Running Shoes 2.0', '', '', '', ''),
(1451, 1, 1, 'Ciesz się komfortem i pewnością siebie podczas pierwszego maratonu lub swobodnego biegu po okolicy. Te buty do biegania adidas zostały zaprojektowane zarówno dla początkujących, jak i dla zapalonych biegaczy. Podeszwa środkowa Dreamstrike+ została stworzona z myślą o komforcie, a pręty wspierające prowadzą stopę, gwarantując płynne przetoczenie stopy na wyższy poziom. Wycięcia w podeszwie zewnętrznej zmniejszają wagę, dzięki czemu możesz skoncentrować się na treningu. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-supernova-rise', '', '', '', 'Buty Supernova Rise', '', '', '', ''),
(1452, 1, 1, 'Spójność to klucz do sukcesu. Nie rezygnuj z biegania w butach do biegania adidas stworzonych z myślą o komforcie i wsparciu, które robią różnicę. Podeszwa środkowa Dreamstrike+ amortyzuje każde lądowanie. Mocna podeszwa zewnętrzna Adiwear zapewnia niezawodną przyczepność. \n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-supernova-rise', '', '', '', 'Buty Supernova Rise', '', '', '', ''),
(1453, 1, 1, 'Stride through the city on a 3D-printed midsole that provides impact absorption and stability on your daily run. adidas 4DFWD X STRUNG running shoes glide across pavement, powered by the industry\'s most innovative technology. Coded for the perfect fit, the upper provides seamless, cocoon-like containment for your foot, while the grippy, durable Continental™ Rubber outsole sticks to the street and keeps you grounded along your route. \n\nThis product features at least 20% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.', '', '4dfwd-x-strung-4d-running-shoes', '', '', '', '4DFWD x STRUNG 4D Running Shoes', '', '', '', ''),
(1454, 1, 1, 'Buty Prime X 2 Strung, stworzone z wykorzystaniem innowacyjnej technologii i zaprojektowane bez konieczności przestrzegania globalnych ograniczeń wynikających z przepisów dotyczących konkurencji biegowych, oferują jeszcze lepsze parametry techniczne designu wyścigowego. Tekstylna, innowacyjna cholewka STRUNG bazuje na danych pozyskanych od sportowców i przekształconych w dynamiczny materiał dostosowany do ich potrzeb. Prime X 2 Strung ma również 3 warstwy LIGHTSTRIKE PRO o łącznej grubości 50 mm. Zupełnie nowy rdzeń dodający energii między dwiema warstwami pianki pomaga zmniejszyć wagę i zapewnia sprężystość w przedniej i środkowej części stopy, dzięki czemu możesz ścigać się z własną życiówką. Podeszwa zewnętrzna z mieszanki Continental zapewnia doskonałą przyczepność na różnych nawierzchniach.', '', 'buty-adizero-prime-x-20-strung', '', '', '', 'Buty Adizero Prime X 2.0 STRUNG', '', '', '', ''),
(1455, 1, 1, 'Łatwiej osiągnąć swoje cele treningowe, gdy masz parę sprawdzonych, wygodnych butów na co dzień. \n\nPoznaj buty Solarboost 5. Model, który zapewnia równowagę między wsparciem, amortyzacją i zwrotem energii, łączy sprężystą piankę Light BOOST z przewiewną cholewką z siateczki. System Linear Energy Push dodaje Ci energii na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-solarboost-5', '', '', '', 'Buty Solarboost 5', '', '', '', ''),
(1456, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(1457, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(1458, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(1459, 1, 1, 'Startuj. Ląduj. I jeszcze raz. Biegi długodystansowe to stawianie jednej stopy przed drugą — tak przez dłuższy czas. Buty adidas Adistar 2.0 powstały to, by udało Ci się pobiec jeszcze dalej.\n\nPodeszwa środkowa łączy dwa rodzaje pianki EVA: REPETITOR to lekka pianka, która zwiększa sprężystość butów, a REPETITOR+ to twardsza mieszanka, która otula piętę. Cholewka z siateczki blokuje stopę i zapewnia wsparcie, dzięki czemu możesz biegać krok po kroku, kilometr po kilometrze, a podeszwa zewnętrzna z gumy Continental™ gwarantuje nadzwyczajną trakcję na mokrych i suchych nawierzchniach.', '', 'buty-adistar-20', '', '', '', 'Buty Adistar 2.0', '', '', '', ''),
(1460, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(1461, 1, 1, 'Buty Prime X 2 Strung, stworzone z wykorzystaniem innowacyjnej technologii i zaprojektowane bez konieczności przestrzegania globalnych ograniczeń wynikających z przepisów dotyczących konkurencji biegowych, oferują jeszcze lepsze parametry techniczne designu wyścigowego. Tekstylna, innowacyjna cholewka STRUNG bazuje na danych pozyskanych od sportowców i przekształconych w dynamiczny materiał dostosowany do ich potrzeb. Prime X 2 Strung ma również 3 warstwy LIGHTSTRIKE PRO o łącznej grubości 50 mm. Zupełnie nowy rdzeń dodający energii między dwiema warstwami pianki pomaga zmniejszyć wagę i zapewnia sprężystość w przedniej i środkowej części stopy, dzięki czemu możesz ścigać się z własną życiówką. Podeszwa zewnętrzna z mieszanki Continental zapewnia doskonałą przyczepność na różnych nawierzchniach.', '', 'buty-adizero-prime-x-20-strung', '', '', '', 'Buty Adizero Prime X 2.0 STRUNG', '', '', '', ''),
(1462, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1463, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(1464, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Oddychająca membrana GORE-TEX zapewnia suchy komfort stopom, gdy pluskasz się w kałużach. Podeszwa środkowa BOOST jest najlżejsza jak do tej pory — lekka pianka BOOST — zwraca więcej energii niż kiedykolwiek, zapewniając Ci siłę podczas mżawki i ulewy. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(1465, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(1466, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Membrana GORE-TEX sprawdzi się, gdy pokonujesz kałuże. Od spodu najlżejsza podeszwa środkowa BOOST — lekka pianka BOOST — dodaje Ci energii na każdym kroku. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(1467, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(1468, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(1469, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(1470, 1, 1, 'Poczuj płynność biegu w butach do biegania Ultra 4DFWD. Łączą cholewkę naszych kultowych butów Ultraboost z podeszwą środkową adidas 4DFWD z nadrukiem 3D, która została udoskonalona tak, aby kompresja do przodu zmniejszała siłę hamowania i przekształcała energię uderzenia w ruch naprzód. Gwarantuje to płynne przetoczenie stopy i wyjątkowe wrażenia niczym podczas szybowania. Cholewka adidas PRIMEKNIT otula stopę, zapewniając jej dynamiczne wsparcie w strategicznych obszarach, a podeszwa zewnętrzna z gumy Continental™ zwiększa przyczepność w każdych warunkach pogodowych.', '', 'ultra-4dfwd-shoes', '', '', '', 'Ultra 4DFWD Shoes', '', '', '', ''),
(1471, 1, 1, 'Niezależnie od tego, czy wybierasz się na górski szlak, czy na wypad do ulubionej kawiarni, te buty do biegania adidas zapewnią Ci amortyzację. Podeszwa środkowa Cloudfoam oferuje natychmiastowy komfort, który nigdy się nie kończy, a tekstylna cholewka gwarantuje wsparcie i przewiewność. Gumowa podeszwa zewnętrzna trzyma się nawierzchni w zmiennym terenie, ułatwiając pewny krok.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-tr-shoes', '', '', '', 'Runfalcon 3 TR Shoes', '', '', '', ''),
(1472, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(1473, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(1474, 1, 1, 'Znajdź swój rytm w dobrym stylu dzięki butom Earthlight z kolekcji adidas by Stella McCartney, które są równie efektowne jak efektywne. \n\nButy będące doskonałym wyborem na miejskie biegi na dystansie do 10 km mają przyczepną, gumową podeszwę zewnętrzną o unikalnym designie. Została zaprojektowana tak, aby zapewniać optymalne wsparcie przy wybiciu do przodu i płynne przetaczanie stopy podczas pokonywania kolejnych kilometrów. \n\nCholewka z przewiewnej siateczki gwarantuje chłód podczas biegu, a podeszwa środkowa z pianki EVA wspiera każdy Twój krok. \n\nAby zyskać jak najlepszy efekt, zestaw buty z innymi modelami z kolekcji adidas by Stella McCartney.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% składu przędy stanowi poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-earthlight-mesh-shoes', '', '', '', 'adidas by Stella McCartney Earthlight Mesh Shoes', '', '', '', ''),
(1475, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl', '', '', '', 'ADIZERO SL', '', '', '', ''),
(1476, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX mokre, śliskie nawierzchnie nie stanowią problemu. Wodoodporny, oddychający GORE-TEX pomaga Ci pokonywać kolejne kilometry w wilgotne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia odpowiednią przyczepność na każdym kroku. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(1477, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(1478, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nNie pozwól, by spadająca temperatura powstrzymała Cię przed długim biegiem. Buty Adistar COLD.RDY dbają o ciepły komfort stóp kilometr po kilometrze dzięki izolacji COLD.RDY. Dwa rodzaje pianki tworzą podeszwę środkową o podwójnej gęstości, która amortyzuje i wspiera każdy krok, aby pomóc Ci dotrzeć dalej niż sądzisz, że to możliwe. Wodoodporna cholewka i wyjątkowo mocna podeszwa zewnętrzna z gumy Continental™ dodadzą Ci pewności siebie w każdych warunkach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-adistar-coldrdy', '', '', '', 'Buty Adistar COLD.RDY', '', '', '', ''),
(1479, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(1480, 1, 1, 'W tym sezonie stylowa kolekcja adidas by Stella McCartney przypomina nam o radości, jaką daje ruch na łonie natury. Techniczne detale łączą się z modnymi, inspirowanymi Ziemią motywami ― od psychodelicznych drzew i kamuflażowych wzorów po wzory słojów w przekroju drzewa. Kolekcja oddaje hołd niezrównanemu pięknu przyrody, inspirując Cię do przeniesienia treningu na świeże powietrze. \n\nWysokowydajne buty w modnym stylu. Przedstawiamy buty ULTRABOOST 23 — Twój nowy ulubiony towarzysz codziennych biegów. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Buty ze wspierającą cholewką z siateczki w modnych kolorach pomogą Ci się subtelnie wyróżnić, gdy pokonujesz kolejne kilometry.', '', 'adidas-by-stella-mccartney-ultraboost-speed', '', '', '', 'adidas by Stella McCartney ULTRABOOST SPEED', '', '', '', ''),
(1481, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(1482, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(1483, 1, 1, 'Od drzwi Twojego domu po szlak i z powrotem buty TERREX SOULSTRIDE FLOW są Twoim partnerem podczas długich przygód w outdoorze. Buty do biegów przełajowych z miękką amortyzacją z lekkiej pianki EVA powstały, aby zapewnić Ci swobodę ruchu. Podeszwa zewnętrzna z gumy Continental™ doskonale trzyma się korzeni, kamieni i ziemi, a cholewka z siateczki o specjalnej konstrukcji gwarantuje optymalny podział na strefy, przewiewność, elastyczność i idealne dopasowanie.', '', 'terrex-soulstride-flow-trail-running-shoes', '', '', '', 'TERREX Soulstride Flow Trail Running Shoes', '', '', '', ''),
(1484, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1485, 1, 1, 'Niezależnie od tego, jak daleko zaprowadzi Cię bieg, buty z kolekcji adidas by Stella McCartney wspierają każdy Twój krok. Ich ultralekki i dopasowujący się design sprawi, że pokonanie kolejnego odcinka lub kilometra (może nawet dwóch) zawsze będzie możliwe. Pluszowa amortyzacja BOOST zwraca energię, którą wkładasz w bieg, dzięki czemu będzie to też naprawdę łatwe.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy pochodzącej z recyklingu, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z przetworzonych plastikowych odpadów zebranych na odległych wyspach, plażach i w nadmorskich miejscowościach w celu zapobiegania zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'adidas-by-stella-mccartney-ultraboost-20-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost 20 Shoes', '', '', '', ''),
(1486, 1, 1, 'Buty Adistar CS 2.0 zostały zaprojektowane, aby przenieść Twój codzienny bieg na wyższy poziom. Buty do biegania, które zrodziły się z idei perpetuum mobile, wspierają rytmiczny bieg, który pomoże Ci osiągnąć wyznaczone cele. Mają podeszwę środkową REPETITOR+ o zwiększonej gęstości, która stabilizuje każdy krok i wspiera płynne przetoczenie stopy pomiędzy krokami. Asymetryczny system sznurowania łączy się ze stabilną ramą Repetitor Plus i wzmocnioną warstwą siateczki, aby zapewnić Ci stabilizację na każdym kroku. Dodaj do tego specjalną geometrię buta i ruszaj przed siebie, aby pobić życiówkę.', '', 'buty-adistar-cs-20', '', '', '', 'Buty Adistar CS 2.0', '', '', '', ''),
(1487, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Innowacyjna podeszwa środkowa adidas 4D z nadrukiem 3D i nową konstrukcją przypominającą kratownicę przekształca siły uderzenia w ruch do przodu wspierana przez nadzwyczajną przyczepność podeszwy zewnętrznej z gumy Continental™. Cholewka z lekkiej, oddychającej monosiateczki z kołnierzem PRIMEKNIT wokół kostki gwarantuje stopom komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1488, 1, 1, 'Wynieś swój bieg na wyższy poziom dzięki tym butom do biegania adidas. Buty nazwane na cześć rewolucyjnej podeszwy środkowej drukowanej w technologii 3D pochłaniają siłę uderzenia i dodają Ci przyspieszenia na każdym kroku. Cholewka adidas Primeknit otula Twoją stopę, zapewniając przewiewny komfort i wspierając naturalne ruchy na ulicach miasta. Podeszwa zewnętrzna z gumy Continental™ gwarantuje przyczepność, dzięki czemu możesz biegać w deszczu lub słońcu. Niezależnie od tego, czy trenujesz na dystansie 5 kilometrów, czy po prostu biegniesz, ile sił w nogach, buty 4DFWD uprzyjemnią Ci każdy bieg.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1489, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1490, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1491, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-m', '', '', '', 'ADIZERO ADIOS PRO 3 M', '', '', '', ''),
(1492, 1, 1, 'Zdumiewająco lekkie. Bezkompromisowo szybkie. adidas Adizero Adios Pro Evo 1 to nowa klasa butów do biegania, zaprojektowana, aby pomóc ambitnym maratończykom dać z siebie wszystko. Model jest o 40% lżejszy od wszystkich stworzonych przez nas butów do biegania, to zaledwie 138 g czystej innowacji. Pianka Lightstrike Pro łączy się z przełomową technologią podeszwy zewnętrznej, lekką jak piórko siateczką i pierwszym w swoim rodzaju elementem kołyszącym w przedniej części stopy, który został przetestowany laboratoryjnie, aby poprawić ekonomię biegania. Adizero Adios Pro Evo 1 to doskonałe narzędzie do biegania, które pomoże Ci przetrwać cały bieg i dotrzeć do linii mety. Ten model jest gotowy do wyścigu.', '', 'adizero-adios-pro-evo-1', '', '', '', 'Adizero Adios Pro Evo 1', '', '', '', ''),
(1493, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(1494, 1, 1, 'Adizero Adios Pro 3 to pokazowy design z serii Adizero Racing. Został stworzona z myślą o sportowcach, którzy chcą osiągać niewiarygodne wyniki. Te buty do biegania adidas powstały z myślą o optymalnie wydajnym biegu. Nasze ENERGYRODS z włókna węglowego zapewniają sztywność, przy zachowaniu lekkości, dla szybkiego i dynamicznego biegu. Ultralekka podeszwa amortyzuje każdy krok dzięki dwóm warstwom naszej najbardziej sprężystej pianki LIGHTSTRIKE PRO, aby pomóc Ci zachować energię przez długi czas. Cała konstrukcja została osadzona na cienkiej warstwie tekstylno-gumowej podeszwy zewnętrznej, gwarantującej nadzwyczajną przyczepność na mokrych i suchych nawierzchniach.', '', 'adizero-adios-pro-3-w', '', '', '', 'Adizero Adios Pro 3 W', '', '', '', ''),
(1495, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(1496, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(1497, 1, 1, 'W tym sezonie stylowa kolekcja adidas by Stella McCartney przypomina nam o radości, jaką daje ruch na łonie natury. Techniczne detale łączą się z modnymi, inspirowanymi Ziemią motywami ― od psychodelicznych drzew i kamuflażowych wzorów po wzory słojów w przekroju drzewa. Kolekcja oddaje hołd niezrównanemu pięknu przyrody, inspirując Cię do przeniesienia treningu na świeże powietrze. \n\nWysokowydajne buty w modnym stylu. Przedstawiamy buty ULTRABOOST 23 — Twój nowy ulubiony towarzysz codziennych biegów. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Buty ze wspierającą cholewką z siateczki w modnych kolorach pomogą Ci się subtelnie wyróżnić, gdy pokonujesz kolejne kilometry.', '', 'adidas-by-stella-mccartney-ultraboost-speed', '', '', '', 'adidas by Stella McCartney ULTRABOOST SPEED', '', '', '', ''),
(1498, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(1499, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1500, 1, 1, 'Nie ograniczaj się do ulic miasta i pewnie ruszaj na szlak w tych butach adidas do biegów przełajowych. Lekka amortyzacja zapewnia Ci komfort typowy dla butów do biegania w każdym terenie, na chodniku czy szlaku. Wodoodporna, oddychająca membrana GORE-TEX pozwoli Ci odkrywać mokre, błotniste szlaki i kończyć bieg z suchymi stopami. Cholewka z siateczki o dużych oczkach zapewnia przepływ powietrza, a gumowa podeszwa zewnętrzna Traxion gwarantuje przyczepność, dzięki czemu możesz z łatwością poruszać się po śliskich nawierzchniach.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'tracerocker-20-gore-tex-trail-running-shoes', '', '', '', 'Tracerocker 2.0 GORE-TEX Trail Running Shoes', '', '', '', ''),
(1501, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl-w', '', '', '', 'ADIZERO SL W', '', '', '', ''),
(1502, 1, 1, 'Miejskie przygody Cię wzywają. Odpowiedz w tych butach do biegania adidas. Innowacyjna podeszwa środkowa 4D dodaje Ci przyspieszenia na każdym kroku. Cholewka adidas Primeknit otula Twoją stopę, zapewniając przewiewne wsparcie i zwiększając naturalny ruch, gdy biegniesz po chodniku lub odkrywasz boczne ulice. Podeszwa zewnętrzna z gumy Continental™ trzyma się podłoża, gwarantując Ci bezpieczeństwo za każdym rogiem.\n\nSięgając po materiały pochodzące z recyklingu, ponownie wykorzystujemy materiały, które zostały już wcześniej stworzone, co pomaga nam zmniejszyć ilość generowanych odpadów. Wybór materiałów odnawialnych oznacza mniejszą zależność od kurczących się zasobów surowców. Nasze produkty wykonane są z mieszanki materiałów pochodzących z recyklingu i odnawialnych źródeł, a ich całkowita zawartość wynosi co najmniej 20%.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1503, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(1504, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność w ruchu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(1505, 1, 1, 'Buty Ultraboost dają gwarancję sprężystego biegu w miejskiej dżungli, niezależnie od tego, czy zamierzasz się przebiec podczas lunchu czy planujesz trening na dystansie 10 km. Buty z kolekcji adidas by Stella McCartney dodają stylu ulubionemu modelowi biegowemu. To świetna opcja na dni, w które poranny trening kończy się śniadaniem z partnerem treningowym. Cholewka adidas PRIMEKNIT ma przewiewną konstrukcję ze wstawkami z siateczki. Nasza najlżejsza pianka BOOST zapewnia jeszcze większy zwrot energii na każdym kroku.', '', 'adidas-by-stella-mccartney-ultraboost-light-shoes', '', '', '', 'adidas by Stella McCartney Ultraboost Light Shoes', '', '', '', ''),
(1506, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl', '', '', '', 'ADIZERO SL', '', '', '', ''),
(1507, 1, 1, 'Wynieś swój bieg na wyższy poziom dzięki tym butom do biegania adidas. Buty nazwane na cześć rewolucyjnej podeszwy środkowej drukowanej w technologii 3D pochłaniają siłę uderzenia i dodają Ci przyspieszenia na każdym kroku. Cholewka adidas Primeknit otula Twoją stopę, zapewniając przewiewny komfort i wspierając naturalne ruchy na ulicach miasta. Podeszwa zewnętrzna z gumy Continental™ gwarantuje przyczepność, dzięki czemu możesz biegać w deszczu lub słońcu. Niezależnie od tego, czy trenujesz na dystansie 5 kilometrów, czy po prostu biegniesz, ile sił w nogach, buty 4DFWD uprzyjemnią Ci każdy bieg.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1508, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1509, 1, 1, 'Slip into comfort and performance with these supportive running shoes from adidas. Featuring a breathable mesh upper, these lightweight sneakers make every step a dream. A full-length Dreamstrike midsole cushions your stride as you explore the city streets or your favourite running route.\n\nThis product features at least 20% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.', '', 'response-super-shoes', '', '', '', 'Response Super Shoes', '', '', '', ''),
(1510, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(1511, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(1512, 1, 1, 'Nie musisz wybierać między szybkością a wydajnością. Buty Adizero Distancestar pozwolą Ci osiągnąć to, co najlepsze z obu światów. Lekkie buty stworzone z myślą o zmaganiach z bieżnią mają podeszwę zewnętrzną z płytką z kolcami, która zapewnia intensywną trakcję, dzięki czemu możesz pewnie przyspieszać i pokonywać kolejne zakręty. \nOddychająca, syntetyczna cholewka zapewnia Ci komfort podczas krótkich sprintów lub wyścigów z wieloma okrążeniami, a design stworzony z myślą o bieżni doda Ci przyspieszenia w drodze do zwycięstwa. Rekordy są po to, by je bić – załóż ten model i ruszaj przed siebie. \n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych opadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-adizero-distancestar', '', '', '', 'Buty Adizero Distancestar', '', '', '', ''),
(1513, 1, 1, 'Codzienne pokonywanie trasy biegowej to prawdziwa przyjemność w butach do biegania adidas Pureboost 23. BOOST na całej długości zapewnia maksymalny zwrot energii, a strategicznie rozmieszczone wycięcia na gumowej podeszwie zewnętrznej pozwalają na kompresję i swobodne rozszerzanie się pianki podczas biegu. Lekka cholewka z siateczki o specjalnej konstrukcji jest przewiewna, gdy temperatura rośnie, i zapewnia wsparcie tam, gdzie jest ono potrzebne, dzięki czemu cała stopa może cieszyć się komfortem w czasie biegu.  \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-pureboost-23', '', '', '', 'Buty Pureboost 23', '', '', '', ''),
(1514, 1, 1, 'Poczuj się dobrze, biegaj szybko, działaj lepiej. To samonapędzające się koło. Dodaj sprężystości swojemu biegowi w butach do biegania Ultraboost Light. Najlżejsze i najbardziej sprężyste Ultraboost zostawiają mniejszy ślad węglowy niż poprzednie wersje. Magia tkwi w podeszwie środkowej Light BOOST – nowej generacji technologii adidas BOOST, która zapewnia jeszcze większy zwrot energii. Oznacza to, że będziesz czuć się bardziej energicznie na kolejnych kilometrach, niezależnie od tempa i dystansu.', '', 'buty-ultraboost-light', '', '', '', 'Buty Ultraboost Light', '', '', '', ''),
(1515, 1, 1, 'Nie bez powodu nazywamy to wielką otwartą przestrzenią. Zbadaj ją do samych granic, biegając po górskich szlakach. Buty adidas Terrex do biegów przełajowych łączą lekką, sprężystą amortyzację z przyczepnością, wsparciem i trwałością, aby sprostać różnym warunkom. Design z klinem przy języku chroni przed brudem. Warstwa chroniąca przed kamieniami w podeszwie środkowej pozwala pewnie poruszać się po nierównym terenie, a bieżnik z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych korzeniach i w kamienistym terenie.', '', 'terrex-trail-rider-trail-running-shoes', '', '', '', 'Terrex Trail Rider Trail Running Shoes', '', '', '', ''),
(1516, 1, 1, 'Załóż te uniwersalne buty do biegania adidas i ruszaj przebiec się po parku lub na spacer do kawiarni. Amortyzowana podeszwa środkowa Cloudfoam zadba o Twój komfort od pierwszego kroku.  Tekstylna cholewka jest wygodna i przewiewna, a gumowa podeszwa zewnętrzna gwarantuje przyczepność i pewność na każdym kroku.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-shoes', '', '', '', 'Runfalcon 3 Shoes', '', '', '', ''),
(1517, 1, 1, 'Nie bez powodu nazywamy to wielką otwartą przestrzenią. Zbadaj ją do samych granic, biegając po górskich szlakach. Buty adidas Terrex do biegów przełajowych łączą lekką, sprężystą amortyzację z przyczepnością, wsparciem i trwałością, aby sprostać różnym warunkom. Design z klinem przy języku chroni przed brudem. Warstwa chroniąca przed kamieniami w podeszwie środkowej pozwala pewnie poruszać się po nierównym terenie, a bieżnik z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych korzeniach i w kamienistym terenie.', '', 'terrex-trail-rider-trail-running-shoes', '', '', '', 'Terrex Trail Rider Trail Running Shoes', '', '', '', ''),
(1518, 1, 1, 'Maraton Bostoński to wyścig. Ale wyścig oznacza również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 12 powstały z myślą o biegach na średnich i długich dystansach. Zapewniają poczucie przyspieszenia w dniu wyścigu podczas treningu dzięki ENERGYRODS 2.0 z domieszką włókna szklanego, które ograniczają utratę energii pod stopą. Model jest szybki, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', '', 'adizero-boston-12-m', '', '', '', 'ADIZERO BOSTON 12 M', '', '', '', ''),
(1519, 1, 1, 'Wznieś swój bieg na wyższy poziom w butach do biegania adidas 4DFWD 3. Podeszwa środkowa z nadrukiem 3D pochłania siłę uderzenia i stabilizuje Twój krok, gdy pokonujesz kolejne kilometry w mieście. Cholewka adidas PRIMEKNIT jest równie futurystyczna, co funkcjonalna, i zapewnia dopasowanie niczym w skarpetce, dzięki czemu porusza się tak dynamicznie jak Ty. Gdy wzywa Cię przygoda, te buty zapewniają przyczepność i trwałość, dzięki czemu możesz pozostać na ziemi i dać z siebie wszystko na swojej trasie. Wykorzystaj w pełni każdy krok w butach do biegania 4DFWD i ruszaj w przyszłość.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych opadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1520, 1, 1, 'Zderzenie dwóch ikon adidas: Ultraboost i 4D FWD. Załóż buty do biegania adidas, które dodadzą Ci przyspieszenia, i poczuj, czym jest płynny, komfortowy bieg. Gdy Twoje stopy uderzają o ziemię, podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Formowana cholewka adidas PRIMEKNIT otula stopę przy pomocy strategicznych obszarów wsparcia.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'buty-ultra-4dfwd-running', '', '', '', 'Buty Ultra 4DFWD Running', '', '', '', ''),
(1521, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D wydrukowaną w technologii 3D, dodając nową strukturę siatki, która przekształca siłę uderzenia w ruch do przodu, i połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby zapewnić Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1522, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1523, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na poruszaniu się do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane specjalnie, aby wspierać ruch stopy do przodu. Odświeżyliśmy innowacyjną podeszwę środkową adidas 4D z nadrukiem 3D przy pomocy nowego designu kratownicy, która przekształca siłę uderzenia w ruch do przodu. Całość połączyliśmy ją z nadzwyczajną przyczepnością podeszwy zewnętrznej z gumy Continental™. Dopasowujący się do stopy materiał adidas PRIMEKNIT łączy się z lekką, oddychającą siateczką, aby dać Ci komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1524, 1, 1, 'Niezależnie od tego, czy koncentrujesz się na kolejnym kroku, czy na linii mety, bieganie polega na ruchu do przodu. Dlatego buty do biegania 4DFWD 3 zostały zaprojektowane z myślą o ruchu do przodu. Innowacyjna podeszwa środkowa adidas 4D z nadrukiem 3D i nową konstrukcją przypominającą kratownicę przekształca siły uderzenia w ruch do przodu wspierana przez nadzwyczajną przyczepność podeszwy zewnętrznej z gumy Continental™. Cholewka z lekkiej, oddychającej monosiateczki z kołnierzem PRIMEKNIT wokół kostki gwarantuje stopom komfort kilometr po kilometrze.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1525, 1, 1, 'Załóż buty do biegania Ultraboost 23 i poczuj zwrot energii jak nigdy dotąd. Model ma podeszwę środkową Light BOOST – naszą kolejną, jak dotąd najlżejszą generację technologii BOOST, która doda Ci mocy na każdym dystansie i w każdym tempie biegu. Zintegrowany z podeszwą zewnętrzną system Linear Energy Push zwiększa stabilizację, a otulający stopę materiał adidas PRIMEKNIT uzupełnia całość, gwarantując płynny, sprężysty bieg.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'buty-ultraboost-23', '', '', '', 'Buty Ultraboost 23', '', '', '', ''),
(1526, 1, 1, 'Trenujesz, by ustanowić nowy rekord życiowy, czy po prostu chcesz zdążyć na autobus? Niezależnie od tego, jaki jest Twój cel i gdziekolwiek idziesz, buty adidas Duramo SL dodadzą Ci lekkości, sprężystości i komfortu dzięki amortyzacji LIGHTMOTION. Oddychająca cholewka z siateczki zapewnia stopom przewiewny i suchy komfort niezależnie od tego, jak intensywnie trenujesz. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-duramo-sl', '', '', '', 'Buty Duramo SL', '', '', '', ''),
(1527, 1, 1, 'Od drzwi Twojego domu po szlak i z powrotem buty TERREX SOULSTRIDE FLOW są Twoim partnerem podczas długich przygód w outdoorze. Buty do biegów przełajowych z miękką amortyzacją z lekkiej pianki EVA powstały, aby zapewnić Ci swobodę ruchu. Podeszwa zewnętrzna z gumy Continental™ doskonale trzyma się korzeni, kamieni i ziemi, a cholewka z siateczki o specjalnej konstrukcji gwarantuje optymalny podział na strefy, przewiewność, elastyczność i idealne dopasowanie.', '', 'terrex-soulstride-flow-trail-running-shoes', '', '', '', 'TERREX Soulstride Flow Trail Running Shoes', '', '', '', ''),
(1528, 1, 1, 'Załóż je i ruszaj. Te buty do biegania adidas zapewnią Ci komfort niezależnie od tego, jak długi okaże się Twój dzień. Doskonałe buty do noszenia na co dzień mają lekką i przewiewną cholewkę z siateczki, która gwarantuje stopom chłodny komfort, oraz sprężystą podeszwę środkową Cloudfoam. Gumowa podeszwa zewnętrzna została zaprojektowana tak, aby dawać stabilność na wszystkich nawierzchniach, od mokrej trawy po glinę. Zmieniaj swoje plany bez konieczności zmieniania butów. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'galaxy-6-shoes', '', '', '', 'Galaxy 6 Shoes', '', '', '', ''),
(1529, 1, 1, 'Bieganie to przełomowe doświadczenie — niezależnie od tego, czy wybierzesz inną perspektywę, masz lżejszy nastrój, czy szybciej osiągasz życiówkę. Podobnie buty Ultraboost są stworzone do postępu. Wyprzedzające trendy buty Ultraboost Light z kolekcji adidas by Stella McCartney powstały z wykorzystaniem nowej generacji adidas BOOST — najlżejszej w historii adidas pianki BOOST, która zapewnia jeszcze większy zwrot energii. \n\nWspierający krój cholewki adidas PRIMEKNIT otula stopę, gwarantując większą dynamikę. Noś je na krótkie i średnie dystanse w mieście.', '', 'buty-adidas-by-stella-mccartney-ultraboost-light', '', '', '', 'Buty adidas by Stella McCartney Ultraboost Light', '', '', '', ''),
(1530, 1, 1, 'Codzienne pokonywanie trasy biegowej to prawdziwa przyjemność w butach do biegania adidas Pureboost 23. BOOST na całej długości zapewnia maksymalny zwrot energii, a strategicznie rozmieszczone wycięcia na gumowej podeszwie zewnętrznej pozwalają na kompresję i swobodne rozszerzanie się pianki podczas biegu. Lekka cholewka z siateczki o specjalnej konstrukcji jest przewiewna, gdy temperatura rośnie, i zapewnia wsparcie tam, gdzie jest ono potrzebne, dzięki czemu cała stopa może cieszyć się komfortem w czasie biegu.  \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-pureboost-23', '', '', '', 'Buty Pureboost 23', '', '', '', ''),
(1531, 1, 1, 'Poczuj lekkość, szybkość i swobodę. Gdy chcesz podkręcić tempo i trenować na trasach do 10 km, te buty do biegania adidas komfortowo wspierają Twoje wysiłki. Mają lekką konstrukcję dzięki miękkiej cholewce z siateczki i stabilnej podeszwie środkowej LIGHTMOTION. Podeszwa zewnętrzna Adiwear pewnie trzyma się bieżni i chodnika.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-duramo-sl', '', '', '', 'Buty Duramo SL', '', '', '', ''),
(1532, 1, 1, 'Jeśli chcesz odkrywać świat poza chodnikiem, buty do biegania adidas ułatwią Ci to zadanie. Głęboko żłobiona podeszwa zewnętrzna sprawdzi się na szosie, żwirze i w parku. Cholewka z siateczki przepuszcza powietrze, ale nie przepuszcza brudu. Amortyzacja Bounce zapewnia wygodę i ochronę na trasie i poza nią.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-ultrabounce-tr-bounce-running', '', '', '', 'Buty Ultrabounce TR Bounce Running', '', '', '', ''),
(1533, 1, 1, 'Model stworzony z myślą o zróżnicowanym terenie i całodziennym komforcie. Od dróg po nierówne szlaki, od krętych ścieżek po pokrytą rosą trawę, buty do biegów przełajowych adidas Terrex Soulstride RAIN.RDY pozwolą Ci łatwo zmienić trasę. \n\nZaprojektowana z myślą o komforcie technologia RAIN.RDY zapewnia Ci suchy komfort, a oddychająca siateczka otula stopę, gwarantując idealne dopasowanie. Lekka amortyzacja zapewnia wsparcie w trudnym terenie, a podeszwa zewnętrzna Traxion gwarantuje przyczepność we wszystkich kierunkach i pewność kroków.', '', 'buty-terrex-soulstride-rainrdy-trail-running', '', '', '', 'Buty Terrex Soulstride RAIN.RDY Trail Running', '', '', '', ''),
(1534, 1, 1, 'Niezależnie od tego, czy biegniesz blisko, daleko, szybko, czy wolno, buty do biegania adidas Supernova 3 pomogą Ci biegać w swojej strefie komfortu. Poczujesz się w nich dobrze od chwili założenia dzięki przewiewnej cholewce z siateczki i wyściółce na języku i pięcie. Precyzyjnie wyważone połączenie amortyzacji Bounce i BOOST zapewnia zarówno komfort, jak i energię, dzięki czemu cieszysz się każdym krokiem na drodze do swoich celów biegowych.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-supernova-3-running', '', '', '', 'Buty Supernova 3 Running', '', '', '', ''),
(1535, 1, 1, 'Jeśli szukasz butów do biegania, które podkręcą Twój styl, buty Solarglide z kolekcji adidas by Stella McCartney mogą być tym, czego potrzebujesz.\n\nLekka cholewka Primeknit wykonana częściowo z materiałów pochodzących z recyklingu idealnie dopasowuje się do stóp podczas biegu na dystansie około 10 km. Inspirowana szybkością klatka jest wykonana z pianki EVA z biomateriałów. Klatka została zaprojektowana, aby zapewnić Ci dodatkowe wsparcie na każdym kroku, a buty zyskały charakterystyczny look Stelli McCartney. \n\nNiezależnie od tego, czy nosisz te buty podczas biegania, czy przez cały dzień, elastyczna podeszwa zewnętrzna i podeszwa środkowa BOOST dodadzą Ci energii na każdym kroku. Te buty uzupełniają każdy strój niczym wyróżniający się element garderoby.', '', 'adidas-by-stella-mccartney-solarglide-running-shoes', '', '', '', 'adidas by Stella McCartney Solarglide Running Shoes', '', '', '', ''),
(1536, 1, 1, 'Staw czoła zimnym, mokrym warunkom w butach Ultraboost Light COLD.RDY 2.0. Lekka podeszwa środkowa BOOST to nasza najnowsza generacja pianki BOOST, która zapewnia jeszcze większy zwrot energii i dodaje Ci siły na każdym dystansie i w każdym tempie. Guma Continental™ WinterGrip™ zapewnia doskonałą przyczepność. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light-coldrdy-20', '', '', '', 'Buty Ultraboost Light COLD.RDY 2.0', '', '', '', ''),
(1537, 1, 1, 'Niekończąca się energia przez cały bieg to Twoje marzenie. Te buty do biegania adidas sprawią, że stanie się to rzeczywistością, dzięki najnowszej generacji technologii adidas BOOST. Nasza najlżejsza jak dotąd podeszwa środkowa Light BOOST zapewnia poczucie wyjątkowej sprężystości od pierwszego do ostatniego kroku, niezależnie od dystansu i tempa. Cholewka adidas PRIMEKNIT+ z technologią Forgedmesh wspiera Cię na każdym kilometrze dzięki blokadzie śródstopia i strategicznie rozmieszczonym strefom rozciągania, które dopasowują się do ruchów Twojej stopy. Dodaj do tego system Linear Energy Push, który zapewnia dodatkową stabilizację, i otrzymasz wynik w postaci płynnego biegu od startu do mety.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'buty-ultraboost-light', '', '', '', 'Buty Ultraboost Light', '', '', '', ''),
(1538, 1, 1, 'Rzuć to wszystko: zadania do wykonania, e-maile i załatwianie spraw. Liczy się tylko powietrze w płucach i rytm kroków na chodniku. Przemierzaj bliskie i dalekie trasy w butach do biegania adidas osadzonych na miękkiej i wygodnej podeszwie środkowej Cloudfoam. Gumowa podeszwa zewnętrzna zapewnia przyczepność na bieżni, drodze lub trawie.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'runfalcon-wide-3-shoes', '', '', '', 'RunFalcon Wide 3 Shoes', '', '', '', ''),
(1539, 1, 1, 'Slip into comfort and performance with these supportive running shoes from adidas. Featuring a breathable mesh upper, these lightweight sneakers make every step a dream. A full-length Dreamstrike midsole cushions your stride as you explore the city streets or your favourite running route. By choosing recycled, we are able to reuse materials that have already been created, which helps to reduce waste. Renewable materials choices will help us to remove our reliance on finite resources. Our products made with a blend of recycled and renewable materials feature at least 20% total of these materials.', '', 'response-super-shoes', '', '', '', 'Response Super Shoes', '', '', '', ''),
(1540, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu, dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich modeli do biegania, które pozwolą Ci przekraczać własne granice bez czynników rozpraszających.\n\nWystartuj z bloków i sięgnij po medale. Gdy dajesz z siebie wszystko, buty Adizero Finesse otulają Twoje stopy leciutkim wsparciem. Cholewka Celermesh dobrze blokuje stopę, co docenisz na zakręcie. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-adizero-finesse-track-and-field', '', '', '', 'Buty Adizero Finesse Track and Field', '', '', '', ''),
(1541, 1, 1, 'Niezależnie od tego, czy biegniesz blisko, daleko, szybko, czy wolno, buty adidas Supernova 3 pomogą Ci biegać w swojej strefie komfortu. Poczujesz się w nich dobrze od chwili założenia dzięki przewiewnej cholewce z siateczki i wyściółce na języku i pięcie. Precyzyjnie wyważone połączenie amortyzacji Bounce i BOOST zapewnia zarówno komfort, jak i energię, dzięki czemu cieszysz się każdym krokiem na drodze do swoich celów biegowych.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-supernova-3-running', '', '', '', 'Buty Supernova 3 Running', '', '', '', ''),
(1542, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX ciężkie warunki nie stanowią problemu. Cholewka z materiału tekstylnego z GORE-TEX zapewnia stopom komfort, gdy pokonujesz kolejne kilometry w chłodne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia bezpieczną przyczepność na pokrytych wodą nawierzchniach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(1543, 1, 1, 'Rozpocznij od linii początkowej. Te kolce sprinterskie adidas wbijają się w bieżnię, więc możesz królować na krótkich dystansach. Cholewka jest lekka i zapewnia precyzyjne wsparcie. Model ma wewnętrzną skarpetę o konstrukcji gwarantującej jeszcze lepszą blokadę stopy.', '', 'sprintstar-shoes', '', '', '', 'Sprintstar Shoes', '', '', '', ''),
(1544, 1, 1, 'Są buty, w których możesz biegać. I są też buty do biegania, w których chcesz biegać. SOLARGLIDE 6 to buty, które zakładasz codziennie, pamiętając o swoich celach, takich jak pokonywanie kolejnych kilometrów lub bicie życiowych rekordów. Wyposażono je w technologie, których potrzebujesz, aby móc biegać dalej i szybciej, w tym sprężystą amortyzację BOOST. adidas LEP 2.0 prowadzi każdy krok, dodając Ci przyspieszenia, a podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych i suchych nawierzchniach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'solarglide-6-shoes', '', '', '', 'SOLARGLIDE 6 Shoes', '', '', '', ''),
(1545, 1, 1, 'Bieganie to przełomowe doświadczenie — niezależnie od tego, czy wybierzesz inną perspektywę, masz lżejszy nastrój, czy szybciej osiągasz życiówkę. Podobnie buty Ultraboost są stworzone do postępu. Wyprzedzające trendy buty Ultraboost Light z kolekcji adidas by Stella McCartney powstały z wykorzystaniem nowej generacji adidas BOOST — najlżejszej w historii adidas pianki BOOST, która zapewnia jeszcze większy zwrot energii. \n\nWspierający krój cholewki adidas PRIMEKNIT otula stopę, gwarantując większą dynamikę. Noś je na krótkie i średnie dystanse w mieście.', '', 'buty-adidas-by-stella-mccartney-ultraboost-light', '', '', '', 'Buty adidas by Stella McCartney Ultraboost Light', '', '', '', ''),
(1546, 1, 1, 'Codzienne pokonywanie trasy biegowej to prawdziwa przyjemność w butach do biegania adidas Pureboost 23. BOOST na całej długości zapewnia maksymalny zwrot energii, a strategicznie rozmieszczone wycięcia na gumowej podeszwie zewnętrznej pozwalają na kompresję i swobodne rozszerzanie się pianki podczas biegu. Lekka cholewka z siateczki o specjalnej konstrukcji jest przewiewna, gdy temperatura rośnie, i zapewnia wsparcie tam, gdzie jest ono potrzebne, dzięki czemu cała stopa może cieszyć się komfortem w czasie biegu.  \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-pureboost-23', '', '', '', 'Buty Pureboost 23', '', '', '', ''),
(1547, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Membrana GORE-TEX sprawdzi się, gdy pokonujesz kałuże. Od spodu najlżejsza podeszwa środkowa BOOST — lekka pianka BOOST — dodaje Ci energii na każdym kroku. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(1548, 1, 1, 'Bieganie długodystansowe to o wiele więcej niż tylko pokonanie drogi stąd tam. Chodzi o powiew wiatru w plecy, rytm Twojego biegu, swobodę na otwartej drodze. Te buty do biegania adidas zostały zaprojektowane z myślą o nieustających ruchu, a więc ułatwią Ci płynne pokonywanie kolejnych kilometrów. Podeszwa środkowa o podwójnej gęstości łączy lekką piankę gwarantującą sprężystą amortyzację z twardszym tworzywem, które otula piętę. Wewnętrzna klatka blokuje stopę, zapewniając jej optymalne wsparcie, które nigdy Cię nie zawiedzie.', '', 'adistar-20-shoes', '', '', '', 'Adistar 2.0 Shoes', '', '', '', ''),
(1549, 1, 1, 'Niezależnie od tego, czy biegniesz blisko, daleko, szybko, czy wolno, buty adidas Supernova 3 pomogą Ci biegać w swojej strefie komfortu. Poczujesz się w nich dobrze od chwili założenia dzięki przewiewnej cholewce z siateczki i wyściółce na języku i pięcie. Precyzyjnie wyważone połączenie amortyzacji Bounce i BOOST zapewnia zarówno komfort, jak i energię, dzięki czemu cieszysz się każdym krokiem na drodze do swoich celów biegowych.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-supernova-3-running', '', '', '', 'Buty Supernova 3 Running', '', '', '', ''),
(1550, 1, 1, 'Niezależnie od tego, czy wybierasz się na górski szlak, czy na wypad do ulubionej kawiarni, te buty do biegania adidas zapewnią Ci amortyzację. Podeszwa środkowa Cloudfoam oferuje natychmiastowy komfort, który nigdy się nie kończy, a tekstylna cholewka gwarantuje wsparcie i przewiewność. Gumowa podeszwa zewnętrzna trzyma się nawierzchni w zmiennym terenie, ułatwiając pewny krok.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-tr-shoes', '', '', '', 'Runfalcon 3 TR Shoes', '', '', '', ''),
(1551, 1, 1, 'Podejmij wyzwanie dzisiejszego biegu. Niezależnie od tego, czy pokonujesz kolejne kilometry na bieżni, czy na trasie, buty Supernova 3 Vegan Running BOOST pozwolą Ci pozostać w ruchu. \n\nPracuj nad swoją życiówką, ciesząc się optymalnym komfortem dzięki precyzyjnie wyważonemu połączeniu sprężystej amortyzacji Bounce i adidas BOOST, która zapewnia zwrot energii. Cholewka z siateczki dba o przewiewny komfort na każdym dystansie i w każdym tempie.\n\nOd nowego stylu po sprawdzoną klasykę. Nasze modele są teraz dostępne w wersjach wykonanych z materiałów wegańskich, dzięki czemu możesz zadbać o to, co jest dla Ciebie ważne.', '', 'buty-supernova-3-vegan-running-boost', '', '', '', 'Buty Supernova 3 Vegan Running BOOST', '', '', '', ''),
(1552, 1, 1, 'Jeśli szukasz butów do biegania, które podkręcą Twój styl, buty Solarglide z kolekcji adidas by Stella McCartney mogą być tym, czego potrzebujesz.\n\nLekka cholewka Primeknit wykonana częściowo z materiałów pochodzących z recyklingu idealnie dopasowuje się do stóp podczas biegu na dystansie około 10 km. Inspirowana szybkością klatka jest wykonana z pianki EVA z biomateriałów. Klatka została zaprojektowana, aby zapewnić Ci dodatkowe wsparcie na każdym kroku, a buty zyskały charakterystyczny look Stelli McCartney. \n\nNiezależnie od tego, czy nosisz te buty podczas biegania, czy przez cały dzień, elastyczna podeszwa zewnętrzna i podeszwa środkowa BOOST dodadzą Ci energii na każdym kroku. Te buty uzupełniają każdy strój niczym wyróżniający się element garderoby.', '', 'adidas-by-stella-mccartney-solarglide-running-shoes', '', '', '', 'adidas by Stella McCartney Solarglide Running Shoes', '', '', '', ''),
(1553, 1, 1, 'O kilometr dalej. O kilka sekund szybciej. Buty adidas Solarglide 6 wspierają Twoje postępy w osiąganiu celów biegowych, zapewniając komfort i energię. Sprężysta pianka BOOST w podeszwie środkowej daje Ci moc, która pozwala poruszać stopami, a adidas LEP 2.0 prowadzi każdy krok, dodając Ci przyspieszenia.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-solarglide-6', '', '', '', 'Buty Solarglide 6', '', '', '', ''),
(1554, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX ciężkie warunki nie stanowią problemu. Cholewka z materiału tekstylnego z GORE-TEX zapewnia stopom komfort, gdy pokonujesz kolejne kilometry w chłodne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia bezpieczną przyczepność na pokrytych wodą nawierzchniach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(1555, 1, 1, 'Nie bez powodu nazywamy to wielką otwartą przestrzenią. Zbadaj ją do samych granic, biegając po górskich szlakach. Buty adidas Terrex do biegów przełajowych łączą lekką, sprężystą amortyzację z przyczepnością, wsparciem i trwałością, aby sprostać różnym warunkom. Design z klinem przy języku chroni przed brudem. Warstwa chroniąca przed kamieniami w podeszwie środkowej pozwala pewnie poruszać się po nierównym terenie, a bieżnik z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych korzeniach i w kamienistym terenie.', '', 'terrex-trail-rider-trail-running-shoes', '', '', '', 'Terrex Trail Rider Trail Running Shoes', '', '', '', ''),
(1556, 1, 1, 'Niezależnie od tego, czy biegniesz blisko, daleko, szybko, czy wolno, buty do biegania adidas Supernova 3 pomogą Ci biegać w swojej strefie komfortu. Poczujesz się w nich dobrze od chwili założenia dzięki przewiewnej cholewce z siateczki i wyściółce na języku i pięcie. Precyzyjnie wyważone połączenie amortyzacji Bounce i BOOST zapewnia zarówno komfort, jak i energię, dzięki czemu cieszysz się każdym krokiem na drodze do swoich celów biegowych.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-supernova-3-running', '', '', '', 'Buty Supernova 3 Running', '', '', '', ''),
(1557, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl-w', '', '', '', 'ADIZERO SL W', '', '', '', ''),
(1558, 1, 1, 'Zderzenie dwóch ikon adidas: Ultraboost i 4D FWD. Załóż buty do biegania adidas, które dodadzą Ci przyspieszenia, i poczuj, czym jest płynny, komfortowy bieg. Gdy Twoje stopy uderzają o ziemię, podeszwa środkowa 4DFWD 2 kurczy się, ograniczając siłę hamowania i przekształcając energię płynącą z kontaktu z podłożem w dynamiczny ruch do przodu. Formowana cholewka adidas PRIMEKNIT otula stopę przy pomocy strategicznych obszarów wsparcia.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'buty-ultra-4dfwd-running', '', '', '', 'Buty Ultra 4DFWD Running', '', '', '', ''),
(1559, 1, 1, 'Deszczowa pogoda może być idealną pogodą do biegania. Załóż buty Ultraboost Light GTX i przekonaj się o tym. \n\nButy są wyposażone w technologię RAIN.RDY, która wykorzystuje zaawansowane materiały hydroizolacyjne i ma konstrukcję, która chroni przed wodą. Membrana GORE-TEX sprawdzi się, gdy pokonujesz kałuże. Od spodu najlżejsza podeszwa środkowa BOOST — lekka pianka BOOST — dodaje Ci energii na każdym kroku. Poczuj radość biegania w deszczu.', '', 'buty-ultraboost-light-gtx', '', '', '', 'Buty Ultraboost Light GTX', '', '', '', ''),
(1560, 1, 1, 'Podejmij wyzwanie dzisiejszego biegu. Niezależnie od tego, czy pokonujesz kolejne kilometry na bieżni, czy na trasie, buty Supernova 3 Vegan Running BOOST pozwolą Ci pozostać w ruchu. \n\nPracuj nad swoją życiówką, ciesząc się optymalnym komfortem dzięki precyzyjnie wyważonemu połączeniu sprężystej amortyzacji Bounce i adidas BOOST, która zapewnia zwrot energii. Cholewka z siateczki dba o przewiewny komfort na każdym dystansie i w każdym tempie.\n\nOd nowego stylu po sprawdzoną klasykę. Nasze modele są teraz dostępne w wersjach wykonanych z materiałów wegańskich, dzięki czemu możesz zadbać o to, co jest dla Ciebie ważne.', '', 'buty-supernova-3-vegan-running-boost', '', '', '', 'Buty Supernova 3 Vegan Running BOOST', '', '', '', ''),
(1561, 1, 1, 'Poczuj niesamowitą energię w nowych Ultraboost Light, najlżejszych butach Ultraboost. Magia tkwi w podeszwie środkowej Light BOOST, nowej generacji adidas BOOST. Unikalny design cząsteczki sprawia, że to najlżejsza pianka BOOST. Setki kapsułek BOOST emanują energią, doskonałą amortyzacją i komfortem, a niektóre stopy naprawdę mogą mieć to wszystko.', '', 'ultraboost-light-shoes', '', '', '', 'Ultraboost Light Shoes', '', '', '', ''),
(1562, 1, 1, 'Od szybkich okrążeń w porze lunchu po długi bieg w weekend, wykorzystaj maksymalnie każdy kilometr w tych butach do biegania adidas. Wyposażono je w Light BOOST, nową generację adidas BOOST – najlżejszą do tej pory, zapewniającą większy zwrot energii niż kiedykolwiek wcześniej. Dodaj do tego system Linear Energy Push, który zapewnia dodatkową stabilizację, i otulającą stopę cholewkę adidas PRIMEKNIT, a uzyskasz płynny, sprężysty bieg na każdym dystansie i w każdym tempie.\n\nCholewka tych butów została wykonana z wysokiej jakości przędzy, która zawiera co najmniej 50% Parley Ocean Plastic — tworzywa wyprodukowanego z poddanych recyklingowi plastikowych odpadów zebranych z odległych wysp, plaż i nadmorskich miejscowości, aby zapobiegać zanieczyszczeniu oceanów. Pozostałe 50% to poliester pochodzący z recyklingu.', '', 'buty-ultraboost-light-running', '', '', '', 'Buty Ultraboost Light Running', '', '', '', ''),
(1563, 1, 1, 'Poczuj niesamowitą energię w nowych Ultraboost Light, najlżejszych butach Ultraboost. Magia tkwi w podeszwie środkowej Light BOOST, nowej generacji adidas BOOST. Dzięki unikalnej strukturze molekuł powstała najlżejsza jak dotąd pianka BOOST. Setki kapsułek BOOST emanują energią, doskonałą amortyzacją i komfortem, a niektóre stopy naprawdę mogą mieć to wszystko.', '', 'ultraboost-light-shoes', '', '', '', 'Ultraboost Light Shoes', '', '', '', ''),
(1564, 1, 1, 'INNOWACJE PRZYSZŁOŚCI\n\nPrzenieś swój bieg na wyższy poziom dzięki nowemu designowi Switch FWD, który zamienia grawitację w ruch do przodu. \n\nPodeszwa środkowa z pianki EVA o specjalnej konstrukcji kompresuje się i rozszerza pod ciśnieniem, pomagając Ci na każdym kroku. Przewiewna cholewka z siateczki zwiększa komfort, a specjalne wsparcie w pięcie gwarantuje stabilizację w każdym tempie. Lekka, zaawansowana technologicznie podeszwa zewnętrzna zapewnia optymalną przyczepność w każdych warunkach. Przekonaj się, jak płynny jest Twój bieg, dzięki nowemu designowi Switch FWD.', '', 'buty-switch-fwd-running', '', '', '', 'Buty Switch FWD Running', '', '', '', ''),
(1565, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX ciężkie warunki nie stanowią problemu. Cholewka z materiału tekstylnego z GORE-TEX zapewnia stopom komfort, gdy pokonujesz kolejne kilometry w chłodne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia bezpieczną przyczepność na pokrytych wodą nawierzchniach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(1566, 1, 1, 'Chcesz podkręcić swój trening? Te buty adidas pomogą Ci zrobić kolejny krok w biegowej podróży. Lekka amortyzacja Bounce zapewnia komfort i elastyczność, dodając Ci energii, gdy pokonujesz kolejne kilometry w codziennym biegu. Trwała, gumowa podeszwa zewnętrzna dba o przyczepność na różnych nawierzchniach, która przekłada się na pewny bieg.', '', 'ultrabounce-shoes', '', '', '', 'Ultrabounce Shoes', '', '', '', ''),
(1567, 1, 1, 'Buty TERREX AGRAVIC ULTRA powstały w ścisłej współpracy z jedną z najszybszych zawodniczek biegów przełajowych – EKATERINĄ MITYAEVĄ. To jeden z pierwszych modeli butów do biegów przełajowych od adidas z płytką z termoplastycznego elastomeru (TPE) wykonaną w 90% z odnawialnego włókna węglowego.​\n\n​Płytka z bio-tworzywa TPE przebiega całą długość buta, łącząc się z podeszwą środkową oraz zewnętrzną i zapewniając lekką, trwałą ochronę przed kamieniami na długich, górskich szlakach.​\nModel został stworzony z wykorzystaniem odnawialnych źródeł węgla i przy użyciu bioskładników.​ \nPołączenie sprężystej pianki Boost i ultralekkiej technologii Lightstrike z płytką z TPE gwarantuje wysoki zwrot energii w górskim terenie oraz doskonałą amortyzację, co pomaga utrzymać tempo na technicznych szlakach.', '', 'terrex-agravic-ultra-trail-running-shoes', '', '', '', 'Terrex Agravic Ultra Trail Running Shoes', '', '', '', ''),
(1568, 1, 1, 'Im dłuższy bieg, tym więcej czasu spędzasz na świeżym powietrzu. Wydłużaj swoją trasę w butach do biegania adidas, które zapewnią Ci amortyzowany komfort na każdym dystansie. Podeszwa środkowa Bounce na całej długości dba o miękkie lądowanie na każdym kroku. Lekka cholewka z siateczki otula Twoją stopę, zapewniając przewiewny komfort, a jednocześnie blokując stopę i wspierając ją tam, gdzie najbardziej jej potrzebujesz.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-questar', '', '', '', 'Buty Questar', '', '', '', ''),
(1569, 1, 1, 'Gotowi, do biegu... Ruszaj w świat! Te buty do biegów przełajowych od adidas powstały, aby ułatwić Ci eksplorację otoczenia. Od zarośniętych leśnych ścieżek po zakurzone pustynne szlaki lekka podeszwa środkowa z pianki EVA zapewnia niekończącą się amortyzację i niezwykle miękki krok. Poruszaj się bez trudu po śliskich skałach i gładkich korzeniach dzięki przyczepnej, gumowej podeszwie zewnętrznej Traxion, która pewnie trzyma się każdego rodzaju nawierzchni. Gdy przemierzasz zatokę lub schodzisz ze szczytu w upalne popołudnie, cholewka z siateczki o dużych oczkach oferuje przewiewny komfort podczas biegu. Niezależnie od tego, jak lubisz odkrywać świat, te buty Ci to ułatwią.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-tracerocker-20-trail-running', '', '', '', 'Buty Tracerocker 2.0 Trail Running', '', '', '', ''),
(1570, 1, 1, 'Codzienne pokonywanie trasy biegowej to prawdziwa przyjemność w butach do biegania adidas Pureboost 23. BOOST na całej długości zapewnia maksymalny zwrot energii, a strategicznie rozmieszczone wycięcia na gumowej podeszwie zewnętrznej pozwalają na kompresję i swobodne rozszerzanie się pianki podczas biegu. Lekka cholewka z siateczki o specjalnej konstrukcji jest przewiewna, gdy temperatura rośnie, i zapewnia wsparcie tam, gdzie jest ono potrzebne, dzięki czemu cała stopa może cieszyć się komfortem w czasie biegu.  \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-pureboost-23', '', '', '', 'Buty Pureboost 23', '', '', '', ''),
(1571, 1, 1, 'Jeśli chodzi o osiąganie swoich celów, liczy się każda sekunda. Od dnia treningu po dzień wyścigu dobre wyniki wymagają stroju zoptymalizowanego pod kątem szybkości. Przedstawiamy najnowszą linię lekkich butów do biegania, które pomogą Ci pokonywać własne granice bez czynników rozpraszających.\n\nButy do biegania Adizero SL czerpią to, co najlepsze z naszej bijącej rekordy na świecie kolekcji Adizero. Lekka podeszwa środkowa LIGHTSTRIKE z pianki EVA zapewnia trwałość konstrukcji podeszwy środkowej, dzięki czemu możesz skoncentrować się na kolejnym kroku, a cholewka jest wykonana z miękkiej, zaawansowanej technologicznie siateczki rozmieszczonej w kluczowych obszarach. Wyściełana pięta i język zapewniają optymalny komfort, podobnie jak wyróżniający się na pięcie element Adizero. Wysokiej jakości podeszwa zewnętrzna zapewnia przyczepność.', '', 'adizero-sl', '', '', '', 'ADIZERO SL', '', '', '', ''),
(1572, 1, 1, 'Niezależnie od tego, czy wybierasz się na górski szlak, czy na wypad do ulubionej kawiarni, te buty do biegania adidas zapewnią Ci amortyzację. Podeszwa środkowa Cloudfoam oferuje natychmiastowy komfort, który nigdy się nie kończy, a tekstylna cholewka gwarantuje wsparcie i przewiewność. Gumowa podeszwa zewnętrzna trzyma się nawierzchni w zmiennym terenie, ułatwiając pewny krok.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'runfalcon-3-tr-shoes', '', '', '', 'Runfalcon 3 TR Shoes', '', '', '', ''),
(1573, 1, 1, 'Są buty, w których możesz biegać. I są też buty do biegania, w których chcesz biegać. SOLARGLIDE 6 to buty, które zakładasz codziennie, pamiętając o swoich celach, takich jak pokonywanie kolejnych kilometrów lub bicie życiowych rekordów. Wyposażono je w technologie, których potrzebujesz, aby móc biegać dalej i szybciej, w tym sprężystą amortyzację BOOST. adidas LEP 2.0 prowadzi każdy krok, dodając Ci przyspieszenia, a podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną trakcję na mokrych i suchych nawierzchniach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą nam wyeliminować zanieczyszczenie plastikiem.', '', 'solarglide-6-shoes', '', '', '', 'SOLARGLIDE 6 Shoes', '', '', '', ''),
(1574, 1, 1, 'Gdy szlak wymaga technicznego podejścia, buty adidas Terrex do biegów przełajowych pozwolą Ci na poważnie zabrać się za pokonywanie kolejnych kilometrów. Model stworzony we współpracy z naszymi biegaczami łączy trwałość niezbędną na szlaku z wydajnym designem, który wspiera wysiłki na długich dystansach. Buty zapewniają równowagę między lekkością, trwałością i stabilnością, a połączenie materiałów Lightstrike i BOOST w podeszwie środkowej dodaje energii każdemu krokowi. W rezultacie powstały sprężyste buty stworzone z myślą o precyzyjnej pracy nóg w trudnym terenie. Wstawka Pebax® w podeszwie środkowej chroni przed kamieniami, nie zwiększając wagi buta, a siedmiopunktowy system sznurowania gwarantuje idealne, blokujące stopę dopasowanie, dzięki czemu but jest niczym przedłużenie Twojej stopy. Podeszwa zewnętrzna z gumy Continental™ zapewnia nadzwyczajną przyczepność w każdych warunkach. Czas założyć buty i zobaczyć, co możesz zrobić.', '', 'terrex-agravic-ultra-trail-running-shoes', '', '', '', 'Terrex Agravic Ultra Trail Running Shoes', '', '', '', '');
INSERT INTO `ad_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1575, 1, 1, 'Niezależnie od tego, czy biegasz w mieście ze swoją społecznością, czy samotnie, nie ma nic lepszego niż wyrzut adrenaliny u osób biegających. Jedno jest pewne: komfort i wsparcie są najważniejsze w maksymalizacji codziennego biegu. \n\nW butach do biegania Supernova 3 GTX mokre, śliskie nawierzchnie nie stanowią problemu. Wodoodporny, oddychający GORE-TEX pomaga Ci pokonywać kolejne kilometry w wilgotne dni. Hybrydowa podeszwa środkowa, która łączy zwracającą energię piankę BOOST ze sprężystą amortyzacją BOUNCE, oferuje optymalne wsparcie. Podeszwa zewnętrzna z gumy Continental™ WinterGrip™ zapewnia odpowiednią przyczepność na każdym kroku. \n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. To tylko jedno z naszych rozwiązań, które pomogą eliminować zanieczyszczenie plastikiem.', '', 'buty-supernova-3-gtx-running', '', '', '', 'Buty Supernova 3 GTX Running', '', '', '', ''),
(1576, 1, 1, 'Niezależnie od tego, czy biegniesz blisko, daleko, szybko, czy wolno, buty do biegania adidas Supernova 3 pomogą Ci biegać w swojej strefie komfortu. Poczujesz się w nich dobrze od chwili założenia dzięki przewiewnej cholewce z siateczki i wyściółce na języku i pięcie. Precyzyjnie wyważone połączenie amortyzacji Bounce i BOOST zapewnia zarówno komfort, jak i energię, dzięki czemu cieszysz się każdym krokiem na drodze do swoich celów biegowych.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-supernova-3-running', '', '', '', 'Buty Supernova 3 Running', '', '', '', ''),
(1577, 1, 1, 'Biegnij z domu na szlak i z powrotem. Wyruszaj po przygodę poza dobrze znane ścieżki w butach do biegów przełajowych adidas Terrex Soulstride, które zapewniają komfort, dzięki czemu możesz odkrywać świat. \n\nPodeszwa środkowa z pianki EVA gwarantuje lekką amortyzację niezależnie od tego, ile kilometrów pokonujesz, a cholewka z siateczki o specjalnej konstrukcji dba o przewiewność i wsparcie. Podeszwa zewnętrzna Traxion zapewnia przyczepność na nierównym terenie, dzięki czemu możesz pewnie ruszać na szlak.', '', 'buty-terrex-soulstride-trail-running', '', '', '', 'Buty Terrex Soulstride Trail Running', '', '', '', ''),
(1578, 1, 1, 'Nowy wymiar ruchu do przodu. Buty do biegania adidas 4DFWD 3 pomogą Ci wejść w przyszłość biegania. Podeszwa środkowa drukowana 3D dopasowuje się do Twojej stopy, pochłaniając siłę uderzenia i zapewniając stabilizację na każdym kroku. Cholewka adidas PRIMEKNIT otula stopę, zapewniając idealne dopasowanie, które rozciąga się z każdym Twoim ruchem. Guma Continental™ to mocna, przyczepna podeszwa zewnętrzna, która sprawdzi się w każdym terenie. Bez względu na to, czy chcesz pobić nowy rekord życiowy, czy pokonywać kolejne kilometry w weekend, 4DFWD 3 dodadzą Ci mocy.\n\nTen produkt został wykonany w co najmniej 20% z materiałów pochodzących z recyklingu. Ponowne wykorzystanie materiałów wtórnych pomaga nam ograniczyć ilość generowanych plastikowych odpadów i uniezależnić się od kurczących się zasobów surowców. W ten sposób zmniejszamy także ślad węglowy naszych produktów.', '', 'buty-4dfwd-3-running', '', '', '', 'Buty 4DFWD 3 Running', '', '', '', ''),
(1579, 1, 1, 'Połączenie lekkiej i oddychającej cholewki z siateczki o specjalnej konstrukcji z podeszwą środkową LIGHTSTRIKE na całej długości zapewnia szybkość ruchów, a mocna podeszwa zewnętrzna powstała z myślą o biegaczach, którzy chcą się uczyć i dążą do coraz lepszych wyników.\n \nModel wykonany z serii materiałów pochodzących z recyklingu. Ten produkt jest tylko jednym z naszych rozwiązań, które pomagają położyć kres plastikowym odpadom.', '', 'buty-duramo-speed', '', '', '', 'Buty Duramo Speed', '', '', '', ''),
(1580, 1, 1, 'Maraton Bostoński to wyścig. Ale wyścig oznacza również cel, plan treningowy i wszystkie te dni, kiedy myślisz o starcie. Buty Adizero Boston 12 powstały z myślą o biegach na średnich i długich dystansach. Zapewniają poczucie przyspieszenia w dniu wyścigu podczas treningu dzięki ENERGYRODS 2.0 z domieszką włókna szklanego, które ograniczają utratę energii pod stopą. Model jest szybki, ale nie kosztem trwałości — podeszwa środkowa łączy ultralekką amortyzację Lightstrike Pro z trwałą pianką EVA Lightstrike.', '', 'adizero-boston-12-m', '', '', '', 'ADIZERO BOSTON 12 M', '', '', '', ''),
(1581, 1, 1, 'Przemierzaj strome szlaki w biegowych butach trailowych adidas. Model z lekką i wygodną amortyzowaną podeszwą środkową ma bezszwowe nakładki, które dbają o Twoje bezpieczeństwo, gdy poruszasz się po śliskich korzeniach i mokrych skałach. Podeszwa zewnętrzna z gumy Continental™ zapewnia przyczepność zarówno na suchych, jak i mokrych nawierzchniach.\n\nCholewka zawiera co najmniej 50% materiałów pochodzących z recyklingu. Ten produkt stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'terrex-speed-flow-trail-running-shoes', '', '', '', 'Terrex Speed Flow Trail Running Shoes', '', '', '', ''),
(1582, 1, 1, 'When it comes to accomplishing running goals, consistency is key. These shoes are made for the daily run that keeps you on track. Foot-hugging adidas PRIMEKNIT supports every step, and BOOST underfoot keeps you energised as you tick off the kilometres. Extra stability comes from adidas LEP 2.0 technology, designed to help guide each foot strike and propel you forward. Lace up and stride toward that PB.\n\nMade with a series of recycled materials, this upper features at least 50% recycled content. This product represents just one of our solutions to help end plastic waste.', '', 'solarcharge-shoes', '', '', '', 'Solarcharge Shoes', '', '', '', ''),
(1583, 1, 1, 'Wyjdź na szlak i znajdź swój rytm w butach do biegów przełajowych Terrex Soulstride od adidas. Mają uniwersalny design z hybrydowym bieżnikiem i dużą amortyzacją, która pozwoli Ci płynnie przejść z chodnika na szlak. Lekka podeszwa środkowa z pianki EVA pod stopą przekłada się na miękką amortyzację od pierwszego do ostatniego kroku. Gumowa podeszwa zewnętrzna Traxion zapewnia przyczepność, dzięki czemu możesz pewnie poruszać się po śliskich nawierzchniach. Cholewka z siateczki o specjalnej konstrukcji zapewnia przewiewność, dzięki czemu możesz komfortowo dotrzeć do celu.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-terrex-soulstride-trail-running', '', '', '', 'Buty Terrex Soulstride Trail Running', '', '', '', ''),
(1584, 1, 1, 'Załóż buty adidas Ultraboost Light, nasze najlżejsze Ultraboost w historii, wykonane z lżejszego o 30% materiału BOOST, który sprawi, że Twoje stopy z łatwością będą odrywały się od ziemi. Setki kapsułek BOOST emanują niesamowitą energią za każdym razem, gdy Twoja stopa uderza o podłoże. Cholewka adidas PRIMEKNIT+ i Forgedmesh blokuje śródstopie, wspierając stopę, a strategicznie rozmieszczone strefy rozciągania się rozciągają, gdy się poruszasz. LEP zapewnia stabilizację i sprężysty bieg. \n\nTen produkt został wykonany co najmniej w 50% z materiałów pochodzących z recyklingu i stanowi tylko jedno z naszych rozwiązań, które pomogą wyeliminować zanieczyszczenie plastikiem.', '', 'buty-ultraboost-light', '', '', '', 'Buty Ultraboost Light', '', '', '', ''),
(1585, 1, 1, 'Każdy bieg. Na każdym dystansie. Zawsze jesteś w gotowości, by realizować swoje cele w butach adidas Solarboost 5. To Twoje ulubione buty do biegania ze wsparciem, amortyzacją i energią, których potrzebujesz, aby osiągać coraz lepsze wyniki. Podeszwa środkowa BOOST na całej długości zwraca energię, którą wkładasz w bieg, a adidas LEP 2.0 dodaje Ci mocy na każdym kroku.', '', 'solarboost-5-shoes', '', '', '', 'Solarboost 5 Shoes', '', '', '', ''),
(1586, 1, 1, 'Od drzwi Twojego domu po szlak i z powrotem buty TERREX SOULSTRIDE FLOW są Twoim partnerem podczas długich przygód w outdoorze. Buty do biegów przełajowych z miękką amortyzacją z lekkiej pianki EVA powstały, aby zapewnić Ci swobodę ruchu. Podeszwa zewnętrzna z gumy Continental™ doskonale trzyma się korzeni, kamieni i ziemi, a cholewka z siateczki o specjalnej konstrukcji gwarantuje optymalny podział na strefy, przewiewność, elastyczność i idealne dopasowanie.', '', 'terrex-soulstride-flow-trail-running-shoes', '', '', '', 'TERREX Soulstride Flow Trail Running Shoes', '', '', '', ''),
(1587, 1, 1, 'Poczuj lekkość, szybkość i swobodę. Gdy chcesz podkręcić tempo i trenować na trasach do 10 km, te buty do biegania adidas komfortowo wspierają Twoje wysiłki. Mają lekką konstrukcję dzięki miękkiej cholewce z siateczki i stabilnej podeszwie środkowej LIGHTMOTION. Podeszwa zewnętrzna Adiwear pewnie trzyma się bieżni i chodnika.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-duramo-sl', '', '', '', 'Buty Duramo SL', '', '', '', ''),
(1588, 1, 1, 'Chcesz podkręcić swój trening? Te buty adidas pomogą Ci zrobić kolejny krok w biegowej podróży. Lekka amortyzacja Bounce zapewnia komfort i elastyczność, dodając Ci energii, gdy pokonujesz kolejne kilometry w codziennym biegu. Trwała, gumowa podeszwa zewnętrzna dba o przyczepność na różnych nawierzchniach, która przekłada się na pewny bieg.', '', 'ultrabounce-shoes', '', '', '', 'Ultrabounce Shoes', '', '', '', ''),
(1589, 1, 1, 'Im więcej energii wkładasz w bieg, tym więcej do Ciebie wraca. Stworzone z myślą o codziennym bieganiu buty adidas Pureboost 23 mają piankę BOOST na całej długości, która zwraca energię, oraz strategicznie rozmieszczone wycięcia wzdłuż gumowej podeszwy zewnętrznej, które pozwalają na kompresję i swobodne rozszerzanie się stopy w ruchu. Lekka cholewka z siateczki o specjalnej konstrukcji gwarantuje przewiewność, gdy temperatura rośnie, i zapewnia wsparcie tam, gdzie jest ono potrzebne, dzięki czemu możesz komfortowo biegać.\n\nCholewka uszyta z serii materiałów pochodzących z recyklingu zawiera co najmniej 50% materiałów z odzysku. Ten produkt jest tylko jednym z naszych rozwiązań, które pomogą położyć kres plastikowym odpadom.', '', 'buty-pureboost-23', '', '', '', 'Buty Pureboost 23', '', '', '', '');
